INSERT INTO docs.tbl_document VALUES (1885, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '5eda4dae-c348-11e0-9a33-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, '1pctCO2', '1pctCO2', NULL, 'ESM2M-C1_1pct-co2_2x_T1', 'GFDL experiment name = ESM2M-C1_1pct-co2_2x_T1. PCMDI experiment name = 1 percent per year CO2 (run1). Initial conditions for this experiment were taken from 1 January of year 1 of the 1860 control model experiment named ESM2M_pi-control_C1. In the ESM2M-C1_1pct-co2_2x_T1 experiment atmospheric CO2 levels were prescribed to increase from their initial mixing ratio level of 286.15 ppmv at a compounded rate of +1 percent per year until year 70 (the point of doubling). CO2 levels were held constant at 574.2349 ppmv from year 71 through the end of the 200 year long experiment. For the entire 200 year duration of the experiment, all non-CO2 forcing agents (CH4, N2O, tropospheric and stratospheric O3, tropospheric sulfates, black and organic carbon, dust, sea salt, and solar irradiance) were held constant at values representative of year 1860. This integration did not include land use change (i.e., a "potential vegetation" integration) and volcanic aerosols were zero. The direct effect of tropospheric aerosols is', 'GFDL-ESM2M', '1pctCO2');
