INSERT INTO docs.tbl_document VALUES (1302, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '6ccd1558-c34e-11e0-9bbf-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, '1pctCO2_4x', '1pctCO2_4x', NULL, 'ESM2M-C1_1pct-co2_4x_U1', 'GFDL experiment name = ESM2M-C1_1pct-co2_4x_U1. PCMDI experiment name = 1 percent per year CO2 (run1). Initial conditions for this experiment were taken from 1 January of year 10 of the 1860 control model experiment named ESM2M_pi-control_C1. In the ESM2M-C1_1pct-co2_4x_U1 experiment, atmospheric CO2 levels were prescribed to increase from their initial mixing ratio level of 286.15 ppmv at a compounded rate of +1 percent per year until year 140 (the point of quadrupling). CO2 levels were held constant at 1144.6 ppmv from year 141 through the end of the 300 year long experiment. For the entire 300 year duration of the experiment, all non-CO2 forcing agents (CH4, N2O, tropospheric and stratospheric O3, tropospheric sulfates, black and organic carbon, dust, sea salt, and solar irradiance) were held constant at values representative of year 1860. This integration did not include land use change (i.e., a "potential vegetation" integration) and volcanic aerosols were zero. The direct effect of tropospheric aerosol', 'GFDL-ESM2M', '1pctCO2');
INSERT INTO docs.tbl_document VALUES (1507, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', 'f45afb6e-5ef5-11e1-8b11-00163e9152a5', 1, '2015-07-26 01:51:53.609378', true, '1pctCO2_4x esm2g', '1pctCO2_4x esm2g', NULL, 'ESM2G-C2_1pct-co2_4x_U2', 'GFDL experiment name = ESM2G-C2_1pct-co2_4x_U2. PCMDI experiment name = 1 percent per year CO2 (run1). Initial conditions for this experiment were taken from 1 January of year 11 of the 1860 control model experiment named ESM2G_pi-control_C2. In the ESM2G-C2_1pct-co2_4x_U2 experiment, atmospheric CO2 levels were prescribed to increase from their initial mixing ratio level of 286.15 ppmv at a compounded rate of +1 percent per year until year 140 (the point of quadrupling). CO2 levels were held constant at 1144.6 ppmv from year 141 through the end of the 300 year long experiment. For the entire 300 year duration of the experiment, all non-CO2 forcing agents (CH4, N2O, tropospheric and stratospheric O3, tropospheric sulfates, black and organic carbon, dust, sea salt, and solar irradiance) were held constant at values representative of year 1860, and there was no land use (i.e., a "potential vegetation" integration).', 'GFDL-ESM2G', '1pctCO2');
INSERT INTO docs.tbl_document VALUES (1174, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '6ccd1558-c34e-11e0-9bbf-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, '1pctCO2_4x esm2m', '1pctCO2_4x esm2m', NULL, 'ESM2M-C1_1pct-co2_4x_U1', 'GFDL experiment name = ESM2M-C1_1pct-co2_4x_U1. PCMDI experiment name = 1 percent per year CO2 (run1). Initial conditions for this experiment were taken from 1 January of year 10 of the 1860 control model experiment named ESM2M_pi-control_C1. In the ESM2M-C1_1pct-co2_4x_U1 experiment, atmospheric CO2 levels were prescribed to increase from their initial mixing ratio level of 286.15 ppmv at a compounded rate of +1 percent per year until year 140 (the point of quadrupling). CO2 levels were held constant at 1144.6 ppmv from year 141 through the end of the 300 year long experiment. For the entire 300 year duration of the experiment, all non-CO2 forcing agents (CH4, N2O, tropospheric and stratospheric O3, tropospheric sulfates, black and organic carbon, dust, sea salt, and solar irradiance) were held constant at values representative of year 1860. This integration did not include land use change (i.e., a "potential vegetation" integration) and volcanic aerosols were zero. The direct effect of tropospheric aerosol', 'GFDL-ESM2M', '1pctCO2');
INSERT INTO docs.tbl_document VALUES (1385, 'cmip5', NULL, 'inm', 'cim.1.misc.DocumentSet', '5f6e86a8-2853-11e0-9e91-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, '1pctCo2', '1pctCo2', NULL, '1pctCo2', '1pctCo2', 'INMCM4', '1pctCO2');
