INSERT INTO docs.tbl_document VALUES (1986, 'cmip5', NULL, 'cnrm-cerfacs', 'cim.1.misc.DocumentSet', '84758f82-19cf-11e1-a896-00163e9152a5', 1, '2015-07-26 01:51:53.609378', true, 'AB4CO2', 'AB4CO2', NULL, 'Abrupt quadrupling of CO2 concentration', 'Abrupt quadrupling of CO2 concentration', 'CNRM-CM5', 'abrupt4xCO2');
INSERT INTO docs.tbl_document VALUES (2032, 'cmip5', NULL, 'csiro-bom', 'cim.1.software.ModelComponent', '4b225a48-775f-11e0-bfe0-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'ACCESS1.0', 'ACCESS1.0', NULL, 'ACCESS1.0', 'The atmospheric component of ACCESS1.0 uses the UK Met Office''s Unified Model (UM) 7.3 code with atmospheric physics the same as for the the Met Office''s HadGEM2 version r1.1. The land surface component is the Met Office’s MOSES2.  The ocean and sea ice components are based on the GFDL MOM4p1 and LANL CICE4.1 codes. The OASIS3.2.5 coupler (CERFACS) is used to couple the ocean, sea ice and atmospheric components.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (2051, 'cmip5', NULL, 'csiro-bom', 'cim.1.software.ModelComponent', '4b225a48-775f-11e0-bfe0-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'ACCESS1.0', 'ACCESS1.0', NULL, 'ACCESS1.0', 'The atmospheric component of ACCESS1.0 uses the UK Met Office''s Unified Model (UM) 7.3 code with atmospheric physics the same as for the the Met Office''s HadGEM2 version r1.1. The land surface component is the Met Office’s MOSES2.  The ocean and sea ice components are based on the GFDL MOM4p1 and LANL CICE4.1 codes. The OASIS3.2.5 coupler (CERFACS) is used to couple the ocean, sea ice and atmospheric components.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (1241, 'cmip5', NULL, 'csiro-bom', 'cim.1.software.ModelComponent', '5057261e-c9c1-11e1-b5ae-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'ACCESS1.3', 'ACCESS1.3', NULL, 'ACCESS1.3', 'The atmospheric component of ACCESS1.3 uses the UK Met Office''s Unified Model (UM) 7.3 code with atmospheric physics similar to the MetOffice GA1.0 global atmosphere model (though including modifications by CAWCR scientists). Significantly, the GA1.0 and ACCESS1.3 include the PC2 prognostic cloud scheme.  The land surface component is the Australian community CABLE land surface model.  The ocean and sea ice components are based on the GFDL MOM4p1 and LANL CICE4.1 codes. The OASIS3.2.5 coupler (CERFACS) is used to couple the ocean, sea ice and atmospheric components.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (1844, 'cmip5', NULL, 'csiro-bom', 'cim.1.software.ModelComponent', '5057261e-c9c1-11e1-b5ae-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'ACCESS1.3', 'ACCESS1.3', NULL, 'ACCESS1.3', 'The atmospheric component of ACCESS1.3 uses the UK Met Office''s Unified Model (UM) 7.3 code with atmospheric physics similar to the MetOffice GA1.0 global atmosphere model (though including modifications by CAWCR scientists). Significantly, the GA1.0 and ACCESS1.3 include the PC2 prognostic cloud scheme.  The land surface component is the Australian community CABLE land surface model.  The ocean and sea ice components are based on the GFDL MOM4p1 and LANL CICE4.1 codes. The OASIS3.2.5 coupler (CERFACS) is used to couple the ocean, sea ice and atmospheric components.', NULL, NULL);
