INSERT INTO docs.tbl_document VALUES (48138, 'dcmip-2012', NULL, NULL, 'cim.1.software.ModelComponent', '132609e8-66a0-4e7c-a83f-f6d377596ff2', 9, '2016-01-07 20:15:58.553319', true, 'ENDGame', 'ENDGame', NULL, 'Even Newer Dynamics for General atmospheric modelling of the environment', 'ENDGame is the new dynamical core proposed for the UK Met Office''s Unified Model (UM). It is an evolution of the current New Dynamics dynamical core and shares some of the same design philosophies. ENDGame deep atmosphere, non-hydrostatic model using a two time level, iterated, Semi-Implicit Semi-Lagrangian (SISL) finite difference scheme on a latitude-longitude grid.', NULL, NULL);
