INSERT INTO docs.tbl_document VALUES (48135, 'dcmip-2012', NULL, NULL, 'cim.1.software.ModelComponent', '748331ee-04f9-455a-87e0-eaabef5128ea', 11, '2016-01-07 20:15:58.553319', true, 'FIM', 'FIM', NULL, 'Flow-Following Icosahedral Model', 'A global, hydrostatic extended-range weather prediction model using an icosahedral grid in the horizontal and an adaptive grid (terrain-following near the ground, isentropic aloft) in the vertical.', NULL, NULL);
