INSERT INTO docs.tbl_document VALUES (1544, 'cmip5', NULL, 'nasa-giss', 'cim.1.software.ModelComponent', 'd53e949e-2a7a-11e0-b65a-00163e9152a5', 4, '2015-07-26 01:51:53.609378', true, 'GISS-E2-H', 'GISS-E2-H', NULL, 'GISS ModelE version 2, HYCOM ocean model', 'GISS-E2-H is the NASA GISS atmospheric model (version E2) combined with the HYCOM Ocean model. It can be run with 3 different treatments of the atmospheric composition. With "physics-version=1", the aerosols and chemistry are read in from offline fields. For "physics-version=2" and "physics-version=3", the aerosols and gas phase chemistry are interactive with the climate and driven by emissions. The Aerosol Indirect Effect is parameterized in p1 and p2 to have a specific forcing at year 2000, while in p3, the AIE is prognostic.', NULL, NULL);
