INSERT INTO docs.tbl_document VALUES (1675, 'cmip5', NULL, 'mohc', 'cim.1.software.ModelComponent', '73c59aba-dc6d-11df-a442-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'HADCM3', 'HADCM3', NULL, 'HadCM3 (2000) atmosphere: HadAM3 (N48L19); ocean: HadOM (lat: 1.25 lon: 1.25 L20); land-surface/vegetation: MOSES1;', 'HadCM3 is a coupled atmosphere-ocean GCM developed at the Hadley Centre and described by Gordon et al. (2000). It has a stable control climatology and does not use flux adjustment. The climate component represented the model used by the Hadley Centre to provide input for the IPCC Third and Fourth Assessment Reports. The atmosphere and ocean are coupled once per day. The atmospheric model is run with fixed SSTs through the day and the various forcing fluxes are accumulated each atmospheric model time step. At the end of the day these fluxes are passed to the ocean model which is then integrated forwards in time. The updated SSTs and sea ice extents are then passed back to the atmospheric model. As there are six ocean grid points to every atmospheric grid point interpolation and/or averaging is used to transfer fields between the two grids conserved.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (1999, 'cmip5', NULL, 'mohc', 'cim.1.software.ModelComponent', '73c59aba-dc6d-11df-a442-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'HADCM3', 'HADCM3', NULL, 'HadCM3 (2000) atmosphere: HadAM3 (N48L19); ocean: HadOM (lat: 1.25 lon: 1.25 L20); land-surface/vegetation: MOSES1;', 'HadCM3 is a coupled atmosphere-ocean GCM developed at the Hadley Centre and described by Gordon et al. (2000). It has a stable control climatology and does not use flux adjustment. The climate component represented the model used by the Hadley Centre to provide input for the IPCC Third and Fourth Assessment Reports. The atmosphere and ocean are coupled once per day. The atmospheric model is run with fixed SSTs through the day and the various forcing fluxes are accumulated each atmospheric model time step. At the end of the day these fluxes are passed to the ocean model which is then integrated forwards in time. The updated SSTs and sea ice extents are then passed back to the atmospheric model. As there are six ocean grid points to every atmospheric grid point interpolation and/or averaging is used to transfer fields between the two grids conserved.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (1344, 'cmip5', NULL, 'mohc', 'cim.1.software.ModelComponent', '7a2b64cc-03ca-11e1-a36a-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'HADGEM2-A', 'HADGEM2-A', NULL, 'Hadley Global Environment Model 2 - Atmosphere', 'The HadGEM2-A model is a configuration of the HadGEM2 model which is an atmosphere only simulation with other component interfaces replaced with ancillary file input.', NULL, NULL);
