INSERT INTO docs.tbl_document VALUES (2342, 'cmip5', NULL, 'mohc', 'cim.1.software.ModelComponent', '2f4cc6d0-9679-11e0-a921-00163e9152a5', 4, '2015-07-26 01:51:53.609378', false, 'HADGEM2-CC', 'HADGEM2-CC', NULL, 'Hadley Global Environment Model 2 - Carbon Cycle', 'The HadGEM2-CC is a specific configuration of HadGEM2 for the CMIP5 project using a 60 level atmosphere.  Major differences from HadGEM2-ES are the inclusion of a non-orographic gravity wave drag scheme, production of stratospheric water vapour from methane oxidation, and the removal of the UKCA interactive tropospheric chemistry component.  Chemical oxidants are prescribed using decadal averages from the equivalent HadGEM2-ES simulations.', NULL, NULL);
