INSERT INTO docs.tbl_document VALUES (2187, 'cmip5', NULL, 'inm', 'cim.1.software.ModelComponent', '204e6fe2-ee42-11df-93b1-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'INM-CM4', 'INM-CM4', NULL, 'inmcm4', 'inmcm4', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (2027, 'cmip5', NULL, 'inpe', 'cim.1.software.ModelComponent', 'f1ff59b4-db37-11e1-85e5-00163e9152a5', 2, '2015-07-26 01:51:53.609378', false, 'INPE-HADGEM2-ES', 'INPE-HADGEM2-ES', NULL, 'Hadley Global Environment Model 2 - Earth System', 'The HadGEM2-ES model was a two stage development from HadGEM1, representing improvements in the physical model (leading to HadGEM2-AO) and the addition of earth system components and coupling (leading to HadGEM2-ES). [1] The HadGEM2-AO project targeted two key features of performance: ENSO and northern continent land-surface temperature biases. The latter had a particularly high priority in order for the model to be able to adequately model continental vegetation. Through focussed working groups a number of mechanisms that improved the performance were identified. Some known systematic errors in HadGEM1, such as the Indian monsoon, were not targeted for attention in HadGEM2-AO. HadGEM2-AO substantially improved mean SSTs and wind stress and improved tropical SST variability compared to HadGEM1. The northern continental warm bias in HadGEM1 has been significantly reduced. The power spectrum of El Nino is made worse, but other aspects of ENSO are improved. Overall there is a noticeable improvement from HadGEM1', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (2149, 'cmip5', NULL, 'inpe', 'cim.1.software.ModelComponent', 'f1ff59b4-db37-11e1-85e5-00163e9152a5', 3, '2015-07-26 01:51:53.609378', true, 'INPE-HADGEM2-ES', 'INPE-HADGEM2-ES', NULL, 'Hadley Global Environment Model 2 - Earth System', 'The HadGEM2-ES model was a two stage development from HadGEM1, representing improvements in the physical model (leading to HadGEM2-AO) and the addition of earth system components and coupling (leading to HadGEM2-ES). [1] The HadGEM2-AO project targeted two key features of performance: ENSO and northern continent land-surface temperature biases. The latter had a particularly high priority in order for the model to be able to adequately model continental vegetation. Through focussed working groups a number of mechanisms that improved the performance were identified. Some known systematic errors in HadGEM1, such as the Indian monsoon, were not targeted for attention in HadGEM2-AO. HadGEM2-AO substantially improved mean SSTs and wind stress and improved tropical SST variability compared to HadGEM1. The northern continental warm bias in HadGEM1 has been significantly reduced. The power spectrum of El Nino is made worse, but other aspects of ENSO are improved. Overall there is a noticeable improvement from HadGEM1', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (45938, 'esps', NULL, NULL, 'cim.1.software.ModelComponent', '5e19d55b-e4a9-4ad4-8fe6-d83361428a8d', 7, '2016-01-06 17:54:01.255978', false, 'NavGEM', 'NavGEM', NULL, 'Navy Global Environmental Model', 'Navy Global Environmental Model', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (2300, 'cmip5', NULL, 'inpe', 'cim.1.software.ModelComponent', 'f1ff59b4-db37-11e1-85e5-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'INPE-HADGEM2-ES', 'INPE-HADGEM2-ES', NULL, 'Hadley Global Environment Model 2 - Earth System', 'The HadGEM2-ES model was a two stage development from HadGEM1, representing improvements in the physical model (leading to HadGEM2-AO) and the addition of earth system components and coupling (leading to HadGEM2-ES). [1] The HadGEM2-AO project targeted two key features of performance: ENSO and northern continent land-surface temperature biases. The latter had a particularly high priority in order for the model to be able to adequately model continental vegetation. Through focussed working groups a number of mechanisms that improved the performance were identified. Some known systematic errors in HadGEM1, such as the Indian monsoon, were not targeted for attention in HadGEM2-AO. HadGEM2-AO substantially improved mean SSTs and wind stress and improved tropical SST variability compared to HadGEM1. The northern continental warm bias in HadGEM1 has been significantly reduced. The power spectrum of El Nino is made worse, but other aspects of ENSO are improved. Overall there is a noticeable improvement from HadGEM1', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (1553, 'cmip5', NULL, 'ipsl', 'cim.1.software.ModelComponent', '4b29d25e-2968-11e0-8517-00163e9152a5', 8, '2015-07-26 01:51:53.609378', false, 'IPSL-CM5A-LR', 'IPSL-CM5A-LR', NULL, 'IPSL-CM5A-LR;atmosphere:LMDZ5A(95x96L39);ocean:NEMOv3.2 (OPA-LIM-PISCES,149x182L31)', 'IPSL-CM5A-LR is the low resolution version of the IPSL-CM5A Earth system model. The resolution is 1.875°x3.75° with 39 vertical level for the atmosphere (96x95L39) and about 2° (with a meridional increased resolution of 0.5° near the equator) and with 31 vertical levels for the ocean (149x182L31).
