INSERT INTO docs.tbl_document VALUES (48126, 'dcmip-2012', NULL, NULL, 'cim.1.software.ModelComponent', '96d8e181-6d34-4bcf-b61b-7d562bea9522', 4, '2016-01-07 20:15:58.553319', true, 'NICAM', 'NICAM', NULL, 'Nonhydrostatic ICosahedral Atmospheric Model', 'The Nonhydrostatic ICosahedral Atmosphere Model (NICAM) was developed for uses on the Earth Simulator. The prognostic variables are density, momentum, total energy, and tracer species. Sound waves are computed explicitly in horizontal and implicitly in vertical. The A-grid arrangement is adopted for the prognostic variables horizontally, that is, all of the prognostic variables are positioned at the centers of hexagonal cells. The Finite-Volume method is used for the spatial discretization of operators. The icosahedral grids are developed and optimized by the spring-dynamics method of Tomita et al. (2002). It supports a variable resolution mesh by stretching (Tomita 2008). The finite-volume method is used for the second-order accurate horizontal discretizations of divergence and gradient (Tomita et al. 2001). Tracers are transported by an upwind-bosed scheme using a linear reconstruction (Miura 2007). A three-stage Runge-Kutta scheme is supported, but the two-stage Runge-Kutta scheme is used usually.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (48127, 'dcmip-2012', NULL, NULL, 'cim.1.software.ModelComponent', 'bc98f751-45ca-429d-bf8c-aaaee750bc88', 7, '2016-01-07 20:15:58.553319', true, 'NIM', 'NIM', NULL, 'Non-hydrostatic Icosahedral Model', 'The Nonhydrostatic Icosahedral Model (NIM) formulates the latest numerical innovation of the three-dimensional finite-volume control volume on the quasi-uniform icosahedral grid suitable for ultra-high resolution simulations. NIM’s modeling goal is to improve numerical accuracy for weather and climate simulations as well as to utilize the state-of-art computing architecture such as massive parallel CPUs and GPUs to deliver routine high-resolution forecasts in timely manner.', NULL, NULL);
