INSERT INTO docs.tbl_document VALUES (45895, 'esps', NULL, NULL, 'cim.1.software.ModelComponent', '58317588-dbcd-47e3-939b-7ab3ec65de01', 1, '2016-01-06 17:54:01.255978', false, 'WaveWatch III', 'WaveWatch III', NULL, 'WaveWatch III', 'WaveWatch III', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (1176, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', '5e45202c-2b2a-11e1-a1f2-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'abrupt4xCO2', 'abrupt4xCO2', NULL, '6.3  Gregory-style diagnosis of slow climate system responses', 'Imposes an instantaneous quadrupling of atmospheric CO2 concentration (relative to pre-industrial) and then holds it fixed for the rest of the simulation.  Main run extends for 150 years from 1859-12-01.  The remaining 11 members run for only 5 years at the start of the simulation - each is initialised from piControl at a different month in 1860 9e.g. r2i1p1 runs from 1860-01-01 to 1865-01-01, and is initialised from piControl 1860-01-01.', 'HADGEM2-ES', 'abrupt4xCO2');
INSERT INTO docs.tbl_document VALUES (1699, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', '5e45202c-2b2a-11e1-a1f2-00163e9152a5', 2, '2015-07-26 01:51:53.609378', false, 'abrupt4xCO2', 'abrupt4xCO2', NULL, '6.3  Gregory-style diagnosis of slow climate system responses', 'Imposes an instantaneous quadrupling of atmospheric CO2 concentration (relative to pre-industrial) and then holds it fixed for the rest of the simulation.  Main run extends for 150 years from 1859-12-01.  The remaining 11 members run for only 5 years at the start of the simulation - each is initialised from piControl at a different month in 1860 9e.g. r2i1p1 runs from 1860-01-01 to 1865-01-01, and is initialised from piControl 1860-01-01.', 'HADGEM2-ES', 'abrupt4xCO2');
INSERT INTO docs.tbl_document VALUES (1846, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', 'a589f51e-c399-11e0-987c-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'abrupt4xCO2', 'abrupt4xCO2', NULL, 'ESM2M-C1_abrupt-4xco2_S1', 'GFDL experiment name = ESM2M-C1_abrupt-4xco2_S1. PCMDI experiment name = abrupt 4XCO2 (run1). Initial conditions for this experiment were taken from 1 January of year 1 of the 1860 control model experiment named ESM2M_pi-control_C1. In the ESM2M-C1_abrupt-4xco2_S1 experiment, atmospheric CO2 levels were prescribed to increase from their initial mixing ratio level of 286 ppmv to an instantaneous quadrupling (1144 ppm). CO2 levels were held constant at 1144 ppmv for the duration of the 300 year long experiment. For the entire 300 year duration of the experiment, all non-CO2 forcing agents (CH4, N2O, tropospheric and stratospheric O3, tropospheric sulfates, black and organic carbon, dust, sea salt, and solar irradiance) were held constant at values representative of year 1860. This integration did not include land use change (i.e., a "potential vegetation" integration) and volcanic aerosols were zero. The direct effect of tropospheric aerosols is calculated by the model, but not the indirect effects.', 'GFDL-ESM2M', 'abrupt4xCO2');
INSERT INTO docs.tbl_document VALUES (2492, 'cmip5', NULL, 'nasa-giss', 'cim.1.misc.DocumentSet', '30d56920-6fbe-11e1-9bbb-00163e9152a5', 2, '2015-07-26 01:51:53.609378', false, 'amip GISS-E2 p3', 'amip GISS-E2 p3', NULL, 'amip, GISS-E2-R/H, interactive composition (physics-version=3)', 'Since this is an agcm-only run, GISS-E2-R and GISS-E2-H are the same. Filed under GISS-E2-R for convenience.', 'GISS-E2-R', 'amip');
INSERT INTO docs.tbl_document VALUES (2077, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', '5e45202c-2b2a-11e1-a1f2-00163e9152a5', 3, '2015-07-26 01:51:53.609378', true, 'abrupt4xCO2', 'abrupt4xCO2', NULL, '6.3  Gregory-style diagnosis of slow climate system responses', 'Imposes an instantaneous quadrupling of atmospheric CO2 concentration (relative to pre-industrial) and then holds it fixed for the rest of the simulation.  Main run extends for 150 years from 1859-12-01.  The remaining 11 members run for only 5 years at the start of the simulation - each is initialised from piControl at a different month in 1860 9e.g. r2i1p1 runs from 1860-01-01 to 1865-01-01, and is initialised from piControl 1860-01-01.', 'HADGEM2-ES', 'abrupt4xCO2');
