INSERT INTO docs.tbl_document VALUES (1275, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', 'a589f51e-c399-11e0-987c-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'abrupt4xCO2 esm2m', 'abrupt4xCO2 esm2m', NULL, 'ESM2M-C1_abrupt-4xco2_S1', 'GFDL experiment name = ESM2M-C1_abrupt-4xco2_S1. PCMDI experiment name = abrupt 4XCO2 (run1). Initial conditions for this experiment were taken from 1 January of year 1 of the 1860 control model experiment named ESM2M_pi-control_C1. In the ESM2M-C1_abrupt-4xco2_S1 experiment, atmospheric CO2 levels were prescribed to increase from their initial mixing ratio level of 286 ppmv to an instantaneous quadrupling (1144 ppm). CO2 levels were held constant at 1144 ppmv for the duration of the 300 year long experiment. For the entire 300 year duration of the experiment, all non-CO2 forcing agents (CH4, N2O, tropospheric and stratospheric O3, tropospheric sulfates, black and organic carbon, dust, sea salt, and solar irradiance) were held constant at values representative of year 1860. This integration did not include land use change (i.e., a "potential vegetation" integration) and volcanic aerosols were zero. The direct effect of tropospheric aerosols is calculated by the model, but not the indirect effects.', 'GFDL-ESM2M', 'abrupt4xCO2');
