INSERT INTO docs.tbl_document VALUES (1757, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', 'e4155a28-268e-11e1-9a0e-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'amip', 'amip', NULL, '3.3 AMIP and AMIP Ensemble', 'Main amip ensemble simulations.  Dust tuning modified from HadGEM2-ES runs as a result of previous work indicating that HadGEM2-A did not suffer from SST biases to which the dust is very senstive.  SST and sea-ice imposed from observations and other forcings are as defined for the historical experiment.  Output includes CFMIP required variables.   Although the submitted data starts from December 1978, the simulations were started from September 1978 to allow configured fields like river water storage time to spin up.', 'HADGEM2-A', 'amip');
INSERT INTO docs.tbl_document VALUES (2097, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', 'e4155a28-268e-11e1-9a0e-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'amip', 'amip', NULL, '3.3 AMIP and AMIP Ensemble', 'Main amip ensemble simulations.  Dust tuning modified from HadGEM2-ES runs as a result of previous work indicating that HadGEM2-A did not suffer from SST biases to which the dust is very senstive.  SST and sea-ice imposed from observations and other forcings are as defined for the historical experiment.  Output includes CFMIP required variables.   Although the submitted data starts from December 1978, the simulations were started from September 1978 to allow configured fields like river water storage time to spin up.', 'HADGEM2-A', 'amip');
