INSERT INTO docs.tbl_document VALUES (2596, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', 'c04f62a8-4bf2-11e1-a210-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'amip4K', 'amip4K', NULL, 'Cloud response to an imposed 4K change in SST', 'Consistent with the CFMIP requirements, this simulation adds a uniform +4K to the AMIP SST inputs used for the main SST run.  Although the submitted data starts from December 1978, the simulations were started from September 1978 to allow configured fields like river water storage time to spin up.', 'HADGEM2-A', 'amip4k');
INSERT INTO docs.tbl_document VALUES (1307, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', 'd2f369ce-4826-11e1-8243-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'amip4xCO2', 'amip4xCO2', NULL, '6.5 Cloud response to imposed 4xCO2', 'Consistent with CFMIP requirements, the AMIP conditions are imposed, but the radiation code (only) sees quadrupled CO2, relative to AMIP.  The carbon cycle sub-model is inactive in HadGEM2-A.  Although the submitted data starts from December 1978, the simulations were started from September 1978 to allow configured fields like river water storage time to spin up.', 'HADGEM2-A', 'amip4xCO2');
