INSERT INTO docs.tbl_document VALUES (1321, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', '1e799eae-7afa-11e0-9f98-00163e9152a5', 4, '2015-07-26 01:51:53.609378', true, 'decadal_anomaly', 'decadal_anomaly', NULL, '1.1 Anomaly initialisation ensembles', 'Ten element ensembles, initialised at the end of specific years in the second half of the 20th century and early part of the 21st century.  Most ensembles extend for 10 years, with some running for 30 years. Initial ocean conditions are representative of the observed anomalies for the start date.  The atmospheric composition (and other conditions including volcanic aerosols) are as prescribed in the historical run and the RCP4.5 scenario of the long-term suite of experiments.
