INSERT INTO docs.tbl_document VALUES (1784, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '85f68668-c27c-11e0-bf94-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'esmControl', 'esmControl', NULL, 'ESM2M_pi-control-E1', 'GFDL experiment name = ESM2M_pi-control_E1. PCMDI experiment name = ESM pre-industrial control (run1). Initial conditions for this experiment were derived from a multi-step process involving a multi-century spin-up integration to allow both the physical climate system and the carbon cycle to come into a quasi-dynamic equilibrium with year 1860 radiative forcing. First, a dynamic vegetation and carbon cycle model was spun up with forcing agents obtained from a previous CM2.1 control integration at levels representative of 1860, and potential (i.e., no land use) vegetation. Second, the spun up dynamic vegetation and carbon cycle model was coupled to an atmosphere model using Atmospheric Model Intercomparison Project (AMIP) protocols and spun up with time-varying observed sea surface temperatures and sea ice values. Third, an ocean + sea ice model was spun up with initial conditions for sea ice, ocean potential temperature and salinity derived from late 20th century observations. The ESM was coupled to the ocea', 'GFDL-ESM2M', 'esmControl');
INSERT INTO docs.tbl_document VALUES (1854, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', '5d3080da-2690-11e1-9522-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'esmControl', 'esmControl', NULL, '5.1 ESM preindustrial control', 'Initial conditions as for the main preindustrial control simulation (piControl), but with CO2 concentration determined interactively by the model rather than being prescribed.', 'HADGEM2-ES', 'esmControl');
INSERT INTO docs.tbl_document VALUES (1966, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', '5d3080da-2690-11e1-9522-00163e9152a5', 3, '2015-07-26 01:51:53.609378', true, 'esmControl', 'esmControl', NULL, '5.1 ESM preindustrial control', 'Initial conditions as for the main preindustrial control simulation (piControl), but with CO2 concentration determined interactively by the model rather than being prescribed.', 'HADGEM2-ES', 'esmControl');
