INSERT INTO docs.tbl_document VALUES (2358, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '021ec160-5d73-11e1-89fa-00163e9152a5', 1, '2015-07-26 01:51:53.609378', true, 'esmControl esm2g', 'esmControl esm2g', NULL, 'ESM2G_pi-control-E2', 'GFDL experiment name = ESM2G_pi-control_E2. PCMDI experiment name = pre-industrial control (run1). Initial conditions for this experiment were derived from a multi-step process involving a multi-century spin-up integration to allow both the physical climate system and the carbon cycle to come into a quasi-dynamic equilibrium with year 1860 radiative forcing. First, a dynamic vegetation and carbon cycle land only model was spun up with forcing agents obtained from a previous CM2.1 control integration at levels representative of 1860, and potential vegetation (i.e., no land use). Second, the spun up dynamic vegetation and carbon cycle land only model was coupled to an atmosphere model using Atmospheric Model Intercomparison Project (AMIP) protocols and spun up with using the monthly climatology of observed sea surface temperatures and sea ice concentrations averaged over the AMIP period. Third, an ocean + sea ice model was initialized from a zero-velocity state with temperature and salinity profiles derived fr', 'GFDL-ESM2G', 'esmControl');
INSERT INTO docs.tbl_document VALUES (1732, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '85f68668-c27c-11e0-bf94-00163e9152a5', 4, '2015-07-26 01:51:53.609378', true, 'esmControl esm2m', 'esmControl esm2m', NULL, 'ESM2M_pi-control-E1', 'GFDL experiment name = ESM2M_pi-control_E1. PCMDI experiment name = ESM pre-industrial control (run1). Initial conditions for this experiment were derived from a multi-step process involving a multi-century spin-up integration to allow both the physical climate system and the carbon cycle to come into a quasi-dynamic equilibrium with year 1860 radiative forcing. First, a dynamic vegetation and carbon cycle model was spun up with forcing agents obtained from a previous CM2.1 control integration at levels representative of 1860, and potential (i.e., no land use) vegetation. Second, the spun up dynamic vegetation and carbon cycle model was coupled to an atmosphere model using Atmospheric Model Intercomparison Project (AMIP) protocols and spun up with time-varying observed sea surface temperatures and sea ice values. Third, an ocean + sea ice model was spun up with initial conditions for sea ice, ocean potential temperature and salinity derived from late 20th century observations. The ESM was coupled to the ocea', 'GFDL-ESM2M', 'esmControl');
INSERT INTO docs.tbl_document VALUES (2345, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '85f68668-c27c-11e0-bf94-00163e9152a5', 2, '2015-07-26 01:51:53.609378', false, 'esmControl esm2m', 'esmControl esm2m', NULL, 'ESM2M_pi-control-E1', 'GFDL experiment name = ESM2M_pi-control_E1. PCMDI experiment name = ESM pre-industrial control (run1). Initial conditions for this experiment were derived from a multi-step process involving a multi-century spin-up integration to allow both the physical climate system and the carbon cycle to come into a quasi-dynamic equilibrium with year 1860 radiative forcing. First, a dynamic vegetation and carbon cycle model was spun up with forcing agents obtained from a previous CM2.1 control integration at levels representative of 1860, and potential (i.e., no land use) vegetation. Second, the spun up dynamic vegetation and carbon cycle model was coupled to an atmosphere model using Atmospheric Model Intercomparison Project (AMIP) protocols and spun up with time-varying observed sea surface temperatures and sea ice values. Third, an ocean + sea ice model was spun up with initial conditions for sea ice, ocean potential temperature and salinity derived from late 20th century observations. The ESM was coupled to the ocea', 'GFDL-ESM2M', 'esmControl');
INSERT INTO docs.tbl_document VALUES (1901, 'cmip5', NULL, 'bcc', 'cim.1.misc.DocumentSet', '432dfd4e-f250-11e0-9edb-00163e9152a5', 1, '2015-07-26 01:51:53.609378', true, 'esmFdbk2', 'esmFdbk2', NULL, NULL, 'The carbon cycle is fed the time-invariant CO2 concentration from the control. The radiation code responds only to the increase in CO2 concentration.This run is initialized from 160yr of pre-industrial control run  and CO2 concentration is prescribed to change as expt.3.2 during 1850-2005 and RCP4.5 beyond 2005.', 'BCC-CSM1.1', 'esmFdbk2');
INSERT INTO docs.tbl_document VALUES (1227, 'cmip5', NULL, 'ncc', 'cim.1.misc.DocumentSet', '1196cc30-42cc-11e1-92c9-00163e9152a5', 1, '2015-07-26 01:51:53.609378', true, 'sstClim4xCO2', 'sstClim4xCO2', NULL, NULL, NULL, 'NORESM1-M', 'sstClim4xCO2');
INSERT INTO docs.tbl_document VALUES (1650, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', '4cd257d6-32e8-11e1-a339-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'esmFdbk2', 'esmFdbk2', NULL, '5.5-2 ESM experiment to further understanding of carbon/climate feedback', 'Experiment to diagnose components of the carbon/climate feedback. This experiment is forced with prescribed atmospheric CO2 concentrations. Spin off from the control (3.1) at the same point as the historical experiment (3.2) and impose conditions identical to the historical and rcp45 experiment.  Only the radiation code is fed the all the evolving forcings used in the historical and rcp45 experiment. Forced in this way, the carbon cycle, which is only subject to the control atmospheric CO2 concentrations, responds to climate change alone.', 'HADGEM2-ES', 'esmFdbk2');
INSERT INTO docs.tbl_document VALUES (2044, 'cmip5', NULL, 'ncar', 'cim.1.misc.DocumentSet', '69af4866-781a-11e0-89ef-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'b40.mh6ka.1deg.003', 'b40.mh6ka.1deg.003', NULL, 'TIER1 CCSM4 Mid-Holocene (6ka BP)', 'TIER1 CCSM4 Mid-Holocene (6ka BP)', 'CCSM4', 'midHolocene');
INSERT INTO docs.tbl_document VALUES (2353, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '85f68668-c27c-11e0-bf94-00163e9152a5', 3, '2015-07-26 01:51:53.609378', false, 'esmControl esm2m', 'esmControl esm2m', NULL, 'ESM2M_pi-control-E1', 'GFDL experiment name = ESM2M_pi-control_E1. PCMDI experiment name = ESM pre-industrial control (run1). Initial conditions for this experiment were derived from a multi-step process involving a multi-century spin-up integration to allow both the physical climate system and the carbon cycle to come into a quasi-dynamic equilibrium with year 1860 radiative forcing. First, a dynamic vegetation and carbon cycle model was spun up with forcing agents obtained from a previous CM2.1 control integration at levels representative of 1860, and potential (i.e., no land use) vegetation. Second, the spun up dynamic vegetation and carbon cycle model was coupled to an atmosphere model using Atmospheric Model Intercomparison Project (AMIP) protocols and spun up with time-varying observed sea surface temperatures and sea ice values. Third, an ocean + sea ice model was spun up with initial conditions for sea ice, ocean potential temperature and salinity derived from late 20th century observations. The ESM was coupled to the ocea', 'GFDL-ESM2M', 'esmControl');
INSERT INTO docs.tbl_document VALUES (1170, 'cmip5', NULL, 'mpi-m', 'cim.1.misc.DocumentSet', 'a7cce830-df97-11e0-807e-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'esmControl-LR', 'esmControl-LR', NULL, 'esmControl-LR', 'Pre Industrial control run, emission forced (1850 to 2849). Low resolution T63L47 / GR15L40. Reference year for insolation / JSBACH=1850.', 'MPI-ESM-LR', 'esmControl');
INSERT INTO docs.tbl_document VALUES (1918, 'cmip5', NULL, NULL, 'cim.1.activity.NumericalExperiment', '9f20505e-d3a5-11df-837f-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'esmFdbk1', 'esmFdbk1', NULL, 'ESM feedback 1', 'Impose conditions identical to 3.1::Control but radiation code sees CO2 concentration increase.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (1997, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', '68e35f2a-32e7-11e1-838f-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'esmFdbk1', 'esmFdbk1', NULL, '5.5-1 ESM experiment to further understanding of the carbon/climate feedback', 'Experiment to diagnose components of the carbon/climate feedback. This experiment is forced with prescribed atmospheric CO2 concentrations. Spin off from the control (3.1) at the same point as1%/yr experiment and impose conditions identical to those prescribed in that experiment, but only the radiation code is fed the rising CO2 concentration. Forced in this way, the carbon cycle, which is only subject to the control atmospheric CO2 concentrations, responds to climate change alone.', 'HADGEM2-ES', 'esmFdbk1');
INSERT INTO docs.tbl_document VALUES (1291, 'cmip5', NULL, 'bcc', 'cim.1.misc.DocumentSet', 'd9904950-6a69-11e0-b244-00163e9152a5', 1, '2015-07-26 01:51:53.609378', true, 'esmFdbk1', 'esmFdbk1', NULL, NULL, 'The carbon cycle is fed the time-invariant CO2 concentration from the control. The radiation code responds only to the increase in CO2 concentration.This run is initialized from 160yr of pre-industrial control run  and CO2 concentration is prescribed to increase at 1%/yr.', 'BCC-CSM1.1', 'esmFdbk1');
INSERT INTO docs.tbl_document VALUES (1698, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', '68e35f2a-32e7-11e1-838f-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'esmFdbk1', 'esmFdbk1', NULL, '5.5-1 ESM experiment to further understanding of the carbon/climate feedback', 'Experiment to diagnose components of the carbon/climate feedback. This experiment is forced with prescribed atmospheric CO2 concentrations. Spin off from the control (3.1) at the same point as1%/yr experiment and impose conditions identical to those prescribed in that experiment, but only the radiation code is fed the rising CO2 concentration. Forced in this way, the carbon cycle, which is only subject to the control atmospheric CO2 concentrations, responds to climate change alone.', 'HADGEM2-ES', 'esmFdbk1');
INSERT INTO docs.tbl_document VALUES (2287, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', 'ca21caea-dfb0-11e0-9f97-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'esmFdbk1', 'esmFdbk1', NULL, 'ESM2M-C1_1pct-co2_2x_nofert_TN1', 'GFDL experiment name = ESM2M-C1_1pct-co2_2x_nofert_TN1. PCMDI experiment name = ESM feedback 1 (run1). Initial conditions for this experiment were taken from 1 January of year 1 of the 1860 control model experiment named ESM2M_pi-control_C1. In the ESM2M-C1_1pct-co2_2x_nofert_TN1 experiment atmospheric CO2 levels were prescribed to increase from their initial mixing ratio level of 286.15 ppmv at a compounded rate of +1 percent per year until year 70 (the point of doubling). CO2 levels were held constant at 574.2349 ppmv from year 71 through the end of the 200 year long experiment. For the entire 200 year duration of the experiment, all non-CO2 forcing agents (CH4, N2O, tropospheric and stratospheric O3, tropospheric sulfates, black and organic carbon, dust, sea salt, and solar irradiance) were held constant at values representative of year 1860. This integration did not include land use change (i.e., a "potential vegetation" integration) and volcanic aerosols were zero. The carbon cycle "sees" the control CO', 'GFDL-ESM2M', 'esmFdbk1');
INSERT INTO docs.tbl_document VALUES (2495, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', 'ca21caea-dfb0-11e0-9f97-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'esmFdbk1 esm2m', 'esmFdbk1 esm2m', NULL, 'ESM2M-C1_1pct-co2_2x_nofert_TN1', 'GFDL experiment name = ESM2M-C1_1pct-co2_2x_nofert_TN1. PCMDI experiment name = ESM feedback 1 (run1). Initial conditions for this experiment were taken from 1 January of year 1 of the 1860 control model experiment named ESM2M_pi-control_C1. In the ESM2M-C1_1pct-co2_2x_nofert_TN1 experiment atmospheric CO2 levels were prescribed to increase from their initial mixing ratio level of 286.15 ppmv at a compounded rate of +1 percent per year until year 70 (the point of doubling). CO2 levels were held constant at 574.2349 ppmv from year 71 through the end of the 200 year long experiment. For the entire 200 year duration of the experiment, all non-CO2 forcing agents (CH4, N2O, tropospheric and stratospheric O3, tropospheric sulfates, black and organic carbon, dust, sea salt, and solar irradiance) were held constant at values representative of year 1860. This integration did not include land use change (i.e., a "potential vegetation" integration) and volcanic aerosols were zero. The carbon cycle "sees" the control CO', 'GFDL-ESM2M', 'esmFdbk1');
INSERT INTO docs.tbl_document VALUES (1813, 'cmip5', NULL, 'mpi-m', 'cim.1.misc.DocumentSet', 'c715eeb8-9333-11e0-9b0a-00163e9152a5', 5, '2015-07-26 01:51:53.609378', true, 'esmFdbk1-LR', 'esmFdbk1-LR', NULL, 'esmFdbk1-LR', 'Coupled model run with 1%/yr CO2 increase (1850 - 1999), which has an effect on the carbon cycle and a feedback in the atmosphere. Low resolution T63L47 / GR15L40. Reference year for insolation /JSBACH =1850.', 'MPI-ESM-LR', 'esmFdbk1');
INSERT INTO docs.tbl_document VALUES (2637, 'cmip5', NULL, 'mpi-m', 'cim.1.misc.DocumentSet', 'c715eeb8-9333-11e0-9b0a-00163e9152a5', 2, '2015-07-26 01:51:53.609378', false, 'esmFdbk1-LR', 'esmFdbk1-LR', NULL, 'esmFdbk1-LR', 'coupled atmosphere ocean model with 1%/yr CO2 increase, which only has an effect on the carbon cycle & the atmosphere sees the increase', 'MPI-ESM-LR', 'esmFdbk1');
INSERT INTO docs.tbl_document VALUES (1234, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', '4cd257d6-32e8-11e1-a339-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'esmFdbk2', 'esmFdbk2', NULL, '5.5-2 ESM experiment to further understanding of carbon/climate feedback', 'Experiment to diagnose components of the carbon/climate feedback. This experiment is forced with prescribed atmospheric CO2 concentrations. Spin off from the control (3.1) at the same point as the historical experiment (3.2) and impose conditions identical to the historical and rcp45 experiment.  Only the radiation code is fed the all the evolving forcings used in the historical and rcp45 experiment. Forced in this way, the carbon cycle, which is only subject to the control atmospheric CO2 concentrations, responds to climate change alone.', 'HADGEM2-ES', 'esmFdbk2');
INSERT INTO docs.tbl_document VALUES (2334, 'cmip5', NULL, 'mpi-m', 'cim.1.misc.DocumentSet', 'c0bf214a-929f-11e0-9b0a-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'esmFixClim1-LR', 'esmFixClim1-LR', NULL, 'esmFixClim1-LR', 'coupled atmosphere ocean model with 1%/yr CO2 increase, which only has an effect on the carbon cycle, but not on the atmosphere', 'MPI-ESM-LR', 'esmFixClim1');
INSERT INTO docs.tbl_document VALUES (1690, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '11ab0582-0beb-11e1-b02f-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'esmFdbk2', 'esmFdbk2', NULL, 'ESM2M-C1_all_historical_HCN1_rcp45_XCN1_nofert', 'GFDL experiment name = ESM2M-C1_all_historical_HCN1_rcp45_XCN1_nofert. PCMDI experiment name = ESM feedback 2 (run1). This is a merged experiment resulting from two GFDL experiments run for ESM feedback 2, ESM2M-C1_all_historical_nofert_HCN1 and ESM2M-HC1_2006-2100_all_historical_nofert_rcp45_XCN1. The experiments were merged for publishing purposes to satisfy the requirements that this data be published as one experiment. The GFDL experiment name listed in the metadata is not the actual GFDL experiments run, rather the merged experiment name. Initial conditions for this experiment were taken from 1 January of year 1861 of the parent experiment, ESM2M-C1_1700-1860_historical_HC1, which is an unpublished experiment branched from 1 January of year 1 of 1860 control model experiment, ESM2M_pi-control_C1 (piControl). This parent experiment is an extension of piControl except historical transitions of land use are applied from 1700-1860 in order to allow the terrestrial carbon stores to respond to the imposition', 'GFDL-ESM2M', 'esmFdbk2');
INSERT INTO docs.tbl_document VALUES (2108, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '11ab0582-0beb-11e1-b02f-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'esmFdbk2 esm2m', 'esmFdbk2 esm2m', NULL, 'ESM2M-C1_all_historical_HCN1_rcp45_XCN1_nofert', 'GFDL experiment name = ESM2M-C1_all_historical_HCN1_rcp45_XCN1_nofert. PCMDI experiment name = ESM feedback 2 (run1). This is a merged experiment resulting from two GFDL experiments run for ESM feedback 2, ESM2M-C1_all_historical_nofert_HCN1 and ESM2M-HC1_2006-2100_all_historical_nofert_rcp45_XCN1. The experiments were merged for publishing purposes to satisfy the requirements that this data be published as one experiment. The GFDL experiment name listed in the metadata is not the actual GFDL experiments run, rather the merged experiment name. Initial conditions for this experiment were taken from 1 January of year 1861 of the parent experiment, ESM2M-C1_1700-1860_historical_HC1, which is an unpublished experiment branched from 1 January of year 1 of 1860 control model experiment, ESM2M_pi-control_C1 (piControl). This parent experiment is an extension of piControl except historical transitions of land use are applied from 1700-1860 in order to allow the terrestrial carbon stores to respond to the imposition', 'GFDL-ESM2M', 'esmFdbk2');
INSERT INTO docs.tbl_document VALUES (1361, 'cmip5', NULL, 'bcc', 'cim.1.misc.DocumentSet', 'da597a52-6a67-11e0-906c-00163e9152a5', 1, '2015-07-26 01:51:53.609378', true, 'esmFixClim1', 'esmFixClim1', NULL, 'experiment to diagnose strength of carbon/climate feedback', 'The radiation code is fed the time-invariant CO2 concentration from the control. The carbon cycle responds only to the increase in CO2 concentration.This run is initialized from 160yr of pre-industrial control run  and CO2 concentration is prescribed to increase at 1%/yr.', 'BCC-CSM1.1', 'esmFixClim1');
INSERT INTO docs.tbl_document VALUES (1373, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '6848651a-dfb3-11e0-b564-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'esmFixClim1', 'esmFixClim1', NULL, 'ESM2M-C1_control_fert_1pct-co2_2x_TOF1', 'GFDL experiment name = ESM2M-C1_control_fert_1pct-co2_2x_TOF1. PCMDI experiment name = ESM fixed climate 1 (run1). Initial conditions for this experiment were taken from 1 January of year 1 of the 1860 control model experiment named ESM2M_pi-control_C1. In the ESM2M-C1_control_fert_1pct-co2_2x_TOF1 experiment atmospheric CO2 levels were constant at the 1860 value of 286 ppmv, while the biology is allowed to respond to prescribed CO2 values that increased from their initial mixing ratio level of 286.15 ppmv at a compounded rate of +1 percent per year until year 70 (the point of doubling). The CO2 levels that the biology sees were held constant at 574.2349 ppmv from year 71 through the end of the 200 year long experiment. For the entire 200 year duration of the experiment, all non-CO2 forcing agents (CH4, N2O, tropospheric and stratospheric O3, tropospheric sulfates, black and organic carbon, dust, sea salt, and solar irradiance) were held constant at values representative of year 1860, and there was no land u', 'GFDL-ESM2M', 'esmFixClim1');
INSERT INTO docs.tbl_document VALUES (1570, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', '4febe3c8-32e4-11e1-a13e-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'esmFixClim1', 'esmFixClim1', NULL, '5.4-1 ESM experiment to diagnose strength of carbon/climate feedback', 'Experiment to diagnose strength of carbon/climate feedback. This experiment is forced with prescribed atmospheric CO2 concentrations. Spin off from the control (3.1) at the same point as ( 6.1 1%/yr) and impose conditions identical to those prescribed in (6.1), but the radiation code is fed the time-invariant CO2 concentration from the control. There is little climate change and the carbon cycle responds only to the increase in CO2 concentration.', 'HADGEM2-ES', 'esmFixClim1');
INSERT INTO docs.tbl_document VALUES (2370, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', '4febe3c8-32e4-11e1-a13e-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'esmFixClim1', 'esmFixClim1', NULL, '5.4-1 ESM experiment to diagnose strength of carbon/climate feedback', 'Experiment to diagnose strength of carbon/climate feedback. This experiment is forced with prescribed atmospheric CO2 concentrations. Spin off from the control (3.1) at the same point as ( 6.1 1%/yr) and impose conditions identical to those prescribed in (6.1), but the radiation code is fed the time-invariant CO2 concentration from the control. There is little climate change and the carbon cycle responds only to the increase in CO2 concentration.', 'HADGEM2-ES', 'esmFixClim1');
INSERT INTO docs.tbl_document VALUES (2443, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '6848651a-dfb3-11e0-b564-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'esmFixClim1 esm2m', 'esmFixClim1 esm2m', NULL, 'ESM2M-C1_control_fert_1pct-co2_2x_TOF1', 'GFDL experiment name = ESM2M-C1_control_fert_1pct-co2_2x_TOF1. PCMDI experiment name = ESM fixed climate 1 (run1). Initial conditions for this experiment were taken from 1 January of year 1 of the 1860 control model experiment named ESM2M_pi-control_C1. In the ESM2M-C1_control_fert_1pct-co2_2x_TOF1 experiment atmospheric CO2 levels were constant at the 1860 value of 286 ppmv, while the biology is allowed to respond to prescribed CO2 values that increased from their initial mixing ratio level of 286.15 ppmv at a compounded rate of +1 percent per year until year 70 (the point of doubling). The CO2 levels that the biology sees were held constant at 574.2349 ppmv from year 71 through the end of the 200 year long experiment. For the entire 200 year duration of the experiment, all non-CO2 forcing agents (CH4, N2O, tropospheric and stratospheric O3, tropospheric sulfates, black and organic carbon, dust, sea salt, and solar irradiance) were held constant at values representative of year 1860, and there was no land u', 'GFDL-ESM2M', 'esmFixClim1');
INSERT INTO docs.tbl_document VALUES (1672, 'cmip5', NULL, 'mpi-m', 'cim.1.misc.DocumentSet', 'c0bf214a-929f-11e0-9b0a-00163e9152a5', 3, '2015-07-26 01:51:53.609378', false, 'esmFixClim1-LR', 'esmFixClim1-LR', NULL, 'esmFixClim1-LR', 'Coupled model run with 1%/yr CO2 increase (1850 - 1999), which only has an effect on the carbon cycle, but not on the atmosphere. Low resolution T63L47 / GR15L40. Reference year for insolation /JSBACH =1850.', 'MPI-ESM-LR', 'esmFixClim1');
