INSERT INTO docs.tbl_document VALUES (1567, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', 'c6ee7070-32e5-11e1-a339-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'esmFixClim2', 'esmFixClim2', NULL, '5.4-2 ESm experiment to diagnose strength of carbon/climate feedback', 'Experiment to diagnose strength of carbon/climate feedback. This experiment is forced with prescribed atmospheric CO2 concentrations. Spun off from the HadGEM-ES control (3.1) at the same point as (3.2 historical) and imposed conditions identical to those prescribed in (exp 3.2 - for the historical period) and (exp 4.1 - RCP4.5 for the future), but the radiation code is fed the time-invariant CO2 concentration from the control. The radiation code "sees" all other prescribed conditions evolve as in experiments (3.2) and (4.1). There will be some climate change in this case due the variations in, for example, aerosol forcing, solar variability, and land use change.', 'HADGEM2-ES', 'esmFixClim2');
INSERT INTO docs.tbl_document VALUES (1614, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', 'c6ee7070-32e5-11e1-a339-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'esmFixClim2', 'esmFixClim2', NULL, '5.4-2 ESm experiment to diagnose strength of carbon/climate feedback', 'Experiment to diagnose strength of carbon/climate feedback. This experiment is forced with prescribed atmospheric CO2 concentrations. Spun off from the HadGEM-ES control (3.1) at the same point as (3.2 historical) and imposed conditions identical to those prescribed in (exp 3.2 - for the historical period) and (exp 4.1 - RCP4.5 for the future), but the radiation code is fed the time-invariant CO2 concentration from the control. The radiation code "sees" all other prescribed conditions evolve as in experiments (3.2) and (4.1). There will be some climate change in this case due the variations in, for example, aerosol forcing, solar variability, and land use change.', 'HADGEM2-ES', 'esmFixClim2');
INSERT INTO docs.tbl_document VALUES (2304, 'cmip5', NULL, 'bcc', 'cim.1.misc.DocumentSet', '29c9eaea-84da-11e0-92a2-00163e9152a5', 1, '2015-07-26 01:51:53.609378', true, 'esmFixClim2', 'esmFixClim2', NULL, NULL, 'The radiation code is fed the time-invariant CO2 concentration from the control. The carbon cycle responds only to the increase in CO2 concentration.This run is initialized from 160yr of pre-industrial control run  and CO2 concentration are identical to those prescribed in expt. 3.2 (for the historical period) and expt. 4.1 (RCP4.5 for the future).', 'BCC-CSM1.1', 'esmFixClim2');
INSERT INTO docs.tbl_document VALUES (2417, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '2054385e-0be8-11e1-8033-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'esmFixClim2', 'esmFixClim2', NULL, 'ESM2M-C1_control_HOF1_rcp45_XOF1_fert', 'GFDL experiment name = ESM2M-C1_control_HOF1_rcp45_XOF1_fert. PCMDI experiment name = ESM fixed climate 2 (run1). This is a merged experiment resulting from two GFDL experiments run for ESM fixed climate 2, ESM2M-C1_control_fert_HOF1 and ESM2M-HC1_2006-2100_control_fert_rcp45_XOF1. The experiments were merged for publishing purposes to satisfy the requirements that this data be published as one experiment. The GFDL experiment name listed in the metadata is not the actual GFDL experiments run, rather the merged experiment name. Initial conditions for this experiment were taken from 1 January of year 1861 of the parent experiment, ESM2M-C1_1700-1860_historical_HC1, which is an unpublished experiment branched from 1 January of year 1 of 1860 control model experiment, ESM2M_pi-control_C1 (piControl). This parent experiment is an extension of piControl except historical transitions of land use are applied from 1700-1860 in order to allow the terrestrial carbon stores to respond to the imposition of land use and p', 'GFDL-ESM2M', 'esmFixClim2');
INSERT INTO docs.tbl_document VALUES (2164, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '2054385e-0be8-11e1-8033-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'esmFixClim2 esm2m', 'esmFixClim2 esm2m', NULL, 'ESM2M-C1_control_HOF1_rcp45_XOF1_fert', 'GFDL experiment name = ESM2M-C1_control_HOF1_rcp45_XOF1_fert. PCMDI experiment name = ESM fixed climate 2 (run1). This is a merged experiment resulting from two GFDL experiments run for ESM fixed climate 2, ESM2M-C1_control_fert_HOF1 and ESM2M-HC1_2006-2100_control_fert_rcp45_XOF1. The experiments were merged for publishing purposes to satisfy the requirements that this data be published as one experiment. The GFDL experiment name listed in the metadata is not the actual GFDL experiments run, rather the merged experiment name. Initial conditions for this experiment were taken from 1 January of year 1861 of the parent experiment, ESM2M-C1_1700-1860_historical_HC1, which is an unpublished experiment branched from 1 January of year 1 of 1860 control model experiment, ESM2M_pi-control_C1 (piControl). This parent experiment is an extension of piControl except historical transitions of land use are applied from 1700-1860 in order to allow the terrestrial carbon stores to respond to the imposition of land use and p', 'GFDL-ESM2M', 'esmFixClim2');
INSERT INTO docs.tbl_document VALUES (1688, 'cmip5', NULL, NULL, 'cim.1.activity.NumericalExperiment', 'af6575f2-d3a5-11df-837f-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'esmHistorical', 'esmHistorical', NULL, 'ESM historical', 'Historical simulation (1850 to 2005) as in experiment 3.2_historical 
INSERT INTO docs.tbl_document VALUES (1771, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', 'b668d748-c424-11e0-987c-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'esmHistorical', 'esmHistorical', NULL, 'ESM2M-E1_all_historical_HE1', 'GFDL experiment name = ESM2M-E1_all_historical_HE1. PCMDI experiment name = ESM historical (run1). Initial conditions for this experiment were taken from 1 January of year 1861 of the parent experiment, ESM2M-C1_1700-1860_historical_HC1, which is an unpublished experiment branched from 1 January of year 1 of 1860 control model experiment, ESM2M_pi-control_C1 (piControl). This parent experiment is an extension of piControl except historical transitions of land use are applied from 1700-1860 in order to allow the terrestrial carbon stores to respond to the imposition of land use and produce realistic fluxes by the start of the historical run in 1861. Several forcing agents varied during the 145 year duration of the ESM2M-E1_all_historical_HE1 experiment in a manner based upon observations and reconstructions for the late 19th and 20th centuries. The aerosol concentrations were computed by an off-line model. The time varying forcing agents were anthropogenic CO2 emissions (fossil fuels including cement and gas', 'GFDL-ESM2M', 'esmHistorical');
INSERT INTO docs.tbl_document VALUES (1790, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', 'ea0fd3b6-2690-11e1-a443-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'esmHistorical', 'esmHistorical', NULL, '5.2 ESM historical simulation (1859 - 2005)', 'Forcings as for the main HadGEM2-ES historical run (r1i1p1) but using prescribed anthropogenic emissions (rather than concentrations) for the CO2 forcing .', 'HADGEM2-ES', 'esmHistorical');
INSERT INTO docs.tbl_document VALUES (1309, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', 'a90c3f70-5eea-11e1-bfb5-00163e9152a5', 1, '2015-07-26 01:51:53.609378', true, 'esmHistorical esm2g', 'esmHistorical esm2g', NULL, 'ESM2G-E2_all_historical_HE2', 'GFDL experiment name = ESM2G-E2_all_historical_HE2. PCMDI experiment name = ESM historical (run1). Initial conditions for this experiment were taken from 1 January of year 1861 of the parent experiment, ESM2G-C2_1700-1860_historical_HC2, which is an unpublished experiment branched from 1 January of year 1 of 1860 control model experiment, ESM2G_pi-control_C2 (piControl). This parent experiment is an extension of piControl except historical transitions of land use are applied from 1700-1860 in order to allow the terrestrial carbon stores to respond to the imposition of land use and produce realistic fluxes by the start of the historical run in 1861. Several forcing agents varied during the 145 year duration of the ESM2G-E2_all_historical_HE2 experiment in a manner based upon observations and reconstructions for the late 19th and 20th centuries. The aerosol concentrations were computed by an off-line model. The time varying forcing agents were anthropogenic CO2 emissions (fossil fuels including cement and gas', 'GFDL-ESM2G', 'esmHistorical');
