INSERT INTO docs.tbl_document VALUES (1531, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '80110cd2-dfaf-11e0-af43-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'esmrcp85', 'esmrcp85', NULL, 'ESM2M-HE1_2006-2100_all_rcp85_ZE1', 'GFDL experiment name = ESM2M-HE1_2006-2100_all_rcp85_ZE1. PCMDI experiment name = ESM RCP8.5 (run1). Initial conditions for this experiment were taken from 1 January 2006 of the parent experiment, ESM2M-E1_all_historical_HE1 (ESM historical). Several forcing agents varied during the 95 year duration of the ESM RCP8.5 experiment based upon the MESSAGE integrated assessment model for the 21st century. The time-varying forcing agents include well-mixed greenhouse gases (CH4, N2O, halons), tropospheric and stratospheric O3, model-derived aerosol concentrations (sulfate, black and organic carbon, sea salt, and dust), and land use transitions. The time-varying CO2 forcing includes anthropogenic emissions from fossil fuels and international ships. CO2 was determined by the model (i.e., "emission-driven). Volcanic aerosols were zero and solar irradiance varied seasonally based upon late 20th century averages but with no interannual variation. The direct effect of tropospheric aerosols is calculated by the model, but', 'GFDL-ESM2M', 'esmrcp85');
INSERT INTO docs.tbl_document VALUES (1629, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', '48342000-2691-11e1-a443-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'esmrcp85', 'esmrcp85', NULL, '5.3 ESM rcp85 simulation (2006 - 2100)', 'Continuation of ESM historical simulation using rcp85 forcings but with anthropogenic CO2 forcing input as prescribed emissions (rather than concentrations).', 'HADGEM2-ES', 'esmrcp85');
