INSERT INTO docs.tbl_document VALUES (1487, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '5eab6c22-5ee9-11e1-8dd9-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'historical esm2g', 'historical esm2g', NULL, 'ESM2G-C2_all_historical_HC2', 'GFDL experiment name = ESM2G-C2_all_historical_HC2. PCMDI experiment name = historical (run1). Initial conditions for this experiment were taken from 1 January of year 1861 of the parent experiment, ESM2G-C2_1700-1860_historical_HC2, which is an unpublished experiment branched from 1 January of year 1 of 1860 control model experiment, ESM2G_pi-control_C2 (piControl). This parent experiment is an extension of piControl except historical transitions of land use are applied from 1700-1860 in order to allow the terrestrial carbon stores to respond to the imposition of land use and produce realistic fluxes by the start of the historical run in 1861. Several forcing agents varied during the 145 year duration of the ESM2G-C1_all_historical_HC2 experiment in a manner based upon observations and reconstructions for the late 19th and 20th centuries. The aerosol concentrations were computed by an off-line model. The time varying forcing agents include the well-mixed greenhouse gases (CO2, CH4, N2O, halons), tropospheri', 'GFDL-ESM2G', 'historical');
INSERT INTO docs.tbl_document VALUES (1900, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '5eab6c22-5ee9-11e1-8dd9-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'historical esm2g', 'historical esm2g', NULL, 'ESM2G-C2_all_historical_HC2', 'GFDL experiment name = ESM2G-C2_all_historical_HC2. PCMDI experiment name = historical (run1). Initial conditions for this experiment were taken from 1 January of year 1861 of the parent experiment, ESM2G-C2_1700-1860_historical_HC2, which is an unpublished experiment branched from 1 January of year 1 of 1860 control model experiment, ESM2G_pi-control_C2 (piControl). This parent experiment is an extension of piControl except historical transitions of land use are applied from 1700-1860 in order to allow the terrestrial carbon stores to respond to the imposition of land use and produce realistic fluxes by the start of the historical run in 1861. Several forcing agents varied during the 145 year duration of the ESM2G-C1_all_historical_HC2 experiment in a manner based upon observations and reconstructions for the late 19th and 20th centuries. The aerosol concentrations were computed by an off-line model. The time varying forcing agents include the well-mixed greenhouse gases (CO2, CH4, N2O, halons), tropospheri', 'GFDL-ESM2G', 'historical');
INSERT INTO docs.tbl_document VALUES (2420, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', 'b8bd8514-c39a-11e0-987c-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'historical esm2m', 'historical esm2m', NULL, 'ESM2M-C1_all_historical_HC1', 'GFDL experiment name = ESM2M-C1_all_historical_HC1. PCMDI experiment name = historical (run1). Initial conditions for this experiment were taken from 1 January of year 1861 of the parent experiment, ESM2M-C1_1700-1860_historical_HC1, which is an unpublished experiment branched from 1 January of year 1 of 1860 control model experiment, ESM2M_pi-control_C1 (piControl). This parent experiment is an extension of piControl except historical transitions of land use are applied from 1700-1860 in order to allow the terrestrial carbon stores to respond to the imposition of land use and produce realistic fluxes by the start of the historical run in 1861. Several forcing agents varied during the 145 year duration of the ESM2M-C1_all_historical_HC1 experiment in a manner based upon observations and reconstructions for the late 19th and 20th centuries. The aerosol concentrations were computed by an off-line model. The time varying forcing agents include the well-mixed greenhouse gases (CO2, CH4, N2O, halons), tropospheri', 'GFDL-ESM2M', 'historical');
