INSERT INTO docs.tbl_document VALUES (1935, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', 'b83aceb2-e349-11df-b73d-00163e9152a5', 3, '2015-07-26 01:51:53.609378', false, 'historicalBaseSimulation', 'historicalBaseSimulation', NULL, 'Base Simulation of Ensemble3.2 Historical (1860-2005)', 'Impose changing conditions (consistent with observations), which include: atmospheric composition (including CO2) changes due to both anthropogenic and volcanic influences; solar forcing; emissions or concentrations of short-lived species and natural and anthropogenic aerosols or their precursors; and land use.  The historical ensemble is extended by the historicalExt experiment.', 'HADGEM2-ES', 'historical');
INSERT INTO docs.tbl_document VALUES (2515, 'cmip5', NULL, NULL, 'cim.1.activity.NumericalExperiment', 'b72876d6-d3a5-11df-837f-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'historicalExt', 'historicalExt', NULL, 'Historical Extension', 'Extend the CMIP5 historical runs to the near-present (as we have for AMIP), rather than ending them in 2005.  
INSERT INTO docs.tbl_document VALUES (1206, 'cmip5', NULL, 'nasa-giss', 'cim.1.misc.DocumentSet', '14cf8c66-6fcc-11e1-a766-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'past1000 GISS-E2-R p125', 'past1000 GISS-E2-R p125', NULL, 'Last Millennium, GISS-E2-R, non-interactive composition, physics-version=1', 'This is part of a forcings ensemble for the last millennium. physics-version=125 uses the p1 version of the GISS-E2-R, and forcing scenario 25: "Solar: VK, Volcanic: GAR, LULC: KK10, GHG transient, orbital" as described in Schmidt et al (2011) and http://data.giss.nasa.gov/modelE/ar5/', 'GISS-E2-R', 'past1000');
INSERT INTO docs.tbl_document VALUES (1610, 'cmip5', NULL, NULL, 'cim.1.activity.NumericalExperiment', 'a0d3a554-d3a5-11df-837f-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'abrupt4xco2', 'abrupt4xco2', NULL, 'Abrupt 4XCO2', 'Impose an instantaneous quadrupling of CO2, then hold fixed.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (1684, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', '84d52fd8-2c8e-11e1-a4f1-00163e9152a5', 4, '2015-07-26 01:51:53.609378', true, 'historicalExt', 'historicalExt', NULL, '3.2 Historical Extension (2005-2019)', 'An extension to the historical ensemble for elements r2, r3, and r4.  Impose changing conditions (consistent with observations), which include: atmospheric composition (including CO2) changes due to both anthropogenic and volcanic influences; solar forcing; emissions or concentrations of short-lived species and natural and anthropogenic aerosols or their precursors; and land use.   For the time period beyond 2005 the RCP85 forcings are used.', 'HADGEM2-ES', 'historicalExt');
INSERT INTO docs.tbl_document VALUES (2602, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', '84d52fd8-2c8e-11e1-a4f1-00163e9152a5', 3, '2015-07-26 01:51:53.609378', false, 'historicalExt', 'historicalExt', NULL, '3.2 Historical Extension (2005-2019)', 'An extension to the historical ensemble for elements r2, r3, and r4.  Impose changing conditions (consistent with observations), which include: atmospheric composition (including CO2) changes due to both anthropogenic and volcanic influences; solar forcing; emissions or concentrations of short-lived species and natural and anthropogenic aerosols or their precursors; and land use.   For the time period beyond 2005 the RCP85 forcings are used.', 'HADGEM2-ES', 'historicalExt');
INSERT INTO docs.tbl_document VALUES (1463, 'cmip5', NULL, NULL, 'cim.1.activity.NumericalExperiment', 'a0ed50c6-d3a5-11df-837f-00163e9152a5', 2, '2015-07-26 01:51:53.609378', false, 'noVolc1960', 'noVolc1960', NULL, '1.3 hindcast without volcanoes (1960)', 'Hindcast without volcanoes. Additional 10yr run for experiment 1.1 from 1960 without including the Agung, El Chichon and Pinatubo eruptions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (2138, 'cmip5', NULL, 'nasa-giss', 'cim.1.misc.DocumentSet', 'eabe837c-6fd1-11e1-9bbb-00163e9152a5', 2, '2015-07-26 01:51:53.609378', false, 'historicalExt GISS-E2-H p1', 'historicalExt GISS-E2-H p1', NULL, 'Extension of 20th Century run, GISS-E2-H, non-interactive composition (physics-version=1)', 'This is an extension of the historical simulations from 2006 to 2012. Volcanic forcing is as observed (2012 same as 2011), solar forcing as observed to 2010, with 2011 and 2012 using 1998 and 1999 values respectively. GHGs are as observed, aerosols follow RCP4.5.', 'GISS-E2-H', 'historicalExt');
