INSERT INTO docs.tbl_document VALUES (1527, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', '84d52fd8-2c8e-11e1-a4f1-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'historicalExtBaseSimulation', 'historicalExtBaseSimulation', NULL, 'Base Simulation of Ensemble3.2 Historical Extension (2005-2019)', 'An extension to the historical ensemble for elements r2, r3, and r4.  Impose changing conditions (consistent with observations), which include: atmospheric composition (including CO2) changes due to both anthropogenic and volcanic influences; solar forcing; emissions or concentrations of short-lived species and natural and anthropogenic aerosols or their precursors; and land use.   For the time period beyond 2005 the RCP85 forcings are used.', 'HADGEM2-ES', 'historical');
INSERT INTO docs.tbl_document VALUES (1621, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', '84d52fd8-2c8e-11e1-a4f1-00163e9152a5', 2, '2015-07-26 01:51:53.609378', false, 'historicalExtBaseSimulation', 'historicalExtBaseSimulation', NULL, 'Base Simulation of Ensemble3.2 Historical Extension (2005-2019)', 'An extension to the historical ensemble for elements r2, r3, and r4.  Impose changing conditions (consistent with observations), which include: atmospheric composition (including CO2) changes due to both anthropogenic and volcanic influences; solar forcing; emissions or concentrations of short-lived species and natural and anthropogenic aerosols or their precursors; and land use.   For the time period beyond 2005 the RCP85 forcings are used.', 'HADGEM2-ES', 'historicalExt');
INSERT INTO docs.tbl_document VALUES (2170, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', '79f3bb2e-267c-11e1-9742-00163e9152a5', 4, '2015-07-26 01:51:53.609378', true, 'historicalGHG', 'historicalGHG', NULL, '7.2 GHG only forcing (1850 - 2019)', 'Historical simulation with forcing limited to GHG evolution as in the main historical simulation.  Four member ensemble initialised in the same way as the main historical ensemble e.g. ensemble elements were initialised at 50 year intervals from piControl.  The four elements cover the period from 1859 to 2030 (with the first element running out to 2100).  The forcing from 2006 onwards follows the RCP85 scenario.', 'HADGEM2-ES', 'historicalGHG');
INSERT INTO docs.tbl_document VALUES (2199, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', '79f3bb2e-267c-11e1-9742-00163e9152a5', 3, '2015-07-26 01:51:53.609378', false, 'historicalGHG', 'historicalGHG', NULL, '7.2 GHG only forcing (1850 - 2019)', 'Historical simulation with forcing limited to GHG evolution as in the main historical simulation.  Four member ensemble initialised in the same way as the main historical ensemble e.g. ensemble elements were initialised at 50 year intervals from piControl.  The four elements cover the period from 1859 to 2030 (with the first element running out to 2100).  The forcing from 2006 onwards follows the RCP85 scenario.', 'HADGEM2-ES', 'historicalGHG');
INSERT INTO docs.tbl_document VALUES (2436, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '8cd5848c-527f-11e1-abfc-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'historicalMisc Aer cm3BaseSimulation', 'historicalMisc Aer cm3BaseSimulation', NULL, 'Base Simulation of EnsembleCM3Z_D1_1860-2005_Aerosol_P1', 'GFDL experiment name: CM3Z_D1_1860-2005_Aerosol_P1
INSERT INTO docs.tbl_document VALUES (2299, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '5454ee86-dfd9-11e0-9f97-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'historicalGHG', 'historicalGHG', NULL, 'ESM2M-C1_only_ghg_HOG1', 'GFDL experiment name = ESM2M-C1_only_ghg_HOG1. PCMDI experiment name = GHG-only (run1). Initial conditions for this experiment were taken from 1 January of year 0162 of the parent experiment, ESM2M_pi-control_C1 (piControl). Only the well-mixed greenhouse gases (CO2, CH4, N2O, halons) varied during the 145 year duration of the ESM2M-C1_only_ghg_HOG1 experiment in a manner based upon observations for the late 19th and 20th centuries. Other forcing agents (tropospheric and stratospheric O3, aerosol concentrations (sulfate, black and organic carbon, sea salt, dust), and solar irradiance) were representative of conditions circa-1860, and there was no land use (i.e., a "potential vegetation" integration) or volcanic aerosols. The direct effect of tropospheric aerosols is calculated by the model, but not the indirect effects.', 'GFDL-ESM2M', 'historicalGHG');
