INSERT INTO docs.tbl_document VALUES (1892, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', 'e773377a-5d7b-11e1-bb69-00163e9152a5', 4, '2015-07-26 01:51:53.609378', false, 'midHolocene_HadGEM2-CC', 'midHolocene_HadGEM2-CC', NULL, '3.4 MidHolocene', 'Consistent with PMIP specifications (https://pmip3.lsce.ipsl.fr/wiki/doku.php/pmip3:design:6K:final), simulation is run with midHolocene conditions, including atmospheric conditions of well-mixed gases and orbital variations.  [Nominal start date is set to 1859-12-01 to match piControl run].  Only the final 35 years (i.e the reference dates of 1941 - 1975) of this simulation have been submitted to the CMIP5 archive.', 'HADGEM2-CC', 'midHolocene');
