INSERT INTO docs.tbl_document VALUES (1727, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '25bbb262-dfcf-11e0-b564-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'historicalMiscHCH', 'historicalMiscHCH', NULL, 'ESM2M-C1_historical_human_HCH1', 'GFDL experiment name = ESM2M-C1_historical_human_HCH1. PCMDI experiment name = other historical forcing (run1). Initial conditions for this experiment were taken from 1 January of year 1861 of the parent experiment, ESM2M-C1_1700-1860_historical_HC1, which is an unpublished experiment branched from 1 January of year 1 of 1860 control model experiment, ESM2M_pi-control_C1 (piControl). This parent experiment is an extension of piControl except historical transitions of land use are applied from 1700-1860 in order to allow the terrestrial carbon stores to respond to the imposition of land use and produce realistic fluxes by the start of the historical run in 1861. Only anthropogenic forcing agents (i.e., aerosol concentrations (sulfate, black and organic carbon, sea salt, dust), well-mixed greenhouse gases (CO2, CH4, N2O, halons), tropospheric and stratospheric O3, and historical transitions of land use) varied during the 145 year duration of the ESM2M-C1_historical_human_HCH1 experiment in a manner based upon', 'GFDL-ESM2M', 'historicalMisc');
INSERT INTO docs.tbl_document VALUES (1192, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '25bbb262-dfcf-11e0-b564-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'historicalMiscHCH esm2m', 'historicalMiscHCH esm2m', NULL, 'ESM2M-C1_historical_human_HCH1', 'GFDL experiment name = ESM2M-C1_historical_human_HCH1. PCMDI experiment name = other historical forcing (run1). Initial conditions for this experiment were taken from 1 January of year 1861 of the parent experiment, ESM2M-C1_1700-1860_historical_HC1, which is an unpublished experiment branched from 1 January of year 1 of 1860 control model experiment, ESM2M_pi-control_C1 (piControl). This parent experiment is an extension of piControl except historical transitions of land use are applied from 1700-1860 in order to allow the terrestrial carbon stores to respond to the imposition of land use and produce realistic fluxes by the start of the historical run in 1861. Only anthropogenic forcing agents (i.e., aerosol concentrations (sulfate, black and organic carbon, sea salt, dust), well-mixed greenhouse gases (CO2, CH4, N2O, halons), tropospheric and stratospheric O3, and historical transitions of land use) varied during the 145 year duration of the ESM2M-C1_historical_human_HCH1 experiment in a manner based upon', 'GFDL-ESM2M', 'historicalMisc');
INSERT INTO docs.tbl_document VALUES (1972, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '1d52a314-5f23-11e1-a133-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'historicalMiscHCP esm2g', 'historicalMiscHCP esm2g', NULL, NULL, 'GFDL experiment name = ESM2G-C2_historical_potveg_HCP2. PCMDI experiment name = other historical forcing (run1). Initial conditions for this experiment were taken from 1 January of year 0162 of the parent experiment, ESM2G_pi-control_C2 (piControl). Several forcing agents varied during the 145 year duration of the ESM2G-C2_historical_potveg_HCP2 experiment in a manner based upon observations and reconstructions for the late 19th and 20th centuries. The aerosol concentrations were computed by an off-line model. The time varying forcing agents include the well-mixed greenhouse gases (CO2, CH4, N2O, halons), tropospheric and stratospheric O3, aerosol concentrations (sulfate, black and organic carbon, sea salt, dust), volcanic aerosols, and solar irradiance. There was no land use in this run (i.e., a "potential vegetation" integration). The direct effect of tropospheric aerosols is calculated by the model, but not the indirect effects.', 'GFDL-ESM2G', 'historicalMisc');
INSERT INTO docs.tbl_document VALUES (2238, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '1d52a314-5f23-11e1-a133-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'historicalMiscHCP esm2g', 'historicalMiscHCP esm2g', NULL, NULL, 'GFDL experiment name = ESM2G-C2_historical_potveg_HCP2. PCMDI experiment name = other historical forcing (run1). Initial conditions for this experiment were taken from 1 January of year 0162 of the parent experiment, ESM2G_pi-control_C2 (piControl). Several forcing agents varied during the 145 year duration of the ESM2G-C2_historical_potveg_HCP2 experiment in a manner based upon observations and reconstructions for the late 19th and 20th centuries. The aerosol concentrations were computed by an off-line model. The time varying forcing agents include the well-mixed greenhouse gases (CO2, CH4, N2O, halons), tropospheric and stratospheric O3, aerosol concentrations (sulfate, black and organic carbon, sea salt, dust), volcanic aerosols, and solar irradiance. There was no land use in this run (i.e., a "potential vegetation" integration). The direct effect of tropospheric aerosols is calculated by the model, but not the indirect effects.', 'GFDL-ESM2G', 'historicalMisc');
