INSERT INTO docs.tbl_document VALUES (1755, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', 'c552f64e-5f24-11e1-83af-00163e9152a5', 1, '2015-07-26 01:51:53.609378', true, 'historicalMiscHEP esm2g', 'historicalMiscHEP esm2g', NULL, 'ESM2G-E2_historical_potveg_HEP2', 'GFDL experiment name = ESM2G-E2_historical_potveg_HEP2. PCMDI experiment name = other historical forcing (run1). Initial conditions for this experiment were taken from 1 January of year 0162 of the parent experiment, ESM2G_pi-control_E2 (esmControl). Several forcing agents varied during the 145 year duration of the ESM2G-E2_historical_potveg_HEP2 experiment in a manner based upon observations and reconstructions for the late 19th and 20th centuries. The aerosol concentrations were computed by an off-line model. The time varying forcing agents were anthropogenic CO2 emissions (fossil fuels including cement and gas flaring), well-mixed greenhouse gases (CH4, N2O, halons), tropospheric and stratospheric O3, aerosol concentrations (sulfate, black and organic carbon, sea salt, dust), volcanic aerosols, and solar irradiance. CO2 was determined by the model (i.e., "emission-driven"). There was no land use in this run (i.e., a "potential vegetation" integration). The direct effect of tropospheric aerosols is calcula', 'GFDL-ESM2G', 'historicalMisc');
