INSERT INTO docs.tbl_document VALUES (2050, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '445b032c-e3c5-11e0-a2ef-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'historicalMiscHOA esm2m', 'historicalMiscHOA esm2m', NULL, 'ESM2M-C1_only_aerosol_HOA1', 'GFDL experiment name = ESM2M-C1_only_aerosol_HOA1. PCMDI experiment name = other historical forcing (run1). Initial conditions for this experiment were taken from 1 January of year 0162 of the parent experiment, ESM2M_pi-control_C1 (piControl). Only the aerosol concentrations (sulfate, black and organic carbon, sea salt, dust) varied during the 145 year duration of the ESM2M-C1_only_aerosol_HOA1 experiment in a manner based upon reconstructions for the late 19th and 20th centuries. The aerosol concentrations were computed by an off-line model. Other forcing agents (well-mixed greenhouse gases (CO2, CH4, N2O), tropospheric and stratospheric O3, and solar irradiance) were representative of conditions circa-1860, and there was no land use (i.e., a "potential vegetation" integration) or volcanic aerosols. The direct effect of tropospheric aerosols is calculated by the model, but not the indirect effects.', 'GFDL-ESM2M', 'historicalMisc');
INSERT INTO docs.tbl_document VALUES (1250, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '445b032c-e3c5-11e0-a2ef-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'historicalMiscHOA1', 'historicalMiscHOA1', NULL, 'ESM2M-C1_only_aerosol_HOA1', 'GFDL experiment name = ESM2M-C1_only_aerosol_HOA1. PCMDI experiment name = other historical forcing (run1). Initial conditions for this experiment were taken from 1 January of year 0162 of the parent experiment, ESM2M_pi-control_C1 (piControl). Only the aerosol concentrations (sulfate, black and organic carbon, sea salt, dust) varied during the 145 year duration of the ESM2M-C1_only_aerosol_HOA1 experiment in a manner based upon reconstructions for the late 19th and 20th centuries. The aerosol concentrations were computed by an off-line model. Other forcing agents (well-mixed greenhouse gases (CO2, CH4, N2O), tropospheric and stratospheric O3, and solar irradiance) were representative of conditions circa-1860, and there was no land use (i.e., a "potential vegetation" integration) or volcanic aerosols. The direct effect of tropospheric aerosols is calculated by the model, but not the indirect effects.', 'GFDL-ESM2M', 'historicalMisc');
INSERT INTO docs.tbl_document VALUES (1497, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '3f211372-e3c7-11e0-a561-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'historicalMiscHOL esm2m', 'historicalMiscHOL esm2m', NULL, 'ESM2M-C1_only_landuse_HOL1', 'GFDL experiment name = ESM2M-C1_only_landuse_HOL1. PCMDI experiment name = other historical forcing (run1). Initial conditions for this experiment were taken from 1 January of year 1861 of the parent experiment, ESM2M-C1_1700-1860_historical_HC1, which is an unpublished experiment branched from 1 January of year 1 of 1860 control model experiment, ESM2M_pi-control_C1 (piControl). This parent experiment is an extension of piControl except historical transitions of land use are applied from 1700-1860 in order to allow the terrestrial carbon stores to respond to the imposition of land use and produce realistic fluxes by the start of the historical run in 1861. Only land use varied during the 145 year duration of the ESM2M-C1_only_landuse_HOL1 experiment in a manner based upon reconstructions for the late 19th and 20th centuries. Other forcing agents (aerosol concentrations (sulfate, black and organic carbon, sea salt, dust), well-mixed greenhouse gases (CO2, CH4, N2O), tropospheric and stratospheric O3, and sol', 'GFDL-ESM2M', 'historicalMisc');
