INSERT INTO docs.tbl_document VALUES (2275, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '3f211372-e3c7-11e0-a561-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'historicalMiscHOL1', 'historicalMiscHOL1', NULL, 'ESM2M-C1_only_landuse_HOL1', 'GFDL experiment name = ESM2M-C1_only_landuse_HOL1. PCMDI experiment name = other historical forcing (run1). Initial conditions for this experiment were taken from 1 January of year 1861 of the parent experiment, ESM2M-C1_1700-1860_historical_HC1, which is an unpublished experiment branched from 1 January of year 1 of 1860 control model experiment, ESM2M_pi-control_C1 (piControl). This parent experiment is an extension of piControl except historical transitions of land use are applied from 1700-1860 in order to allow the terrestrial carbon stores to respond to the imposition of land use and produce realistic fluxes by the start of the historical run in 1861. Only land use varied during the 145 year duration of the ESM2M-C1_only_landuse_HOL1 experiment in a manner based upon reconstructions for the late 19th and 20th centuries. Other forcing agents (aerosol concentrations (sulfate, black and organic carbon, sea salt, dust), well-mixed greenhouse gases (CO2, CH4, N2O), tropospheric and stratospheric O3, and sol', 'GFDL-ESM2M', 'historicalMisc');
INSERT INTO docs.tbl_document VALUES (1888, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', 'd62a40ea-e3c7-11e0-a561-00163e9152a5', 3, '2015-07-26 01:51:53.609378', true, 'historicalMiscHOS esm2m', 'historicalMiscHOS esm2m', NULL, 'ESM2M-C1_only_solar_HOS1', 'GFDL experiment name = ESM2M-C1_only_solar_HOS1. PCMDI experiment name = other historical forcing (run1). Initial conditions for this experiment were taken from 1 January of year 0162 of the parent experiment, ESM2M_pi-control_C1 (piControl). Only the solar irradiance varied during the 145 year duration of the ESM2M-C1_only_solar_HOS1 experiment in a manner based upon observations for the late 19th and 20th centuries. The other forcing agents (aerosol concentrations (sulfate, black and organic carbon, sea salt, dust), well-mixed greenhouse gases (CO2, CH4, N2O), tropospheric and stratospheric O3) were representative of conditions circa-1860. This integration did not include land use change (i.e., a "potential vegetation" integration) and volcanic aerosols were zero. The direct effect of tropospheric aerosols is calculated by the model, but not the indirect effects.', 'GFDL-ESM2M', 'historicalMisc');
INSERT INTO docs.tbl_document VALUES (2526, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', 'd62a40ea-e3c7-11e0-a561-00163e9152a5', 2, '2015-07-26 01:51:53.609378', false, 'historicalMiscHOS1', 'historicalMiscHOS1', NULL, 'ESM2M-C1_only_solar_HOS1', 'GFDL experiment name = ESM2M-C1_only_solar_HOS1. PCMDI experiment name = other historical forcing (run1). Initial conditions for this experiment were taken from 1 January of year 0162 of the parent experiment, ESM2M_pi-control_C1 (piControl). Only the solar irradiance varied during the 145 year duration of the ESM2M-C1_only_solar_HOS1 experiment in a manner based upon observations for the late 19th and 20th centuries. The other forcing agents (aerosol concentrations (sulfate, black and organic carbon, sea salt, dust), well-mixed greenhouse gases (CO2, CH4, N2O), tropospheric and stratospheric O3) were representative of conditions circa-1860. This integration did not include land use change (i.e., a "potential vegetation" integration) and volcanic aerosols were zero. The direct effect of tropospheric aerosols is calculated by the model, but not the indirect effects.', 'GFDL-ESM2M', 'historicalMisc');
INSERT INTO docs.tbl_document VALUES (2065, 'cmip5', NULL, 'mpi-m', 'cim.1.misc.DocumentSet', 'ce812588-f999-11e0-a5e8-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'rcp26-MR', 'rcp26-MR', NULL, 'rcp26-MR', 'future projection (2006 - 2300) forced by RCP2.6, initial conditions from historical run in medium resolution at 31.12.2005 Reference year for JSBACH=1850.', 'MPI-ESM-MR', 'rcp26');
