INSERT INTO docs.tbl_document VALUES (2296, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '7a168ec0-e3c8-11e0-b223-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'historicalMiscHOV esm2m', 'historicalMiscHOV esm2m', NULL, 'ESM2M-C1_only_volcanic_HOV1', 'GFDL experiment name = ESM2M-C1_only_volcanic_HOV1. PCMDI experiment name = historicalMisc (run1). Initial conditions for this experiment were taken from 1 January of year 0162 of the parent experiment, ESM2M_pi-control_C1 (piControl). Only the volcanic aerosols varied during the 145 year duration of the ESM2M-C1_only_volcanic_HOV1 experiment in a manner based upon observations for the late 19th and 20th centuries. The other forcing agents (aerosol concentrations (sulfate, black and organic carbon, sea salt, dust), well-mixed greenhouse gases (CO2, CH4, N2O), tropospheric and stratospheric O3, and solar irradiance) were representative of conditions circa-1860, and there was no land use (i.e., a "potential vegetation" integration). The direct effect of tropospheric aerosols is calculated by the model, but not the indirect effects.', 'GFDL-ESM2M', 'historicalMisc');
INSERT INTO docs.tbl_document VALUES (1791, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '7a168ec0-e3c8-11e0-b223-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'historicalMiscHOV1', 'historicalMiscHOV1', NULL, 'ESM2M-C1_only_volcanic_HOV1', 'GFDL experiment name = ESM2M-C1_only_volcanic_HOV1. PCMDI experiment name = historicalMisc (run1). Initial conditions for this experiment were taken from 1 January of year 0162 of the parent experiment, ESM2M_pi-control_C1 (piControl). Only the volcanic aerosols varied during the 145 year duration of the ESM2M-C1_only_volcanic_HOV1 experiment in a manner based upon observations for the late 19th and 20th centuries. The other forcing agents (aerosol concentrations (sulfate, black and organic carbon, sea salt, dust), well-mixed greenhouse gases (CO2, CH4, N2O), tropospheric and stratospheric O3, and solar irradiance) were representative of conditions circa-1860, and there was no land use (i.e., a "potential vegetation" integration). The direct effect of tropospheric aerosols is calculated by the model, but not the indirect effects.', 'GFDL-ESM2M', 'historicalMisc');
INSERT INTO docs.tbl_document VALUES (1246, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', 'bbb2e806-267b-11e1-8298-00163e9152a5', 2, '2015-07-26 01:51:53.609378', false, 'historicalNat', 'historicalNat', NULL, '7.1 Natural only forcing (1850-2019)', 'Natural forcing only simulation - volcanoes and solar variability.  Four member ensemble initialised in the same way as the main historical ensemble e.g. ensemble elements were initialised at 50 year intervals from piControl.  The four elements cover the period from 1859 to 2019.  The forcing from 2006 onwards follows the RCP85 scenario.', 'HADGEM2-ES', 'historicalNat');
