INSERT INTO docs.tbl_document VALUES (1589, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', 'bd6872c4-e3a0-11e0-b223-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'historicalNat', 'historicalNat', NULL, 'ESM2M-C1_historical_natural_HCN1', 'GFDL experiment name = ESM2M-C1_historical_natural_HCN1. PCMDI experiment name = natural-only (run1). Initial conditions for this experiment were taken from 1 January of year 0162 of the parent experiment, ESM2M_pi-control_C1 (piControl). Only natural forcing agents (i.e., solar irradiance and volcanoes) varied during the 145 year duration of the ESM2M-C1_historical_natural_HCN1 experiment in a manner based upon observations for the late 19th and 20th centuries. Anthropogenic forcing agents (i.e., well-mixed greenhouse gases (CO2, CH4, N2O), tropospheric and stratospheric O3, aerosol concentrations (sulfate, black and organic carbon, sea salt, dust), were representative of conditions circa-1860. There was no land use in this run (i.e., a "potential vegetation" integration) and volcanic aerosols were zero. The direct effect of tropospheric aerosols is calculated by the model, but not the indirect effects.', 'GFDL-ESM2M', 'historicalNat');
