INSERT INTO docs.tbl_document VALUES (1502, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', 'e773377a-5d7b-11e1-bb69-00163e9152a5', 3, '2015-07-26 01:51:53.609378', false, 'midHolocene_HadGEM2-CC', 'midHolocene_HadGEM2-CC', NULL, '3.4 MidHolocene', 'Consistent with PMIP specifications (https://pmip3.lsce.ipsl.fr/wiki/doku.php/pmip3:design:6K:final), simulation is run with midHolocene conditions, including atmospheric conditions of well-mixed gases and orbital variations.  [Nominal start date is set to 1859-12-01 to match piControl run].  Only the final 35 years (i.e the reference dates of 1941 - 1975) of this simulation have been submitted to the CMIP5 archive.', 'HADGEM2-CC', 'midHolocene');
INSERT INTO docs.tbl_document VALUES (1403, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', 'bd6872c4-e3a0-11e0-b223-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'historicalNat esm2m', 'historicalNat esm2m', NULL, 'ESM2M-C1_historical_natural_HCN1', 'GFDL experiment name = ESM2M-C1_historical_natural_HCN1. PCMDI experiment name = natural-only (run1). Initial conditions for this experiment were taken from 1 January of year 0162 of the parent experiment, ESM2M_pi-control_C1 (piControl). Only natural forcing agents (i.e., solar irradiance and volcanoes) varied during the 145 year duration of the ESM2M-C1_historical_natural_HCN1 experiment in a manner based upon observations for the late 19th and 20th centuries. Anthropogenic forcing agents (i.e., well-mixed greenhouse gases (CO2, CH4, N2O), tropospheric and stratospheric O3, aerosol concentrations (sulfate, black and organic carbon, sea salt, dust), were representative of conditions circa-1860. There was no land use in this run (i.e., a "potential vegetation" integration) and volcanic aerosols were zero. The direct effect of tropospheric aerosols is calculated by the model, but not the indirect effects.', 'GFDL-ESM2M', 'historicalNat');
INSERT INTO docs.tbl_document VALUES (1822, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', 'bbb2e806-267b-11e1-8298-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'historicalNatBaseSimulation', 'historicalNatBaseSimulation', NULL, 'Base Simulation of Ensemble7.1 Natural only forcing (1850-2019)', 'Natural forcing only simulation - volcanoes and solar variability.  Four member ensemble initialised in the same way as the main historical ensemble e.g. ensemble elements were initialised at 50 year intervals from piControl.  The four elements cover the period from 1859 to 2019.  The forcing from 2006 onwards follows the RCP85 scenario.', 'HADGEM2-ES', 'historicalNat');
