INSERT INTO docs.tbl_document VALUES (2434, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', 'b03b61fa-4de6-11e1-ab91-00163e9152a5', 4, '2015-07-26 01:51:53.609378', true, 'historical_HadGEM2-CC', 'historical_HadGEM2-CC', NULL, '3.2 Historical (1860-2005)', 'Impose changing conditions (consistent with observations), which include: atmospheric composition (including CO2) changes due to both anthropogenic and volcanic influences; solar forcing; emissions or concentrations of short-lived species and natural and anthropogenic aerosols or their precursors; and land use.  The historical ensemble is extended by the historicalExt experiment.', 'HADGEM2-CC', 'historical');
