INSERT INTO docs.tbl_document VALUES (2422, 'cmip5', NULL, 'ncc', 'cim.1.misc.DocumentSet', '91a486a2-a654-11e0-b2b4-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'piControl', 'piControl', NULL, NULL, NULL, 'NORESM1-M', 'piControl');
INSERT INTO docs.tbl_document VALUES (1292, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '25708c1e-c284-11e0-9bbf-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'piControl', 'piControl', NULL, 'ESM2M_pi-control_C1', 'GFDL experiment name = ESM2M_pi-control_C1. PCMDI experiment name = pre-industrial control (run1). Initial conditions for this experiment were derived from a multi-step process involving a multi-century spin-up integration to allow both the physical climate system and the carbon cycle to come into a quasi-dynamic equilibrium with year 1860 radiative forcing. First, a dynamic vegetation and carbon cycle model was spun up with forcing agents obtained from a previous CM2.1 control integration at levels representative of 1860, and potential (i.e., no land use) vegetation. Second, the spun up dynamic vegetation and carbon cycle model was coupled to an atmosphere model using Atmospheric Model Intercomparison Project (AMIP) protocols and spun up with time-varying observed sea surface temperatures and sea ice values. Third, an ocean + sea ice model was spun up with initial conditions for sea ice, ocean potential temperature and salinity derived from late 20th century observations. The ESM was coupled to the ocean bi', 'GFDL-ESM2M', 'piControl');
INSERT INTO docs.tbl_document VALUES (2218, 'cmip5', NULL, 'mohc', 'cim.1.misc.DocumentSet', '354ed4ec-e346-11df-9343-00163e9152a5', 2, '2015-07-26 01:51:53.609378', false, 'piControl', 'piControl', NULL, '3.1 Pre-industrial Control (1860 - 2360)', 'Control run for the Met Office Hadley Centre''s HadGEM2-ES simulations', 'HADGEM2-ES', 'piControl');
INSERT INTO docs.tbl_document VALUES (2174, 'cmip5', NULL, 'csiro-qccce', 'cim.1.misc.DocumentSet', 'c72be39a-eb8a-11df-9144-00163e9152a5', 1, '2015-07-26 01:51:53.609378', true, 'piControl', 'piControl', NULL, 'Pre-industrial control', 'Experiment was initialised from starting conditions taken from another preindustrial control experiment that showed little evidence of drift; there were some minor differences in aerosol treatments, but the net radiative balance at the top of the atmosphere was similar in the two experiments. A 160-year spin-up period allowed the model to adjust to the new CMIP5 pre-industrial forcings, before data collection commenced. Data throughout the spin-up period were not submitted to CMIP5.', 'CSIRO-MK3.6.0', 'piControl');
