INSERT INTO docs.tbl_document VALUES (1902, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '03570936-50fb-11e1-9b99-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'piControl esm2g', 'piControl esm2g', NULL, 'ESM2G_pi-control_C2', 'GFDL experiment name = ESM2G_pi-control_C2. PCMDI experiment name = pre-industrial control (run1). Initial conditions for this experiment were derived from a multi-step process involving a multi-century spin-up integration to allow both the physical climate system and the carbon cycle to come into a quasi-dynamic equilibrium with year 1860 radiative forcing. First, a dynamic vegetation and carbon cycle land only model was spun up with forcing agents obtained from a previous CM2.1 control integration at levels representative of 1860, and potential vegetation (i.e., no land use). Second, the spun up dynamic vegetation and carbon cycle land only model was coupled to an atmosphere model using Atmospheric Model Intercomparison Project (AMIP) protocols and spun up with using the monthly climatology of observed sea surface temperatures and sea ice concentrations averaged over the AMIP period. Third, an ocean + sea ice model was initialized from a zero-velocity state with temperature and salinity profiles derived fr', 'GFDL-ESM2G', 'piControl');
INSERT INTO docs.tbl_document VALUES (2585, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '03570936-50fb-11e1-9b99-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'piControl esm2g', 'piControl esm2g', NULL, 'ESM2G_pi-control_C2', 'GFDL experiment name = ESM2G_pi-control_C2. PCMDI experiment name = pre-industrial control (run1). Initial conditions for this experiment were derived from a multi-step process involving a multi-century spin-up integration to allow both the physical climate system and the carbon cycle to come into a quasi-dynamic equilibrium with year 1860 radiative forcing. First, a dynamic vegetation and carbon cycle land only model was spun up with forcing agents obtained from a previous CM2.1 control integration at levels representative of 1860, and potential vegetation (i.e., no land use). Second, the spun up dynamic vegetation and carbon cycle land only model was coupled to an atmosphere model using Atmospheric Model Intercomparison Project (AMIP) protocols and spun up with using the monthly climatology of observed sea surface temperatures and sea ice concentrations averaged over the AMIP period. Third, an ocean + sea ice model was initialized from a zero-velocity state with temperature and salinity profiles derived fr', 'GFDL-ESM2G', 'piControl');
INSERT INTO docs.tbl_document VALUES (1816, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '25708c1e-c284-11e0-9bbf-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'piControl esm2m', 'piControl esm2m', NULL, 'ESM2M_pi-control_C1', 'GFDL experiment name = ESM2M_pi-control_C1. PCMDI experiment name = pre-industrial control (run1). Initial conditions for this experiment were derived from a multi-step process involving a multi-century spin-up integration to allow both the physical climate system and the carbon cycle to come into a quasi-dynamic equilibrium with year 1860 radiative forcing. First, a dynamic vegetation and carbon cycle model was spun up with forcing agents obtained from a previous CM2.1 control integration at levels representative of 1860, and potential (i.e., no land use) vegetation. Second, the spun up dynamic vegetation and carbon cycle model was coupled to an atmosphere model using Atmospheric Model Intercomparison Project (AMIP) protocols and spun up with time-varying observed sea surface temperatures and sea ice values. Third, an ocean + sea ice model was spun up with initial conditions for sea ice, ocean potential temperature and salinity derived from late 20th century observations. The ESM was coupled to the ocean bi', 'GFDL-ESM2M', 'piControl');
