INSERT INTO docs.tbl_document VALUES (1474, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '8321cc28-c429-11e0-9a33-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'rcp26 esm2m', 'rcp26 esm2m', NULL, 'ESM2M-HC1_2006-2100_all_rcp26_WC1', 'GFDL experiment name = ESM2M-HC1_2006-2100_all_rcp26_WC1. PCMDI experiment name = RCP2.6 (run1). Initial conditions for this experiment were taken from 1 January 2006 of the parent experiment, ESM2M-C1_all_historical_HC1 (historical). Several forcing agents varied during the 95 year duration of the RCP2.6 experiment based upon the IMAGE integrated assessment model for the 21st century. The time-varying forcing agents include the well-mixed greenhouse gases (CO2, CH4, N2O, halons), tropospheric and stratospheric O3, model-derived aerosol concentrations (sulfate, black and organic carbon, sea salt and dust), and land use transitions. Volcanic aerosols were zero and solar irradiance varied seasonally based upon late 20th century averages but with no interannual variation. The direct effect of tropospheric aerosols is calculated by the model, but not the indirect effects.', 'GFDL-ESM2M', 'rcp26');
