INSERT INTO docs.tbl_document VALUES (1256, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', 'a0df18fa-df96-11e0-807e-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'rcp45', 'rcp45', NULL, 'ESM2M-HC1_2006-2100_all_rcp45_XC1', 'GFDL experiment name = ESM2M-HC1_2006-2100_all_rcp45_XC1. PCMDI experiment name = RCP4.5 (run1). Initial conditions for this experiment were taken from 1 January 2006 of the parent experiment, ESM2M-C1_all_historical_HC1 (historical). Several forcing agents varied during the 95 year duration of the RCP4.5 experiment based upon the MINICAM integrated assessment model for the 21st century. The time-varying forcing agents include the well-mixed greenhouse gases (CO2, CH4, N2O, halons), tropospheric and stratospheric O3, model-derived aerosol concentrations (sulfate, black and organic carbon, sea salt and dust), and land use transitions. Volcanic aerosols were zero and solar irradiance varied seasonally based upon late 20th century averages but with no interannual variation. The direct effect of tropospheric aerosols is calculated by the model, but not the indirect effects.', 'GFDL-ESM2M', 'rcp45');
