INSERT INTO docs.tbl_document VALUES (1223, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', 'f7930dc2-5f12-11e1-bfb5-00163e9152a5', 1, '2015-07-26 01:51:53.609378', true, 'rcp45 esm2g', 'rcp45 esm2g', NULL, 'ESM2G-HC2_2006-2100_all_rcp45_XC2', 'GFDL experiment name = ESM2G-HC2_2006-2100_all_rcp45_XC2. PCMDI experiment name = RCP4.5 (run1). Initial conditions for this experiment were taken from 1 January 2006 of the parent experiment, ESM2G-C2_all_historical_HC2 (historical). Several forcing agents varied during the 95 year duration of the RCP4.5 experiment based upon the MINICAM integrated assessment model for the 21st century. The time-varying forcing agents include the well-mixed greenhouse gases (CO2, CH4, N2O, halons), tropospheric and stratospheric O3, model-derived aerosol concentrations (sulfate, black and organic carbon, sea salt and dust), and land use transitions. Volcanic aerosols were zero and solar irradiance varied seasonally based upon late 20th century averages but with no interannual variation. The direct effect of tropospheric aerosols is calculated by the model, but not the indirect effects.', 'GFDL-ESM2G', 'rcp45');
