INSERT INTO docs.tbl_document VALUES (1654, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '1db0caec-5f15-11e1-bd49-00163e9152a5', 1, '2015-07-26 01:51:53.609378', true, 'rcp85 esm2g', 'rcp85 esm2g', NULL, 'ESM2G-HC2_2006-2100_all_rcp85_ZC2', 'GFDL experiment name = ESM2G-HC2_2006-2100_all_rcp85_ZC2. PCMDI experiment name = RCP8.5 (run1). Initial conditions for this experiment were taken from 1 January 2006 of the parent experiment, ESM2G-C2_all_historical_HC2 (historical). Several forcing agents varied during the 95 year duration of the RCP8.5 experiment based upon the MESSAGE integrated assessment model for the 21st century. The time-varying forcing agents include the well-mixed greenhouse gases (CO2, CH4, N2O, halons), tropospheric and stratospheric O3, model-derived aerosol concentrations (sulfate, black and organic carbon, sea salt and dust), and land use transitions. Volcanic aerosols were zero and solar irradiance varied seasonally based upon late 20th century averages but with no interannual variation. The direct effect of tropospheric aerosols is calculated by the model, but not the indirect effects.', 'GFDL-ESM2G', 'rcp85');
INSERT INTO docs.tbl_document VALUES (2340, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '2539a9fa-dfae-11e0-b73a-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'rcp85 esm2m', 'rcp85 esm2m', NULL, 'ESM2M-HC1_2006-2100_all_rcp85_ZC1', 'GFDL experiment name = ESM2M-HC1_2006-2100_all_rcp85_ZC1. PCMDI experiment name = RCP8.5 (run1). Initial conditions for this experiment were taken from 1 January 2006 of the parent experiment, ESM2M-C1_all_historical_HC1 (historical). Several forcing agents varied during the 95 year duration of the RCP8.5 experiment based upon the MESSAGE integrated assessment model for the 21st century. The time-varying forcing agents include the well-mixed greenhouse gases (CO2, CH4, N2O, halons), tropospheric and stratospheric O3, model-derived aerosol concentrations (sulfate, black and organic carbon, sea salt and dust), and land use transitions. Volcanic aerosols were zero and solar irradiance varied seasonally based upon late 20th century averages but with no interannual variation. The direct effect of tropospheric aerosols is calculated by the model, but not the indirect effects.', 'GFDL-ESM2M', 'rcp85');
