INSERT INTO docs.tbl_document VALUES (1984, 'cmip5', NULL, 'noaa-gfdl', 'cim.1.misc.DocumentSet', '3e03c4d0-5f14-11e1-bd49-00163e9152a5', 1, '2015-07-26 01:51:53.609378', false, 'sst2030 hiram-c180', 'sst2030 hiram-c180', NULL, 'Simulation using HIRAM-C180 using future SSTs and RCP 4.5 forcing for the period 2026-2035', 'Model was run in AMIP mode with SST and sea ice concentration determined from the HadISST1.1 data set (Rayner et al 2003) plus a monthly mean SST and sea ice concentration anomaly computed as the difference between either the historical and RCP4.5 experiment for either the GFDL-ESM2M (p1) or CM3 (p2) models. The sea-ice model assumes that each grid point is either fully ice-covered or ice-free and also assumes a uniform ice thickness determined from either the GFDL-ESM2M or CM3 model.', 'GFDL-HIRAM-C180', 'sst2030');
