INSERT INTO docs.tbl_document VALUES (45993, 'esps', NULL, NULL, 'cim.1.software.ModelComponent', 'a362e050-bb13-4c3b-8e06-35077709bbc3', 4, '2016-01-06 17:54:01.255978', false, 'HYCOM', 'HYCOM', NULL, 'HYbrid Coordinate Ocean Model', 'Traditional vertical coordinate choices [z-level, terrain-following (sigma), isopycnic] are not by themselves optimal everywhere in the ocean, as pointed out by recent model comparison exercises performed in Europe (DYnamics of North Atlantic MOdels - DYNAMO) and in the U.S. (Data Assimilation and Model Evaluation Experiment - DAMEE). Ideally, an ocean general circulation model (OGCM) should (a) retain its water mass characteristics for centuries (a characteristic of isopycnic coordinates), (b) have high vertical resolution in the surface mixed layer (a characteristic of z-level coordinates) for proper representation of thermodynamical and biochemical processes, (c) maintain sufficient vertical resolution in unstratified or weakly-stratified regions of the ocean, and (d) have high vertical resolution in coastal regions (a characteristic of terrain-following coordinates).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (2244, 'cmip5', NULL, 'mpi-m', 'cim.1.misc.DocumentSet', 'd9140490-c715-11e0-9a33-00163e9152a5', 2, '2015-07-26 01:51:53.609378', false, 'sstClim4xCO2-LR', 'sstClim4xCO2-LR', NULL, NULL, 'Standalone run of the atmosphere model echam6, with the land surface component JSBACH, but no dynamical vegetation', 'MPI-ESM-LR', 'sstClim4xCO2');
