INSERT INTO docs.tbl_document VALUES (45989, 'esps', NULL, NULL, 'cim.1.software.ModelComponent', 'f4b07b32-ac99-4db9-93dd-180e540cffbe', 4, '2016-01-06 17:54:01.255978', false, 'ModelE atmosphere', 'ModelE atmosphere', NULL, 'ModelE atmosphere', 'ModelE atmosphere', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (48095, 'dcmip-2012', NULL, NULL, 'cim.1.software.ModelComponent', 'f6414981-9679-40a3-8ca8-8fff1b8c01ab', 14, '2016-01-07 20:15:58.553319', true, 'UZIM', 'UZIM', NULL, 'Unified Z-grid Icosahedral Model', 'This model is based on the unified system described by Arakawa and Konor (2009).  The unified system is a nonhydrostatic system that is designed for global cloud resolving models which filters vertically propagating sound waves while allowing elasticity due to thermal expansion. The horizontal grid is based on an icosahedral hexagon-pentagon discretization. The dynamical core predicts the vorticity (vertical component) and divergence directly on the Z-grid defined at cell centers.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (48093, 'dcmip-2012', NULL, NULL, 'cim.1.software.ModelComponent', 'f753f67e-177f-466c-81e9-ea102505530a', 6, '2016-01-07 20:15:58.553319', true, 'PUMA', 'PUMA', NULL, 'Portable University Model of the Atmosphere', 'The Portable University Model of the Atmosphere (PUMA) is the dynamical core of the climate model PlanetSimulator [Fraedrich et al. 2005, Fraedrich 2012] and it is based on the multi-level spectral hydrostatic model described by Hoskins and Simmons (1975). Model fields are represented in terms of spherical harmonics subject to a triangular trunction. The spectral transform method enables an efficient calculation of nonlinear products [Orszag 1970 and Eliasen et. al 1970]. The model employs a semi-implicit time integration method for making the treatment fast gravity wave tendencies more efficient. The vertical coordinate is sigma (pressure divided by surface pressure) and the vertically discretized equations conserve total energy and mass.', NULL, NULL);
