INSERT INTO docs.tbl_document VALUES (48128, 'dcmip-2012', NULL, NULL, 'cim.1.software.ModelComponent', '9b16fb7a-e4f9-4323-9636-ca85d8c5625c', 6, '2016-01-07 20:15:58.553319', true, 'fv3-gfdl', 'fv3-gfdl', NULL, 'GFDL Cubed-sphere Finite-Volume dynamical core', 'GFDL Cubed-sphere Finite-Volume dynamical core', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (48094, 'dcmip-2012', NULL, NULL, 'cim.1.software.ModelComponent', '16c5a1f2-31e0-4e66-a90a-aa27b5de2540', 27, '2016-01-07 20:15:58.553319', true, 'GEM-latlon', 'GEM-latlon', NULL, 'Global Environmental Multiscale Model (GEM) on lat-lon grid', 'The Global Environmental Multiscale (GEM) Model is the operational model at the Canadian Meteorological Center (CMC) and is described by Côté et al.(1998). The temporal discretization is a two-time-level Crank-Nicholson iterative semi-Lagrangian method with an advecting wind interpolated in time. Recently, the vertical staggering (Charney-Phillips grid) was introduced and is described by Girard et al. (2010). GEM Lat-Lon uses the latitude-longitude grid. Implicit 2D diffusion damps the winds [u,v,d(zeta)/dt,dz/dt]. A 6th order selective diffusion (Qaddouri and Lee, 2008) is adopted with a 2 Delta-x removal ratio of 4% per timestep and is applied after the physics. In GEM, the dynamics and physics are time split. All prognostic variables are updated by the dynamics and then the physics. The time step is the same for dynamics and physics.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (48096, 'dcmip-2012', NULL, NULL, 'cim.1.software.ModelComponent', '97029360-2dad-4f27-a208-83c60bac66f7', 24, '2016-01-07 20:15:58.553319', true, 'OLAM', 'OLAM', NULL, 'Ocean-Land-Atmosphere Model', 'OLAM is a global nonhydrostatic weather and climate prediction model that has been developed since 2001.  It is an outgrowth of the Regional Atmospheric Modeling System (RAMS), which was developed for investigating meso- and cloud-scale phenomena.  OLAM incorporates all of the physics schemes from RAMS, and is thus equipped for atmospheric simulations at very high resolution.  The major improvement over RAMS is its OLAM''s dynamic core and computational grid that accommodates the entire globe while enabling local refinement in targeted regions of interest or significance.  Thus, OLAM combines the advantages of global models and high resolution regional models into a single fully-interactive framework.
INSERT INTO docs.tbl_document VALUES (48101, 'dcmip-2012', NULL, NULL, 'cim.1.software.ModelComponent', '4bd04760-1240-4112-8495-35ebe8dd4cf9', 4, '2016-01-07 20:15:58.553319', true, 'MPAS', 'MPAS', NULL, 'Model for Prediction Across Scales', 'Model for prection Across Scales', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (48102, 'dcmip-2012', NULL, NULL, 'cim.1.software.ModelComponent', '5d3a022d-4b02-4268-8ed4-a0d652facc87', 3, '2016-01-07 20:15:58.553319', true, 'mcore', 'mcore', NULL, 'MCore', 'MCore', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (48103, 'dcmip-2012', NULL, NULL, 'cim.1.software.ModelComponent', 'a52d396f-7e00-479b-8dbe-660518648d9b', 15, '2016-01-07 20:15:58.553319', true, 'ICON-MPI-DWD', 'ICON-MPI-DWD', NULL, 'Icosahedral Nonhydrostatic Model - MPI - DWD', 'The ICON models are developed for application in operational NWP and climate research, thus will be used at a wide range of spatial and temporal scales, from ~1 to ~100 km and from days to centuries, in the atmosphere, the ocean or the coupled climate system.
INSERT INTO docs.tbl_document VALUES (48104, 'dcmip-2012', NULL, NULL, 'cim.1.software.ModelComponent', 'fa93486e-d86c-4dd1-90c1-2fd8bd28d8c1', 32, '2016-01-07 20:15:58.553319', true, 'CAM-FV2', 'CAM-FV2', NULL, 'Community Atmosphere Model (CAM) with the Finite-Volume (FV) dynamical core', 'The mass-conservative finite-volume (FV) dynamical core in flux form is built upon
INSERT INTO docs.tbl_document VALUES (48113, 'dcmip-2012', NULL, NULL, 'cim.1.software.ModelComponent', '17255f1c-2168-4fae-9c0d-216b3c998469', 1, '2016-01-07 20:15:58.553319', true, 'DYNAMICO', 'DYNAMICO', NULL, 'Dynamico Atmospheric Dynamical Core Model', 'Dynamico Atmospheric Dynamical Core Model', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (48114, 'dcmip-2012', NULL, NULL, 'cim.1.software.ModelComponent', '6c5a9ed5-b4b1-4a41-b42d-9ef8561416d9', 21, '2016-01-07 20:15:58.553319', true, 'GEM-yinyang', 'GEM-yinyang', NULL, 'Global Environmental Multiscale Model (GEM) on Yin-Yang grid', 'At the Canadian Meteorological Center (CMC), we are currently developing the future global forecasting Yin-Yang model. In the horizontal we use spherical coordinates on the overset Yin-Yang grid (Kageyama and Sato, 2004), while in the vertical we use a loghydrostatic-pressure coordinate on the Charney-Phillips grid (Girard et al. (2010). The parametrization of physical processes is kept the same as in the current Global Environmental Multiscale (GEM) operational model (Côté et al.(1998)). The Yin-Yang global forecast is performed by considering a domain decomposition (a two-way coupling method) between two limited-area models (LAMs) discretized on the two panels of the Yin-Yang grid and using the same time step (Qaddouri, A., and V.Lee, 2011). Each panel of the Yin-Yang grid system is extended by a static halo region and uses the same fully implicit semi-Lagrangian method as in the GEM operational model to solve its own dynamic core. The spatial and time discretizations are implemented independently on eac', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (48115, 'dcmip-2012', NULL, NULL, 'cim.1.software.ModelComponent', '14cced5a-fd01-42da-af84-67003bd404a1', 21, '2016-01-07 20:15:58.553319', true, 'CAM-SE', 'CAM-SE', NULL, 'Community Atmosphere Model (CAM) Spectral Element (SE)', 'The Community Atmosphere (CAM) Spectral Element (SE) dynamical core is anticipated to become the default dynamical core in the future CAM release CAM 5.2. The model development and detailed design are documented by Taylor et al. [2007, 2008], Taylor and Fournier [2010], Taylor [2011] and Dennis et al. [2012]. CAM-SE utilizes an explicit Runge-Kutta time stepping approach and a continuous Galerkin spectral finite element method in the horizontal directions. The latter is described by Taylor et al. [1997] and Fournier et al. [2004]. The horizontal discretization is built upon unstructured quadrilaterals (a cubed-sphere mesh). Typically, third-order polynomials are selected that provide a fourth-order accurate horizontal discretization. These polynomials make use of 4x4 Gauss-Lobatto-Legendre (GLL) quadrature points within each spectral element.
INSERT INTO docs.tbl_document VALUES (1276, 'cmip5', NULL, NULL, 'cim.1.activity.NumericalExperiment', 'aadc187e-d3a5-11df-837f-00163e9152a5', 2, '2015-07-26 01:51:53.609378', true, 'midHolocene', 'midHolocene', NULL, 'mid-Holocene', 'Consistent with PMIP (Paleo Model Intercomparison Project) specifications. Impose
INSERT INTO docs.tbl_document VALUES (48116, 'dcmip-2012', NULL, NULL, 'cim.1.software.ModelComponent', '80992011-b028-4746-ade3-7131f8df2b5a', 14, '2016-01-07 20:15:58.553319', true, 'ICON-IAP', 'ICON-IAP', NULL, 'Icosahedral Nonhydrostatic Model at the Insitute for Atmospheric Physics', 'ICON-IAP (Icosahedral Nonhydrostatic model at the Institute for Atmospheric Physics) is a global non-hydrostatic dynamical core on a hexagonal C-grid which is designed to conserve mass, tracer mass, and energy. Energy conservation is achieved by discretizing the antisymmetric Poisson bracket which mimics correct energy conversions between the different kinds of energy (kinetic, potential, internal). Because of the bracket structure this is even possible in a complicated numerical environment with (i) the occurrence of terrain-following coordinates with all the metric terms in it, (ii) the horizontal C-grid staggering on the Voronoi mesh and the complications induced by the need for an acceptable stationary geostrophic mode, and (iii) the necessity for avoiding Hollingsworth instability. The model is equipped with a Smagorinsky-type nonlinear horizontal diffusion. The associated dissipative heating is accounted for by the application of the discrete product rule for derivatives. The time integration scheme is', NULL, NULL);
