INSERT INTO docs.tbl_document VALUES (399450, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '6502d22c-037f-4e86-aea6-abd8cc53105c', 1, '2020-11-17 01:19:05.639745', true, 'MinimumOne', 'MinimumOneMemberEnsemble', NULL, 'At least one member Ensemble', 'An ensemble of at least one simulation', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399451, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '5e79d1dc-c6cf-434e-b5bf-45971a16b544', 1, '2020-11-17 01:19:05.639745', true, '2x 1850 Biogenic VOC Emissions', '2x1850bioVOC', NULL, 'Doubled 1850 emissions of biogenic VOCs', 'Impose 1850 doubled biogenic VOC emission fluxes. Or double the VOC emissions of the 1850 climatological data.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399452, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '4bda08c3-b0bc-41df-aaa5-5577e1be5ab6', 1, '2020-11-17 01:19:05.639745', true, 'rad-pdwv-p4K', 'rad-pdwv-p4K', NULL, 'RFMIP-IRF', 'Offline radiative transfer calculations of vertically-resolved broadband-integrated longwave and shortwave fluxes for present-day (2015) clear sky (aerosol-free) conditions with plus 4K atmosphere. Present-day (PD) greenhouse gas concentrations and water vapour with PD plus 4K atmosphere. Use specified atmospheric distributions of temperature and humidity and surface properties over many profiles.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399453, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ec912cc6-a08d-4ebd-819e-f3746d3f4463', 1, '2020-11-17 01:19:05.639745', true, '2014 Aerosol Emissions', '22014Aerosol', NULL, '2014 Emissions of Aerosol', 'Impose 2014 emissions of aerosols.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399454, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '5269abf2-f9b5-44c5-8a73-e5af80b62026', 1, '2020-11-17 01:19:05.639745', true, '100MemberAMIP', '100MemberAMIPEnsemble', NULL, '100 Member AMIP Ensemble', 'An ensemble of one hundred simulations.  Initial conditions should be based on the AMIP simulation for 1st April 2000 if possible, though any suitable start dump may be used, noting that the first two months of the simulations will be ignored. The results are not expected to be particularly sensitive to the way in which ensemble members are generated, and any suitable method may be used but should be documented.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399455, 'cmip6', NULL, '--', 'cim.2.designing.Project', 'e02da263-c493-4ce0-a860-10ef9534ed7e', 1, '2020-11-17 01:19:05.639745', true, 'DECK', 'deck', NULL, 'Diagnosis, Evaluation, and Characterization of Klima (Climate)', 'Core simulations for climate model intercomparison.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399456, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'af668751-5f9f-4349-8b49-693e715f94a4', 1, '2020-11-17 01:19:05.639745', true, '1950s Emissions', '1950sEmissions', NULL, '1950s Emissions  Climatology', '1950s (10 year) climatology of core emissions data.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399457, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '3f0be8d1-d65f-4bcc-bda3-18d9493070a1', 1, '2020-11-17 01:19:05.639745', true, 'AMIP II GHG', 'AMIPIIGHG', NULL, 'AMIP II green house gases', 'Radiatively active trace gases are well-mixed with mixing ratios following the AMIP II recommendations: CO2: 348 ppmv; CH4: 1650 ppbv; N2O: 306 ppbv; Halocarbon yield of approximately 0.24 W m-2 radiative forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399458, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'af41deca-a17c-4769-ab1b-c973befbd87a', 1, '2020-11-17 01:19:05.639745', true, 'Past 2k WMGHG', 'past2kWMGHG', NULL, 'Well Mixed Greenhouse Gas forcing for the first two millennia', 'Atmospheric concentrations of well-mixed green house gas concentrations for the first two millennia, 01 to 1849.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399459, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '7b0c88bb-53d6-4588-aef3-5cf84200ae20', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Stratospheric H2O Concentrations', 'Pre-IndustrialStratosphericH2OConcentrations', NULL, 'Pre-Industrial Stratospheric Water Vapour Concentrations', 'Constant pre-Industrial stratospheric water vapour concentration.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399460, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '7c68b8c6-cbc5-4efc-ac14-36156c1490e4', 1, '2020-11-17 01:19:05.639745', true, 'RCP60 Aerosol Precursors', 'RCP60aerpre', NULL, 'Representative Concentration Pathway 6.0 Aerosol Precursors', 'Impose changing emissions of RCP6.0 aerosol precursors including SO2 and NHy.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399461, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '37ea67ed-fe05-4a91-9a07-368ffc957819', 1, '2020-11-17 01:19:05.639745', true, '1pctCO2Initialisationat4X', '1pctCO2InitialisationAt4X', NULL, '1pctCO2 Initialisation at quadrupling', 'Initialisation from the 1pctCO2 simulation once atmospheric CO2 reaches quadrupling.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399462, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'eb06c1c1-0eae-4677-a40f-8a92c5733f42', 1, '2020-11-17 01:19:05.639745', true, 'Pinatubo Aerosol', 'pinatuboAerosol', NULL, 'Pinatubo volcanic aerosol forcing', 'Aerosol forcing from the 1991 Pinatubo volcanic eruption.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399499, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '3615e411-2d6e-4558-9ad2-cface2ff4c8e', 1, '2020-11-17 01:19:05.639745', true, 'Aquaplanet Configuration', 'aquaplanetConfiguration', NULL, 'aquaplanet configuration', 'Aquaplanet configuration is an atmosphere model with no land surfaces and prescribed sea surface temperatures.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399500, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'aa0f8018-d905-466c-a85c-4dc0d2a329e3', 1, '2020-11-17 01:19:05.639745', true, '1850 Wood Harvest', '1850WoodHarvest', NULL, '1850 wood harvest', 'Maintain 1850 wood harvest amounts/areas. Wood harvest due to land deforestation for agriculture should continue yielding non-zero anthropogenic product pools.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399501, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '2eeae186-d2c3-48ad-a208-9bd8934f56e9', 1, '2020-11-17 01:19:05.639745', true, 'MinimumTwo', 'MinimumTwoMemberEnsemble', NULL, 'At least two member Ensemble', 'An ensemble of at least two simulations', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399502, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '419c5cf0-03ce-48cc-a7a3-d54ad573d458', 1, '2020-11-17 01:19:05.639745', true, 'LMIPSSP5-85Forcing', 'LMIPSSP5-85Forcing', NULL, 'Land offline MIP SSP5-85 forcing scenario', 'SSP5-85 forcing data for offline land surface models running the L3MIP future simulations.  Data provided by the LS3MIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399503, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '582d66e3-0387-4a51-91a7-f760bfe87f1c', 1, '2020-11-17 01:19:05.639745', true, '2015-2024 10yrs', '10yrs2015-2024', NULL, '2014/12/31-2024/12/31', 'Scenario. Start date on or before 31st December 2014.  Start dates on or before 15th November recommended to allow for DJF seasonal forecast results. Run for 10 years', NULL, NULL);
