INSERT INTO docs.tbl_document VALUES (398313, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e85f6aef-56f9-4e76-85b5-3bd4f0240ead', 1, '2020-11-17 01:19:05.639745', true, 'Historical Non-Reactive WMGHG Concentrations', 'HistoricalNonReactiveWMGHGconcentrations', NULL, 'Historical non-chemically reactive Well Mixed Greenhouse Gas (WMGHG) Concentrations', 'Impose historical non-chemically reactive Well Mixed Greenhouse Gas (WMGHG) concentrations.  No methane, nitrous oxide or halocarbons.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398314, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '82a95dcf-c3ff-4a52-9ae0-86d3c0bfe7c4', 1, '2020-11-17 01:19:05.639745', true, 'Historical Volcanic Aerosol', 'historicalVolcano', NULL, 'Historical volcanic aerosol forcing', 'Historical volcanic aerosol forcing (1850-2015).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398315, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'db142540-da7c-40cd-8ed8-1ed1efedf5e3', 1, '2020-11-17 01:19:05.639745', true, 'hist-nat initialisation', 'hist-natinitialisation', NULL, 'hist-nat Initialisation', 'Initialisation data is taken from the end of the hist-nat simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398316, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '7046f5d7-6efe-42a3-ad8c-695b205aca9a', 1, '2020-11-17 01:19:05.639745', true, 'Boreal Deforestation', 'IdealisedBorealDeforestation', NULL, 'Boreal Deforestation', 'Idealised regional deforestation: Boreal region.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398317, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '68535038-aa38-46c2-80f8-10463bc7603b', 1, '2020-11-17 01:19:05.639745', true, 'Present Day Forcing', 'pdForcing', NULL, 'Present-Day forcing', 'Present-Day forcing', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398318, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '3ebca31d-6b12-4241-b64c-70d0f36bb961', 1, '2020-11-17 01:19:05.639745', true, 'The PMIP4 contribution to CMIP6 – Part 1: Overview and over-arching analysis plan', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398319, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '77c3cb9b-6baa-42e0-be08-f6c9f1fd7031', 1, '2020-11-17 01:19:05.639745', true, 'High Resolution Model Intercomparison project', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398320, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '483c8841-063b-4efe-877e-f1b454b69792', 1, '2020-11-17 01:19:05.639745', true, 'First Millennium Volcanic Aerosols', 'FirstMillenniumVolcAer', NULL, 'Volcanic aerosols in the first millennium', 'Time varying radiative forcing due to volcanic stratospheric aerosols in the first millennium 01-849. The PMIP past1000 forcings data sets include the first millennium.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398321, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '352736b6-35d1-41e9-bf30-efbb1d5dabf0', 1, '2020-11-17 01:19:05.639745', true, 'RCP85 Forcing', 'rcp85Forcing', NULL, 'Representative Concentration Pathway 8.5W/m2 Forcing', 'Impose RCP8.5 forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398322, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'f6dc8026-c10b-4efd-9166-26882db57386', 1, '2020-11-17 01:19:05.639745', true, 'Future Electron Forcing', 'FutureElectronForcing', NULL, 'Future Electron Forcing', 'CMIP6 recommends the use of parameterisations based on geomagnetic activity indices such as the Kp- or Ap-index to describe ionisation from electron precipitation in the lower thermosphere and upper mesosphere (for those models that explicitly include those height levels in their code) as a best estimate for the impact of electron precipitation.
INSERT INTO docs.tbl_document VALUES (398323, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'daec8c41-3f38-4c60-83b6-7f2417b2b9f6', 1, '2020-11-17 01:19:05.639745', true, 'Historical Electron Forcing', 'HistoricalElectronForcing', NULL, 'Historical Electron Forcing', 'CMIP6 recommends the use of parameterisations based on geomagnetic activity indices such as the Kp- or Ap-index to describe ionisation from electron precipitation in the lower thermosphere and upper mesosphere (for those models that explicitly include those height levels in their code) as a best estimate for the impact of electron precipitation.
INSERT INTO docs.tbl_document VALUES (398324, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '404e54cd-5fd1-4f05-b89e-1de17bff4cd0', 1, '2020-11-17 01:19:05.639745', true, 'Present Day 2014 Electron Forcing', 'PD2014ElectronForcing', NULL, 'Present Day 2014 Electron Forcing', 'Present day (2014) electron forcing. CMIP6 recommends the use of parameterisations based on geomagnetic activity indices such as the Kp- or Ap-index to describe ionisation from electron precipitation in the lower thermosphere and upper mesosphere (for those models that explicitly include those height levels in their code) as a best estimate for the impact of electron precipitation.
INSERT INTO docs.tbl_document VALUES (398325, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '4cc9a46d-be0f-421b-bd42-49f47e551c12', 1, '2020-11-17 01:19:05.639745', true, '1950 Ozone Depleting Halocarbon Concentrations', '1950OzoneDepletingHalocarbonConc', NULL, '1950 Concentrations of Ozone Depleting Halocarbons', 'Impose 1950 concentrations of Ozone Depleting Halocarbons, namely CFCs and HCFCs.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398326, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a8967488-883f-4616-ab6b-7eda09a95196', 1, '2020-11-17 01:19:05.639745', true, 'SSP5 RCP85 Land Use', 'RCP85land', NULL, 'Representative Concentration Pathway 8.5 Land Use for Shared Socioeconomic Pathway 5', 'Impose changing RCP8.5 land use including crops, pasture, urban area, vegetation and forest for SSP5.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398327, 'cmip6', '<damip>', '--', 'cim.2.designing.NumericalExperiment', '083aba1c-5f94-43bc-afed-39b2ee215192', 1, '2020-11-17 01:19:05.639745', true, 'ssp245-nat', 'ssp245-nat', NULL, 'natural-only SSP2-4.5 runs', 'An extension of at least one of the hist-nat (histNAT) simulations to the year 2100 following SSP2-45 solar and volcanic forcing. The future solar forcing data recommended for CMIP6 has a downward trend (Matthes et al., 2016).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398328, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '8bde315b-0560-4526-97e4-75046d2e841a', 1, '2020-11-17 01:19:05.639745', true, 'RCP34 Short Lived Gas Species', 'RCP34sls', NULL, 'Representative Concentration Pathway 3.4 Short Lived Gas Species', 'Impose changing emissions of RCP3.4 short lived gas species including CH4, NOx, VOCs and CO.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398329, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '78da25e3-ffbb-4283-a77e-79dfb99c78a1', 1, '2020-11-17 01:19:05.639745', true, 'rad-pd-LGM', 'rad-pd-LGM', NULL, 'RFMIP-IRF', 'Offline radiative transfer calculations of vertically-resolved broadband-integrated longwave and shortwave fluxes for present-day (2015) clear sky (aerosol-free) conditions with last glacial maximum (LGM) greenhouse gases (GHG) based on PMIP LGM GHG specifications. Use specified atmospheric distributions of present day temperature and humidity and surface properties over many profiles.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398293, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', '8cb1d600-99cc-486a-8144-afa0aae86251', 1, '2020-11-17 01:19:05.639745', true, 'pa-futArcSIC-ext', 'pa-futArcSIC-ext', '6.2', 'Partially-coupled extended simulation with future Arctic SIC', 'Coupled ocean-atmosphere transient experiment.  Coupled model extended simulation constrained with present day sea ice.   Present day and future sea ice to be the same as used in experiment pdSST-futArcSIC (1.6).  It is recommended to constrain sea ice by nudging but with a weak relaxation timescale of 2 months. However, appropriately calibrated long-wave fluxes applied to the sea ice model may also be used.  Radiative forcing to be set to present day (year 2000) levels. Initial conditions for coupled model experiments to be taken from year 2000 of coupled model historical simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398294, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '2e8b83f0-8067-45d0-8397-7d81e1e087c8', 1, '2020-11-17 01:19:05.639745', true, 'RCP26-overshoot Short Lived Gas Species', 'RCP26oversls', NULL, 'Representative Concentration Pathway 2.6 Overshoot Short Lived Gas Species', 'Impose changing emissions of RCP2.6-overshoot short lived gas species including CH4, NOx, VOCs and CO.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398295, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'be7d5c80-5b4d-48e7-9fb9-05f7e8506444', 1, '2020-11-17 01:19:05.639745', true, 'Pre-industrial GHG Concentrations excluding O3', 'preIndGHGExclO3', NULL, 'Pre-Industrial Greenhouse Gas concentrations excluding Ozone', 'Impose Pre-industrial (1850) concentrations of well mixed greenhouse gases (CO2, CH4, N2O, CFCs, HFCs, …) excluding ozone (O3).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398296, 'cmip6', NULL, '--', 'cim.2.shared.Party', '2c93feed-6771-4bb0-b7e5-352adb40173e', 1, '2020-11-17 01:19:05.639745', true, 'Andy Turner', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398297, 'cmip6', NULL, '--', 'cim.2.shared.Party', '125f2c9d-14be-4a7f-9136-4c5ba048f608', 1, '2020-11-17 01:19:05.639745', true, 'Veronika Eyring', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398336, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', '707b899a-423d-4543-af7b-93128a24ae32', 1, '2020-11-17 01:19:05.639745', true, 'histSST-piNTCF', 'histSST-piNTCF', NULL, 'historical SSTs and historical forcing, but with pre-industrial NTCF emissions', 'Historical atmosphere only simulation with historical WMGHG, transient historical SSTs.  Near Term Climate Forcers (NTCFs: tropospheric ozone and aerosols, and their precursors) fixed at 1850 emission levels.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398298, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', '38b386f0-3fa0-47ad-97b0-994475067077', 1, '2020-11-17 01:19:05.639745', true, 'piSST', 'piSST', NULL, 'control SSTs', 'An AGCM experiment with monthly-varying SSTs, sea-ice, atmospheric constituents and any other necessary boundary conditions (e.g. vegetation if required) taken from each model''s own piControl simulation (using the 30 years of piControl that are parallel to years 111-140 of its abrupt4xCO2 run).  Dynamic vegetation should be turned off in all the piSST set of experiments and the vegetation distribution that is output from the piControl simulation used.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398299, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '0053f5b2-9556-42c8-be9c-34f9d5e2afac', 1, '2020-11-17 01:19:05.639745', true, 'RCP60 Forcing', 'rcp60Forcing', NULL, 'Representative Concentration Pathway 6.0 W/m2 Forcing', 'Impose RCP6.0 forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398300, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '98ff5c18-538d-4e4b-bfc9-8d0f92870f8b', 1, '2020-11-17 01:19:05.639745', true, '1950s Ozone Concentrations', '1950sStratosphereTroposphereOzoneConcentrations', NULL, '1950s Stratosphere-Troposphere Ozone Concentrations Climatology', '1950s (10 year) climatology of ozone concentration database encompassing both the stratosphere and the troposphere.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398301, 'cmip6', '<rfmip>', '--', 'cim.2.designing.NumericalExperiment', '758a428b-612e-444c-a828-84d718413f08', 1, '2020-11-17 01:19:05.639745', true, 'piClim-spAer-histall', 'piClim-spAer-histall', 'RFMIP-SpAerO3-piSST-histall', 'transient effective radiative forcing with specified anthropogenic aerosol optical properties, all forcings', 'A historical (1850-2014) experiment using an atmosphere-land model with interactive vegetation in which sea surface temperatures (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  All transient anthropogenic and natural forcings to be consistent with the historical forcing used in the DAMIP hist-all experiment but with RFMIP specified anthropogenic aerosol optical properties.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398302, 'cmip6', NULL, '--', 'cim.2.shared.Party', '30643026-95d8-4f14-b2e9-3fb73bcbf5ca', 1, '2020-11-17 01:19:05.639745', true, 'Oleg Saenko', NULL, NULL, NULL, '', NULL, NULL);
