INSERT INTO docs.tbl_document VALUES (398311, 'cmip6', '<ls3mip>', '--', 'cim.2.designing.NumericalExperiment', '1fd8487e-4269-4ec8-9953-57a9db9a7d83', 1, '2020-11-17 01:19:05.639745', true, 'lfmip-rmLC-princeton', 'lfmip-rmLC-princeton', NULL, 'prescribed land conditions (from running mean climatology) derived from land-hist-princeton and initialized from "historical" run year 1980', 'Scenario forced experiment with prescribed land surface climatology derived from transient 30 year running mean from land-hist-princeton.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398312, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '960968e9-33c4-46b5-b04b-63ffcf9d3fad', 1, '2020-11-17 01:19:05.639745', true, 'Atlantic hurricanes and natural variability in 2005', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398330, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '6dc943b5-3324-4818-aea1-46df7245a39d', 1, '2020-11-17 01:19:05.639745', true, '2014 O3x0.1', '2014O3x0.1', NULL, '2014 ozone x 0.1', 'Impose present day (2014) ozone concentrations scaled by 0.1.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398331, 'cmip6', NULL, '--', 'cim.2.shared.Party', '54da2d26-cd40-4342-9ccb-fde57921b55c', 1, '2020-11-17 01:19:05.639745', true, 'Malte Meinshausen', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398332, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '0e917f10-7a9c-4cfe-a10a-728800cb9129', 1, '2020-11-17 01:19:05.639745', true, 'Restore SST AMV pos Extra Tropical N Atlantic', 'RestoreSSTAMVposExTropNAtlantic', NULL, 'Restore extra-tropical north Atlantic sea surface temperature to positive AMV', 'Sea Surface Temperatures (SSTs) are restored to model climatology plus positive AMV anomaly by Newtonian cooling over the extra-tropical north Atlantic (30N-65N). The restoring timescale is 10 days for a 50m deep mixed layer (or equivalent). The restoring coefficient of 40 W/m2/K should decrease to zero over an 8 degree buffer zone bounding the restored region.  No restoring if sea ice is present. Idealised AMV anomalies of SST will be provided by DCPP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398333, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '7c46a901-a9e4-409d-97da-92fb918c5916', 1, '2020-11-17 01:19:05.639745', true, 'Interdecadal modulation of the impact of ENSO on Australia', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398334, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a7e28c1b-d680-406d-861d-6ddd82bdb06b', 1, '2020-11-17 01:19:05.639745', true, 'Historical land surface forcings except irrigation and fertilisation', 'historicalLandSurfaceForcingsNoIrrigFert', NULL, 'historical land surface  forcings except irrigation and fertilisation', 'Apply all transient historical forcings that are relevant for the land surface model except for irrigation and fertilisation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398335, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'bc0111dc-868e-43dc-a150-cad68295098b', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Cosmic Ray Forcing', 'piCosmicRayForcing', NULL, 'Pre-Industrial Cosmic Ray Forcing', 'CMIP6 recommends the use of the CRAC:CRII (Cosmic Ray induced Cascade: Application for Cosmic Ray Induced Ionization) model extended toward the upper atmosphere (Usoskin et al. 2010).  The results of the CRAC:CRII model are parameterized (see Usoskin and Kovaltsov 2006) to give ion pair production rate as a function of the altitude (quantified via the barometric pressure), geomagnetic latitude (quantified via geomagnetic cut-off rigidity), and solar activity (quantified via the modulation potential θ). For pre-industrial solar forcing use the (1850-1873 mean).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398337, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'a9a7463f-3131-423b-b867-572be3933290', 1, '2020-11-17 01:19:05.639745', true, 'UptoThree', 'UptoThreeMemberEnsemble', NULL, 'Up to Three Member Ensemble', 'An ensemble of up to three simulations', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398338, 'cmip6', '<ismip6>', '--', 'cim.2.designing.NumericalExperiment', '2ab7720e-d9a4-4069-ae6d-acc2af8fc3d9', 1, '2020-11-17 01:19:05.639745', true, 'ism-historical-std', 'ism-historical-std', NULL, 'offline ice sheet model forced by ISMIP6-specified AOGCM historical output', 'Stand alone ice sheet model driven offline by ISMIP6 CMIP6 standard input for the historical climate experiment. This is an abbreviated experiment for the historical period which begins from the present day control and ends in December 2014.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398339, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '65f81371-4a14-49b6-b324-ff57814ef115', 1, '2020-11-17 01:19:05.639745', true, 'HadISST in AMO', 'HadISSTinAMO', NULL, 'HadISST anomalies applied in the AMO domain', 'Sea surface temperature is restored to the model climatology plus HadISST observed historical anomaly in the AMO domain (0-70°N, 70°W-0°). The weight=1 in the inner box (5°N-65°N, 65°W-5°W) and linearly reduces to zero in the buffer zone from the inner to the outer box. Technical details for the restoring method for SSTs can be found in the appendix of Zhou et al 2014.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398340, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '5ba993e7-7a3a-4e32-8e6b-eaa2f4c7f5e3', 1, '2020-11-17 01:19:05.639745', true, 'All historical land surface forcings', 'allHistoricalLandSurfaceForcings', NULL, 'All historical land surface model forcings', 'Apply all transient historical forcings that are relevant for the land surface model. Include transient CO2, Nitrogen deposition, aerosol deposition and population density etc.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398341, 'cmip6', '<omip>', '--', 'cim.2.designing.NumericalExperiment', '4a9c0aee-c0ac-454d-9c14-0c17f2e37576', 1, '2020-11-17 01:19:05.639745', true, 'omip1-spunup', 'omip1-spunup', NULL, 'OMIP experiment forced by Large & Yeager (CORE-2, NCEP) atmospheric data set and initialized from at least a 2000-year spin up of the coupled physical-biogeochemical model', 'Global ocean/sea-ice/inert-chemical/biogeochemical experiment like omip1 except that it is not initialized with observed climatologies; rather it is initialized with results from at least a 2000-year spin up of the coupled physical-biogeochemical models.   
INSERT INTO docs.tbl_document VALUES (398342, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '40225327-5690-44a2-82c8-bb904750550f', 1, '2020-11-17 01:19:05.639745', true, '100Gt Carbon removed from 2010 atmosphere', 'remove100GtCarbonFrom2010Atmos', NULL, '2010 CO2 emissions are instantaneously reduced in 2015 by removing 100 Gt Carbon', 'CO2 emissions (as used from 2010 onwards in the esm-yr2010CO2-control experiment) held at 2010 levels for 5 years.  At the begining of 2015 100 Gt of Carbon is subtracted instantaneously from the atmosphere within one timestep. 
INSERT INTO docs.tbl_document VALUES (398343, 'cmip6', '<c4mip>', '--', 'cim.2.designing.NumericalExperiment', 'cfd70983-7123-413f-b15f-e4e6ce5c1406', 1, '2020-11-17 01:19:05.639745', true, 'esm-bell-2000PgC', 'esm-bell-2000PgC', 'B3', 'emissions driven 2000 PgC bell-curve', 'Bell-shape zero emissions experiment. Run in emissions-driven configuration with CO2-only forcing, all non-CO2 forcing is fixed at pre-industrial levels. Use a bell-shaped CO2 emissions profile designed to give cumulative emissions of 2000 PgC after 100 years.  Then hold CO2 emissions at zero and simulate the subsequent reduction in CO2 and change in climate for at least 100 years (1000 years for EMICs).  The time series of global CO2 for the bell-shape emission profiles will be provided by ZECMIP via the C4MIP and CDRMIP websites.  A model decision is required on the spatial pattern of CO2 emissions, ZECMIP suggest globally uniform at surface.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398344, 'cmip6', NULL, '--', 'cim.2.shared.Party', 'fe6d64db-4d33-4fce-ad30-b82d28ae4447', 1, '2020-11-17 01:19:05.639745', true, 'Stephen Griffies', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398345, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '416b381a-6c53-4d24-b78e-4169b2da8b5e', 1, '2020-11-17 01:19:05.639745', true, 'Historical Land Use High', 'historicalLandUseHigh', NULL, 'historical land use with high estimates of  crop, pasture and wood harvest', 'Historical land use with high estimates of crop cultivation, pasture land and wood harvest.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398346, 'cmip6', '<pmip>', '--', 'cim.2.designing.NumericalExperiment', 'f2993f1b-16ff-4d28-9dce-4bbbf8b47532', 1, '2020-11-17 01:19:05.639745', true, 'esm-past1000', 'esm-past1000', 'past1000esm', 'last millennium experimentwith interactive caron cycle', 'Parallel experiment to past1000, but for model set-ups with interactive carbon cycle. Main forcings: trace gases, volcanoes, solar variability, land-use.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398347, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '1ab88ebd-96bb-4472-b2d0-298c9524ffa5', 1, '2020-11-17 01:19:05.639745', true, '1960Biennial', '1960biennial', NULL, '1960 Biennial', 'Start date every other year from 1960 to the present.  Start date on or before 31st December of the year preceding the forecast period.  Start dates on or before 15th November recommended to allow for DJF seasonal forecast results.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398348, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '87a6c94f-08b4-427c-ac06-e2515c94342d', 1, '2020-11-17 01:19:05.639745', true, 'Timing and climate forcing of volcanic eruptions for the past 2,500 years', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398349, 'cmip6', '<volmip>', '--', 'cim.2.designing.NumericalExperiment', '9f8df441-4fd5-44db-8cef-82f9b3279f35', 1, '2020-11-17 01:19:05.639745', true, 'volc-pinatubo-full', 'volc-pinatubo-full', NULL, 'Pinatubo experiment', '1991 Pinatubo forcing as used in the CMIP6 historical simulations.  Maintain the same constant boundary forcing as the pre-industrial control integration, except for the volcanic forcing. Requires special diagnostics of parameterised and resolved wave forcings, radiative and latent heating rates. The experiment will not account for the actual climate conditions when the real event occured (e.g., presence and strength of additional forcing factors). Instead, the experiment is designed to span very different initial climate states to systematically assess uncertainties in the post-eruption behaviour that are related to background climate conditions. Sampling of an eastern phase of the Quasi-Biennial Oscillation (QBO), as observed after the 1991 Pinatubo eruption is preferred for those models that spontaneously generate such mode of stratospheric variability. Run at least 25 ensemble members for 3 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398350, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'e3ac7cf0-6c67-4092-b9c8-8bc4df2a5e22', 1, '2020-11-17 01:19:05.639745', true, 'Historical Solar Particle Forcing', 'HistoricalSolarParticleForcing', NULL, 'Historical Solar Particle Forcing', 'Historical solar particle forcing (1850-2014). For models with interactive stratospheric chemistry.  Proton forcing: HOx and NOx production by solar protons. Electron forcing:  Kp- or Ap-index to describe ionisation from electron precipitation in the lower thermosphere and upper mesosphere. Cosmic ray forcing:  ion-pair production by galactic cosmic rays.  CMIP6 models that do not have interactive chemistry should  prescribe the CMIP6 recommended ozone forcing data set.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398351, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e6941df3-d1fe-4e22-929c-60740bf24f1b', 1, '2020-11-17 01:19:05.639745', true, '2010 Aerosol Plume Climatology', '2010SimpleAerosolPlumeClimatology', NULL, '2010 Simple Aerosol Plume Climatology', '2010 Aerosol plume. Apply fields of aerosol optical properties (fine and coarse mode aerosol optical depth (AOD), single scattering albedo (SSA), asymmetry parameter (ASY)) and cloud activity (anthropogenic increment in drop number, dN/N), which are easy to use and to configure (i.e., scale in amplitude for hypothesis testing).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398352, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'fc362213-0c99-41c0-bf72-33c48ccfd0df', 1, '2020-11-17 01:19:05.639745', true, '1850 non-Sea Salt Aerosol Emissions', '1850nonSeaSaltAer', NULL, '1850 emissions of non-SeaSalt Aerosols', 'Impose pre-industrial (1850) emissions of non-Sea Salt aerosols.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398353, 'cmip6', '<damip>', '--', 'cim.2.designing.NumericalExperiment', 'a8759d8e-b76a-4b8e-acca-84562ab67a2d', 1, '2020-11-17 01:19:05.639745', true, 'ssp245-covid', 'ssp245-covid', NULL, '2-year Covid-19 emissions blip based upon ssp245', 'Future scenario based on ssp245, but with 2-year perturbation to emissions for 2020 and 2021 due to Covid-19 pandemic restrictions. Emissions revert to ssp245 after this. Concentration-driven. Branch from ssp245 at 1 Jan 2020.  Near-term impact simulations run for 5 years with a minimum of 10 ensemble members. Longer-term impact of recovery scenarios to be run for 30 years with 10 ensemble members if possible.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398354, 'cmip6', '<geomip>', '--', 'cim.2.designing.NumericalExperiment', '9fc57a40-5334-4bde-ae6b-c1e9318daec8', 1, '2020-11-17 01:19:05.639745', true, 'G6SST1', 'G6SST1', 'G6Slice1', 'SSTs, forcings, and other prescribed conditions from year 2020 of SSP5-8.5', 'Time slice for the first year of the ScenarioMIP SSP5-85 (high forcing scenario) experiment. Run for 10 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398355, 'cmip6', '<geomip>', '--', 'cim.2.designing.NumericalExperiment', '2be95bce-25a1-4711-911e-b3dd0f0409db', 1, '2020-11-17 01:19:05.639745', true, 'G6sulfur', 'G6sulfur', NULL, 'stratospheric sulfate aerosol injection to reduce net forcing from SSP585 to SSP245', 'Injection of sulfate aerosol precursors in the equatorial stratosphere to reduce the radiative forcing of the ScenarioMIP high forcing scenario (SSP5-85) to match that of the ScenarioMIP medium forcing scenario (SSP2-45).   Geoengineering will be simulated over years 2020 to 2100.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398356, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', '98c1d0ee-0c61-4d38-8d99-bd98ad56fc54', 1, '2020-11-17 01:19:05.639745', true, 'amip-4xCO2', 'amip-4xCO2', NULL, 'control SSTs with 4xCO2', 'Continuation of CFMIP-2 AMIP experiments and CMIP5 experiment 6.5. 
INSERT INTO docs.tbl_document VALUES (398357, 'cmip6', NULL, '--', 'cim.2.designing.Project', '24af8666-b799-4ebf-a2bf-4599da0fc856', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP', 'pamip', NULL, 'Polar Amplification Model Intercomparison Project', 'Polar amplification - the phenomenon that external radiative forcing produces a larger change in surface temperature at high latitudes than the global average - is a key aspect of anthropogenic climate change, but its causes and consequences are not fully understood. The Polar Amplification Model Intercomparison Project seeks to improve our understanding of this phenomenon through a coordinated set of numerical model experiments.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398374, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '621c4177-d115-4be8-82c5-705a65bc30b5', 1, '2020-11-17 01:19:05.639745', true, 'InitMIP basal melting rate anomaly', 'InitMIPBasalMelt', NULL, 'Basal melting rate anomaly for the ISMIP6 InitMIP experiments', 'Apply a prescribed anomaly of basal melting rate under floating ice, provided by ISMIP6, which simulates a doubling of sub-ice-shelf melting after 40 years of simulation for models with initial melting rates close to today’s observations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398375, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'e2505c01-b4a7-4f97-a2f0-f53edb682ac6', 1, '2020-11-17 01:19:05.639745', true, 'BGCIronInitialisation', 'BGCIronInitialisation', NULL, 'Biogeochemical Iron Initialisation', 'Iron initialisation based on the GEOTRACES database with data provided by OMIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398415, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '0807f10b-ce01-4ccd-8181-90501c41eb98', 1, '2020-11-17 01:19:05.639745', true, 'LFMIP present day land-hist-wfdei forcing', 'LFMIP-pd-land-hist-wfdei', NULL, 'Present day climate land surface forcing from land-hist-wfdei', 'Land surface forcing climatology for present climate (1980-2014) from the land-hist-wfdei simulation.  Note the climatological median of soil water and snow water is to be used instead of climatological means.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398358, 'cmip6', '<rfmip>', '--', 'cim.2.designing.NumericalExperiment', '11f0e4a0-5fe5-469a-ad2d-99a3af65a3df', 1, '2020-11-17 01:19:05.639745', true, 'piClim-spAer-histaer', 'piClim-spAer-histaer', 'RFMIP-SpAerO3-piSST-histaer', 'transient effective radiative forcing with specified anthropogenic aerosol optical properties, aerosol forcing', 'A historical (1850-2014) experiment using an atmosphere-land model with interactive vegetation in which sea surface temperatures (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  Transient anthropogenic aerosol optical properties specified by RFMIP, other forcing agents are set at pre-industrial levels.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398359, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', 'af20c84a-35b1-4b5a-9013-3039390c286e', 1, '2020-11-17 01:19:05.639745', true, 'abrupt-2xCO2', 'abrupt-2xCO2', NULL, 'Abrupt doubling of the atmospheric concentration of carbon dioxide', 'Impose an instantaneous doubling of the concentration of atmospheric carbon dioxide, then hold fixed.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398360, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '650fe315-71f3-48fd-9ac7-65ffb3dc3221', 1, '2020-11-17 01:19:05.639745', true, 'AOGCM-ISM Configuration', 'AOGCM-ISMConfiguration', NULL, 'Atmosphere-Ocean General Circulation Model or Earth System Model with Interactive Ice Sheets', 'Use a coupled Atmosphere-Ocean general circulation model or an Earth System Model with interactive ice sheets', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398361, 'cmip6', '<lumip>', '--', 'cim.2.designing.NumericalExperiment', '38d336e2-9f97-437f-988b-73b1e47fed21', 1, '2020-11-17 01:19:05.639745', true, 'land-crop-grass', 'land-crop-grass', NULL, 'historical land-only with cropland as natural grassland', 'Land surface model simulation.  Same as land-hist except with all new crop and pasture-land treated as unmanaged grassland. Start year either 1850 or 1700 depending on standard practice for particular model.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398362, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', 'b439764f-15cd-4a0d-9ed3-17cf7326bc71', 1, '2020-11-17 01:19:05.639745', true, 'dcppC-hindcast-noAgung', 'dcppC-hindcast-noAgung', 'C3.3', 'hindcast but with only background volcanic forcing', 'Prediction experiment without volcano forcing. Repeat DCCP-A1 1963 hindcast without Agung forcing. Background volcanic aerosol to be the same as that used in the 2015 forecast. 10 ensemble members. Run each member for at least 5 years, preferably 10 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398363, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '12eca5b0-a3e7-4471-94ac-29491950763e', 1, '2020-11-17 01:19:05.639745', true, 'AMIP SIT protocol', 'AMIP-SIT-protocol', NULL, 'AMIP sea ice thickness protocol', 'Sea ice thickness should be specified with the same protocol that was used in the CMIP6 AMIP experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398364, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '57ce03ef-cc2f-497b-9fd4-6849e0c0ef96', 1, '2020-11-17 01:19:05.639745', true, 'Ensemble Average present day SST from experiment pa-pdSIC', 'PAMIP-ensMean-SST-pa-pdSIC', NULL, 'Present day SST calculated from the ensemble average SST for each month of experiment pa-pdSIC', 'Present day monthly mean climatology of sea surface temperature (SST) calculated from the ensemble mean for each month of experiment pa-pdSIC.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398365, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '8e34fa8b-c03b-4c00-8042-ff96b7cf12a7', 1, '2020-11-17 01:19:05.639745', true, 'RCP26-extension Short Lived Gas Species', 'RCP26extsls', NULL, 'Representative Concentration Pathway 2.6 Extension Short Lived Gas Species', 'Impose changing emissions of RCP2.6 extension short lived gas species including CH4, NOx, VOCs and CO.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398366, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'a1b879d4-aede-4be1-a106-25743c1f6429', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Forcing Excluding Volcanic Aerosols', 'preIndForcingExclVolcAer', NULL, 'Pre-industrial forcing, excluding volcanic forcing', 'Pre-Industrial forcing excluding volcanic aerosols.', NULL, NULL);
