INSERT INTO docs.tbl_document VALUES (398369, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '8829c9c7-9a32-4090-9243-bda60142a24c', 1, '2020-11-17 01:19:05.639745', true, 'RCP26-extension Well Mixed GHG', 'RCP26extwmGHG', NULL, 'Representative Concentration Pathway 2.6 Extension Well Mixed Greenhouse Gases', 'Impose changing concentrations of RCP2.6 extension long-lived greenhouse gases, including CO2, N2O and halogenated gases.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398370, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'aae8d590-c9fa-49bf-b48f-18b61c18925f', 1, '2020-11-17 01:19:05.639745', true, 'rad-future', 'rad-future', NULL, 'RFMIP-IRF', 'Offline radiative transfer calculations of vertically-resolved broadband-integrated longwave and shortwave fluxes for future clear sky (aerosol-free) conditions with future greenhouse gases. Future greenhouse gas concentrations, and future atmosphere based on RCP8.5 at 2100. Use specified atmospheric distributions of temperature and humidity and surface properties over many profiles.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398371, 'cmip6', '<gmmip>', '--', 'cim.2.designing.NumericalExperiment', '55b58c1d-e28a-4535-a01e-d5440d5f39fd', 1, '2020-11-17 01:19:05.639745', true, 'amip-TIP', 'amip-TIP', NULL, 'same as "amip" run, but surface elevations of the Tibetan-Iranian Plateau and Himalayas reduced to 500m', 'The topography of the Tibetan Plateau (TIP) and other Asian highlands is modified by setting surface elevations to 500m. Other settings are the same as the standard DECK AMIP simulation. 
INSERT INTO docs.tbl_document VALUES (398372, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'd2a93caa-b5a2-4f0c-90f0-ac7bff38b820', 1, '2020-11-17 01:19:05.639745', true, 'The Carbon Dioxide Removal Model Intercomparison Project (CDR-MIP): Rationale and experimental protocol for CMIP6', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398373, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '8d99539c-d3b6-4e39-9fc2-e81fe6677b89', 1, '2020-11-17 01:19:05.639745', true, 'Future Atmospheric States', 'FutureAtmosStates', NULL, 'Future atmospheric states', 'Specified atmospheric states (vertical distribution of temperature and humidity) over many profiles for future conditions based on RCP8.5 at 2100.', NULL, NULL);
