INSERT INTO docs.tbl_document VALUES (398417, 'cmip6', NULL, '--', 'cim.2.designing.MultiEnsemble', '5ba636dc-bb03-4bd1-8a51-3fc5e70445b0', 1, '2020-11-17 01:19:05.639745', true, 'realTimeAnnualx10', 'realTimeAnnualx10', NULL, 'Multi-initialisations of real time annual start date ensemble', 'A multi-ensemble with ten initialisations for each start date in real time and ongoing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398418, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '23979639-5bb1-498a-aba3-8d35f4615292', 1, '2020-11-17 01:19:05.639745', true, '1950s O3 and Stratospheric H2O Concentrations', '1950sO3andStratosphericH2OConcentrations', NULL, '1950s Ozone and Stratospheric Water Vapour Concentrations Climatology', '1950s (10 year) climatology of ozone concentration data encompassing both the stratosphere and the troposphere and a stratospheric water vapour concentration data.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398376, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '468aa02f-b781-4a2c-a30b-6a83d89762d4', 1, '2020-11-17 01:19:05.639745', true, '3MemberAMIP', '3MemberAMIPEnsemble', NULL, '3 Member AMIP Ensemble', 'An ensemble of three simulations.  Initial conditions should be based on the AMIP simulation for 1st April 2000 if possible, though any suitable start dump may be used, noting that the first two months of the simulations will be ignored. The results are not expected to be particularly sensitive to the way in which ensemble members are generated, and any suitable method may be used but should be documented.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398377, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '1d5a3e78-816b-44dd-8f53-46b4b054454e', 1, '2020-11-17 01:19:05.639745', true, 'RCP26-overshoot Well Mixed GHG', 'RCP26overwmGHG', NULL, 'Representative Concentration Pathway 2.6 Overshoot Well Mixed Greenhouse Gases', 'Impose changing concentrations of RCP2.6-overshoot long-lived greenhouse gases, including CO2, N2O and halogenated gases.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398378, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '2694327e-b5fe-416f-951f-9e5817cbc905', 1, '2020-11-17 01:19:05.639745', true, 'The Flux-Anomaly-Forced Model Intercomparison Project (FAFMIP) contribution to CMIP6: investigation of sea-level and ocean climate change in response to CO2 forcing', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398379, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '248839be-eff7-4f5f-9eb6-2fdfb2ac2267', 1, '2020-11-17 01:19:05.639745', true, 'G7cirrusInitialisation', 'g7cirrusInitialisation', NULL, 'GeoMIP G7Cirrus Initialisation', 'Initialisation is made from the final year of the GeoMIP G7cirrus experiment', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398380, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', 'b480afd9-31fd-400c-9260-eb6b0ace3f8c', 1, '2020-11-17 01:19:05.639745', true, 'ssp370SST-lowAer', 'ssp370SST-lowAer', NULL, 'SSP3-7.0, prescribed SSTs, with low aerosol emissions', 'SSP-based RCP scenario following approximately RCP7.0 global forcing pathway but with reduced aerosol precursors (not NOx). SSP3 socioeconomic conditions. Atmosphere only with SST from experiment SSP3-70.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398381, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '27a2c3cb-47b5-4962-bc68-c95283d0f8ca', 1, '2020-11-17 01:19:05.639745', true, 'RCP26 Forcing Excluding Land Use', 'rcp26ForcingExcludingLandUse', NULL, 'Representative Concentration Pathway 2.6 W/m2 Forcing excluding land use', 'Impose RCP2.6 forcing excluding land use. Concentration driven.', NULL, NULL);
