INSERT INTO docs.tbl_document VALUES (398384, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '36b8469f-b8e0-4a9a-bae6-6aadb1552d88', 1, '2020-11-17 01:19:05.639745', true, 'AMIP SST', 'amipSST', NULL, 'Prescribed AMIP Sea Surface Temperature Boundary Condition', 'Apply AMIP sea surface temperature boundary conditions derived from observational data.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398385, 'cmip6', NULL, '--', 'cim.2.designing.Project', '36365e90-d132-4e88-86ea-e75bfab37aac', 1, '2020-11-17 01:19:05.639745', true, 'LUMIP', 'lumip', NULL, 'Land-Use Model Intercomparison Project', 'LUMIP is a suite of experiments focused on land use, including both idealized and realistic scenarios with and without transient land use.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398386, 'cmip6', NULL, '--', 'cim.2.designing.MultiEnsemble', '6099e385-4761-4713-a47f-a78c6a9fbd70', 1, '2020-11-17 01:19:05.639745', true, 'RCP85RCP34x3', 'rcp45rcp26x3', NULL, 'Multi-initialisations of RCP8.5 and RCP3.4 forcings', 'A multi-ensemble of six simulations with three realisations for each forcing scenario RCP8.5 and RCP3.4', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398387, 'cmip6', '<damip>', '--', 'cim.2.designing.NumericalExperiment', '75af4543-6153-4dfc-9dac-86169f0cd19f', 1, '2020-11-17 01:19:05.639745', true, 'ssp245-cov-fossil', 'ssp245-cov-fossil', NULL, '2-year Covid-19 emissions blip followed by increased emissions due to a fossil-fuel based recovery, based upon ssp245', 'Future scenario based on ssp245, but following a path of increased emissions due to a fossil-fuel rebound economic recovery from the Covid-19 pandemic restrictions. Concentration-driven. Branch from ssp245 at 1 Jan 2020 and run for 30 years with 10 ensemble members if possible.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398388, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'de31d594-d591-4ff6-ac77-5531b6bfd762', 1, '2020-11-17 01:19:05.639745', true, 'Overview of the Coupled Model Intercomparison Project Phase 6 (CMIP6) experimental design and organization', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398389, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'd537072d-b9c9-48d2-9dfb-65e66b3faeec', 1, '2020-11-17 01:19:05.639745', true, 'Easy Volcanic Aerosol (EVA v1.0): an idealized forcing generator for climate simulations', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398390, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '7b3931b4-13ae-4404-a707-38c189be8bd0', 1, '2020-11-17 01:19:05.639745', true, 'RCP70 Reduced Aerosols', 'ReducedRCP70aer', NULL, 'Reduced Representative Concentration Pathway 7.0 Aerosols', 'Impose changing concentrations of reduced RCP7.0 aerosols. Beginning in 2014 with air quality policies (or maximum feasible reductions) applied to the SSP3-7 NTCF emissions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398391, 'cmip6', NULL, '--', 'cim.2.designing.Project', '77c4c3a1-2870-438b-b044-0d9d0e31b109', 1, '2020-11-17 01:19:05.639745', true, 'RFMIP', 'rfmip', NULL, 'Radiative Forcing Model Intercomparison Project', 'RFMIP assess the accuracy of instantaneous radiative forcing calculations for greenhouse gases and aerosols in each model by comparing these to reference calculations across a range of states representative of present-day, past and future climates.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398392, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'fc6cef7d-73ea-4ae7-ba12-0c80f566debf', 1, '2020-11-17 01:19:05.639745', true, 'piSST-control SST plus patterned 4K derived from 4xCO2 monthly varying SST anomalies', 'piSST-controlPatternedSSTp4KFrom4xCO2', NULL, 'sstPi sea surface temperature patterned 4K increase derived from the 4xCO2 monthly varying sea surface temperature anomalies.', 'Impose a +4K warming pattern anomaly to the piSST-control SST.  The SST pattern anomaly is derived from years 91-140 of the model''s own abrupt4xCO2 experiment, with respect to the piControl, and scaled to have a global mean increase of 4K. The SST pattern anomaly is to be expressed as seasonally varying monthly means.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398393, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '632fceeb-456c-4d39-9bb2-271957f3336a', 1, '2020-11-17 01:19:05.639745', true, 'RCP85 Aerosols', 'RCP85aer', NULL, 'Representative Concentration Pathway 8.5 Aerosols', 'Impose changing emissions of RCP8.5 aerosols including BC and OC.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398394, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '9d1c55ce-08be-4991-af84-f59406c6936c', 1, '2020-11-17 01:19:05.639745', true, '2014 Anthropogenic Aerosol Precursors', '2014AnthropAerPre', NULL, '2014 anthropogenic aerosol precursor concentrations /  emissions', 'Impose present day (2014) anthropogenic aerosol precursor concentrations / emissions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398395, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '9870ab06-23d9-4add-b6e4-576e225cc00c', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP pre-industrial Arctic SIC', 'PAMIP-pi-arc-SIC-clim', NULL, 'PAMIP monthly mean climatology of pre-industrial Arctic sea ice concentration', 'Pre-industrial monthly mean cimatology of arctic sea ice concentration, data provided by PAMIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398419, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '6b043001-5468-4e0e-8933-fb6cb9aa5975', 1, '2020-11-17 01:19:05.639745', true, '1850 non-NOx Tropospheric Ozone Precursor Emissions', '1850nonNOxTropO3Pre', NULL, '1850 Emissions of non-NOx Tropospheric Ozone Precursors', 'Impose pre-industrial (1850) emissions of non-NOx tropospheric ozone precursors.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398396, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', '8dc38ae6-fde1-41f4-9aff-26747b76b2f9', 1, '2020-11-17 01:19:05.639745', true, 'piSST-pdSIC', 'piSST-pdSIC', '1.3', 'Atmosphere time slice with pre-industrial SST and present day SIC', 'Atmosphere-only time slice experiment forced by climatological monthly mean sea ice concentration (SIC) for the present day and pre-industrial sea surface temperature (SST).  Radiative forcing to be set to present day (year 2000) levels. Past SST will be computed from the ensemble of CMIP5 simulations by PAMIP. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398397, 'cmip6', '<volmip>', '--', 'cim.2.designing.NumericalExperiment', '25fdd79d-461b-477b-a628-6173814115b5', 1, '2020-11-17 01:19:05.639745', true, 'volc-pinatubo-strat', 'volc-pinatubo-strat', NULL, 'Pinatubo experiment with only long-wave forcing', '1991 Pinatubo forcing is expressed with a prescribed perturbation to the total (LW+SW) radiative heating rates. Maintain the same constant boundary forcing as the pre-industrial control integration, except for the volcanic forcing. Requires special diagnostics of parameterised and resolved wave forcings, radiative and latent heating rates. The experiment will not account for the actual climate conditions when the real event occured (e.g., presence and strength of additional forcing factors). Instead, the experiment is designed to span very different initial climate states to systematically assess uncertainties in the post-eruption behaviour that are related to background climate conditions. Sampling of an eastern phase of the Quasi-Biennial Oscillation (QBO), as observed after the 1991 Pinatubo eruption is preferred for those models that spontaneously generate such mode of stratospheric variability. Run at least 25 ensemble members for 3 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398398, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '1badc583-eb57-4b4a-87d2-fc58de273e75', 1, '2020-11-17 01:19:05.639745', true, '2014 Methane Concentration', '2014CH4', NULL, '2014 Methane Concentration', 'Impose 2014 concentration of Methane (CH4).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398399, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'bd7ab1ac-cae4-4e86-8bb9-96cb3bdf0202', 1, '2020-11-17 01:19:05.639745', true, 'Historical Nitrogen deposition', 'historicalNDep', NULL, 'Transient historical nitrogen deposition', 'Impose time varying (transient) historical nitrogen (N) deposition.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398400, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '0636c36c-2900-45e4-9f24-481c83714244', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Ice sheets', 'preIndIceSheet', NULL, 'Pre-industrial Ice Sheets', 'Impose pre-industrial (1850) ice sheets.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398401, 'cmip6', '<pmip>', '--', 'cim.2.designing.NumericalExperiment', '1995dbe6-d840-465d-9695-c27600e5f867', 1, '2020-11-17 01:19:05.639745', true, 'lgm', 'lgm', NULL, 'last glacial maximum', 'Impose Last Glacial Maximum (21 kyr ago) boundary conditions for ice-sheet and land-sea mask, the atmospheric concentration of well-mixed greenhouse gases and orbital parameters.  Run for at least 100 years after spin-up. It is mandatory that the model versions used for the PMIP-CMIP6 experiments are the exactly the same as for the other CMIP6 experiments, in particular the DECK and historical simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398402, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c417f62f-02de-4823-83a6-4abe18396a8e', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP present day SST for use with future Arctic SIC', 'PAMIP-pd-SST-clim-for-fut-arc-SIC', NULL, 'PAMIP monthly mean climatology of present day sea surface temperature for use with future Arctic sea ice concentration', 'Present day monthly mean cimatology of sea surface temperatue for use with future arctic sea ice. Data provided by PAMIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398403, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '10dc539d-c7cc-4dbc-b407-a557f4acae7a', 1, '2020-11-17 01:19:05.639745', true, 'High Resolution Ocean', 'highResOcean', NULL, 'High Resolution Ocean', 'Ocean resolution 0.25 degrees', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398404, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'bd854804-612f-4b86-80dd-8cb17fea74cc', 1, '2020-11-17 01:19:05.639745', true, 'Mid-Pliocene Ice Sheets', 'midPlioIceSheet', NULL, 'Ice sheets for the mid-Pliocene', 'Impose Mid-Pliocene Warm Period (3.2 Ma ago) ice sheets, smaller area than in the piControl.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398405, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '42ff6b7f-2255-41d0-9a73-19105798d785', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP present day SST for use with future Sea of Okhotsk SIC', 'PAMIP-pd-SST-clim-for-fut-okhotsk-SIC', NULL, 'PAMIP monthly mean climatology of present day sea surface temperature for use with future Sea of Okhotsk sea ice concentration', 'Present day monthly mean cimatology of sea surface temperatue for use with future Sea of Okhotsk sea ice. Data provided by PAMIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398406, 'cmip6', NULL, '--', 'cim.2.shared.Party', '25c176b5-1ca2-497b-b61e-6d2da77ca21f', 1, '2020-11-17 01:19:05.639745', true, 'Brian O''Neill', NULL, NULL, NULL, '', NULL, NULL);
