INSERT INTO docs.tbl_document VALUES (398410, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'dd4f8f09-43a2-44fd-ba92-54d1b305ee92', 1, '2020-11-17 01:19:05.639745', true, 'esmpiControlInit', 'esmpiControlInit', NULL, 'esm-piControl Initialisation', 'The ESM pre-industrial control experiment, esm-piControl, is intitialised from the ESM pre-industrial control spinup esm-piControl-spinup.', NULL, NULL);
