INSERT INTO docs.tbl_document VALUES (398413, 'cmip6', NULL, '--', 'cim.2.designing.Project', 'b9242236-acd8-44b6-8932-4ad0c6f9b36e', 1, '2020-11-17 01:19:05.639745', true, 'ISMIP6', 'ismip6', NULL, 'Ice Sheet Model Intercomparison Project for CMIP6', 'ISMIP6 repeats selected DECK experiments with coupled AOGCM-ISM (where the ice sheet is an interactive component of the AOGCM) and standalone ISM (where the ice sheet model is driven offline by output from either an uncoupled AOGCM or from a standard ISMIP6 dataset).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398414, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '2d3e6627-5f9a-4d58-a31f-bd1818658089', 1, '2020-11-17 01:19:05.639745', true, 'High Res HadISST2.2 Plus Uniform 4K', 'HighResHadISST2.2-p4k', NULL, 'High resolution HadISST2.2 data version 2.2 plus uniform 4K', 'Force with the high resolution (0.25 degree) daily HadISST2.2  sea surface temperature (SST) plus uniform 4K and daily HadISST2.2 sea ice concentration (SIC) data set.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398420, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'eadc8152-8409-402f-85ad-8779eef40462', 1, '2020-11-17 01:19:05.639745', true, '2100-2101 10yrs100', '10yrs2100-2101_yr100', NULL, '2100/01/01-2100/12/31', 'Idealised temporal constraint, repeating 2100 for 10 years, to coincide with the final year of the ScenarioMIP SSP5-85 experiment', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398421, 'cmip6', '<c4mip>', '--', 'cim.2.designing.NumericalExperiment', 'bd83c36e-8b04-4e60-8fa4-7c4dcc993b78', 1, '2020-11-17 01:19:05.639745', true, 'esm-bell-1000PgC', 'esm-bell-1000PgC', 'B1', 'emissions driven 1000 PgC bell-curve', 'Bell-shape zero emissions experiment. Run in emissions-driven configuration with CO2-only forcing, all non-CO2 forcing is fixed at pre-industrial levels. Use a bell-shaped CO2 emissions profile designed to give cumulative emissions of 1000 PgC after 100 years.  Then hold CO2 emissions at zero and simulate the subsequent reduction in CO2 and change in climate for at least 100 years (1000 years for EMICs).  The time series of global CO2 for the bell-shape emission profiles will be provided by ZECMIP via the C4MIP and CDRMIP websites.  A model decision is required on the spatial pattern of CO2 emissions, ZECMIP suggest globally uniform at surface.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398422, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c18f5e1c-4b19-47a7-a3c6-aa1c2efcde9e', 1, '2020-11-17 01:19:05.639745', true, '1850 NTCF Emissions', '1850NTCFEmissions', NULL, '1850 Emissions of Near Term Climate Forcers', 'Impose 1850 emissions of Near Term Climate Forcers (NTCF: tropospheric ozone and aerosols, and their precursors).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398423, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '83c1b0bf-34d5-4700-a8ea-177d9320f8e8', 1, '2020-11-17 01:19:05.639745', true, 'High Res HadISST2', 'HighResHadISST', NULL, 'High resolution HadISST data', 'Force with the high resolution (0.25 degree) daily HadISST data set with sea surface temperature (SST) and sea ice concentration (SIC).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398424, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', 'e4b84ccf-5644-46c5-b859-31a154c19802', 1, '2020-11-17 01:19:05.639745', true, 'dcppC-atl-control', 'dcppC-atl-control', 'C1.1', 'idealised atlantic control', 'Restore the north Atlantic sea surface temperature to the model control run climatology. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members. SST signal may also be imposed by altering surface fluxes.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398425, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'f99393ba-526b-4aef-81fc-968a2375cafa', 1, '2020-11-17 01:19:05.639745', true, 'Historical GHG concentrations for CMIP6 Historical Runs', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398426, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', 'a8c985de-82c2-4a4e-aa10-b880181a0c2a', 1, '2020-11-17 01:19:05.639745', true, 'pdSST-futBKSeasSIC', 'pdSST-futBKSeasSIC', '3.2', 'Atmosphere time slice with present day SST and future Barents and Kara Seas SIC', 'Atmosphere-only time slice experiment to investigate regional forcing. Time slice forced by climatological monthly mean sea surface temperature (SST) for the present day and future Arctic sea ice concentration (SIC) only in the Barents and Kara Seas. Radiative forcing to be set to present day (year 2000) levels. Future SIC will be computed from the ensemble of CMIP5 projections by PAMIP. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398427, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a1577e81-9cbd-422b-8d7d-077609a96bae', 1, '2020-11-17 01:19:05.639745', true, 'Solar RCP85 to RCP45', 'solarRCP85-RCP45', NULL, 'Solar irradiance reduction to reduce RCP8.5 forcing to RCP4.5 levels', 'Reduce solar irradiance to reduce the radiative forcing of ScenarioMIP high forcing scenario (SSP5-85) to match that of the ScenarioMIP medium forcing scenario (SSP2-45).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398428, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '46143148-87d9-4843-a37c-87c895c24cc6', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Tropospheric Ozone Concentrations', 'Pre-IndustrialTroposphereO3Concentrations', NULL, 'Pre-Industrial Tropospheric Ozone Concentrations', 'Tropospheric ozone should be fixed at 3D long-term monthly mean piControl values, with grid cells having an ozone concentration below 100 ppbv in the piControl climatology for a given month classed as tropospheric.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398880, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '3cdc1b9f-1acd-4147-9a13-9e25c9a097d8', 1, '2020-11-17 01:19:05.639745', true, 'Attribution of the spatial pattern of CO2-forced sea level change to ocean surface flux changes', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398429, 'cmip6', '<ls3mip>', '--', 'cim.2.designing.NumericalExperiment', '5378a31e-a362-4095-965d-885ff9a750f9', 1, '2020-11-17 01:19:05.639745', true, 'lfmip-pdLC', 'lfmip-pdLC', 'LFMIP-pdLC', 'prescribed land conditions (from current climate climatology) and initialized from "historical" run year 1980', 'Scenario forced experiment with prescribed land surface climatology derived from "present climate" conditions (1980-2014).  The experiment is comprised of transient coupled atmosphere-ocean simulations in which a selection of land surface characteristics is prescribed rather than interactively calculated in the model.  The "climatological" land surface forcing is calculated as the mean annual cycle in the period 1980-2014 from the historical GCM simulations. Additional ensemble members are requested with tier 2 priority.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398430, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'c0749379-efad-456e-90a7-4bb6d74e557a', 1, '2020-11-17 01:19:05.639745', true, '100yrsAfterSpinUp', '100yrsAfterSpinUp', NULL, '100 years after spin-up', 'Run for at least 100 years after spin-up, for use with paleoclimate experiments.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398431, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '354fd4b3-7150-4ffe-bf8c-7e31813d9ed0', 1, '2020-11-17 01:19:05.639745', true, 'High Med Low Radiative Forcing', 'HighMedLowRadiativeForcing', NULL, 'Three member ensemble of high, medium and low radiative forcing scenarios', 'An ensemble of three simulations forced high, medium and low radiative forcing scenarios.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398432, 'cmip6', '<highresmip>', '--', 'cim.2.designing.NumericalExperiment', '74155ce4-d9ab-4415-bc75-faacf273470a', 1, '2020-11-17 01:19:05.639745', true, 'hist-1950', 'hist-1950', NULL, 'coupled historical 1950-2014', 'Historical coupled ocean atmosphere simulations of the near past (1950-2014) at high and standard resolution.
INSERT INTO docs.tbl_document VALUES (398433, 'cmip6', NULL, '--', 'cim.2.shared.Party', 'e417e0ea-1ebc-4556-aad8-b61fe18793df', 1, '2020-11-17 01:19:05.639745', true, 'ISMIP6 email', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398434, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '93fa2f21-757e-46dd-9116-2c2f5f1663b9', 1, '2020-11-17 01:19:05.639745', true, 'rad-pd-piO3', 'rad-pd-piO3', NULL, 'RFMIP-IRF', 'Offline radiative transfer calculations of vertically-resolved broadband-integrated longwave and shortwave fluxes for present-day (2015) clear sky (aerosol-free) conditions with present day (2015) greenhouse gas concentrations and pre-industrial ozone (O3). Use specified atmospheric distributions of present day temperature and humidity and surface properties over many profiles.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398435, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '2487d58d-904e-4e6e-bc1d-b569cc6f4c8f', 1, '2020-11-17 01:19:05.639745', true, 'Historical Anthropogenic Aerosol', 'histAnthropAer', NULL, 'Historical anthropogenic aerosol forcing', 'Historical anthropogenic aerosol forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398436, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '75c79518-9485-4a26-8e06-9d98d17a4515', 1, '2020-11-17 01:19:05.639745', true, 'The Met Office Hadley Centre Sea Ice and Sea Surface Temperature data set, version 2, part 3: the combined analysis', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398437, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd7dde2c8-7056-4567-af84-4c0dea7234e3', 1, '2020-11-17 01:19:05.639745', true, 'AMIP II GHG with 4xCO2', 'AMIPIIGHG4xCO2', NULL, 'AMIP II radiatively active trace gases with CO2 quadrupled', 'Radiatively active trace gases are well-mixed with mixing ratios following the AMIP II recommendations but with CO2 concentration quadrupled: CO2: 4 x 348 ppmv; CH4: 1650 ppbv; N2O: 306 ppbv; Halocarbon yield of approximately 0.24 W m-2 radiative forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398438, 'cmip6', '<c4mip>,<cdrmip>', '--', 'cim.2.designing.NumericalExperiment', '11dccbc0-5208-4407-840e-711d8dc586f1', 1, '2020-11-17 01:19:05.639745', true, 'esm-ssp585', 'esm-ssp585', NULL, 'update of emission-driven RCP8.5 based on SSP5', 'Emission driven future scenario (SSP-based RCP SSP5-8.5) up to 2100. Starting conditions taken from emissions-driven Historical simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398439, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '24673d89-3de0-4a17-ab32-63e5dcef0a22', 1, '2020-11-17 01:19:05.639745', true, 'rad-pd-future', 'rad-pd-future', NULL, 'RFMIP-IRF', 'Offline radiative transfer calculations of vertically-resolved broadband-integrated longwave and shortwave fluxes for present-day (2015) clear sky (aerosol-free) conditions with future well-mixed greenhouse gases (WMGHG) based on RCP8.5 at 2100. Use specified atmospheric distributions of present day temperature and humidity and surface properties over many profiles.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398440, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '45cc1443-ec38-4c55-8096-c108daeba6df', 1, '2020-11-17 01:19:05.639745', true, 'SSP534-over-bgc-Initialisation', 'ssp534-over-bgc-Initialisation', NULL, 'SSP5-3.4 Overshoot BGC Initialisation', 'Initialisation is from the end of the ssp534-over-bgc experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398441, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '31852cd6-8975-4e6a-944f-9dd53e507ff7', 1, '2020-11-17 01:19:05.639745', true, 'Calculate Pre-Industrial CO2 Concentration', 'CalcPreIndustrialCO2', NULL, 'Calculate Pre-Industrial Carbon Dioxide (CO2) Concentration', 'Pre-Industrial CO2 concentrations are calculated and anthropogenic sources of CO2 are prescribed. For models that can calculate atmospheric CO2 concentration and account for the fluxes of CO2 between the atmosphere, the ocean, and biosphere. The atmospheric CO2 concentration should be representative of Earth around the year 1850.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398442, 'cmip6', NULL, '--', 'cim.2.designing.Project', '946932cc-6e96-4a9d-8c31-c5b09aa988c5', 1, '2020-11-17 01:19:05.639745', true, 'ScenarioMIP', 'scenariomip', NULL, 'Scenario Model Intercomparison Project', 'ScenarioMIP simulates climate outcomes based on alternative plausible future scenarios.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398443, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '6ec72eab-a504-4834-9ac4-59bf4afd343b', 1, '2020-11-17 01:19:05.639745', true, 'RCP45 CO2', 'rcp45co2', NULL, 'RCP 4.5 carbon dioxide', 'RCP4.5 carbon dioxide concentrations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398444, 'cmip6', NULL, '--', 'cim.2.shared.Party', '95f8f699-414b-41f3-b4ba-5e66eddc0af8', 1, '2020-11-17 01:19:05.639745', true, 'Sandy Harrison', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398445, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '1057e2f5-0614-4737-8173-fcf65c6efc39', 1, '2020-11-17 01:19:05.639745', true, '1000PgC-Initialisation', '1000PgC-Initialisation', NULL, 'Initialise from the 1pctCO2 or esm-1pctCO2 simulation when carbon concentrations reach 1000 PgC', 'Initialise from the 1pctCO2 or esm-1pctCO2 simulation when cumulative carbon concentrations reach 1000 PgC.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398446, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '22aa7a87-9207-4042-87b1-0b9d5d731aa4', 1, '2020-11-17 01:19:05.639745', true, 'Datasets and protocol for the CLIVAR WGOMD Coordinated Ocean-ice Reference Experiments (COREs)', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398447, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e9a3a638-b550-45a7-ae61-48ab4e982db8', 1, '2020-11-17 01:19:05.639745', true, 'ISMIP6-specified Historical input', 'ISMIP6historicalInput', NULL, 'ISMIP6-specified input from an AOGCM historical experiment', 'ISMIP6-specified input from the output of an AOGCM historical climate forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398448, 'cmip6', '<damip>', '--', 'cim.2.designing.NumericalExperiment', 'cc05cd12-5b3a-4e54-9ea9-d23b9840d104', 1, '2020-11-17 01:19:05.639745', true, 'ssp245-cov-strgreen', 'ssp245-cov-strgreen', NULL, '2-year Covid-19 emissions blip followed by strong-green stimulus recovery, based upon ssp245', 'Future scenario based on ssp245, but following a path of reduced emissions due to a strong-green stimulus economic recovery from the Covid-19 pandemic restrictions. Concentration-driven. Branch from ssp245 at 1 Jan 2020 and run for 30 years with 10 ensemble members if possible.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399308, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '7954ce3f-b1d7-479c-8f58-006e283c51c4', 1, '2020-11-17 01:19:05.639745', true, 'Technical note for DCPP-Component C. I. Definition of the Anomalous Sea Surface Temperature patterns.', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398449, 'cmip6', NULL, '--', 'cim.2.designing.Project', '65662d6c-1de0-4af4-8a77-9f57a54fddf9', 1, '2020-11-17 01:19:05.639745', true, 'AerChemMIP', 'aerchemmip', NULL, 'Aerosols and Chemistry MIP', 'The Aerosol Chemistry Model Intercomparison Project (AerChemMIP) is endorsed by the Coupled-Model Intercomparison Project 6 (CMIP6) and is designed to quantify the climate and air quality impacts of aerosols and chemically-reactive gases. These are specifically near-term climate forcers (NTCFs: methane, tropospheric ozone and aerosols, and their precursors), nitrous oxide and ozone-depleting halocarbons.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398510, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '2efdbba3-1397-4fe5-ba02-7af8c9d73a74', 1, '2020-11-17 01:19:05.639745', true, '2010 CO2 Concentration', '2010CO2', NULL, 'CO2 Concentration held fixed at 2010 level', 'Global annual mean CO2 concentration held fixed at 389 ppm, this represents 2010 CO2 concentration.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398511, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '9362a0d5-041d-424a-8d56-b4fcbaac0b1d', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial CO2 Concentration', 'PreIndustrialCO2', NULL, 'Pre-Industrial Carbon Dioxide (CO2) Concentration', 'Constant pre-industrial Carbon Dioxide (CO2) concentration. The CO2 concentration should be representative of Earth around the year 1850.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398512, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '02bb3aad-3224-4535-9bfe-29d4856cb0ba', 1, '2020-11-17 01:19:05.639745', true, 'PreIndustrialInitialisation', 'PreIndustrialInitialisation', NULL, 'Pre-Industrial Initialisation', 'Initialisation from a January in the pre-industrial control simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398513, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'a4e5ad7c-c275-4c64-ba08-c1f591ea5121', 1, '2020-11-17 01:19:05.639745', true, 'BGCTracerMillennialSpinUp', 'BGCTracerMillennialSpinUp', NULL, 'Millennial-scale spin-up of biogeochemical tracers', 'Initialise ocean biogeochemistry with model tracer fields that have been spun up for at least 2000 years, ideally for 5000 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398545, 'cmip6', '<c4mip>', '--', 'cim.2.designing.NumericalExperiment', '8cf588f6-7988-4ede-bed1-d41c2a7a7fa5', 1, '2020-11-17 01:19:05.639745', true, '1pctCO2Ndep-bgc', '1pctCO2Ndep-bgc', NULL, 'biogeochemically-coupled version of 1 percent per year increasing CO2 experiment with increasing N-deposition', 'Biogeochemically-coupled concentration driven 1% per year increasing CO2 up to 4XCO2 simulation. CO2 increase only affects carbon cycle models, radiative code sees pre-industrial CO2.  With time varying anthropogenic nitrogen deposition.  Only applicable to models whose simulation will be affected by the deposition of reactive nitrogen either due to terrestrial or marine nitrogen cycle effects on carbon fluxes and store.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398450, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'fa9c831f-108a-4491-a199-158de3f96dcd', 1, '2020-11-17 01:19:05.639745', true, 'SSP5 RCP34-extension-overshoot Land Use', 'RCP34extoverland', NULL, 'Representative Concentration Pathway 3.4 extension Overshoot Land Use for Shared Socioeconomic Pathway 5', 'Impose changing RCP3.4 extension overshoot land use including crops, pasture, urban area, vegetation and forest for SSP5.  
INSERT INTO docs.tbl_document VALUES (398451, 'cmip6', '<aerchemmip>,<c4mip>,<cdrmip>,<cmip>,<damip>,<dcpp>,<gmmip>,<highresmip>,<ismip6>,<ls3mip>,<lumip>,<pamip>,<rfmip>,<volmip>', '--', 'cim.2.designing.NumericalExperiment', '713f15b6-e289-44e9-ba74-0d0e827e42ac', 1, '2020-11-17 01:19:05.639745', true, 'historical', 'historical', NULL, 'all-forcing simulation of the recent past', 'Simulation of recent past (1850 to 2014). 
INSERT INTO docs.tbl_document VALUES (398452, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '093eedec-de64-43b1-8ac9-05c9c8da0a7d', 1, '2020-11-17 01:19:05.639745', true, 'NH Eruption SO2', 'NHEruptionSO2', NULL, 'SO2 emissions for a large Northern Hemisphere eruption', 'Emission of 28.1 Tg of SO2 into the northern hemisphere stratosphere (60N).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398453, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '62ba8f21-87bd-4a9c-9b6e-969465a1e808', 1, '2020-11-17 01:19:05.639745', true, 'Mid-Pliocene Land Sea Mask', 'midPlioLandSeaMask', NULL, 'Land sea mask for the Mid-Pliocene', 'Impose Mid-Pliocene Warm Period (3.2 Ma ago) land-sea mask.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398454, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '044abc89-d863-4429-b8c5-e8e295817683', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP future Antarctic SIT', 'PAMIP-fut-ant-SIT-clim', NULL, 'PAMIP monthly mean climatology of future Antarctic sea ice thickness', 'Future monthly mean climatology of Antarctic sea ice thickness, data provided by PAMIP.  If sea ice thickness cannot be specified then it should be left free to evolve in the coupled model experiments.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398455, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', 'f8701e94-511b-43c3-96c4-250f854e3da9', 1, '2020-11-17 01:19:05.639745', true, 'amip-lwoff', 'amip-lwoff', NULL, 'AMIP SSTs with longwave cloud-radiative effects off', 'Continuation of CFMIP-2 AMIP experiments and CMIP5 experiment 3.3.   
INSERT INTO docs.tbl_document VALUES (398456, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'fe6ba35b-8232-48e5-999d-f5dfd85a6726', 1, '2020-11-17 01:19:05.639745', true, 'ssp245-cov-GHG Short Lived Species', 'ssp245-cov-GHGSLS', NULL, 'ssp245-cov-GHG Short Lived Species', 'ssp245-cov-GHG short lived species: BC, CO, OC, SO2, NH3, NOx, NMVOCs', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398457, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', '5b5aac88-e61e-424a-9823-b6d2433d91a6', 1, '2020-11-17 01:19:05.639745', true, 'amip-climSIC', 'amip-climSIC', '5.2', 'AMIP with climatological SIC', 'Atmosphere-only transient experiment. Repeat CMIP6 AMIP (1979-2014) but with climatological monthly mean sea ice concentration (SIC) provided by PAMIP. Prescribe historical sea surface temperature (SST) as used in the AMIP experiment.  Other conditions as in the CMIP6 Historical simulation. Minimum ensemble size is 3 simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398458, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd951e731-e559-4767-b6ad-4a2d2a2ef392', 1, '2020-11-17 01:19:05.639745', true, '1950s Proton Forcing', '1950sProtonForcing', NULL, '1950s Proton Forcing Climatology', '1950s (10 year) climatology of solar proton forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398459, 'cmip6', '<lumip>', '--', 'cim.2.designing.NumericalExperiment', '9b74864c-be8d-401d-9b32-7583acfce643', 1, '2020-11-17 01:19:05.639745', true, 'land-cClim', 'land-cClim', NULL, 'historical land-only constant climate', 'Land surface model simulation.  Same as land-hist except with climate held constant. Branch from end of land-hist spin-up period and continue with spin-up forcing looping over the first 20 years of meteorological forcing data.  Use the same land model configuration as used in the coupled CMIP6 historical simulations. Include representation of land cover, land use and land management. All applicable land use features should be active. Start year either 1850 or 1700 depending on standard practice for particular model. 
INSERT INTO docs.tbl_document VALUES (398460, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'e4cd3c5e-28d5-40f8-a2a8-c59a55b547f7', 1, '2020-11-17 01:19:05.639745', true, '2010 Solar Particle Forcing', '2010SolarParticleForcing', NULL, '2010 Solar Particle Forcing', '2010 solar particle forcing. For models with interactive stratospheric chemistry.  Proton forcing: HOx and NOx production by solar protons. Electron forcing:  Kp- or Ap-index to describe ionisation from electron precipitation in the lower thermosphere and upper mesosphere. Cosmic ray forcing:  ion-pair production by galactic cosmic rays.  CMIP6 models that do not have interactive chemistry should  prescribe the CMIP6 recommended ozone forcing data set.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398461, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '897d0c29-c639-4be1-b782-3266a87ba61c', 1, '2020-11-17 01:19:05.639745', true, '1850 Non-Reactive WMGHG Concentrations', '1850NonReactiveWMGHGconcentrations', NULL, '1850 non-chemically reactive Well Mixed Greenhouse Gas (WMGHG) Concentrations', 'Impose pre-industrial (1850) non-chemically reactive Well Mixed Greenhouse Gas (WMGHG) concentrations.  No methane, nitrous oxide or halocarbons.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398462, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e6f52b84-3b84-4a79-a858-2c5bbba58210', 1, '2020-11-17 01:19:05.639745', true, 'SSP5-85 SST 2100', 'SSP5-85SST2100', NULL, 'SSP5-8.5 Sea Surface Temperature for the year 2100', 'Sea surface temperature climatology calculated from the ScenarioMIP SSP5-85 experiment for the year 2100.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398463, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'a6fb4dbe-450d-4d4d-a7ed-1d31f7976fd3', 1, '2020-11-17 01:19:05.639745', true, 'FourMember', 'FourMemberEnsemble', NULL, 'Four Member Ensemble', 'An ensemble of four simulations', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398464, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '87f354ef-eacf-4f50-be8b-d9ff18eb245f', 1, '2020-11-17 01:19:05.639745', true, '2014-2049 36yrs', '36yrs2014-2049', NULL, '2014/01/01-2050/01/01', 'Scenario, from 2014 to the mid 21st century.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398465, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b29cbdb4-4fbc-4095-b1f9-cf7544086e1d', 1, '2020-11-17 01:19:05.639745', true, 'RCP45 Short Lived Gas Species', 'RCP45sls', NULL, 'Representative Concentration Pathway 4.5 Short Lived Gas Species', 'Impose changing emissions of RCP4.5 short lived gas species including CH4, NOx, VOCs and CO.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398466, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '378ee53a-7973-46f1-a794-5f56952b906d', 1, '2020-11-17 01:19:05.639745', true, 'Southern Ocean Model Intercomparison Project (SOMIP)', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398467, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '5c547f4d-1743-4f99-a069-5866aba1e379', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP future Arctic SIT', 'PAMIP-fut-arc-SIT-clim', NULL, 'PAMIP monthly mean climatology of future Arctic sea ice thickness', 'Future monthly mean climatology of Arctic sea ice thickness, data provided by PAMIP.  If sea ice thickness cannot be specified then it should be left free to evolve in the coupled model experiments.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398468, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '82dbd4b5-0e8d-4a49-8c08-00682d6fa226', 1, '2020-11-17 01:19:05.639745', true, 'RCP34-extension overshoot Well Mixed GHG', 'RCP3.4extoverwmGHG', NULL, 'Representative Concentration Pathway 3.4 extension Overshoot Well Mixed Greenhouse Gases', 'Impose changing concentrations of RCP3.4 extension overshoot long-lived greenhouse gases, including CO2, N2O and halogenated gases.  The negative CO2 emissions level reached in 2100 by SSP5-3.4 remain constant at that level to 2150 and then increase linearly to zero by 2250.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398469, 'cmip6', '<volmip>', '--', 'cim.2.designing.NumericalExperiment', '514088d8-aac2-4793-9c48-fce4c85d0491', 1, '2020-11-17 01:19:05.639745', true, 'volc-long-hlN', 'volc-long-hlN', NULL, 'Idealized Northern Hemisphere high-latitude eruption emitting 28.1 Tg of SO2', 'Idealised high-latitude (60N) northern hemisphere eruption corresponding to an initial emission of 28.1 Tg of SO2 (equal to half the total amount injected for volc-long-eq).  volc-long-hlN is not directly comparable to the 1783–84 Laki eruption since it does not try to reproduce the very specific characteristics of Laki. The experiment is designed to span very different initial climate states to systematically assess uncertainties in post-eruption behaviour that are related to background climate conditions.  If, for instance, year Y of the control integration matches the desired conditions for the initial condition sampling, then the corresponding VolMIP simulation should start with restart data from year Y-1 of the control.  Run nine ensemble members for at least 20 years, but preferably longer (50 years) to cover the multi-decadal oceanic response. Initialisation date from the piControl start year is 1st April.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398470, 'cmip6', '<ismip6>', '--', 'cim.2.designing.NumericalExperiment', '6b164a59-2373-4f6d-b1c1-ea0a9b6a9302', 1, '2020-11-17 01:19:05.639745', true, '1pctCO2-4xext', '1pctCO2-4xext', NULL, 'extension from year 140 of 1pctCO2 with 4xCO2', 'Branched from the 1pctCO2 simulation at year 140 and run with CO2 fixed at 4x pre-industrial concentration.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398471, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'bbbc970d-6961-4a9d-98ee-f459f3b139b6', 1, '2020-11-17 01:19:05.639745', true, '1950s Land Use', '1950sLandUse', NULL, '1950s Land Use', '1950s (10 year) mean global gridded land-use forcing data.  This new generation of “land use harmonization” (LUH2) builds upon past work from CMIP5, and includes updated inputs, higher spatial resolution, more detailed land-use transitions, and the addition of important agricultural management layers.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398472, 'cmip6', '<ismip6>', '--', 'cim.2.designing.NumericalExperiment', '66be373b-7bbe-4faf-a8e2-b324b4a34611', 1, '2020-11-17 01:19:05.639745', true, 'ssp585-withism', 'ssp585-withism', NULL, 'SSP5-85 scenario with interactive ice sheets', 'ScenarioMIP SSP5-85 forcing in a model with interactive ice sheets. 
INSERT INTO docs.tbl_document VALUES (398473, 'cmip6', NULL, '--', 'cim.2.shared.Party', 'cba2e6ec-0654-423c-9170-eace2513f216', 1, '2020-11-17 01:19:05.639745', true, 'Chris Bretherton', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398474, 'cmip6', NULL, '--', 'cim.2.shared.Party', '34432edf-616c-4e99-a4bd-6faa76c9057e', 1, '2020-11-17 01:19:05.639745', true, 'James Screen', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398475, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '7e7e4aac-f280-403d-9f31-1441e0fe9a2b', 1, '2020-11-17 01:19:05.639745', true, 'AGCM Configuration', 'AGCMConfiguration', NULL, 'Atmosphere General Circulation Model Configuration', 'An Atmosphere only general circulation model configuration.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398476, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '73ebd884-2df3-40d4-82ec-5edca0db9fe9', 1, '2020-11-17 01:19:05.639745', true, '2040-2099 60 yrs', '60yrs2040-2099', NULL, '2040/01/01-2100/01/01', 'Scenario, from 2040 to the end of the 21st century.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398477, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'adf9442b-9213-43cc-b7a0-b52730334e21', 1, '2020-11-17 01:19:05.639745', true, 'Present Day 2005-2014 SST Climatology', 'PDSSTClim', NULL, 'Present day (2005-2014) sea surface temperature climatology calculated from the model''s own historical simulation.', 'Present day sea surface temperature (SST) calculated from a 2005-2014 climatology of the model''s own CMIP6 historical simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398478, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '9fcaf315-89b8-45fd-8974-b63679134c32', 1, '2020-11-17 01:19:05.639745', true, 'past1000 Solar Variability', 'past1000SolarVar', NULL, 'Solar variability in the last millennium', 'Solar variability (TSI and SSI) in the last millennium 850-1850.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398479, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', 'e30efbfb-c593-45c5-93ce-aee32e15dc78', 1, '2020-11-17 01:19:05.639745', true, 'piClim-2xdust', 'piClim-2xdust', NULL, 'pre-industrial climatolgical SSTs and forcing, but with doubled emissions of dust', 'Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases). The dust aerosol emission fluxes in the interactive parameterisation are double their pre-industrial value.  All other NTCF (near term climate forcers) are set to pre-industrial levels. For models that do not interactively parameterise particular emissions, the fluxes from the 1850 climatological dataset should be doubled. This is a timeslice experiment of 30 years total.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398528, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '8a43908d-3f0d-4cc0-9556-a93aff7215e4', 1, '2020-11-17 01:19:05.639745', true, '1850 non-Fire Aerosol Emissions', '1850nonFireAer', NULL, '1850 emissions of non-Fire Aerosols', 'Impose pre-industrial (1850) emissions of non-fire aerosols.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398529, 'cmip6', NULL, '--', 'cim.2.shared.Party', '38edaaec-d0d5-410e-b953-a86db6c87b24', 1, '2020-11-17 01:19:05.639745', true, 'George Boer', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398480, 'cmip6', '<highresmip>', '--', 'cim.2.designing.NumericalExperiment', '21ec48bc-97be-4ccb-aa23-0f9b3685b235', 1, '2020-11-17 01:19:05.639745', true, 'control-1950', 'control-1950', NULL, 'coupled control with fixed 1950''s forcing (HighResMIP equivalent of pre-industrial control)', 'The HighResMIP equivalent of the pre-industrial control with fixed 1950s forcing.  The forcing consists of greenhouse gases, including ozone and aerosol loading for a 1950s (~10 year mean) climatology.  For optimal comparison between models, aerosol concentrations are recommended (rather than emissions).
INSERT INTO docs.tbl_document VALUES (398481, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'be900316-b675-46cc-bb19-d356ef3a996b', 1, '2020-11-17 01:19:05.639745', true, 'Pasture', 'pasture', NULL, 'Grazing on Pasture', 'Grazing on pasture.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398482, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'a0864167-50f4-4901-8a9e-b5dc99e00a37', 1, '2020-11-17 01:19:05.639745', true, 'mid1990sAnnual', 'mid1990sannual', NULL, 'mid-1990s Annual', 'Start dates from the end of 1993, 1994, 1995, 1996.  Start date on or before 31st December, start dates on or before 15th November recommended to allow for DJF seasonal forecast results.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398483, 'cmip6', NULL, '--', 'cim.2.shared.Party', '55eb5721-b6f5-4d78-8c6c-9ba03327a057', 1, '2020-11-17 01:19:05.639745', true, 'Peter Good', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398484, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'e0d24abf-073d-4b68-8000-5a4c6f2519a3', 1, '2020-11-17 01:19:05.639745', true, 'DCPPB1Initialisation', 'dcppB1Initialisation', NULL, 'Initialisation from the end of DCPP B1 simulations', 'Initialisation from the end of DCPP B1 simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398533, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '44945cdc-e8a6-4092-ae92-d69fcb1856d8', 1, '2020-11-17 01:19:05.639745', true, 'Future Surface Properties', 'FutureSurfaceProps', NULL, 'Future surface properties', 'Specified surface properties for future conditions based on RCP8.5 at 2100.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398485, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '2d18a0b0-4bb0-4569-9381-b58a6dcebae5', 1, '2020-11-17 01:19:05.639745', true, 'WFDEI recycling of climate mean and variability', 'WFDEIRecycleClimateMeanAndVariability', NULL, 'WFDEI recycling of climate mean and variability from the forcing dataset', 'Recycling of the climate mean and variability from two decades (1901-1920) of the WFDEI dataset (WATCH Forcing Data methodology applied to ERA-Interim reanalysis data).  The recycled variables are the forcing variables needed to drive an offline land module. So these are wind speed in two directions at 10m height, atmosphere temperature and humidity at 2m height, incoming shortwave and longwave radiation, incoming rainfall and snowfall, surface pressure.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398486, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a3537ef1-4a4c-49a3-96b1-7165095758c3', 1, '2020-11-17 01:19:05.639745', true, 'RFMIP historical Aerosols', 'RFMIPhistoricalAerosols', NULL, 'RFMIP specified aerosols for the historical period', 'Historical aerosol optical properties including cloud-radiation interactions prescribed by RFMIP.  An analytically-described spatial pattern with time-constant spectral variation and time-varying strength (building on the Easy Aerosol experience).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398487, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'be317438-679e-45a6-bec5-1291c354144c', 1, '2020-11-17 01:19:05.639745', true, 'Historical SST', 'HistoricalSST', NULL, 'Historical Transient Sea Surface Temperature', 'Time-evolving monthly sea surface temperature (SST) taken from a coupled historical simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398488, 'cmip6', '<lumip>', '--', 'cim.2.designing.NumericalExperiment', '754a137e-824d-4163-a001-90e216813154', 1, '2020-11-17 01:19:05.639745', true, 'land-crop-noIrrig', 'land-crop-noIrrig', NULL, 'historical land-only with no irrigation', 'Land surface model simulation.  Same as land-hist except with irrigated area held at 1850 levels. Irrigation amounts within the 1850 irrigated area are allowed to change. Only relevant if land-hist utilises at least some form of crop management (e.g. planting and harvesting).  Start year either 1850 or 1700 depending on standard practice for particular model.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398489, 'cmip6', NULL, '--', 'cim.2.shared.Party', '1c3d01af-a1b9-4571-82be-0384d8182178', 1, '2020-11-17 01:19:05.639745', true, 'Andrew Lenton', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398490, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '1aac541d-6473-42f9-b06e-71dc5d41d920', 1, '2020-11-17 01:19:05.639745', true, 'CORE2 Air-Sea Fluxes', 'CORE2air-seaFluxes', NULL, 'CORE2 air-sea fluxes', 'Five/six repetitions of the CORE-II air–sea fluxes of momentum, heat, freshwater and their components which cover the 62-year period from 1948-2009.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398491, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '0dfb6ce7-de2d-4f2a-92d2-46c01c112b98', 1, '2020-11-17 01:19:05.639745', true, '2014 O3x2', '2014O3x2', NULL, '2014 ozone x 2', 'Impose present day (2014) ozone concentrations scaled by 2.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398492, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ca72396a-ccc6-4f94-9587-977f92f5e478', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Land Use', 'PreIndustrialLandUse', NULL, 'Pre-Industrial Land Use', 'Constant pre-industrial (1850) land-use forcing. Land use should not change in the control run and should be fixed according to reconstructed agricultural maps from 1850.  Due to the diversity of model approaches in Earth System Models for land carbon, some groups might deviate from this specification, this must be clearly documented.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398493, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '3878de1c-b091-460f-81c7-4108faba20dc', 1, '2020-11-17 01:19:05.639745', true, 'Development of a 50-Year High-Resolution Global Dataset of Meteorological Forcings for Land Surface Modeling', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398534, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '24a79d4a-8870-4f5f-a3ee-e37665740d35', 1, '2020-11-17 01:19:05.639745', true, 'Historical Transient Fertilisation', 'transientFertilisation', NULL, 'Transient historical Fertilisation', 'Historical transient fertilisation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398535, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '86e1ddc1-9761-4908-923e-bcf96c7da994', 1, '2020-11-17 01:19:05.639745', true, 'Historical land use except with 1850 wood harvest', 'historicalLandUse1850WoodHarvest', NULL, 'historical land use except with 1850 wood harvest', 'Historical land use except maintain 1850 wood harvest amounts/areas. Wood harvest due to land deforestation for agriculture should continue yielding non-zero anthropogenic product pools.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398536, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e77c89bb-cadc-4fa8-9ab5-a4f7c4b81ea1', 1, '2020-11-17 01:19:05.639745', true, 'RCP85-extension Aerosols', 'RCP85extaer', NULL, 'Representative Concentration Pathway 8.5 Extension Aerosols', 'Impose changing emissions of RCP8.5 extension aerosols including BC and OC.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398537, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'e7410b15-9d66-434e-b036-4c59d0f1885c', 1, '2020-11-17 01:19:05.639745', true, 'Biogeochemical Coupling', 'BiogeochemicalCoupling', NULL, 'Biogeochemical coupling with carbon cycle', 'Biogeochemical coupling with carbon cycle', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398538, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '96f3bc9c-f253-438b-90f7-8a23d77dfa7f', 1, '2020-11-17 01:19:05.639745', true, 'Climate Model Intercomparisons: Preparing for the Next Phase', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398539, 'cmip6', NULL, '--', 'cim.2.shared.Party', '4949de74-aed7-4637-894c-d2655011465f', 1, '2020-11-17 01:19:05.639745', true, 'Hervé Douville', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398540, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '60df1e33-39a1-4454-a1da-2dfe90a63f60', 1, '2020-11-17 01:19:05.639745', true, 'Emissions changes in 2020 due to Covid19', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398530, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '403f5e25-27a7-4182-a305-a4ce2eade4c1', 1, '2020-11-17 01:19:05.639745', true, 'RCP45 Aerosol Precursors', 'RCP45aerpre', NULL, 'Representative Concentration Pathway 4.5 Aerosol Precursors', 'Impose changing emissions of RCP4.5 aerosol precursors including SO2 and NHy.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398541, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '2e3b10e8-89f6-4eb4-8603-862c736386d4', 1, '2020-11-17 01:19:05.639745', true, 'TIP 500 No Sensible Heat', 'TIP500NoSH', NULL, 'Tibetan Plateau sensible heat flux to atmosphere is zero above 500m', 'Modify the surface sensible heat flux of the Tibetan Plateau (TIP).  The sensible heating on topography is removed (by setting the vertical diffusive heating term in the atmospheric thermodynamic equation to zero) where the topography is above 500m in the following regions: 35°-45°N, 25°-50°E; 30°-35°N, 40°-50°E; 20°-45°N, 50°-70°E; 15°-45°N, 70°-110°E.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398542, 'cmip6', NULL, '--', 'cim.2.shared.Party', 'cc6e22d0-e708-4556-b985-228125d81dc8', 1, '2020-11-17 01:19:05.639745', true, 'Malcolm Roberts', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398543, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c398d65c-4074-4b8b-8ec7-849a06d82195', 1, '2020-11-17 01:19:05.639745', true, 'RCP70 Short Lived Gas Species', 'RCP70sls', NULL, 'Representative Concentration Pathway 7.0 Short Lived Gas Species', 'Impose changing emissions of RCP7.0 short lived gas species including CH4, NOx, VOCs and CO.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398544, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '0d337e18-6df7-46df-be20-d54eb8f5716e', 1, '2020-11-17 01:19:05.639745', true, 'Stratospheric Aerosol Data Set (SADS Version 2) Prospectus', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398546, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'bec9906f-e9e8-410d-aaa2-625f50ebf467', 1, '2020-11-17 01:19:05.639745', true, 'Impose SST clim Pacific', 'ImposeSSTclimPacific', NULL, 'Impose model climatology sea surface temperature in the Pacific', 'Alter surface fluxes to impose model control climatology Sea Surface Temperatures (SSTs) over the Pacific (15S-25N). No SST modification if sea ice is present. For groups that are unable to restore SSTs.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398547, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a8297b3d-f33f-4aa4-af92-c0f085fa94d1', 1, '2020-11-17 01:19:05.639745', true, 'RCP70ReducedMethane', 'ReducedRCP70CH4', NULL, 'Reduced RCP7.0 Methane', 'Impose reduced RCP7.0 methane (CH4) emissions.  Beginning in 2014 with air quality policies (or maximum feasible reductions) applied to the SSP3-70 methane NTCF emissions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398494, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'f591c9d6-008a-4342-b8e0-450cfc43c2fd', 1, '2020-11-17 01:19:05.639745', true, '1pctCO2 Heat Flux Anomaly At Doubling', '1pctCO2HeatFluxAtDoubling', NULL, '1pctCO2 ensemble mean surface heat flux anomaly at time of CO2 doubling', 'Impose heat flux anomalies to the ocean surface, created from the CMIP5 diagnostic of surface downward heat flux in sea-water (hfds).  The surface heat-flux anomalies are calculated from the ensemble mean of the CMIP5 1pctCO2 simulations at the time of CO2 doubling.  Surface flux anomalies (a function of longitude, latitude and time of year) are to remain constant throughout the experiment.  Note that the fluxes themselves are not replaced because this would typically cause a very large climate drift and possible instability.  The method for implementing the heat flux anomaly should follow that used by Bouttes and Gregory (2014).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398495, 'cmip6', '<lumip>', '--', 'cim.2.designing.NumericalExperiment', '97d57509-4d60-4e38-afb4-c0bb7152404b', 1, '2020-11-17 01:19:05.639745', true, 'land-noShiftCultivate', 'land-noShiftCultivate', 'land-noShiftcultivate', 'historical land-only with shifting cultivation turned off', 'Land surface model simulation. Same as land-hist except shifting cultivation turned off. (i.e. with net transitions instead of gross).  Start year either 1850 or 1700 depending on standard practice for particular model.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398496, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '64a02c1d-af88-4d67-a4b7-825104093e13', 1, '2020-11-17 01:19:05.639745', true, 'Add 100 Gt Carbon', 'add100GtC', NULL, 'Instantly add 100 Gt Carbon', 'Instantaneously (within 1 time step) add 100 Gt of Carbon to the atmosphere.  If models have CO2 spatially distributed throughout the atmosphere, add the carbon in a uniform manner.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398497, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'af0cb517-c47e-4cf6-82dd-515d950f6a33', 1, '2020-11-17 01:19:05.639745', true, 'RCP70 NOx', 'RCP70NOx', NULL, 'RCP7.0 NOx', 'Impose changing concentrations of RCP7.0 NOx.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398498, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '2e53f4be-bc32-449d-9e32-190f3b65ba1f', 1, '2020-11-17 01:19:05.639745', true, '2040-2100 61 yrs min', '61yrs2040-2100min', NULL, '2040/01/01-2100/12/31 minimum', 'Scenario, from 2040 to the end of the 21st century.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398499, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'f7abab0f-bfd2-4375-8e0e-5a818bc62a85', 1, '2020-11-17 01:19:05.639745', true, 'SSP1 RCP26 Land Use', 'RCP26land', NULL, 'Representative Concentration Pathway 2.6 Land Use for Shared Socioeconomic Pathway 1', 'Impose changing RCP2.6 land use including crops, pasture, urban area, vegetation and forest for SSP1.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398500, 'cmip6', NULL, '--', 'cim.2.shared.Party', '2e70b507-d535-4641-bf13-db36c88d8bd0', 1, '2020-11-17 01:19:05.639745', true, 'ISMIP6 leads', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398501, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', '0aafcd81-bfa2-4392-a1b2-269c0557e227', 1, '2020-11-17 01:19:05.639745', true, 'histSST-piO3', 'histSST-piO3', NULL, 'historical SSTs and historical forcing, but with pre-industrial ozone precursor emissions', 'Historical atmosphere only simulation with historical WMGHG, transient historical SSTs.  Tropospheric ozone precursors fixed at 1850 emission levels. The model should have the capacity for interactive tropospheric chemistry.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398502, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'b5275f81-e703-4dd1-af18-9088b3bbd098', 1, '2020-11-17 01:19:05.639745', true, 'World Ocean Atlas 2013', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398503, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', '53779b1f-8ada-43dc-814f-dbe6aca2f304', 1, '2020-11-17 01:19:05.639745', true, 'piClim-N2O', 'piClim-N2O', NULL, 'pre-industrial climatolgical SSTs and forcing, but with 2014 N2O concentrations (including chemistry)', 'Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply present day (2014) concentrations of nitrous oxide (N2O) all other WMGHG (well mixed greenhouse gas) concentrations set to pre-industrial levels.  Apply pre-industrial emissions of NTCF (near term climate forcers). This is a timeslice experiment of 30 years total.  Only models with stratospheric chemistry should run this experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398504, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', '3902d795-a30f-41a4-a732-19ce0ede87af', 1, '2020-11-17 01:19:05.639745', true, 'dcppC-ipv-NexTrop-pos', 'dcppC-ipv-NexTrop-pos', 'C1.9', 'idealised positive northern extratropical IPV anomaly pattern', 'Restore the extra-tropical north Pacific sea surface temperature to positive Pacific Decadal Variability (PDV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members. SST signal may also be imposed by altering surface fluxes.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398505, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '6aae65fe-b5ed-4d43-8a2c-01501a0f7e75', 1, '2020-11-17 01:19:05.639745', true, '1850-1851 100yrs', '100yrs1850-1851', NULL, '1850/01/01-1850/12/31', 'Idealised temporal constraint, repeating 1850 for 100 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398506, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '049a81fe-3030-4fba-b262-c32a7db27667', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP present day SIT', 'PAMIP-pd-SIT-clim', NULL, 'PAMIP monthly mean climatology of present day sea ice thickness', 'Present day monthly mean climatology of sea ice thickness, data provided by PAMIP.  If sea ice thickness cannot be specified then it should be left free to evolve in the coupled model experiments.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398507, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd2109f70-ca01-451c-a873-ac2429b94b72', 1, '2020-11-17 01:19:05.639745', true, 'RCP26 Short Lived Gas Species', 'RCP26sls', NULL, 'Representative Concentration Pathway 2.6 Short Lived Gas Species', 'Impose changing emissions of RCP2.6 short lived gas species including CH4, NOx, VOCs and CO.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398508, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '2e7d75ff-cea1-4afe-b983-0424eb42db7b', 1, '2020-11-17 01:19:05.639745', true, 'The Geoengineering Model Intercomparison Project Phase 6 (GeoMIP6): simulation design and preliminary results', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398509, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '6d573c15-c44c-44c4-bb42-44b5ed023dda', 1, '2020-11-17 01:19:05.639745', true, 'Impose SST AMV neg tropical N Atlantic', 'ImposeSSTAMVnegTropNAtlantic', NULL, 'Impose negative AMV anomaly to sea surface temperatures in the tropical north Atlantic', 'Alter surface fluxes to impose model climatology plus negative Atlantic Multidecadal Variability (AMV) anomalies of Sea Surface Temperature (SST) over the extra-tropical north Atlantic (10N-30N).  Idealised AMV anomalies of SST will be provided by DCPP.  For groups that are unable to restore SSTs.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399479, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '8246538e-09dd-4466-92dd-c2b364e7770e', 1, '2020-11-17 01:19:05.639745', true, 'RCP34 Aerosols', 'RCP34aer', NULL, 'Representative Concentration Pathway 3.4 Aerosols', 'Impose changing emissions of RCP3.4 aerosols including BC and OC.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399480, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'eeea1fe1-e498-4324-a718-9e499cb7ff2b', 1, '2020-11-17 01:19:05.639745', true, 'A new scenario framework for climate change research: the concept of shared socioeconomic pathways', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399552, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '4707c219-4b63-4518-a97e-d7119f5e970c', 1, '2020-11-17 01:19:05.639745', true, '2101-2300 200yrs', '200yrs2101-2300', NULL, '2101/01/01-2301/01/01', 'Future scenario, begin in 2101 and run for 200 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399553, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'a4f137b2-3407-4e34-9e68-b4d9210d5c7e', 1, '2020-11-17 01:19:05.639745', true, 'hist-stratO3 initialisation', 'hist-stratO3Initialisation', NULL, 'hist-stratO3 Initialisation', 'Initialisation data is taken from the end of the hist-stratO3 simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398514, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', 'a2791eb7-d3b6-4cf3-8da0-1261fabe98d1', 1, '2020-11-17 01:19:05.639745', true, 'piClim-2xfire', 'piClim-2xfire', NULL, 'pre-industrial climatolgical SSTs and forcing, but with doubled emissions from fires', 'Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases). The fire aerosol emission fluxes in the interactive parameterisation are double their pre-industrial value.  All other NTCF (near term climate forcers) are set to pre-industrial levels. For models that do not interactively parameterise particular emissions, the fluxes from the 1850 climatological dataset should be doubled. This is a timeslice experiment of 30 years total.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398515, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '8123f79c-abab-416b-bf54-3d29e3b2eae3', 1, '2020-11-17 01:19:05.639745', true, 'CO2 bell 750 PgC', 'CO2Bell750PgC', NULL, '750 PgC bell-shaped CO2 emissions profile', 'Use a bell-shaped CO2 emissions profile designed to give cumulative emissions of 750 PgC after 100 years, then hold CO2 emissions at zero. The time series of global CO2 for the bell-shape emission profiles will be provided by ZECMIP via the C4MIP and CDRMIP websites.  A model decision is required on the spatial pattern of CO2 emissions, ZECMIP suggest globally uniform at surface.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398516, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'cc51b1e6-afbe-45df-8c84-321b37456568', 1, '2020-11-17 01:19:05.639745', true, 'Land Use Harmonisation (LUH2 v1.0h) land use forcing data (850-2100)', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398517, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '47f5586f-67c3-4e43-a973-329f09fda0d1', 1, '2020-11-17 01:19:05.639745', true, 'The cloud feedback intercomparison project: (CFMIP).', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398518, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '671e62dc-88c2-4c9f-a89a-8ce7a40d85a3', 1, '2020-11-17 01:19:05.639745', true, 'Historical Emission Based Grid-Point Aerosol Forcing', 'HistoricalEmissionBasedGrid-PointAerosolForcing', NULL, 'Historical Emission Based Grid-Point Aerosol Forcing', 'Apply mass mixing ratio fields at 1x1 degree resolution for main aerosol components (sulphate, black carbon, organic carbon, nitrate, sea salt, mineral dust),  along with effective radius per species.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398519, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'f8a458e9-adb9-412a-b44d-d9f13eee5fd3', 1, '2020-11-17 01:19:05.639745', true, '1pctCO2 Passive Tracer At Doubling', '1pctCO2PassiveTracerAtDoubling', NULL, '1pctCO2 ensemble mean surface heat flux anomaly passive tracer at time of CO2 doubling', 'Add a surface flux of passive tracer at the same rate as the surface heat flux perturbation in the faf-heat experiment.  The passive tracer flux will be added to the top layer of a passive temperature tracer.  Surface flux anomalies (a function of longitude, latitude and time of year) are to remain constant throughout the experiment.  The method for implementing the passive tracer should follow that used by Bouttes and Gregory (2014).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398520, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '10071777-6f2c-4417-b61a-a8d410777766', 1, '2020-11-17 01:19:05.639745', true, 'RCP70Methane', 'RCP70CH4', NULL, 'RCP7.0 Methane', 'Impose changing concentrations of RCP7.0 methane.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398521, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'c4693967-ee23-463e-9ad9-b140bd26831d', 1, '2020-11-17 01:19:05.639745', true, 'AOGCM-StratChem Configuration', 'AOGCM-StratChemConfiguration', NULL, 'Atmosphere-Ocean General Circulation Model with Stratospheric Chemistry', 'Use a coupled Atmosphere-Ocean general circulation model with a chemistry component that includes stratospheric chemistry.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398522, 'cmip6', '<rfmip>', '--', 'cim.2.designing.NumericalExperiment', 'a2d6235d-b46e-4791-a509-2d3d9985e06c', 1, '2020-11-17 01:19:05.639745', true, 'piClim-ghg', 'piClim-ghg', 'RFMIP-ERF-GHG', 'effective radiative forcing by present day greenhouse gases', 'An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperature (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  Non-ozone greenhouse gases set to present day (2014) values, other forcing agents are specified at pre-industrial values.  Run for 30 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398523, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '6497a981-6d51-4701-803b-d97c90775a42', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Forcing Excluding Anthropogenic Aerosols', 'preIndForcingExclAnthropAer', NULL, 'Pre-industrial forcing, excluding anthropogenic aerosols', 'Pre-Industrial forcing excluding anthropogenic aerosols.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398524, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a81e52b8-ec1a-4c3f-8549-554684ced480', 1, '2020-11-17 01:19:05.639745', true, '1850 Irrigation', '1850Irrigation', NULL, '1850 irrigation', 'Maintain 1850 irrigated area.  Irrigation amounts within the irrigated area are allowed to change.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398525, 'cmip6', '<rfmip>', '--', 'cim.2.designing.NumericalExperiment', 'bca333fe-45d8-4273-80be-132d387a55e0', 1, '2020-11-17 01:19:05.639745', true, 'piClim-histaer', 'piClim-histaer', 'RFMIP-ERF-HistAer', 'transient effective radiative forcing by aerosols', 'An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperatures (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  Apply transient aerosols and their indirect effects consistent with historical forcing used in the DAMIP hist-all experiments and future forcing in the ScenarioMIP SSP2 RCP8.5 scenario.  A small ensemble of three simulations from 1850-2100.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398526, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c1cadce6-e62f-4adc-b4c5-a413a17abf4f', 1, '2020-11-17 01:19:05.639745', true, 'Present Day 2014 Solar Irradiance Forcing', 'PD2014SolarIrradiance', NULL, 'Present Day 2014 Solar Irradiance Forcing', 'Present day (2014) solar forcing. The standard solar forcing dataset recommended for usage is the solar reference scenario dataset. Includes total solar irradiance, F10.7 cm solar radio flux, and spectral solar irradiance for 10-100000 nm range.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398527, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'f2c036d8-a215-432d-b601-05aa41235d18', 1, '2020-11-17 01:19:05.639745', true, 'Large contribution of natural aerosols to uncertainty in indirect forcing', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399390, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '322fea41-80a9-47c7-9fa8-7026b272a64e', 1, '2020-11-17 01:19:05.639745', true, '30-50yrs', '30-50yrs', NULL, '30 years to 50 years', 'Run for 30 to 50 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398531, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '0cefd78d-b80f-45f0-8940-d56511368eaa', 1, '2020-11-17 01:19:05.639745', true, 'Historical land use except with crop and pasture as grassland', 'historicalLandUseCropPastureAsGrassland', NULL, 'historical land use except with new crop and pasture as grassland', 'Historical land use except treat all new cropland and pastureland as unmanaged grassland.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398532, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'daebc851-df3f-4917-910c-112834e20d37', 1, '2020-11-17 01:19:05.639745', true, 'Carbon Dioxide Removal Intercomparison Project (CDRMIP) website', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398548, 'cmip6', '<gmmip>', '--', 'cim.2.designing.NumericalExperiment', 'd0dd2e15-95a4-44ac-96f0-dc57f1771cfc', 1, '2020-11-17 01:19:05.639745', true, 'hist-resAMO', 'hist-resAMO', NULL, 'initialized from "historical" run year 1870 and SSTs in the AMO domain (0deg-70degN, 70degW-0deg) restored to AMIP SSTs with historical forcings', 'Pacemaker 20th century historical run that includes all forcings as used in CMIP6 historical simulation. 
INSERT INTO docs.tbl_document VALUES (398549, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '566f1e92-b170-4517-a16a-468bae8833c9', 1, '2020-11-17 01:19:05.639745', true, 'Present Day ISM Initialisation', 'PresentDayISMInitialisation', NULL, 'Initialisation from the present day control experiment ism-pdControl-std', 'Initialisation is from the ISMIP6 ism-pdControl-std stand alone ice sheet simulation', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398550, 'cmip6', '<cdrmip>', '--', 'cim.2.designing.NumericalExperiment', 'a068d9b8-dac0-4f21-8611-9f8fff450b40', 1, '2020-11-17 01:19:05.639745', true, 'esm-ssp585-ocn-alk-stop', 'esm-ssp585-ocn-alk-stop', 'CDR-ocean-alk', 'emission-driven SSP5-8.5 scenario with alkalinization terminated in year 2070', 'Simulation of abrupt termination of ocean alkalinisation. Branch from esm-ssp585-ocn-alk on 1 January 2070 and stop adding additional alkalinity to the ocean. Continue until 2100 or beyond. All other forcing is as in the esm-ssp585 experiment. Include all anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398551, 'cmip6', NULL, '--', 'cim.2.shared.Party', '5e23e0c0-923b-423c-96ba-6a65a8165150', 1, '2020-11-17 01:19:05.639745', true, 'Robert Pincus', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398552, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '443defdd-7a58-4e32-bc00-6eded19ffa7f', 1, '2020-11-17 01:19:05.639745', true, '1% per year CO2 for Carbon Cycle', '1%CO2CarbonCycle', NULL, '1% per year increase in atmospheric CO2 until quadrupling only affects carbon cycle', '1% per year increase in the concentration of atmospheric carbon dioxide until quadrupling seen by carbon cycle only.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398553, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ca735dfa-c397-499f-9383-d18616db50ab', 1, '2020-11-17 01:19:05.639745', true, '2xPICO2', '2xPICO2', NULL, '2 x Pre-industrial  CO2 concentration', 'Impose 2x pre-industrial (1850) concentration of Carbon Dioxide (CO2).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398554, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '0240fb22-9421-4b74-9106-2fa865f1584d', 1, '2020-11-17 01:19:05.639745', true, 'LW Cloud Radiation Off', 'lwRadOff', NULL, 'Cloud-radiative effects turned off Long wave radiation code', 'Switch off cloud-radiative effects in the long wave part of the radiation code.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398555, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '83bd6f4e-4310-4d12-a21c-4aa54839831b', 1, '2020-11-17 01:19:05.639745', true, 'AMIP II Ozone', 'AMIPIIOzone', NULL, 'AMIP II ozone climatology', 'The ozone distribution is derived from the climatology used in AMIP II (Gates et al., 1999) and is constant in time and symmetric about the equator. This ozone distribution is provided as a netCDF file which is archived on the Earth System Grid and available via the DOI http://dx.doi.org/10.5065/D61834Q6', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398556, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '85fe69f3-bf15-4695-8164-189dd1fecb29', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial O3 and Stratospheric H2O concentrations', 'PreIndustrialO3andStratosphericH2OConcentrations', NULL, 'Pre-Industrial Ozone and Stratospheric Water Vapour Concentrations', 'Pre-industrial ozone concentration encompassing both the stratosphere and the troposphere and stratospheric water vapour concentration.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398557, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '15d69e89-9f99-4278-ada4-f11305bf301b', 1, '2020-11-17 01:19:05.639745', true, 'Solar irradiance reduction via climate engineering-impact of different techniques on the energy balance and the hydrological cycle', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398558, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'ecfed26f-d8b1-4b01-b60b-152476e730e7', 1, '2020-11-17 01:19:05.639745', true, 'DCPP prescribed sea surface temperature (SST) patterns: AMV SST data, PDV SST data and Pacemaker SST data.', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398559, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '864acb0e-d2da-4bdb-b695-52c5e3c82296', 1, '2020-11-17 01:19:05.639745', true, '1850-2014 165yrs', '165yrs1850-2014', NULL, '1850/01/01-2015/01/01', 'Historical, pre-Industrial to present', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398560, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '31e8a480-afec-48b7-b68a-f5bae5c4e82b', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Ozone Concentrations', 'piStratosphereTroposphereOzoneConcentrations', NULL, 'Pre-Industrial Stratosphere-Troposphere Ozone Concentrations', 'Apply ozone concentrations encompassing both the stratosphere and the troposphere from the ozone concentration database.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398561, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '57f1864a-42c7-4d72-845b-d95dafc28e40', 1, '2020-11-17 01:19:05.639745', true, 'RCP45 Forcing Alternative Aerosols', 'rcp45ForcingAltAer', NULL, 'Representative Concentration Pathway 4.5 W/m2 Forcing with alternative aerosol estimation', 'Impose RCP4.5 forcing with alternative estimation for aerosol forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398562, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '89da4da1-b382-4a97-a4ea-d81713af1e99', 1, '2020-11-17 01:19:05.639745', true, 'TRENDY Interim Forcing for GSWP3', 'trendyInterimForcingGSWP3', NULL, 'TRENDY protocol for 1700 to the first year of the GSWP3 forcing dataset', 'For the interim period from 1700 to the first year of the GSWP3 forcing dataset, the forcing data should continue to be recycled but all other forcings (land-use, CO2, etc.) should be as in the piControl simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398563, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'b8a9b1b7-a922-4d65-a3c2-01283e1a2609', 1, '2020-11-17 01:19:05.639745', true, '2020-2100 81yrs min', '81yrs2020-2100min', NULL, '2020/01/01-2100/12/31', 'Run from 2020 to at least 2100.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398564, 'cmip6', '<lumip>', '--', 'cim.2.designing.NumericalExperiment', '84607685-77a0-4d4d-b4be-3fdeb14ce874', 1, '2020-11-17 01:19:05.639745', true, 'land-hist-altLu2', 'land-hist-altLu2', NULL, 'historical land-only with low land use', 'Land surface model simulation.  Same as land-hist except using alternative low land-use history reconstructions that span uncertainty in agriculture and wood harvest.  Note that land use in 1700 and 1850 will be different to that in land-hist so model will need to be spun up again for each alternative dataset. Use the same land model configuration as used in the coupled CMIP6 historical simulations. Include representation of land cover, land use and land management. All applicable land use features should be active. 
INSERT INTO docs.tbl_document VALUES (398565, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '2150085a-fb74-4f54-b947-edc3ddcd90c0', 1, '2020-11-17 01:19:05.639745', true, 'ssp245-cov-strgreen Short Lived Species', 'ssp245-cov-strgreenSLS', NULL, 'ssp245-cov-strgreen Short Lived Species', 'ssp245-cov-strgreen short lived species: BC, CO, OC, SO2, NH3, NOx, NMVOCs', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399145, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '81575f4a-d6ea-4e93-bae1-7d0c51d3a4e6', 1, '2020-11-17 01:19:05.639745', true, 'AMIP CO2 x4 for Radiation', 'amipx4CO2Radiation', NULL, 'AMIP x4 carbon dioxide concentration only affects radiative code.', 'Quadrupled AMIP CO2 concentration seen by radiative code only.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398566, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'd884ca94-430a-4f90-8258-36cdcf7d2d29', 1, '2020-11-17 01:19:05.639745', true, 'Reduced RCP70 NTCF', 'ReducedRCP70NTCF', NULL, 'Reduced RCP 7.0 Near Term Climate Forcers', 'Impose changing concentrations of reduced RCP7.0 Near Term Climate Forcers (NTCF). Beginning in 2014 with air quality policies (or maximum feasible reductions) applied to the SSP3-7 NTCF emissions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398567, 'cmip6', '<rfmip>', '--', 'cim.2.designing.NumericalExperiment', '2bf6b077-859c-4a87-b600-06d3358dd3a4', 1, '2020-11-17 01:19:05.639745', true, 'hist-spAer-all', 'hist-spAer-all', 'RFMIP-SpAer-all', 'historical simulations with specified anthropogenic aerosols', 'A historical (1850-2014) experiment using a coupled AOGCM in which aerosol optical properties including cloud-radiation interactions are prescribed by RFMIP.  Other forcings to be consistent with the historical forcing used in the DAMIP experiments.  One ensemble member required for RFMIP.  Four ensemble members required for inclusion in DAMIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398568, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ae5ca3af-1db8-4d51-ab95-4b1bc5d6c81e', 1, '2020-11-17 01:19:05.639745', true, 'Repeating 1850', 'Repeating1850', NULL, 'Repeating 1850 Seasonal forcing', 'Repeating 1850 seasonal forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398569, 'cmip6', '<lumip>', '--', 'cim.2.designing.NumericalExperiment', '6b45bed6-aaa3-4cbd-9de0-b5deb304c517', 1, '2020-11-17 01:19:05.639745', true, 'hist-noLu', 'hist-noLu', NULL, 'historical with no land-use change', 'Concentration driven historical forcing with land use held constant at 1850 usage.  Same as the concentration driven CMIP6 historical experiment except with land use and land cover change (LULCC) held constant at pre-industrial conditions. Additional ensemble members are requested with tier 2 priority.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398570, 'cmip6', '<c4mip>,<geomip>,<ismip6>,<ls3mip>,<scenariomip>', '--', 'cim.2.designing.NumericalExperiment', '707142bb-67d6-44c0-966b-92deb1164851', 1, '2020-11-17 01:19:05.639745', true, 'ssp585', 'ssp585', NULL, 'update of RCP8.5 based on SSP5', 'SSP-based RCP scenario with high radiative forcing by the end of century. Following approximately RCP8.5 global forcing pathway with SSP5 socioeconomic conditions. Concentration-driven.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398571, 'cmip6', '<c4mip>', '--', 'cim.2.designing.NumericalExperiment', 'd1ad616b-a4a8-431a-b659-25eade2985c2', 1, '2020-11-17 01:19:05.639745', true, 'hist-bgc', 'hist-bgc', NULL, 'biogeochemically-coupled version of the simulation of the recent past with CO2 concentration prescribed', 'Historical, concentration-driven, simulation parallel to standard Historical run, but with radiative effects of CO2 disabled - i.e. the radiation code is fed the time-invariant CO2 concentration from the control run.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398572, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'c209680b-4f1e-4fc4-af6d-f47805e0b322', 1, '2020-11-17 01:19:05.639745', true, 'PMIP4-CMIP6: the contribution of the Paleoclimate Modelling Intercomparison Project to CMIP6', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398573, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '5dc530b5-a38b-4772-81e1-cd5b20ac4df0', 1, '2020-11-17 01:19:05.639745', true, 'abrupt-4xCO2 SIC', 'abrupt4xCO2SIC', NULL, 'Monthly-varying sea ice concentrations from the abrupt4xCO2 simulation', 'Monthly-varying sea ice concentrations from years 111 to 140 of the abrupt4xCO2 simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398574, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', 'de011f62-7430-42ec-bfae-ad43698f9825', 1, '2020-11-17 01:19:05.639745', true, 'piClim-2xNOx', 'piClim-2xNOx', 'piClim-2xNOX', 'pre-industrial climatolgical SSTs and forcing, but with doubled production of NOX due to lightning', 'Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases). The lightning NOx (oxides of nitrogen) emission fluxes in the interactive parameterisation are double their pre-industrial value.  All other NTCF (near term climate forcers) are set to pre-industrial levels. For models that do not interactively parameterise particular emissions, the fluxes from the 1850 climatological dataset should be doubled. This is a timeslice experiment of 30 years total. The model should have the capacity for interactive tropospheric chemistry.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398575, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '52682ab5-e237-499b-90b3-dce027ccda6d', 1, '2020-11-17 01:19:05.639745', true, 'JRA55-do Heat Flux', 'jra55-doHeatFlux', NULL, 'JRA55-do air-sea heat flux', 'JRA55-do air–sea heat flux, covers the 61-year period from 1958-2018.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398576, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b9396c9e-daa5-44bd-ae94-2b2973a3017b', 1, '2020-11-17 01:19:05.639745', true, 'Impose SST Obs Trop E Pacific', 'ImposeSSTObsTropEPacific', NULL, 'Impose observed anomalies of SST in the tropical eastern  Pacific', 'Alter surface fluxes to impose model climatology plus observed historical anomalies of Sea Surface Temperature (SST) over the deep tropical eastern Pacific.  Monthly SST anomalies (1950-2014) will be provided by DCPP.  For groups that are unable to restore SSTs.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398577, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'a0cf2e13-4684-49f8-9d33-fef044e51680', 1, '2020-11-17 01:19:05.639745', true, 'AOGCM Configuration', 'AOGCMconfiguration', NULL, 'Atmosphere-Ocean General Circulation Model Configuration', 'Use a coupled Atmosphere-Ocean general circulation model', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398578, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', '3e78ef07-3e7c-470d-843d-d763f55a17aa', 1, '2020-11-17 01:19:05.639745', true, 'piClim-NOx', 'piClim-NOx', 'piClim-NOX', 'pre-industrial climatolgical SSTs and forcing, but with 2014 NOx emissions', 'Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases), pre-industrial emissions of aersols and aerosol precursors, present day (2014) emissions of NOx, all other emissions of tropospheric ozone precursors set to pre-industrial levels. This is a timeslice experiment of 30 years total. The model should have the capacity for interactive tropospheric chemistry.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398579, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e49a215f-4bce-4ec9-911f-79022b9969be', 1, '2020-11-17 01:19:05.639745', true, 'RCP26 Aerosols', 'RCP26aer', NULL, 'Representative Concentration Pathway 2.6 Aerosols', 'Impose changing emissions of RCP2.6 aerosols including BC and OC.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398580, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '04c42332-0c9d-4dac-bbe1-345b1e00c6ca', 1, '2020-11-17 01:19:05.639745', true, 'OCMIP3 carbon flux', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398581, 'cmip6', NULL, '--', 'cim.2.designing.Project', 'e5dc3560-2d53-445a-857f-1b28a70ccd05', 1, '2020-11-17 01:19:05.639745', true, 'CFMIP', 'cfmip', NULL, 'Cloud Feedback Model Intercomparison Project', 'CFMIP is a suite of experiments that investigate the response to idealised perturbations to SSTs, CO2 and Solar Irradiance in AMIP, aquaplanet (no land) and ESM model configurations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398582, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'b729bc02-7c75-4a80-a09d-4822b5f01466', 1, '2020-11-17 01:19:05.639745', true, '1850-1929 80yrs', '80yrs1850-1929', NULL, '1850/01/01-1930/01/01', 'Begin in 1850 and run for 80 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398583, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '53467dc0-1c33-47c8-94f0-7d977526a2d1', 1, '2020-11-17 01:19:05.639745', true, 'Princeton Historical Forcing', 'PrincetonHistoricalForcing', NULL, 'Land surface historical forcing with Princeton Global Forcing data', 'Apply Princeton Global Forcing to offline land surface models running the LS3MIP land-hist-princeton historical simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399146, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'b5b9e419-2df7-4b59-bd2a-a200639569e9', 1, '2020-11-17 01:19:05.639745', true, '1850-7009 5160yrs max', '5160yrs1850-7009max', NULL, '1850/01/01-7009/12/31 5160yrs max', 'Run from 1850 for a mazimum of 5160 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398584, 'cmip6', '<pmip>', '--', 'cim.2.designing.NumericalExperiment', '69d63242-6c4a-4565-91a8-49c3c69f3f2a', 1, '2020-11-17 01:19:05.639745', true, 'past1000-volconly', 'past1000-volconly', NULL, 'last millennium experiment using only volcanic forcing', 'The past1000-volconly experiment is a parallel experiment to the past1000 experiment. Instead of the complete forcing set, only volcanic forcing is considered.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398585, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '20b59ea2-f103-421d-9c34-9ec423e022ef', 1, '2020-11-17 01:19:05.639745', true, 'LMIP SSP4-34 Forcing', 'LMIPSSP4-34Forcing', NULL, 'Land offline MIP SSP4-34 forcing scenario', 'SSP4-34 forcing data for offline land surface models running the L3MIP future simulations.  Data provided by the LS3MIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398586, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '67b3cbd7-b06d-4217-87f2-5298488152b3', 1, '2020-11-17 01:19:05.639745', true, '01-1849 1849yrs', '1849yrs01-1849', NULL, '01/01/01-1849/12/31', 'Last two millennia, run for 1849 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398587, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '83b6c18c-9c9f-4a38-91e9-4acb576ae136', 1, '2020-11-17 01:19:05.639745', true, 'HadISSTextension', 'HadISSTextension', NULL, 'HadISST extension', 'Extension of the HadISST SST and sea ice dataset to 2050', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398588, 'cmip6', NULL, '--', 'cim.2.shared.Party', 'c39a8724-72b1-436b-81bd-e89fc92518e3', 1, '2020-11-17 01:19:05.639745', true, 'William Collins', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398589, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '98a206cc-55ed-45a6-b8a8-3039e44b9bc6', 1, '2020-11-17 01:19:05.639745', true, 'Easy Aerosol', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398590, 'cmip6', '<damip>', '--', 'cim.2.designing.NumericalExperiment', '75f9c2b3-f2f7-4454-a567-16076086259d', 1, '2020-11-17 01:19:05.639745', true, 'hist-totalO3', 'hist-totalO3', NULL, 'historical total ozone-only run', 'Historical total ozone-only. In models with coupled chemistry, the chemistry scheme should be turned off, and the simulated ensemble mean monthly mean 3D ozone concentrations from the CMIP6 historical simulations should be prescribed through the depth of the atmosphere. In models without coupled chemistry the same ozone prescribed in the CMIP6 historical simulations should be prescribed', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398591, 'cmip6', '<fafmip>', '--', 'cim.2.designing.NumericalExperiment', '27577c18-1fea-483c-bf75-03ace1f90e75', 1, '2020-11-17 01:19:05.639745', true, 'faf-stress', 'faf-stress', NULL, 'control plus perturbative surface flux of momentum into ocean', 'Impose a perturbation in surface zonal and meridional momentum flux i.e. wind stress.  The stress perturbation is added to the momentum balance of the ocean water surface. The stress perturbation is calculated from the ensemble mean of the CMIP5 1pctCO2 simulations at the time of CO2 doubling.  Its dominant feature is the increase in westerly windstress in the Southern Ocean. 
INSERT INTO docs.tbl_document VALUES (398592, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '567c5ff6-613f-422f-821e-eff483f08cd1', 1, '2020-11-17 01:19:05.639745', true, 'Tambora SO2', 'TamboraSO2', NULL, 'SO2 emissions equivalent to Mt. Tambora eruption.', 'Emission of 56.2 Tg of SO2 into the equatorial stratosphere roughly corresponding to the 1815 Mt. Tambora eruption in Indonesia, which was linked to the so-called "year without a summer" in 1816.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398593, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '7676ff22-99e3-4411-8ef4-a7ec5b8bce66', 1, '2020-11-17 01:19:05.639745', true, 'Hemispheric distributions and interannual variability of NOy produced by energetic particle precipitation in 2002–2012', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398594, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '4a5ce2aa-2167-4e6b-bb98-eaa87ac7a8d7', 1, '2020-11-17 01:19:05.639745', true, 'Present Day 2014 Cosmic Ray Forcing', 'PD2014CosmicRayForcing', NULL, 'Present Day 2014 Cosmic Ray Forcing', 'Present day (2014) cosmic ray forcing. CMIP6 recommends the use of the CRAC:CRII (Cosmic Ray induced Cascade: Application for Cosmic Ray Induced Ionization) model extended toward the upper atmosphere (Usoskin et al. 2010).  The results of the CRAC:CRII model are parameterized (see Usoskin and Kovaltsov 2006) to give ion pair production rate as a function of the altitude (quantified via the barometric pressure), geomagnetic latitude (quantified via geomagnetic cut-off rigidity), and solar activity (quantified via the modulation potential θ).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398595, 'cmip6', NULL, '--', 'cim.2.designing.NumericalExperiment', '3c6b7796-6d2c-475e-aafb-30bb583cf7f6', 1, '2020-11-17 01:19:05.639745', true, 'histSST-noLu', 'histSST-noLu', NULL, 'historical SSTs and historical forcing, but with pre-industrial LULCC', 'An uncoupled (atmosphere and land) experiment in which sea surface temperatures (SST) and sea ice concentrations (SICONC) are taken from historical (as in existing histSST experiment). All forcing agents to follow historical except LULCC. LULCC set to 1850 (exactly following hist-noLu prescription)', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398596, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'f0f32782-031e-4959-94da-9b668162d22d', 1, '2020-11-17 01:19:05.639745', true, 'Past1000 WMGHG Concentrations Excluding CO2', 'Past1000WMGHGConcNoCO2', NULL, 'Past1000 Well Mixed Greenhouse Gas (WMGHG) Concentrations Excluding Carbon Dioxide (CO2)', 'Forcing data for past1000 runs. Time varying global annual mean concentrations for the long-lived greenhouse-gases excluding CO2, but including: CH4, N2O, HFCs, PFCs, SF6, several ODS, and NF3 to serve as input for the CMIP6 Historical simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398597, 'cmip6', NULL, '--', 'cim.2.designing.MultiEnsemble', 'bf8c71d8-6cb3-4852-9c28-4eb0dbdaf908', 1, '2020-11-17 01:19:05.639745', true, '1960AnnualxN', '1960annualxn', NULL, 'Multi-initialisations of 1960 Annual start date ensemble', 'A multi-ensemble with N initialisations for each start date occurring every year from 1960 to the present.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398598, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', '0bf451f8-d98f-43bc-9c62-07bbee2d5f05', 1, '2020-11-17 01:19:05.639745', true, 'hist-piNTCF', 'hist-piNTCF', NULL, 'historical forcing, but with pre-industrial NTCF emissions', 'Impose historical WMGHG and halocarbon concentrations. Near Term Climate Forcers (NTCFs: methane, tropospheric ozone and aerosols, and their precursors), to be fixed at 1850 emission levels. These simulations parallel the "CMIP6 historical", and differ only by fixing the anthropogenic emissions or concentrations of a specified class of species.   All other forcing agents must evolve as in "CMIP6 historical".', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398599, 'cmip6', NULL, '--', 'cim.2.shared.Party', 'd33a92da-98f6-4e90-be4f-7d225ab40111', 1, '2020-11-17 01:19:05.639745', true, 'Gunnar Myhre', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398600, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '1ef19c06-f6fb-4836-907f-ad4749162091', 1, '2020-11-17 01:19:05.639745', true, 'SingleMember', 'SingleMemberEnsemble', NULL, 'Single Member Ensemble', 'One ensemble member', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398601, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '42bd3130-728c-45b9-8502-073388e5d33d', 1, '2020-11-17 01:19:05.639745', true, 'LGM Astronomical Parameters', 'LGMAstroParams', NULL, 'Astronomical parameters for the Last Glacial Maximum', 'Impose Last Glacial Maximum (21 kyr ago) orbital astronomical parameters.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398602, 'cmip6', NULL, '--', 'cim.2.shared.Party', '4d7c6e45-99f2-4f79-918f-4545120a7ecf', 1, '2020-11-17 01:19:05.639745', true, 'Davide Zanchettin', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399147, 'cmip6', NULL, '--', 'cim.2.shared.Party', '5fbf9316-2130-4fea-b45f-8ed6cc5bb076', 1, '2020-11-17 01:19:05.639745', true, 'Chris Derksen', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399148, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'e92cebf4-d943-4eca-a0a1-04c4f7933cf5', 1, '2020-11-17 01:19:05.639745', true, '100yrs', '100yrs', NULL, '100 years', 'Run for 100 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398677, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '1ff3fadc-8d72-48b3-be35-5fc195e67d77', 1, '2020-11-17 01:19:05.639745', true, '2000PgC-Initialisation', '2000PgC-Initialisation', NULL, 'Initialise from the 1pctCO2 or esm-1pctCO2 simulation when carbon cumulative emissions reach 2000 PgC', 'Initialise from the 1pctCO2 or esm-1pctCO2 simulation when cumulative carbon emissions reach 2000 PgC.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398603, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e3dd73ba-2e4e-443d-a5ad-9b1eee378976', 1, '2020-11-17 01:19:05.639745', true, 'AMIP SST plus patterned 4K', 'patternedSSTp4K', NULL, 'Patterned plus 4K to AMIP Sea Surface Temperature', 'Add a composite SST warming pattern (derived from coupled models, scaled to a global mean of 4K) to the AMIP sea surface temperatures (SSTs). This warming should be applied to the ice free ocean surface only.  Sea ice and SSTs under sea ice remain the same as in the amip DECK experiment.  The patterned SST forcing dataset is available in a netcdf file called cfmip2_4k_patterned_sst_forcing.vn1.0.nc in the supplementary information for the CMIP6/CFMIP description paper (Webb et. al. 2016).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398604, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '2cb10f39-b15c-484b-a7c4-7eba953a7e6c', 1, '2020-11-17 01:19:05.639745', true, 'rad-pd-4xCO2', 'rad-pd-4xCO2', NULL, 'RFMIP-IRF', 'Offline radiative transfer calculations of vertically-resolved broadband-integrated longwave and shortwave fluxes for present-day (2015) clear sky (aerosol-free) conditions with quadrupled carbon dioxide. Present-day (PD) greenhouse gas concentrations with 4x CO2 and PD atmosphere. Use specified atmospheric distributions of temperature and humidity and surface properties over many profiles.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398605, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '1dd0cf9e-a0b1-49d7-82a2-4cebdd221b40', 1, '2020-11-17 01:19:05.639745', true, '2010HistoricalInitialisation', '2010historicaInitialisation', NULL, 'Initialisation from year 2010 of the historical simulation', 'Initialisation from the historical simulation in the year 2010.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398606, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e7c03992-ed5e-4b4b-bdce-1c296a127103', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Land Use High', 'piLandUseHigh', NULL, 'pre-industrial land use with high estimates of  crop, pasture and wood harvest', 'Pre-industrial land use with high estimates of crop cultivation, pasture land and wood harvest.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398607, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'cded5bc1-89c7-4449-8de0-0de3b9929f0c', 1, '2020-11-17 01:19:05.639745', true, 'Regional climate changes as simulated in time-slice experiments', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398608, 'cmip6', '<geomip>', '--', 'cim.2.designing.NumericalExperiment', '987e6f01-77a8-4193-95c8-747afd53b621', 1, '2020-11-17 01:19:05.639745', true, 'G7SST1-cirrus', 'G7SST1-cirrus', 'G7cirrusSlice1', 'SSTs from year 2020 of SSP5-8.5; forcings and other prescribed conditions from year 2020 of SSP5-8.5 + cirrus thinning', 'Time slice at year 2020 of GeoMIP G7cirrus. Run for 10 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398609, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '6cd9efe7-84f0-4bc3-9dbc-218b502365c2', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Electron Forcing', 'piElectronForcing', NULL, 'Pre-Industrial Electron Forcing', 'CMIP6 recommends the use of parameterisations based on geomagnetic activity indices such as the Kp- or Ap-index to describe ionisation from electron precipitation in the lower thermosphere and upper mesosphere (for those models that explicitly include those height levels in their code) as a best estimate for the impact of electron precipitation.
INSERT INTO docs.tbl_document VALUES (398610, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '5b01fb8c-ed15-4edf-af33-a34fefb46836', 1, '2020-11-17 01:19:05.639745', true, 'RCP85 Well Mixed GHG Emissions', 'RCP85wmGHGEm', NULL, 'Representative Concentration Pathway 8.5 Well Mixed Greenhouse Gas Emissions', 'Impose changing emissions of RCP8.5 long-lived greenhouse gases, including CO2, N2O and halogenated gases.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398611, 'cmip6', NULL, '--', 'cim.2.designing.NumericalExperiment', '246c5690-e3ce-4d9c-8dee-69b7e5a5d50c', 1, '2020-11-17 01:19:05.639745', true, 'historical-withism', 'historical-withism', NULL, 'Historical experiment with interactive ice sheets', 'Historical experiment with interactive ice sheet model.  The experiment should be identical to the corresponding standard CMIP AOGCM experiment except for the treatment of ice sheets.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398612, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', 'f906e17f-1b29-40bc-9140-fbb035a2b8d9', 1, '2020-11-17 01:19:05.639745', true, 'a4SSTice-4xCO2', 'a4SSTice-4xCO2', NULL, 'control plus warming pattern SSTs and SIC with 4xCO2', 'As a4SSTice, but CO2 is quadrupled, and the increase in CO2 is seen by both the radiation scheme and vegetation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398613, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '57c8f65b-3ec1-45e4-bede-14b4cc94a655', 1, '2020-11-17 01:19:05.639745', true, 'Three pre-industrial initialisations', 'threePIInitialisations', NULL, 'Three pre-industrial initialisations', 'Three initialisations from the pre-industrial control made at at least 50 year intervals.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398614, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'e8db817c-9ed7-415d-b2a2-680004e1be47', 1, '2020-11-17 01:19:05.639745', true, 'AOGCM-BGC Configuration', 'AOGCM-BGCConfiguration', NULL, 'Atmosphere-Ocean General Circulation Model with BioGeoChemistry', 'Use a fully coupled Earth System Model which explicitly models the movement of Carbon through the Earth system.  Atmosphere-Ocean general circulation model with biogeochemistry.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398615, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '834c34fd-9f2d-49c4-80cd-50fb98852d14', 1, '2020-11-17 01:19:05.639745', true, 'RCP26 extension Forcing', 'rcp26extForcing', NULL, 'Representative Concentration Pathway 2.6 W/m2 Extension Forcing', 'Impose RCP2.6 extension forcing.
INSERT INTO docs.tbl_document VALUES (398616, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e4e5c600-a056-4c6e-aadd-6dd4bc8d9113', 1, '2020-11-17 01:19:05.639745', true, 'RCP85 Short Lived Gas Species', 'RCP85sls', NULL, 'Representative Concentration Pathway 8.5 Short Lived Gas Species', 'Impose changing emissions of RCP8.5 short lived gas species including CH4, NOx, VOCs and CO.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398617, 'cmip6', NULL, '--', 'cim.2.designing.Project', '1de24b0b-2b19-4e22-ad38-f88ada6d33ae', 1, '2020-11-17 01:19:05.639745', true, 'C4MIP', 'c4mip', NULL, 'Coupled Climate Carbon Cycle MIP', 'C4MIP is a suite of idealised, historical and future scenario experiments that investigate the radiative and biogeochemical effects of changing carbon dioxide concentrations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398618, 'cmip6', NULL, '--', 'cim.2.shared.Party', 'f72a4d05-8c6d-4f7a-b5a0-1c1ac2cdca80', 1, '2020-11-17 01:19:05.639745', true, 'Francis Zwiers', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398637, 'cmip6', '<ismip6>', '--', 'cim.2.designing.NumericalExperiment', 'ad263c16-a0a6-486c-a575-41772ec55e84', 1, '2020-11-17 01:19:05.639745', true, 'ism-ssp585-self', 'ism-ssp585-self', NULL, 'Ice sheet model driven with SSP5-85 scenario forcing', 'Stand alone ice sheet model driven offline by a CMIP6 model with scenarioMIP SSP5-85 forcing.  The ice sheet model should be configured with the same settings as the ice sheet model in the ssp585-withism experiment and should use the same initial conditions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398638, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '0f0ad60b-fb96-4f86-9c7d-7c080f33c9f5', 1, '2020-11-17 01:19:05.639745', true, 'LMIP SSP1-26 Forcing', 'LMIPSSP1-26Forcing', NULL, 'Land offline MIP SSP1-26 forcing scenario', 'SSP1-26 forcing data for offline land surface models running the L3MIP future simulations.  Data provided by the LS3MIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398678, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'bb9dea67-115f-4528-bda3-e6835ec19a65', 1, '2020-11-17 01:19:05.639745', true, 'ssp2-45 stratospheric Ozone', 'ssp2-45StratosphereO3', NULL, 'DAMIP ssp2-45 ensemble mean monthly mean stratospheric ozone concentrations', 'Impose ensemble mean monthly mean of 3D stratospheric ozone from coupled-chemistry simulations of Scenario-MIP SSP2-4.5 simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398619, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', 'b7203bb9-bed3-49bd-8775-611c66366402', 1, '2020-11-17 01:19:05.639745', true, 'dcppA-historical-niff', 'dcppA-historical-niff', 'A4.2', 'hindcasts initialized from historical simulation without observed forcing after initialization', 'A coordinated set of multi-member ensembles of retrospective forecasts (hindcasts) initialised each year from 1960 to the present (otherwise every second year).  Radiative and other forcing information (e.g. greenhouse gas concentrations, aerosols etc.) maintained at initial state value or projected in a simple way.  No inclusion of volcano or other short term forcing unless available at initial time. Initialise from the historical simulation. Run each member for at least 5 years, preferably 10 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398620, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', 'a8c66e82-edb5-41ae-9f9e-0de42795fd1b', 1, '2020-11-17 01:19:05.639745', true, 'piClim-NH3', 'piClim-NH3', NULL, 'pre-industrial climatological SSTs and forcing, but with 2014 ammonia emissions', 'Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases), pre-industrial emissions of aersols and aerosol precursors, present day (2014) emissions of ammonia (NH3). This is a timeslice experiment of 30 years total. Pre-Industrial ozone climatology should be used for models that don’t model the ozone interactively.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398621, 'cmip6', '<scenariomip>', '--', 'cim.2.designing.NumericalExperiment', '8fa9ed0a-f813-452c-b96e-95d3b4a67bf5', 1, '2020-11-17 01:19:05.639745', true, 'ssp126', 'ssp126', NULL, 'update of RCP2.6 based on SSP1', 'SSP-based RCP scenario with low radiative forcing by the end of the century.  Following approximately RCP2.6 global forcing pathway with SSP1 socioeconomic conditions. Radiative forcing reaches a level of 2.6 W/m2 in 2100. Concentration-driven.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398622, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '1b8dee57-484f-4a0f-8b86-13a284029c5b', 1, '2020-11-17 01:19:05.639745', true, 'Zero CO2 emissions', 'zeroCO2', NULL, 'Set carbon dioxide (CO2) emissions to zero', 'Carbon dioxide (CO2) emissions are set to zero.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398623, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '0ad27714-93c2-4926-87df-2ebb354dfe2f', 1, '2020-11-17 01:19:05.639745', true, 'Ocean Alkalinization', 'oceanAlkalinizationFrom2020', NULL, 'Ocean alkilinity increased from year 2020', 'Add 0.14 Pmol Total Alkalinity (TA)/yr to the upper grid boxes of the model''s ocean component.  The alkalinity additions should be limited to mostly ice-free, year-round ship-accessible waters, which for simplicity should be set between 70N and 60S (note that this ignores the presence of seasonal sea ice in some small regions).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398624, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'f948e815-c93d-45b9-92f5-5580a36f97b7', 1, '2020-11-17 01:19:05.639745', true, '1850 non-SO2 Aerosol Precursor Emissions', '1850nonSO2AerPre', NULL, '1850 Emissions of Aerosol Precursors Excluding SO2', 'Impose pre-industrial (1850) emissions of aerosol precursors excluding sulfur dioxide (SO2).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398625, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '5483f2e5-2884-4910-826d-1e2bb051e460', 1, '2020-11-17 01:19:05.639745', true, '2014 Tropospheric Ozone Precursor Emissions', '2014TropO3Pre', NULL, '2014 Emissions of Tropospheric Ozone Precursors', 'Impose 2014 emissions of tropospheric ozone precursors (NOx).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398626, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '3fa2c713-849b-4b48-9272-172a96bcfe36', 1, '2020-11-17 01:19:05.639745', true, '1850 non-DMS Aerosol Emissions', '1850nonDMSAer', NULL, '1850 emissions of non-DMS Aerosols', 'Impose pre-industrial (1850) emissions of non-DMS aerosols.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398627, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '4f36d0e9-8dd3-42b7-a54e-8ae1c2bfd905', 1, '2020-11-17 01:19:05.639745', true, 'Aqua-Planet Experiment Project Ozone Dataset', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398628, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '85fb6086-2e50-4289-9bc5-9da6396a208c', 1, '2020-11-17 01:19:05.639745', true, 'diagnosed 2010 CO2 emissions', 'diagnosed2010CO2Em', NULL, '2010 CO2 emissions diagnosed from the yr2010CO2 simulation', 'CO2 emissions diagnosed from the yr2010CO2 simulation. Emissions required from 2010 to
INSERT INTO docs.tbl_document VALUES (398629, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '0e293ad0-3174-4e23-8a77-607555149713', 1, '2020-11-17 01:19:05.639745', true, '1850 non-CO VOC Tropospheric Ozone Precursor Emissions', '1850nonCOVOCTropO3Pre', NULL, '1850 Emissions of non-CO/VOC Tropospheric Ozone Precursors', 'Impose pre-industrial (1850) emissions of non-CO/VOC (Carbon Monoxide / Volatile Organic Compound) tropospheric ozone precursors.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398630, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '8f2366d8-ece3-4d8a-abc2-99a3130e0448', 1, '2020-11-17 01:19:05.639745', true, '100MemberCoupled', '100MemberCoupledEnsemble', NULL, '100 Member Coupled Ensemble', 'An ensemble of one hundred simulation. Initial conditions should be based on 1st April 2000 from the CMIP6 historical simulation, note that the first two months of the simulations will be ignored. Ideally, different ocean states will be sampled by using different ensemble members of the CMIP6 historical simulation if these are available.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398631, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'fe2eed98-7c91-4a4c-ab62-0ccf5a3931bf', 1, '2020-11-17 01:19:05.639745', true, 'RCP70 Reduced Aerosol Precursors Not NOx', 'ReducedRCP70aerprenotNOx', NULL, 'Reduced RCP7.0 Aerosol precursors but not NOx', 'Impose reduced RCP7.0 aerosol precursor emissions (not NOx).  Beginning in 2014 with air quality policies (or maximum feasible reductions) applied to the SSP3-70 aerosol precursor NTCF emissions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398632, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '0583dc73-1e08-421f-b827-c2e9776fca0a', 1, '2020-11-17 01:19:05.639745', true, 'RCP85-extension Aerosol Precursors', 'RCP85extaerpre', NULL, 'Representative Concentration Pathway 8.5 Extension Aerosol Precursors', 'Impose changing emissions of RCP8.5 extension aerosols precursors including SO2 and NHy.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398633, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ffb0a978-eafe-4e4a-a0dc-f1204a26f2ae', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Aerosol Precursors', 'Pre-IndustrialArePre', NULL, 'Pre-Industrial Aerosol Precursors', 'Pre-Industrial aerosol precursors. For models with interactive chemistry and/or aerosols, the CMIP6 pre-industrial emissions dataset of reactive gases and aerosol precursors should be used.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398634, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '3570275d-723e-455e-b6c4-de5a844c68a5', 1, '2020-11-17 01:19:05.639745', true, 'Future GHG', 'FutureGHG', NULL, 'Future GHG concentration', 'Specified future concentrations of atmospheric greenhouse gases consistent with future atmospheric states and surface properties based on RCP8.5 at 2100.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398635, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'd0ef9105-1693-480d-9ce3-64727f820917', 1, '2020-11-17 01:19:05.639745', true, '1850-1851 50yrs', '50yrs1850-1851', NULL, '1850/01/01-1850/12/31', 'Idealised temporal constraint, repeating 1850 for 50 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398636, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'a73f49c5-f964-4866-98c0-d3b0a58ded55', 1, '2020-11-17 01:19:05.639745', true, 'DCPP experiment protocol and technical notes', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398639, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'c921f066-d7d5-4e93-bfee-5c72dfd5565a', 1, '2020-11-17 01:19:05.639745', true, 'HadISST', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398640, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e424f8ac-1a55-4cf8-90b4-4961ee9717bd', 1, '2020-11-17 01:19:05.639745', true, 'LFMIP present day land-hist-cruNcep forcing', 'LFMIP-pd-land-hist-cruNcep', NULL, 'Present day climate land surface forcing from land-hist-cruNcep', 'Land surface forcing climatology for present climate (1980-2014) from the land-hist-cruNcep simulation.  Note the climatological median of soil water and snow water is to be used instead of climatological means.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398641, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'dfaa9347-3702-4639-80f5-55685ad66894', 1, '2020-11-17 01:19:05.639745', true, 'HadISST', 'hadISST', NULL, 'Hadley Centre Sea Ice and Sea Surface Temperature data set', 'Impose HadISST sea ice and sea surface temperature data.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398642, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '6bbf2bfc-4e84-4d32-8784-699273bb5fa3', 1, '2020-11-17 01:19:05.639745', true, 'Historical Cosmic Ray Forcing', 'HistoricalCosmicRayForcing', NULL, 'Historical Cosmic Ray Forcing', 'CMIP6 recommends the use of the CRAC:CRII (Cosmic Ray induced Cascade: Application for Cosmic Ray Induced Ionization) model extended toward the upper atmosphere (Usoskin et al. 2010).  The results of the CRAC:CRII model are parameterized (see Usoskin and Kovaltsov 2006) to give ion pair production rate as a function of the altitude (quantified via the barometric pressure), geomagnetic latitude (quantified via geomagnetic cut-off rigidity), and solar activity (quantified via the modulation potential θ).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398643, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'fb70fbac-e079-4f5e-80f4-75abf521512b', 1, '2020-11-17 01:19:05.639745', true, '2100-2109 10yrs', '10yrs2100-2109', NULL, '2100/01/01- 2110/01/01', 'Timeslice, begin in 2100 and run for 10 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398644, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '9a36cb1a-e85f-459e-a9ae-e81b91214e7c', 1, '2020-11-17 01:19:05.639745', true, 'OCMIP2 abiotic tracers', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398645, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e6b54c2b-efa2-4c4a-8bf5-bfca5214f6c4', 1, '2020-11-17 01:19:05.639745', true, 'Historical Fossil Carbon Dioxide Emissions', 'HistoricalFossilCarbonDioxideEmissions', NULL, 'Historical Fossil Carbon Dioxide Emissions', 'Fossil fuel and cement emissions by country and fuel 1751-2014 (annual).  
INSERT INTO docs.tbl_document VALUES (398646, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '6501a13c-fae5-414c-9ef5-71defe4210e2', 1, '2020-11-17 01:19:05.639745', true, 'Historical Open Burning Emissions 1950s', 'HistoricalOpenBurningEmissions1950s', NULL, 'Historical Open Burning Emissions 1950s Climatology', '1950s (10 year) climatology of emissions from fires in forests and grasslands.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398647, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'b3abe55c-0802-4327-9c13-129773d94916', 1, '2020-11-17 01:19:05.639745', true, '1979-1988 10yrs', '10yrs1979-1989', NULL, '1979/01/01-1989/01/01', 'Begin in 1979 and run for 10 years after a few months of spin up.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398648, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '87b8acd6-3ceb-417d-9f5c-95fec325f4b0', 1, '2020-11-17 01:19:05.639745', true, 'WoodHarvest', 'woodHarvest', NULL, 'Wood Harvest', 'Harvesting of wood.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398649, 'cmip6', '<rfmip>', '--', 'cim.2.designing.NumericalExperiment', '64c291fc-2404-412c-9fea-39411115cdd5', 1, '2020-11-17 01:19:05.639745', true, 'piClim-histnat', 'piClim-histnat', 'RFMIP-ERF-HistNat', 'transient effective radiative forcing by natural perturbations', 'An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperatures (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  Transient natural forcing (solar and volcano) to be consistent with historical forcing used in the DAMIP hist-all experiment and future forcing used in the ScenarioMIP SSP2 RCP4.5 scenario.  A small ensemble of three simulations from 1850-2100.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398650, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '9a1b0489-782d-4cd7-bfcd-9242cde1b6f0', 1, '2020-11-17 01:19:05.639745', true, 'salinity damping', 'salinityDamping', NULL, 'Damp surface ocean salinity to a monthly observed climatology', 'Damp surface ocean salinity to a monthly observational-based climatology.  OMIP does not specify a damping timescale but recommends that modellers consult Appendix C in Danabasoglu et al. (2014) to choose a salinity restoring protocol that is suitable for their model. Choosing a weak salinity restoring is generally preferred to reduce the impact on variability.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398651, 'cmip6', NULL, '--', 'cim.2.shared.Party', 'e9b41253-26f9-4ba1-a973-d604fb9cbe4e', 1, '2020-11-17 01:19:05.639745', true, 'Mark Webb', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398652, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e2b40087-ef5b-4117-9f8b-10a2723ff85d', 1, '2020-11-17 01:19:05.639745', true, '1850 Fire Management', '1850FireManagement', NULL, '1850 fire management', 'Maintain 1850 levels of fire management (anthropogenic ignition and suppression of fire). If ignitions are based on population density, maintain constant population density.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398653, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '4f15c71f-af27-4f6a-97c1-34cbbd77c7d0', 1, '2020-11-17 01:19:05.639745', true, 'RCP34 extension overshoot Forcing', 'rcp34extoverForcing', NULL, 'Representative Concentration Pathway 3.4 W/m2 extension Overshoot Forcing', 'Impose RCP3.4 overshoot extension forcing. The negative CO2 emissions level reached in 2100 by SSP5-3.4 remain constant at that level to 2150 and then increase linearly to zero by 2250.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398654, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', '57fba0c5-9330-4fbc-8011-e71e32f78faf', 1, '2020-11-17 01:19:05.639745', true, 'piClim-O3', 'piClim-O3', NULL, 'pre-industrial climatolgical SSTs and forcing, but with 2014 ozone precursor emissions', 'Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases), pre-industrial emissions of aersols and aerosol precursors and present day (2014) tropospheric ozone precursors. This is a timeslice experiment of 30 years total. The model should have the capacity for interactive tropospheric chemistry.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398655, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '107c06a9-f12b-4498-8302-0fda29fad367', 1, '2020-11-17 01:19:05.639745', true, '1950s Aerosol Forcing', '1950sAerosolForcing', NULL, '1950s  Aerosol Forcing Climatology', '1950s (10 year) climatology of mass mixing ratio fields at 1x1 degree resolution for main aerosol components (sulphate, black carbon, organic carbon, nitrate, sea salt, mineral dust),  along with effective radius per species.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398656, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '52a192e2-761a-4163-b466-cb6ed4d10873', 1, '2020-11-17 01:19:05.639745', true, 'Historical greenhouse gas concentrations for climate modelling (CMIP6)', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398657, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '3d474f4b-9351-433a-948a-ffbec92a854f', 1, '2020-11-17 01:19:05.639745', true, '30yrs', '30yrs', NULL, '30 years', 'Run for 30 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398658, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'e7508b8a-c411-4995-bc8b-6cf9526715a4', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Forcing Excluding Land Use', 'piForcingExcludingLandUse', NULL, 'Pre-Industrial forcing, excluding land-use', 'Pre-Industrial forcing excluding land-use.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398883, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '358f0697-7d71-4429-8d39-c4cc9256eb36', 1, '2020-11-17 01:19:05.639745', true, '2x 1850 Sea Salt Aerosol Emissions', '2x1850seaSaltAer', NULL, 'Doubled 1850 emissions of sea salt', 'Impose 1850 doubled sea salt emission fluxes. Or double the sea salt aerosol emissions of the 1850 climatological data.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398659, 'cmip6', '<lumip>', '--', 'cim.2.designing.NumericalExperiment', 'db20a5e1-061d-42c0-a3b5-972304e58a1a', 1, '2020-11-17 01:19:05.639745', true, 'deforest-globe', 'deforest-globe', 'deforest-glob', 'idealised transient global deforestation', 'Idealized deforestation experiment. 20 million square km forest area (covered by trees) is converted to natural unmanaged grassland over a period of 50 years with a linear rate of 400000 km2/yr followed by 30 years of constant forest cover. Run for 80 years. Simulations should be branched from an 1850 control simulation (piControl) at least 80 years prior to the end of the piControl simulation so that deforest-globe and piControl can be directly compared.  All pre-industrial forcings including CO2 concentration and land-use maps and land management should be maintained as in the piControl.  Deforestation should be restricted to the top 30% of land grid cells in terms of their area of tree cover.  Effectively this concentrates deforestation in the tropical rainforest and boreal forest regions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398660, 'cmip6', NULL, '--', 'cim.2.shared.Party', 'ef22b949-2867-4172-9de0-a58bd6534f06', 1, '2020-11-17 01:19:05.639745', true, 'Karl Taylor', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398661, 'cmip6', NULL, '--', 'cim.2.designing.NumericalExperiment', 'a8618c78-e5e2-44db-90fe-e28f6426e1d5', 1, '2020-11-17 01:19:05.639745', true, 'piClim-SO2', 'piClim-SO2', NULL, 'pre-industrial climatological SSTs and forcing, but with 2014 SO2 emissions', 'Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases), pre-industrial emissions of aersols and aerosol precursors, present day (2014) emissions of sulfur dioxide (SO2). This is a timeslice experiment of 30 years total.  Pre-Industrial ozone climatology should be used for models that don’t model the ozone interactively.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398662, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '0aa94691-6a4c-42be-bdc9-ca8532eb6d12', 1, '2020-11-17 01:19:05.639745', true, 'rad-pd-piall', 'rad-pd-piall', NULL, 'RFMIP-IRF', 'Offline radiative transfer calculations of vertically-resolved broadband-integrated longwave and shortwave fluxes for present-day (2015) clear sky (aerosol-free) conditions with pre-industrial well-mixed greenhouse gases (WMGHG). Use specified atmospheric distributions of present day temperature and humidity and surface properties over many profiles.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398663, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '1a9f8a1c-bd4a-414d-aef4-c09891ef4d35', 1, '2020-11-17 01:19:05.639745', true, '1950s Stratospheric Aerosol', '1950sStratosphericAerosol', NULL, '1950s Stratospheric Aerosol Climatology', '1950s (10 year) climatology of stratospheric aerosols.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398664, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ca80cacd-ab35-4a34-96e2-3d975ea2672e', 1, '2020-11-17 01:19:05.639745', true, 'Internal Stratospheric Aerosol Precursors RCP85 to RCP45', 'stratAerPreRCP85-RCP45internal', NULL, 'Stratospheric aerosol precursor injection to reduce RCP8.5 forcing to RCP4.5 levels, internal aerosol treatment', 'Injection of stratospheric sulfate aerosol precursors to reduce the radiative forcing of ScenarioMIP high forcing scenario (SSP5-85) to match that of the ScenarioMIP medium forcing scenario (SSP2-45).  
INSERT INTO docs.tbl_document VALUES (398665, 'cmip6', '<c4mip>', '--', 'cim.2.designing.NumericalExperiment', 'cc02c232-55d6-4821-bdb9-32db94039f84', 1, '2020-11-17 01:19:05.639745', true, '1pctCO2-rad', '1pctCO2-rad', NULL, 'radiatively-coupled version of 1 percent per year increasing CO2 experiment', 'Radiatively-coupled version of 1% per year increasing CO2 up to 4XCO2 simulation. CO2 increase only affects the radiative code, carbon cycle models see pre-industrial CO2. Nitrogen deposition held fixed at pre-industrial values.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398666, 'cmip6', '<omip>', '--', 'cim.2.designing.NumericalExperiment', '03938a8f-8bfd-4acd-a0f0-4380d261419b', 1, '2020-11-17 01:19:05.639745', true, 'omip2-spunup', 'omip2-spunup', NULL, 'OMIP experiment forced by JRA-55 atmospheric data set and initialized from at least a 2000-year spin up of the coupled physical-biogeochemical model', 'Global ocean/sea-ice/inert-chemical/biogeochemical experiment like omip2 except that it is not initialized with observed climatologies; rather it is initialized with results from at least a 2000-year spin up of the coupled physical-biogeochemical models.  Another difference from omip2 is that the required simulation length is 5 cycles of the 61-year JRA55-do forcing.   
INSERT INTO docs.tbl_document VALUES (398667, 'cmip6', '<rfmip>', '--', 'cim.2.designing.NumericalExperiment', 'e178d24c-b4d7-4236-8e54-f7556ca0c773', 1, '2020-11-17 01:19:05.639745', true, 'piClim-spAer-aer', 'piClim-spAer-aer', 'RFMIP-SpAerO3-aer', 'effective radiative forcing at present day with specified anthropogenic aerosol optical properties, all forcings', 'An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperatures (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.   Aerosols set to present day (2014) values and other anthropogenic forcing agents are set at pre-industrial values.  Aerosols are specified by RFMIP. Run for 30 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398668, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '577e1e0d-0896-4df6-9720-f879acd30329', 1, '2020-11-17 01:19:05.639745', true, 'Restore SST PDV pos NexTrop Pacific', 'RestoreSSTPDVposNexTropPacific', NULL, 'Restore northern extra-tropical Pacific sea surface temperature to positive PDV', 'Sea Surface Temperatures (SSTs) are restored to model climatology plus positive PDV anomaly by Newtonian cooling over the northern extra-tropical Pacific (10N-65N). The restoring timescale is 10 days for a 50m deep mixed layer (or equivalent). The restoring coefficient of 40 W/m2/K should decrease to zero over an 8 degree buffer zone bounding the restored region.  No restoring if sea ice is present. Idealised AMV anomalies of SST will be provided by DCPP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398669, 'cmip6', NULL, '--', 'cim.2.shared.Party', '2630da7c-a5c9-48e5-ab20-a07e28f93798', 1, '2020-11-17 01:19:05.639745', true, 'Claudia Timmreck', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398670, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'c407592f-d419-4810-aa06-75fb1d0b1b8d', 1, '2020-11-17 01:19:05.639745', true, '10yrs', '10yrs', NULL, '10 years', 'Run for 10 years, for use with a start date ensemble.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398671, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '9ca0f650-7b1f-47cf-8a2d-f5ab4cd0f0b0', 1, '2020-11-17 01:19:05.639745', true, 'LGM Land-Sea Mask', 'LGMlandSeaMask', NULL, 'Land sea mask for the Last Glacial Maximum', 'Impose Last Glacial Maximum (21 kyr ago) land-sea mask.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398672, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'a594f83a-4f64-4d74-9528-07d2ab68bf1f', 1, '2020-11-17 01:19:05.639745', true, 'SSP5-85Initialisation2020', 'ssp5-85Initialisation2020', NULL, 'SSP5-8.5 Initialisation year 2020', 'Initialisation is from the beginning of year 2020 of the SSP5-8.5 experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398673, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'edb56143-e498-4633-97ad-e01cbf7a023a', 1, '2020-11-17 01:19:05.639745', true, '1850 non-NH3 Aerosol Precursor Emissions', '1850nonNH3Aer', NULL, '1850 Emissions of Aerosol Precursors Excluding Ammonia', 'Impose pre-industrial (1850) emissions of aerosol precursors excluding ammonia (NH3).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398674, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'c1e02d8b-c6a9-485b-b3f2-b08b64aa7b0a', 1, '2020-11-17 01:19:05.639745', true, 'Ten Member', 'TenMember', NULL, 'VolMIP ensemble of ten members', 'An ensemble of ten members.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398675, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c45c6c70-700b-4711-9c58-8679cc296f73', 1, '2020-11-17 01:19:05.639745', true, 'RCP26 Well Mixed GHG', 'RCP26wmGHG', NULL, 'Representative Concentration Pathway 2.6 Well Mixed Greenhouse Gases', 'Impose changing concentrations of RCP2.6 long-lived gases, including CO2, N2O and halogenated gases.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398676, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '1b031775-589d-4bfd-98e7-bff2e4a32e9c', 1, '2020-11-17 01:19:05.639745', true, '1850-2115 266yrs min', '266yrs1850-2115min', NULL, '1850/01/01-2115/12/31', 'Run from 1850 to 2115 minimum.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398679, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '91b823e6-886f-4428-8084-bac49fc5fa18', 1, '2020-11-17 01:19:05.639745', true, '1850 WMGHG', '1850WMGHG', NULL, '1850 Well Mixed Green House Gas Concentrations', 'Impose repeating 1850 Well Mixed Green House Gas (WMGHG) concentrations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398680, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'cfc643be-0fa4-4d3e-83b0-888e8e380031', 1, '2020-11-17 01:19:05.639745', true, '1850-1851 10yrs100', '10yrs1850-1851_yr100', NULL, '1850/01/01-1850/12/31', 'Idealised temporal constraint, repeating 1850 for 10 years, to coincide with year 100 of the GeoMIP G1ext experiment', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398681, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '5ceed4ed-751d-41da-af10-715bf6ee676f', 1, '2020-11-17 01:19:05.639745', true, 'A new Geoengineering Model Intercomparison Project (GeoMIP) experiment designed for climate and chemistry models', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398712, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e82671b0-3062-406e-85f1-6053c8025bb0', 1, '2020-11-17 01:19:05.639745', true, 'LFMIP running mean land-hist-wfdei forcing', 'LFMIP-rm-land-hist-wfdei', NULL, '30yr running mean land surface forcing from land-hist-wfdei', '30 year running mean land surface forcing calculated from the land-hist-wfdei simulation.  Note the climatological median of soil water and snow water is to be used instead of climatological means.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398713, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'c7a5f029-4125-4bb6-a04c-b0da67c297eb', 1, '2020-11-17 01:19:05.639745', true, 'An overview of the results of the Atmospheric Model Intercomparison Project (AMIP I)', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398682, 'cmip6', '<ls3mip>', '--', 'cim.2.designing.NumericalExperiment', 'b4cbf2aa-a342-4b85-bd8f-a87e51606653', 1, '2020-11-17 01:19:05.639745', true, 'lfmip-pdLC-wfdei', 'lfmip-pdLC-wfdei', NULL, 'prescribed land conditions (from current climate climatology) derived from land-hist-wfdei and initialized from "historical" run year 1980', 'Scenario forced experiment with prescribed land surface climatology derived from land-hist-wfdei (1980-2014). The experiment is comprised of transient coupled atmosphere-ocean simulations in which a selection of land surface characteristics is prescribed rather than interactively calculated in the model.  The "climatological" land surface forcing is calculated as the mean annual cycle in the period 1980-2014 from the land-hist-wfdei simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398683, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '163f9702-33ce-4cc1-85b2-ff0772ef2213', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP future Sea of Okhotsk SIC', 'PAMIP-fut-othotsk-SIC-clim', NULL, 'PAMIP monthly mean climatology of future Sea of Okhotsk sea ice concentration', 'Future monthly mean cimatology of Sea of Okhotsk sea ice concentration, data provided by PAMIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398684, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '3ffcaa2f-5c2e-41f3-8022-b723da9a64d8', 1, '2020-11-17 01:19:05.639745', true, 'High Res Atmos', '25-50kmResolution', NULL, 'Resolution minimum 25-50km', '25-50km minimum resolution at mid-latitudes', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398685, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '8499e6db-d705-42b6-9fcd-fbcea0717db2', 1, '2020-11-17 01:19:05.639745', true, '100yrs min', '100yrsmin', NULL, 'minimum 100 years', 'Run for a minimum of 100 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398686, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', 'a655f42b-b8e9-41bc-bf21-da454a1969be', 1, '2020-11-17 01:19:05.639745', true, 'piClim-BC', 'piClim-BC', NULL, 'pre-industrial climatolgical SSTs and forcing, but with 2014 black carbon emissions', 'Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases), pre-industrial tropospheric ozone precursors, present day (2014) emissions of black carbon (BC) and pre-industrial emissions of all other aersols and aerosol precursors.  This is a timeslice experiment of 30 years total.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398687, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ed250caa-e4d2-41f3-a60c-9802a948e916', 1, '2020-11-17 01:19:05.639745', true, 'NA0pct 1pctCO2 Heat Flux Anomaly At Doubling', 'NA0pct1pctCO2HeatFluxAtDoubling', NULL, '1pctCO2 ensemble mean surface heat flux anomaly at time of CO2 doubling except that within part of the North Atlantic ocean the perturbation is zero.', 'Impose heat flux anomalies to the ocean surface, created from the CMIP5 diagnostic of surface downward heat flux in sea-water (hfds).  The surface heat-flux anomalies are calculated from the ensemble mean of the CMIP5 1pctCO2 simulations at the time of CO2 doubling except that within part of the North Atlantic ocean the perturbation is zero.  Surface flux anomalies (a function of longitude, latitude and time of year) are to remain constant throughout the experiment.  Note that the fluxes themselves are not replaced because this would typically cause a very large climate drift and possible instability.  The method for implementing the heat flux anomaly should follow that used by Bouttes and Gregory (2014).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398688, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'b0b9f7a4-c47b-4110-b58d-ce9df272f07f', 1, '2020-11-17 01:19:05.639745', true, '70yrs', '70yrs', NULL, '70 years', 'Run for 70 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398689, 'cmip6', NULL, '--', 'cim.2.designing.Project', 'b13e3481-234d-4d4f-abc1-e1185b0a8b0e', 1, '2020-11-17 01:19:05.639745', true, 'HighResMIP', 'highresmip', NULL, 'High Resolution Model Intercomparison Project', 'HighResMIP specifies a suite of historical, future scenario and idealised experiments to be simulated on models at both high and standard horizontal resolution.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398690, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a626f47a-dc2f-4839-8e8c-ba53dd3456af', 1, '2020-11-17 01:19:05.639745', true, 'RCP70 Tropospheric Ozone Precursors No Methane', 'RCP70O3prenoCH4', NULL, 'RCP7.0 Tropospheric ozone precursors but no methane', 'Impose changing concentrations of RCP7.0 tropospheric ozone precursors except methane.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398691, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e7eb9e5d-7466-4592-b224-56012ecb979f', 1, '2020-11-17 01:19:05.639745', true, 'Mid-Pliocene CO2', 'midPlioCO2', NULL, 'Atmospheric concentrations of carbon dioxide for the Mid-Pliocene', 'Impose Mid-Pliocene Warm Period (3.2 Ma ago) atmospheric concentrations of Carbon Dioxide, 400ppm.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398692, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '9e00a66c-0e19-4550-959e-8509c59bf7ee', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Land-Sea mask', 'preIndLandSeaMask', NULL, 'Pre-industrial land-sea mask', 'Impose pre-industrial (1850) land-sea mask.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398693, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'cb2b616a-fe82-4c1a-8ee3-e0390909fe48', 1, '2020-11-17 01:19:05.639745', true, 'Historical Stratospheric H2O Concentrations', 'HistoricalStratosphericH2OConcentrations', NULL, 'Historical Stratospheric Water Vapour Concentrations', 'Apply stratospheric water vapour concentrations from the stratospheric water vapour concentration database.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398694, 'cmip6', '<damip>', '--', 'cim.2.designing.NumericalExperiment', 'ca5b1747-0099-4ae1-a85e-11fed7c76c3f', 1, '2020-11-17 01:19:05.639745', true, 'hist-aer', 'hist-aer', NULL, 'historical anthropogenic aerosols-only runs', 'Historical aerosol-only simulations resemble the historical simulations but instead are forced by changes in anthropogenic aerosol forcing only (sulfate, black carbon, organic carbon, ammonia, NOx and VOCs). 
INSERT INTO docs.tbl_document VALUES (398695, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '41f454c1-dc9e-425a-866a-7e564290ce1b', 1, '2020-11-17 01:19:05.639745', true, 'SSP5-85Initialisation2040', 'ssp5-85Initialisation2040', NULL, 'SSP5-8.5 Initialisation 2040', 'Initialisation is from year 2040 of the SSP5-8.5 experiment.', NULL, NULL);
