INSERT INTO docs.tbl_document VALUES (398698, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'cbb53ff4-1f45-4143-911a-f24fcb5828b1', 1, '2020-11-17 01:19:05.639745', true, 'North Atlantic simulations in Coordinated Ocean-ice Reference Experiments phase II (CORE-II). Part II: Inter-annual to decadal variability', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398714, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '12b6aa03-f0e4-4613-8094-352312d92e3c', 1, '2020-11-17 01:19:05.639745', true, 'Abrupt 2xCO2', 'Abrupt2xCO2', NULL, 'Abrupt doubling of atmospheric carbon dioxide', 'Impose an instantaneous doubling of atmospheric carbon dioxide concentration, then hold fixed.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398910, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '106d89bb-7875-442c-82a8-b03a1f40db8a', 1, '2020-11-17 01:19:05.639745', true, 'pi spinup period', 'piSpinupPeriod', NULL, 'pre-industrial spinup period', 'Length (in years) of the spin-up period required to bring the model into equilibrioum prior to the start of the piControl experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398699, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b38501e1-f9e6-4197-b2ec-e4f2cf9a31e1', 1, '2020-11-17 01:19:05.639745', true, 'Restore SST AMV pos N Atlantic', 'RestoreSSTAMVposNAtlantic', NULL, 'Restore north Atlantic sea surface temperature to positive AMV', 'Sea Surface Temperatures (SSTs) are restored to model climatology plus positive AMV anomaly by Newtonian cooling over the North Atlantic (10N-65N). The restoring timescale is 10 days for a 50m deep mixed layer (or equivalent). The restoring coefficient of 40 W/m2/K should decrease to zero over an 8 degree buffer zone bounding the restored region.  No restoring if sea ice is present. Idealised AMV anomalies of SST will be provided by DCPP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398700, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '68e17410-eb2a-48ad-b25d-7a4fd5a0d5fc', 1, '2020-11-17 01:19:05.639745', true, 'ISMIP6-specified lig127k input', 'ISMIP6lig127kInput', NULL, 'ISMIP-specified input from an AOGCM PMIP4 last interglacial  experiment', 'ISMIP6-specified input from the output of a PMIP4 Last Interglacial experiment, lig127k.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398701, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '6b6c638d-871b-49e1-bf04-15910db64f38', 1, '2020-11-17 01:19:05.639745', true, 'rad-pd-2xCO2', 'rad-pd-2xCO2', NULL, 'RFMIP-IRF', 'Offline radiative transfer calculations of vertically-resolved broadband-integrated longwave and shortwave fluxes for present-day (2015) clear sky (aerosol-free) conditions with two times the pre-industrial carbon dioxide concentrations. Use specified atmospheric distributions of temperature and humidity and surface properties over many profiles.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398702, 'cmip6', '<volmip>', '--', 'cim.2.designing.NumericalExperiment', '5b1148a7-b28c-49c8-88a8-647e3d3a4fb1', 1, '2020-11-17 01:19:05.639745', true, 'volc-cluster-ctrl', 'volc-cluster-ctrl', NULL, '19th century volcanic cluster initialized from PiControl', 'Early 19th century cluster of strong tropical volcanic eruptions, including the 1809 event of unknown location, and the 1815 Tambora and 1835 Cisugüina eruptions.  Run three ensemble members for at least 50 years to cover the multi-decadal oceanic response and to assess stationarity of post-cluster climate.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398703, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', 'd1f579f4-975b-43e0-9074-def2bd022ac1', 1, '2020-11-17 01:19:05.639745', true, 'piSST-4xCO2', 'piSST-4xCO2', NULL, 'control SSTs with 4xCO2', 'An AGCM experiment with monthly-varying SSTs and sea-ice taken from each model''s own piControl simulation (using the 30 years of piControl that are parallel to years 111-140 of its abrupt4xCO2 run) with quadrupled CO2 concentration seen by the radiation code and the vegetation code. Other atmospheric constituents and any other necessary boundary conditions (e.g. vegetation if required) taken from each model''s own piControl simulation (using the 30 years of piControl that are parallel to years 111-140 of its abrupt4xCO2 run). Dynamic vegetation should be turned off and the vegetation distribution that is output from the piControl simulation used.
INSERT INTO docs.tbl_document VALUES (398704, 'cmip6', NULL, '--', 'cim.2.shared.Party', '78fa06f0-8c7d-4324-b4ea-f4c8488818ab', 1, '2020-11-17 01:19:05.639745', true, 'Charlotte Pascoe', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398705, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'f95785db-f383-4990-9b47-8e5d870c2d4d', 1, '2020-11-17 01:19:05.639745', true, 'LS3MIP historical Sea-Ice', 'LS3MIPhistoricalSeaIce', NULL, 'Sea-ice from the first ensemble member of the historical experiment', 'Sea-ice from the first ensemble member of the historical experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398706, 'cmip6', '<volmip>', '--', 'cim.2.designing.NumericalExperiment', '79073d27-4320-4e37-ba62-2598f55795fe', 1, '2020-11-17 01:19:05.639745', true, 'volc-cluster-21C', 'volc-cluster-21C', NULL, 'volcanic cluster experiment under 21st century SSP2-4.5 scenario', 'Parallel experiment to volc-cluster-ctrl but with initial conditions from the end of the historical simulation instead of from the piControl. The first eruption of the cluster begins in 2015. All external forcings, except volcanic forcing are from the 21st-century SSP2-4.5 scenario experiment of ScenarioMIP. At the end of the volcanic cluster, volcanic forcing input shall be kept constant at the same constant value prescribed for the piControl simulation for consistency with the SSP2-4.5 scenario experiment. At least one, preferably three ensemble members. 85 years for each ensemble member.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398707, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '62825565-3d5f-47e1-a549-bbe7308c8979', 1, '2020-11-17 01:19:05.639745', true, 'RCP34 overshoot Forcing', 'rcp34overForcing', NULL, 'Representative Concentration Pathway 3.4 W/m2 Overshoot  Forcing', 'Impose RCP3.4 overshoot forcing.  Beginning in 2040, reduce forcings from the 8.5 W/m2 pathway to 3.4 W/m2 by 2100.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398708, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '87ff73b2-217f-436e-875a-902c962fe304', 1, '2020-11-17 01:19:05.639745', true, 'esmpiControlEndInit', 'esmpiControlEndInit', NULL, 'Initialisation from the end of the esmpiControl', 'Initialise from the end of the esm-piControl experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398709, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '19eb5e9d-acd0-4ba2-bb1e-3a1a73e91c12', 1, '2020-11-17 01:19:05.639745', true, '305yrs', '305yrs1714-2018', NULL, '1714/01/01-2019/01/01', 'Historical, five repetitions of the 61 year JRA-55 (1958-2018) with simulations beginning in 1714.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398710, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', '78161292-81f8-41b5-b91f-0fd191affff1', 1, '2020-11-17 01:19:05.639745', true, 'dcppC-amv-Trop-pos', 'dcppC-amv-Trop-pos', 'C1.8', 'idealised positive tropical AMV anomaly pattern', 'Restore the tropical north Atlantic sea surface temperature to positive Atlantic Multidecadal Variability (AMV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members.  SST signal may also be imposed by altering surface fluxes.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398711, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'ee1efe22-d885-4881-9e2a-fd3e44ce29b7', 1, '2020-11-17 01:19:05.639745', true, '25 piControl Initialisations from June 1st', '25piControlInitialisationsJun1st', NULL, 'VolMIP ensemble or 25 simulations', 'An ensemble of at least twenty-five predefined initialisation states which span: warm/cold/neutral El Niño-Southern Oscillation (ENSO) states, strong/weak/neutral  Atlantic Meridional Overturning Circulation (AMOC) states, the Quasi Biennial Oscillation (QBO), characteristics of the polar vortex and the North Atlantic Oscillation (NAO).  If, for instance, year Y of the control integration matches the desired conditions for the initial condition sampling, then the corresponding VolMIP simulation should start with restart data from June 1st of year Y-1 of the control.  Restart files from piControl must be accordingly selected and documented in the metadata of each simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399086, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '1a09bd87-123b-40bf-91cb-777f1d0b93bc', 1, '2020-11-17 01:19:05.639745', true, '2015-2100 86yrs', '86yrs2015-2100', NULL, '2015/01/01-2101/01/01', 'Scenario, from 2015 to the end of the 21st century.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398715, 'cmip6', '<ls3mip>', '--', 'cim.2.designing.NumericalExperiment', '5302ef7a-d02f-4aae-ba75-3619a1728a7c', 1, '2020-11-17 01:19:05.639745', true, 'lfmip-rmLC', 'lfmip-rmLC', 'LFMIP-rmLC', 'prescribed land conditions (from running mean climatology) and initialized from "historical" run year 1980', 'Scenario forced experiment with prescribed land surface climatology derived from transient 30 year running mean.   Additional ensemble members are requested with tier 2 priority.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398716, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '3f4dc716-87bc-4952-b452-a37852d2b8f2', 1, '2020-11-17 01:19:05.639745', true, 'Historical NTCF Emissions', 'HistoricalNTCFEmissions', NULL, 'Historical Emissions of Near Term Climate Forcers', 'Impose transient historical emissions of near term climate forcers (NTCF): namely tropospheric aerosols and tropospheric ozone precursors.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398717, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd2bce661-c0f5-423c-bdfe-dd6ff6da2aee', 1, '2020-11-17 01:19:05.639745', true, 'Historical land use except with pasture as grassland', 'historicalLandUsePastureAsGrassland', NULL, 'historical land use except with new  pasture as grassland', 'Historical land use except treat all new pastureland as unmanaged grassland.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398718, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '3adcbe88-1375-4d0c-8dab-2d914a76188c', 1, '2020-11-17 01:19:05.639745', true, '4xPICO2', '4xPICO2', NULL, '4x Pre-Industrial CO2 concentration', 'Impose 4x pre-industrial (1850) concentration of Carbon Dioxide (CO2).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398719, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'acdfe647-e222-45e0-b61c-2fa29b851a45', 1, '2020-11-17 01:19:05.639745', true, 'SF6 Tracer', 'sf6Tracer', NULL, 'OCMIP2 SF6 inert chemical tracer', 'Online simulation of SF6 inert chemical tracers.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398720, 'cmip6', '<cdrmip>', '--', 'cim.2.designing.NumericalExperiment', '609acb47-ec58-483f-a9a5-1fda791cce3c', 1, '2020-11-17 01:19:05.639745', true, 'esm-ssp534-over', 'esm-ssp534-over', 'CDR-overshoot', 'emission-driven SSP5-3.4-OS scenario', 'CO2 emissions driven SSP5-3.4 overshoot scenario simulation optionally extending to year 2300. The scenario branches from SSP5-8.5, an unmitigated baseline scenario, at the beginning of 2040 when substantially negative net emissions are applied.  All non-CO2 forcing should be identical to that in the ScenarioMIP experiments: ssp534-over and ssp534-over-ext.
INSERT INTO docs.tbl_document VALUES (398721, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '35f111b2-8348-492e-b73a-d154354296ef', 1, '2020-11-17 01:19:05.639745', true, 'ALK Tracer', 'ALKTracer', NULL, 'Total alkalinity (ALK) tracer', 'Total alkalinity (ALK) tracer for a parallel preindustrial world where atmospheric CO2 is fixed at 278 ppm.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398722, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '2366d781-7e15-447c-a73d-3c24e493aaf0', 1, '2020-11-17 01:19:05.639745', true, 'RFMIP Pre-Industrial Forcing Excluding Land Use', 'RFMIP-preIndForcingExclLU', NULL, 'RFMIP Pre-Industrial forcing excluding land use', 'Pre-industrial forcing excluding land use.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398723, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '7f72b49c-5c6e-4a7c-93f5-6078225a76fa', 1, '2020-11-17 01:19:05.639745', true, 'Future Solar Particle Forcing', 'FutureSolarParticleForcing', NULL, 'Future Solar Particle Forcing', 'Future solar particle forcing (2015-2299). For models with interactive stratospheric chemistry.  Proton forcing: HOx and NOx production by solar protons. Electron forcing:  Kp- or Ap-index to describe ionisation from electron precipitation in the lower thermosphere and upper mesosphere. Cosmic ray forcing:  ion-pair production by galactic cosmic rays.  CMIP6 models that do not have interactive chemistry should  prescribe the CMIP6 recommended ozone forcing data set.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398724, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '97006dc8-fb27-4af4-a005-f9a6077c6a2d', 1, '2020-11-17 01:19:05.639745', true, 'Mesospheric and stratospheric NOy produced by energetic particle precipitation during 2002–2012', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398725, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '3a2e7bd4-a0dd-4d10-bebd-1eb6b4c6e906', 1, '2020-11-17 01:19:05.639745', true, 'Historical Aerosol Forcing', 'HistoricalAerosolForcing', NULL, 'Historical Aerosol Forcing', 'Mass mixing ratio fields at 1x1 degree resolution for main aerosol components (sulphate, black carbon, organic carbon, nitrate, sea salt, mineral dust),  along with effective radius per species.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398726, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '7241089f-6c30-43bb-91da-3a0fadf1a4c2', 1, '2020-11-17 01:19:05.639745', true, 'SSP5-34-overInitialisation', 'ssp5-34-overInitialisation', NULL, 'SSP5-3.4-over Initialisation', 'Initialisation is from the end of the SSP5-3.4-overshoot experiment.  To provide continuity between the 21st century portion of the SSP5-3.4-over experiment and it''s extension to 2300.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398727, 'cmip6', NULL, '--', 'cim.2.shared.Party', '36c328ea-5b6d-4103-8723-03f1ba491b12', 1, '2020-11-17 01:19:05.639745', true, 'Michaela I Hegglin', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398728, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '1501820d-8853-4b13-9281-0293531c514b', 1, '2020-11-17 01:19:05.639745', true, 'LGM CH4', 'LGMCH4', NULL, 'Last Glacial Maximum CH4 concentration', 'Impose Last Glacial Maximum (21 kyr ago) atmospheric methane (CH4) concentration.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398729, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '0a4431bd-d31b-4c70-bf4f-b984e24e4372', 1, '2020-11-17 01:19:05.639745', true, 'Ensemble Average present day SST from experiment pa-pdSIC for future Arctic sea ice', 'PAMIP-ensMean-SST-pa-pdSIC-for-fut-arc-SIC', NULL, 'Present day SST calculated from the ensemble average SST for each month of experiment pa-pdSIC for use with future Arctic sea ice', 'Present day monthly mean climatology of sea surface temperature (SST) calculated from the ensemble mean for each month of experiment pa-pdSIC.  In regions where sea ice has been removed SSTs should be set equal to SSTs in experiment modelSST-pdSIC (4.1) plus the difference in SST between experiments pdSST-futArcSIC (1.6) and pdSST-pdSIC (1.1) (i.e. experiment pdSST-futArcSIC minus experiment pdSST-pdSIC).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398730, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'caeff80c-d309-49ca-98b2-83e8f2cea247', 1, '2020-11-17 01:19:05.639745', true, '2014-2099 86yrs', '86yrs2014-2100', NULL, '2014/01/01- 2100/01/01', 'Scenario, from 2014 to the end of the 21st century.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398731, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '554046cf-a826-4193-b78c-f871e24917e1', 1, '2020-11-17 01:19:05.639745', true, 'Zonally Uniform SST +4K', 'zonalSSTp4K', NULL, 'Zonally Uniform Sea Surface Temperature plus 4K', 'Impose a +4K perturbation to the aquacontrol zonally-uniform distribution of SST.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398732, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'a27f7562-4efd-4e7b-b0aa-1266270e8db8', 1, '2020-11-17 01:19:05.639745', true, '1790 Forcing Excluding Volcanic Aerosols', '1790ForcingExclVolcAer', NULL, '1790 forcing, excluding volcanic forcing', '1790 forcing from the PMIP past1000 experiment, excluding volcanic aerosols.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399328, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '5385e6ec-f296-4767-9f6c-a19b0aa07357', 1, '2020-11-17 01:19:05.639745', true, 'RCP85 Short Lived Gas Species Emissions', 'RCP85slsEm', NULL, 'Representative Concentration Pathway 8.5 Short Lived Gas Species Emissions', 'Impose changing emissions of RCP8.5 short lived gas species.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398881, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'fcc16e13-a797-420a-963d-9c902129f01d', 1, '2020-11-17 01:19:05.639745', true, 'Past 2k Astronomical Parameters', 'past2kAstroParams', NULL, 'Astronomical parameters for the first two millennia', 'Astronomical parameters for the first two millennia, 01 to 1849.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398733, 'cmip6', '<ls3mip>', '--', 'cim.2.designing.NumericalExperiment', '71d6d421-d245-40af-ae3a-d57fa036e431', 1, '2020-11-17 01:19:05.639745', true, 'land-ssp126', 'land-ssp126', NULL, 'Future SSP1-26 land-only', 'Offline land surface simulations forced with ScenarioMIP SSP1-26.  Three realisations required.  A trend preserving statistical bias correction method is applied to 3-hourly surface meteorological variables from the scenario output to generate a set of ensemble forcing data.  Gridded forcings will be provided by LS3MIP. The land model configuration should be identical to that used in the DECK and CMIP6 historical simulations for the parent coupled model.  Spin-up of the land-only simulations should follow the TRENDY protocol.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398734, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '56517109-285e-4882-8e82-76b2932869d9', 1, '2020-11-17 01:19:05.639745', true, 'TRENDY Interim Forcing for GSWP3 high land use', 'trendyInterimForcingGSWP3HighLandUse', NULL, 'TRENDY protocol for 1700 to the first year of the GSWP3 forcing dataset with high land use', 'For the interim period from 1700 to the first year of the GSWP3 high land use forcing, the forcing data should continue to be recycled but all other forcings (CO2, etc.) should be as in the piControl simulation. Use high estimates for land use  (crop, pasture and wood harvest).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398735, 'cmip6', '<highresmip>', '--', 'cim.2.designing.NumericalExperiment', '38068d30-e403-4e70-8c64-9f291547c4b4', 1, '2020-11-17 01:19:05.639745', true, 'spinup-1950', 'spinup-1950', NULL, 'coupled spinup with fixed 1950s forcings from 1950 initial conditions (with ocean at rest) to provide initial condition for control-1950 and hist-1950', 'The HighResMIP equivalent of the pre-industrial spinup with fixed 1950s forcing. The forcing consists of greenhouse gases, including ozone and aerosol loading for a 1950s (~10 year mean) climatology. For optimal comparison between models, use of plume aerosol concentrations is recommended (rather than emissions).  
INSERT INTO docs.tbl_document VALUES (398736, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '78626739-cca8-475c-b114-0e30c20fde5f', 1, '2020-11-17 01:19:05.639745', true, 'ThreeRegionalDeforestation', 'ThreeMemberRegionalDeforestation', NULL, 'Three member ensemble of regional deforestation', 'An ensemble of up to three simulations forced with deforestation in Boreal, Temperate and Tropical regions', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398737, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '11cdcad8-21a1-4245-b41e-dc12fa237b7d', 1, '2020-11-17 01:19:05.639745', true, 'Grassland', 'grassland', NULL, 'Natural Grassland', 'Grassland without any crop management.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398738, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '24a12dc4-9223-4a1b-90ad-0430bfaa99e1', 1, '2020-11-17 01:19:05.639745', true, 'RCP70 Reduced Short Lived Gas Species', 'ReducedRCP70sls', NULL, 'Reduced Representative Concentration Pathway 7.0 Short Lived Gas Species', 'Impose changing concentrations of reduced RCP7.0 short lived gas species. Beginning in 2014 with air quality policies (or maximum feasible reductions) applied to the SSP3-7 NTCF emissions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398739, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '918f08c7-14f2-4c8b-8ca3-24529aeed4d2', 1, '2020-11-17 01:19:05.639745', true, '1850-1851 10yrs1', '10yrs1850-1851_yr1', NULL, '1850/01/01-1850/12/31', 'Idealised temporal constraint, repeating 1850 for 10 years, to coincide with the first year of the GeoMIP G1ext experiment', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398740, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '904bff88-8358-4fe4-9082-fb185929f1b4', 1, '2020-11-17 01:19:05.639745', true, '2100-7099 5000yrs max', '5000yrs2100-7099max', NULL, '2100/01/01-7099/12/31 maximum', 'Run from 2100 for a maximum of 5000 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398741, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '8027c288-9526-4943-a3ee-30d941337665', 1, '2020-11-17 01:19:05.639745', true, 'Crop as grass', 'cropAsGrass', NULL, 'Treat cropland as grassland', 'Cropland is treated like natural grassland without any crop management in terms of biophysical properties.  Note that cropland is treated as agricultural land for dynamic vegetation (i.e. no competition with natural vegetation areas).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398742, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '58a9f4e2-385e-4cda-b377-de2b2548defe', 1, '2020-11-17 01:19:05.639745', true, 'Initialisation after spin-up', 'spinUpInitialisation', NULL, 'Initialisation after system reaches quasi-equilibrium', 'Initialisation after the system reaches quasi-equilibrium', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398743, 'cmip6', '<cdrmip>', '--', 'cim.2.designing.NumericalExperiment', '672668b9-ac8d-4722-a089-1f8287ce6c1e', 1, '2020-11-17 01:19:05.639745', true, 'esm-ssp585-ssp126Lu-ext', 'esm-ssp585-ssp126Lu-ext', 'CDR-afforestation', 'extension of the LUMIP emissions-driven simulation following SSP5-8.5 with SSP1-2.6 land use', 'Long term extension of the LUMIP esm-ssp585-ssp126Lu simulation. A CO2 emissions driven SSP5-8.5 scenario with SSP1-2.6 land use forcing. Include all anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398744, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'aae0d3f5-a6c7-4edc-883d-ca65b29f6f02', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Solar Forcing', 'Pre-IndustrialSolar', NULL, 'Pre-Industrial Solar forcing', 'The pre-Industrial control solar forcing is constructed of time-averaged historical data corresponding to 1850-1873 (solar cycle 9+10) mean conditions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398745, 'cmip6', '<ls3mip>', '--', 'cim.2.designing.NumericalExperiment', '5c35e4ef-7945-4a99-ae3c-8fcc387105ee', 1, '2020-11-17 01:19:05.639745', true, 'lfmip-pdLC-cruNcep', 'lfmip-pdLC-cruNcep', NULL, 'prescribed land conditions (from current climate climatology) derived from land-hist-cruNcep and initialized from "historical" run year 1980', 'Scenario forced experiment with prescribed land surface climatology derived from land-hist-cruNcep (1980-2014). The experiment is comprised of transient coupled atmosphere-ocean simulations in which a selection of land surface characteristics is prescribed rather than interactively calculated in the model.  The "climatological" land surface forcing is calculated as the mean annual cycle in the period 1980-2014 from the land-hist-cruNcep simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398797, 'cmip6', '<damip>', '--', 'cim.2.designing.NumericalExperiment', '8ee14180-73ff-4c64-a466-d88671d8ad83', 1, '2020-11-17 01:19:05.639745', true, 'ssp245-aer', 'ssp245-aer', NULL, 'aerosol-only SSP2-4.5 runs', 'An extension of at least one of the hist-aer (histAER) simulations to the year 2100 following SSP2-4.5 aerosol concentrations. Forced with aerosol and aerosol precursor emissions only (sulfate, black carbon, organic carbon, ammonia, NOx and VOCs).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398798, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '4b5fb216-b5c7-4f16-8326-53700e70fcb7', 1, '2020-11-17 01:19:05.639745', true, '5000yrs max', '5000yrsmax', NULL, 'maximum 5000 years', 'Run for a maximum of 5000 years (minimum 200 years)', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399149, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'dd130d78-8ae6-44c7-9574-21fa4d334032', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP future SST climatology', 'PAMIP-fut-SST-clim', NULL, 'PAMIP monthly mean climatology of future sea surface temperature', 'Future monthly mean cimatology of sea surface temperatue, data provided by PAMIP is representative of 2K global warming.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398973, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '96bf06f7-545e-4909-91ea-64ef35c6e8f4', 1, '2020-11-17 01:19:05.639745', true, 'piControl Vegetation Distribution', 'piControlVegDist', NULL, 'Vegetation distribution from the pre-industrial simulation', 'Vegetation distribution prescribed from the output of the piControl simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398746, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', 'ec3e1c34-8eea-49ec-ad0c-1a8bb3a060ed', 1, '2020-11-17 01:19:05.639745', true, 'pdSST-futArcSIC', 'pdSST-futArcSIC', '1.6', 'Atmosphere time slice with present day SST and future Arctic SIC', 'Atmosphere-only time slice experiment forced by climatological monthly mean sea surface temperature (SST) for the present day sea and future Actic sea ice concentration (SIC). Radiative forcing to be set to present day (year 2000) levels. Future SIC will be computed from the ensemble of CMIP5 projections by PAMIP. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398747, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '07a78047-0712-42ac-aa5f-b9dde67ecae9', 1, '2020-11-17 01:19:05.639745', true, 'Restore SST running Mean Sub Tropical N Atlantic', 'RestoreSSTrunningMeanSubTropNAtlantic', NULL, 'Restore to 12-month running mean of SST in the sub tropical north Atlantic', 'Sea Surface Temperatures (SSTs) are restored to model climatology plus a 12-month running mean of SST anomalies by a Newtonian cooling over the sub tropical North Atlantic (10N-35N).  The restoring timescale is 10 days for a 50m deep mixed layer (or equivalent). The restoring coefficient of 40 W/m2/K should decrease to zero over an 8 degree buffer zone bounding the restored region.   SST  anomalies (1950-2014) will be provided by DCPP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398748, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '3a65cb54-3ced-4b3a-9546-64a44214345e', 1, '2020-11-17 01:19:05.639745', true, 'Mid-Pliocene Topography', 'midPlioTopog', NULL, 'Topography for the Mid-Pliocene', 'Impose Mid-Pliocene Warm Period (3.2 Ma ago) topography (smaller ice sheets).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398749, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '6a0afb0e-e709-4ef1-bb27-688373ba7bb9', 1, '2020-11-17 01:19:05.639745', true, 'BGCTracerInitialisation', 'BGCTracerInitialisation', NULL, 'Biogeochemical tracer initialisation', 'Dissolved Inorganic Carbon (DIC) and total alkalinity (ALK) initialisation from GLODAPv2 gridded data.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398750, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'de7696ea-ded4-4029-b6f1-348a2996f6b8', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Aerosols', 'Pre-IndustrialAerosol', NULL, 'Pre-Industrial Aerosols', 'Constant pre-industrial aerosol characteristics. For models without internally calculated aerosol concentrations, a monthly climatology dataset of aerosol physical and optical properties should be used.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398751, 'cmip6', '<volmip>', '--', 'cim.2.designing.NumericalExperiment', '403c1055-d18e-451a-8f18-18d8dff6069a', 1, '2020-11-17 01:19:05.639745', true, 'volc-pinatubo-slab', 'volc-pinatubo-slab', NULL, 'Pinatubo experiment with full volcanic forcing and slab ocean', '1991 Pinatubo forcing as used in the CMIP6 historical simulations.  Maintain the same constant boundary forcing as the pre-industrial control integration, except for the volcanic forcing. Requires special diagnostics of parameterised and resolved wave forcings, radiative and latent heating rates. The experiment will not account for the actual climate conditions when the real event occured (e.g., presence and strength of additional forcing factors). Instead, the experiment is designed to span very different initial climate states to systematically assess uncertainties in the post-eruption behaviour that are related to background climate conditions. Sampling of an eastern phase of the Quasi-Biennial Oscillation (QBO), as observed after the 1991 Pinatubo eruption is preferred for those models that spontaneously generate such mode of stratospheric variability. Run at least 25 ensemble members for 3 years. Use a model configuration with a slab ocean.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398752, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '047da422-5ce9-41f1-91d9-a09a4d3226d0', 1, '2020-11-17 01:19:05.639745', true, 'A summary of the CMIP5 experiment design', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398753, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'e8cae059-845f-4393-b57d-ad7062796f7e', 1, '2020-11-17 01:19:05.639745', true, 'ObservedInitialisation', 'obsInitialisation', NULL, 'Initialisation from observations', 'Initialisation based on observations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398754, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c000e0c6-2e00-4554-add4-42c677f6ffdd', 1, '2020-11-17 01:19:05.639745', true, '2014 Aerosolsx2', '2014Aerosolsx2', NULL, '2014 aerosols x 2', 'Impose present day (2014) aerosol concentrations scaled by 2.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398755, 'cmip6', NULL, '--', 'cim.2.designing.Project', 'e565a0ac-bb6b-4d0d-823a-380d511bd24c', 1, '2020-11-17 01:19:05.639745', true, 'GeoMIP', 'geomip', NULL, 'The Geoengineering Model intercomparison Project', 'GeoMIP experiments apply geoengineering methods that modify stratospheric sulfate aerosol, solar irradiance and cirrus clouds to specified DECK and ScenarioMIP experiments.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398756, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b2d343e6-b4d8-4b28-bde2-0ae79ec1d012', 1, '2020-11-17 01:19:05.639745', true, 'RCP85-extension Well Mixed GHG', 'RCP85extwmGHG', NULL, 'Representative Concentration Pathway 8.5 Extension Well Mixed Greenhouse Gases', 'Impose changing concentrations of RCP8.5 extension long-lived greenhouse gases, including CO2, N2O and halogenated gases.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398757, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '2eaadf81-1d4f-4edc-8390-a481972a84ff', 1, '2020-11-17 01:19:05.639745', true, 'The Geoengineering Model Intercomparison Project (GeoMIP)', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398758, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '1bf3be4e-c5ba-4522-9e30-f290af78a076', 1, '2020-11-17 01:19:05.639745', true, '1950-2049 100yrs', '100yrs1950-2049', NULL, '1950/01/01-2050/01/01', 'Historical Scenario, from recent past to near future.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398759, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '65a237db-e274-4166-a379-d621ab5e1244', 1, '2020-11-17 01:19:05.639745', true, 'LFMIP-RAForcing', 'LFMIP-RAForcing', NULL, '30yr running mean land surface forcing', '30 year running mean land surface forcing.  Note the climatological median of soil water and snow water is to be used instead of climatological means.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398760, 'cmip6', '<pmip>,<volmip>', '--', 'cim.2.designing.NumericalExperiment', '42323338-1873-4eb4-8bb9-a164a3b83378', 1, '2020-11-17 01:19:05.639745', true, 'past1000', 'past1000', NULL, 'past 1000 years', 'For the period from 850 to 1850 CE (the millennium before the start of the industrial revolution), impose boundary conditions of solar variations, volcanic aerosols, atmospheric concentration of well-mixed greenhouse gases, land use and orbital parameters.  Run for 1000 years after spin-up period. It is mandatory that the model versions used for the PMIP-CMIP6 experiments are the exactly the same as for the other CMIP6 experiments, in particular the DECK and historical simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398761, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a14d2029-0446-4cb5-b000-dd9126db2949', 1, '2020-11-17 01:19:05.639745', true, 'ISMIP6-specified AMIP input', 'ISMIP6AMIPInput', NULL, 'ISMIP6-specified input from an AGCM AMIP experiment', 'ISMIP6-specified input from the output of an AGCM amip climate forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398911, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '814ddf46-b398-489f-8b2f-f1a4c2c9d1af', 1, '2020-11-17 01:19:05.639745', true, '1850 Tropospheric Ozone Precursor Emissions excluding Biogenic VOCs', '1850TropO3PreExcludeBioVOC', NULL, '1850 emissions of tropospheric ozone precursors excluding biogenic VOCs', 'Impose pre-industrial (1850) emissions of tropospheric ozone precursors excluding biogenic VOCs (Volatile Organic Compounds).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398912, 'cmip6', NULL, '--', 'cim.2.shared.Party', '923af713-0285-4d37-9e88-c42fbbe09f54', 1, '2020-11-17 01:19:05.639745', true, 'PCMDI', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398876, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '2217e216-ad8b-4efe-a484-a7ab1b4754bc', 1, '2020-11-17 01:19:05.639745', true, 'rad-pd-3xCO2', 'rad-pd-3xCO2', NULL, 'RFMIP-IRF', 'Offline radiative transfer calculations of vertically-resolved broadband-integrated longwave and shortwave fluxes for present-day (2015) clear sky (aerosol-free) conditions with three times the pre-industrial carbon dioxide concentrations. Use specified atmospheric distributions of temperature and humidity and surface properties over many profiles.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398762, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', '94ba6329-d08b-4170-82a7-405126aaae01', 1, '2020-11-17 01:19:05.639745', true, 'piClim-2xss', 'piClim-2xss', NULL, 'pre-industrial climatolgical SSTs and forcing, but with doubled emissions of sea salt', 'Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases). The sea salt aerosol emission fluxes in the interactive parameterisation are double their pre-industrial value.  All other NTCF (near term climate forcers) are set to pre-industrial levels. For models that do not interactively parameterise particular emissions, the fluxes from the 1850 climatological dataset should be doubled. This is a timeslice experiment of 30 years total.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398763, 'cmip6', '<geomip>,<scenariomip>', '--', 'cim.2.designing.NumericalExperiment', '4cd59c6f-24bf-4d58-baba-7a35ab6c953e', 1, '2020-11-17 01:19:05.639745', true, 'ssp460', 'ssp460', NULL, 'update of RCP6.0 based on SSP4', 'SSP-based RCP scenario with medium radiative forcing by the end of the century.  Following approximately RCP6.0 global forcing pathway with SSP4 socioeconomic conditions. Radiative forcing reaches a level of 6.0 W/m2 in 2100. Concentration-driven.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398764, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '3d2302bf-8ca0-49bf-a624-556d59a7e97b', 1, '2020-11-17 01:19:05.639745', true, 'Restore SST running mean N Atlantic', 'RestoreSSTrunningMeanNAtlantic', NULL, 'Restore to 12-month running mean of SST in the north Atlantic', 'Sea Surface Temperatures (SSTs) are restored to model climatology plus a 12-month running mean of SST anomalies by a Newtonian cooling over the North Atlantic (10N-65N).  The restoring timescale is 10 days for a 50m deep mixed layer (or equivalent). The restoring coefficient of 40 W/m2/K should decrease to zero over an 8 degree buffer zone bounding the restored region.  No restoring if sea ice is present.  SST anomalies (1950-2014) will be provided by DCPP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398765, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'b97e67bb-f31b-4eb3-b568-1174f83be0b4', 1, '2020-11-17 01:19:05.639745', true, '5yrs', '5yrs', NULL, '5 years', 'Run for at least 5 years, for use with a start date ensemble.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398766, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'ab7ed4bd-b97f-43be-8a9e-4e053d33e050', 1, '2020-11-17 01:19:05.639745', true, 'The Model Intercomparison Project on the climatic response to Volcanic forcing (VolMIP): Experimental design and forcing input data', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398767, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '932cbe4c-5851-45cc-bec3-1119c1d71f70', 1, '2020-11-17 01:19:05.639745', true, 'esm-ssp585EndInit', 'esm-ssp585EndInit', NULL, 'Initialisation from the end of the esm-ssp585 simulation', 'Initialise from the end of the C4MIP esm-ssp585 experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398768, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '6ed9e2ea-7a2c-44c4-ac57-0c5d57178f12', 1, '2020-11-17 01:19:05.639745', true, 'rad-pd-8xCO2', 'rad-pd-8xCO2', NULL, 'RFMIP-IRF', 'Offline radiative transfer calculations of vertically-resolved broadband-integrated longwave and shortwave fluxes for present-day (2015) clear sky (aerosol-free) conditions with eight times the pre-industrial carbon dioxide concentrations. Use specified atmospheric distributions of temperature and humidity and surface properties over many profiles.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398769, 'cmip6', '<ls3mip>', '--', 'cim.2.designing.NumericalExperiment', 'f10db1ed-9d5e-4b42-a8d0-c83e846c1415', 1, '2020-11-17 01:19:05.639745', true, 'land-hist-cruNcep', 'land-hist-cruNcep', 'Land-Hist-cruNcep', 'Historical land-only with CRU-NCEP forcings', 'Land only simulations using CRU-NCEP forcing data and a standard bias correction strategy. As LUMIP land-hist but with CRU-NCEP dataset. CRU-NCEP is a forcing dataset in which NCEP reanalysis data are bias corrected using the gridded in situ climate data form the Climate Reserach Unit (CRU). The land model configuration should be identical to that used in the DECK and CMIP6 historical simulations for the parent coupled model.  Spin-up of the land-only simulations should follow the TRENDY protocol.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398770, 'cmip6', NULL, '--', 'cim.2.designing.Project', 'd52302a0-d2a7-40df-8816-148c5a63473e', 1, '2020-11-17 01:19:05.639745', true, 'PMIP', 'pmip', NULL, 'Paleoclimate Modeling Intercomparison Project', 'PMIP is a suite of experiments that give insight into the behaviour of the climate system in the past and how it compares to present-day climate.  PMIP builds on simulations for CMIP5: last millennium (last 1000 years), the mid-Holocene (~6,000 years ago), the Last Glacial Maximum (~21,000 years ago) with two additional warm period simulations: the Last Interglacial (~127,000 years ago) and the mid-Pliocene (~3,200,000 years ago).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398771, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '63d0df42-cde0-47f5-a564-5143fc1ced6f', 1, '2020-11-17 01:19:05.639745', true, 'Relative influences of the Interdecadal Pacific Oscillation and ENSO on the South Pacific Convergence Zone', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398772, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '0b0b6d01-396a-48d9-97b4-68a0c164925d', 1, '2020-11-17 01:19:05.639745', true, '2070-2100 31yrs', '31yrs2070-2100min', NULL, '2070/01/01-2100/12/31 minimum', 'Run from 2070 to at least 2100.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398773, 'cmip6', '<c4mip>', '--', 'cim.2.designing.NumericalExperiment', 'cfa7f5b8-8688-47bd-ac19-9d096d90a4a3', 1, '2020-11-17 01:19:05.639745', true, 'esm-bell-750PgC', 'esm-bell-750PgC', 'B2', 'emissions driven 750 PgC bell-curve', 'Bell-shape zero emissions experiment. Run in emissions-driven configuration with CO2-only forcing, all non-CO2 forcing is fixed at pre-industrial levels. Use a bell-shaped CO2 emissions profile designed to give cumulative emissions of 750 PgC after 100 years.  Then hold CO2 emissions at zero and simulate the subsequent reduction in CO2 and change in climate for at least 100 years (1000 years for EMICs).  The time series of global CO2 for the bell-shape emission profiles will be provided by ZECMIP via the C4MIP and CDRMIP websites.  A model decision is required on the spatial pattern of CO2 emissions, ZECMIP suggest globally uniform at surface.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398774, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd194ae82-cf8c-48ca-a55b-0de391068d26', 1, '2020-11-17 01:19:05.639745', true, '1850 non-OC Aerosol Emissions', '1850nonOCAer', NULL, '1850 Emissions of Aerosols Excluding Organic Carbon', 'Impose pre-industrial (1850) emissions of aerosols excluding organic carbon (OC).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398775, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '4081d6a6-a1ef-4f75-8e04-babf4f3e7a05', 1, '2020-11-17 01:19:05.639745', true, '1% per year CO2 Increase', '1%yrCO2Increase', NULL, '1% per year increase in atmospheric CO2 until quadrupling', 'Impose a 1% per year increase in the concentration of atmospheric carbon dioxide until quadrupling.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398776, 'cmip6', '<fafmip>', '--', 'cim.2.designing.NumericalExperiment', '74c300f1-793a-4c08-94d8-07eebc9eab5b', 1, '2020-11-17 01:19:05.639745', true, 'faf-all', 'faf-all', NULL, 'control plus perturbative surface fluxes of momentum, heat and water into ocean', 'Simultaneously apply anomalous fluxes of windstress, heat and freshwater using the passive-tracer method for heat as in the faf-heat experiment.
INSERT INTO docs.tbl_document VALUES (398777, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a4436a34-2a54-4114-beac-19bfdc3b1743', 1, '2020-11-17 01:19:05.639745', true, 'ssp245-covid Short Lived Species', 'ssp245-covidSLS', NULL, 'ssp245-covid Short Lived Species', 'ssp245-covid short lived species: BC, CO, OC, SO2, NH3, NOx, NMVOCs', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399227, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '173c1d5e-6e3b-4586-8c9a-0224f4f6f4f7', 1, '2020-11-17 01:19:05.639745', true, '1850-1851 70yrs', '70yrs1850-1851', NULL, '1850/01/01-1850/12/31', 'Idealised temporal constraint, repeating 1850 for 70 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398877, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '96ba40b6-8a07-4eab-9092-239907e275c0', 1, '2020-11-17 01:19:05.639745', true, '2x 1850 Fire Aerosol Emissions', '2x1850fireAer', NULL, 'Doubled 1850 emissions from fire', 'Impose 1850 doubled fire emission fluxes. Or double the fire aerosol emissions of the 1850 climatological data.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398778, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'dbd505f9-0e02-4b49-9041-d91d08e7551d', 1, '2020-11-17 01:19:05.639745', true, '1pctCO2 Fresh Water Flux Anomaly At Doubling', '1pctCO2FreshWaterFluxAtDoubling', NULL, '1pctCO2 ensemble mean freshwater flux anomaly at time of CO2 doubling', 'Impose surface freshwater flux anomalies to the ocean (including the contribution from runoff change), created from the CMIP5 diagnostic of water flux into sea water (wfo).  The surface freshwater flux is calculated from the ensemble mean of the CMIP5 1pctCO2 simulations at the time of CO2 doubling.  Surface flux anomalies (a function of longitude, latitude and time of year) are to remain constant throughout the experiment.   Note that the fluxes themselves are not replaced because this would typically cause a very large climate drift and possible instability.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398779, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '578e1723-9c0a-4d95-bd02-915c48be1434', 1, '2020-11-17 01:19:05.639745', true, 'CFC11 Tracer', 'cfc11Tracer', NULL, 'OCMIP2 CFC11 inert chemical tracer', 'Online simulation of CFC11 inert chemical tracers.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398780, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'f6c48434-8328-4489-ad39-2bd6aec7a7e8', 1, '2020-11-17 01:19:05.639745', true, 'CRU-NCEP Historical forcing', 'CRU-NCEPHistoricalForcing', NULL, 'Land surface historical forcing with CRU-NCEP Forcing data', 'Apply CRU-NCEP forcing to offline land surface models running the LS3MIP land-hist-CruNcep historical simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398781, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '63b7deb8-97ae-4d02-a451-b0ec1b0ec776', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Forcing Excluding GHG', 'piForcingExcludingGHG', NULL, 'Pre-industrial forcing, excluding greenhouse gases', 'Pre-Industrial forcing excluding greenhouse gases (GHG). See table 2 Pincus et al 20016).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398782, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '7433ad89-0530-40e8-a20a-b5e7a0a111ca', 1, '2020-11-17 01:19:05.639745', true, 'NA50pct 1pctCO2 Heat Flux Anomaly At Doubling', 'NA50pct1pctCO2HeatFluxAtDoubling', NULL, '1pctCO2 ensemble mean surface heat flux anomaly at time of CO2 doubling except that within part of the North Atlantic ocean the perturbation is multiplied by 0.5.', 'Impose heat flux anomalies to the ocean surface, created from the CMIP5 diagnostic of surface downward heat flux in sea-water (hfds).  The surface heat-flux anomalies are calculated from the ensemble mean of the CMIP5 1pctCO2 simulations at the time of CO2 doubling except that within part of the North Atlantic ocean the perturbation is multiplied by 0.5.  Surface flux anomalies (a function of longitude, latitude and time of year) are to remain constant throughout the experiment.  Note that the fluxes themselves are not replaced because this would typically cause a very large climate drift and possible instability.  The method for implementing the heat flux anomaly should follow that used by Bouttes and Gregory (2014).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398783, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', '4d4a5031-c185-4048-b5d7-9516dcffd94f', 1, '2020-11-17 01:19:05.639745', true, 'aqua-4xCO2', 'aqua-4xCO2', NULL, 'aquaplanet with 4xCO2', 'Continuation of CFMIP-2 AMIP experiments and CMIP5 experiment 6.7b. 
INSERT INTO docs.tbl_document VALUES (398784, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '729b5e0c-ac7c-41bb-a804-54c2ef02dcf7', 1, '2020-11-17 01:19:05.639745', true, 'Solar Forcing for CMIP6 (v3.1)', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398785, 'cmip6', '<cdrmip>', '--', 'cim.2.designing.NumericalExperiment', '6a465822-ac43-4b3e-beb4-388d291860d4', 1, '2020-11-17 01:19:05.639745', true, '1pctCO2-cdr', '1pctCO2-cdr', 'CDR-reversibility', '1 percent per year decrease in CO2 from 4xCO2', '1 percent per year decrease in CO2.  Use the 4 x CO2 restart from the 1pctCO2 simulation and prescribe a 1% per year removal of CO2 from the atmosphere  (start removal at the beginning of the 140th year on 1 January)  until the CO2 concentration reaches 284.7 ppm (140 years of removal).  The CO2 concentration should then be held at 284.7 ppm for as long as possible (minimum 60 years) with all other forcing held constant at pre-industrial levels.  EMICs (Earth System Models of Intermediate Complexity) and box models are encouraged to extend runs for at least 1000 years (max 5000 years) at 284.7 ppm CO2. Additional ensemble members are requested with tier 2 priority.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398786, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a2723151-eb6d-4fc0-993c-b0bb66592cd0', 1, '2020-11-17 01:19:05.639745', true, 'RCP70 Aerosol Precursors', 'RCP70aerpre', NULL, 'Representative Concentration Pathway 7.0 Aerosol Precursors', 'Impose changing emissions of RCP7.0 aerosol precursors including SO2 and NHy.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398787, 'cmip6', NULL, '--', 'cim.2.designing.MultiEnsemble', '4a777485-3b7f-4c12-b0cc-aff139feb049', 1, '2020-11-17 01:19:05.639745', true, '1960Biennialx10', '1960biennialx10', NULL, 'Multi-initialisations of 1960 Biennial start date ensemble', 'A multi-ensemble of 300 simulations with ten initialisations for each start date occurring every other year from 1960 to the present.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398788, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '4080ff9b-e841-48d4-9079-5b820f99156d', 1, '2020-11-17 01:19:05.639745', true, 'Historical Proton Forcing', 'HistoricalProtonForcing', NULL, 'Historical Proton Forcing', 'Include HOx and NOx productios by solar protons in models with interactive stratospheric chemistry by using the daily ionization data available from the SOLARIS-HEPPA website.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398789, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '2b26b751-2152-4415-a972-f2e1af9b6451', 1, '2020-11-17 01:19:05.639745', true, 'PD+4K Atmospheric States', 'PD+4KAtmosStates', NULL, 'Present day plus 4K atmospheric states', 'Present day plus 4K atmospheric conditions, assuming constant relative humidity and using a vertical shift transform to map surface warming to atmospheric structure.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398790, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '83acd6ca-ef0b-40fc-b2fd-2055ece97b48', 1, '2020-11-17 01:19:05.639745', true, '1850-1869 20yrs', '20yrs1850-1869', NULL, '1850/01/01-1870/01/01', 'Begin in pre-industrial era and run for a minimum of 20 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398791, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '5ff98f84-5e5b-4032-aa0c-df8b3f50c134', 1, '2020-11-17 01:19:05.639745', true, 'esm-ssp585-ssp126LuEndInit', 'esm-ssp585-ssp126LuEndInit', NULL, 'Initialisation from the end of the esm-ssp585-ssp126Lu simulation', 'Initialise from the end of the LUMIP esm-ssp585-ssp126Lu experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398792, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ae485116-285e-4346-a54c-3eddfef8a6f9', 1, '2020-11-17 01:19:05.639745', true, 'El Chichon Aerosol', 'elChichonAerosol', NULL, 'El Chichon volcanic aerosol forcing', 'Aerosol forcing from the 1982 El Chichon volcanic eruption.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398793, 'cmip6', NULL, '--', 'cim.2.shared.Party', 'a012a265-373e-4144-b2d6-783accd3548d', 1, '2020-11-17 01:19:05.639745', true, 'Charles Jackman', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398794, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '5e461eb7-2b21-4a60-bcbd-b661e3704d20', 1, '2020-11-17 01:19:05.639745', true, 'HighAndStandardResolution', 'highStandardRes', NULL, 'At least two members, one high resolution and one standard resolution', 'At least two simulations, one at high resolution (minimum 25-50 km at mid-latitudes), and one at the standard model resolution', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398795, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '641a6fbb-5e87-4c84-a632-81805afa2234', 1, '2020-11-17 01:19:05.639745', true, '1980-2009 30yrs', '30yrs1980-2010', NULL, '1980/01/01-2010/01/01', 'Historical, from 1980 to 2010.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398796, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b122007e-f431-41d1-a09c-aa9d43ca9e87', 1, '2020-11-17 01:19:05.639745', true, '2014 SO2', '2014SO2', NULL, 'Present Day 2014 SO2 Emissions', 'Impose present day (2014) emissions of sulfur dioxide (SO2).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398878, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '08fd8067-729a-4c36-8512-801326e9ee9d', 1, '2020-11-17 01:19:05.639745', true, '2014 Ozone Depleting Halocarbon Concentrations', '2014OzoneDepletingHalocarbonConc', NULL, '2014 Concentrations of Ozone Depleting Halocarbons', 'Impose 2014 concentrations of ozone depleting halocarbons (CFC/HCFC).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398799, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'd1a9ef19-ec0d-43f3-93c4-f0805ee779e4', 1, '2020-11-17 01:19:05.639745', true, 'rad-pd-piHFC', 'rad-pd-piHFC', NULL, 'RFMIP-IRF', 'Offline radiative transfer calculations of vertically-resolved broadband-integrated longwave and shortwave fluxes for present-day (2015) clear sky (aerosol-free) conditions with present day (2015) greenhouse gas concentrations and pre-industrial hydrofluorocarbons (HFCs). Use specified atmospheric distributions of present day temperature and humidity and surface properties over many profiles.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398800, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'e888e182-839e-4c81-ab78-2f7b725b7621', 1, '2020-11-17 01:19:05.639745', true, 'Long-term effect of volcanic forcing on ocean heat content', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398801, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '931ebe78-17b1-4d64-a9ad-1a65728c67a9', 1, '2020-11-17 01:19:05.639745', true, '2040-7039 5000 yrs max', '5000yrs2040-7039', NULL, '2040/01/01-7039/12/31 maximum', 'Run from 2040 for a maximum of 5000 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398802, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'f35d4b79-6461-44b8-8062-75bd54c22e41', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP pre-industrial SIC climatology', 'PAMIP-pi-SIC-clim', NULL, 'PAMIP monthly mean climatology of pre-industrial sea ice concentration', 'Pre-industrial monthly mean cimatology of sea ice concentration, data computed from the ensemble of CMIP5 simulations by PAMIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398803, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '7831b684-c894-4d77-ab11-5f7f8af5b659', 1, '2020-11-17 01:19:05.639745', true, '1982-1991 10yrs', '10yrs1982-1991', NULL, '1981/12/31-1991/12/31', 'El Chichon historical.  Start date on or before 31st December 1981.  Start dates on or before 15th November recommended to allow for DJF seasonal forecast results. Run for 10 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398804, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c91cc84c-2c4f-460c-ba84-92d9e484011c', 1, '2020-11-17 01:19:05.639745', true, 'LGM N2O', 'LGMN2O', NULL, 'Last Glacial Maximum N2O concentration', 'Impose Last Glacial Maximum (21 kyr ago) atmospheric Nitrous Oxide (N2O) concentration.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398805, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', 'b531f8df-cecc-4627-b2a2-31b983502c1d', 1, '2020-11-17 01:19:05.639745', true, 'modelSST-futArcSIC', 'modelSST-futArcSIC', '4.2', 'Atmosphere time slice with present day coupled model SST and future Arctic SIC', 'Atmosphere-only time slice experiment to investigate the role of the background state. Time slice forced by future sea ice concentration (SIC) and present day sea surface temperature (SST) from the coupled model experiment pa-pdSIC (2.1) rather than from observations. Radiative forcing to be set to present day (year 2000) levels. Future SIC will be computed from the ensemble of CMIP5 projections by PAMIP. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398806, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '5e53d039-66d0-45f8-984a-8619a0f688d4', 1, '2020-11-17 01:19:05.639745', true, 'Climate Impact of Increasing Atmospheric Carbon Dioxide', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398807, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', '7c445c93-4376-4e77-b6e6-e8178602629e', 1, '2020-11-17 01:19:05.639745', true, 'histSST', 'histSST', NULL, 'historical SSTs and historical forcing', 'Historical atmosphere only simulation with historical forcings in an AGCM model with interactive aerosols.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398808, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', '58fe8bad-1d5e-4217-9130-4bd005eb1013', 1, '2020-11-17 01:19:05.639745', true, 'dcppC-amv-ExTrop-pos', 'dcppC-amv-ExTrop-pos', 'C1.7', 'idealised positive extratropical AMV anomaly pattern', 'Restore the extra-tropical north Atlantic sea surface temperature to positive Atlantic Multidecadal Variability (AMV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members.  SST signal may also be imposed by altering surface fluxes.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398809, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', 'ea5260a5-d611-4593-be3c-4e8784c25d88', 1, '2020-11-17 01:19:05.639745', true, 'piClim-2xVOC', 'piClim-2xVOC', NULL, 'pre-industrial climatolgical SSTs and forcing, but with doubled emissions of biogenic VOCs', 'Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases). The biogenic VOC (volatile organic compounds) emission fluxes in the interactive parameterisation are double their pre-industrial value.  All other NTCF (near term climate forcers) are set to pre-industrial levels. For models that do not interactively parameterise particular emissions, the fluxes from the 1850 climatological dataset should be doubled. This is a timeslice experiment of 30 years total. The model should have the capacity for interactive tropospheric chemistry.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398810, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '88741861-03c1-47f3-a1d5-3ed1800a6264', 1, '2020-11-17 01:19:05.639745', true, 'RCP34 Forcing', 'rcp34Forcing', NULL, 'Representative Concentration Pathway 3.4 W/m2 Forcing', 'Impose RCP3.4 forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398811, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'd5020c60-9478-4358-999d-2c002a411157', 1, '2020-11-17 01:19:05.639745', true, '2070esm-ssp585-ocn-alkInitialisation', '2070esm-ssp585-ocn-alkInitialisation', NULL, 'Initialisation from year 2070 of the esm-ssp585-ocn-alk simulation', 'Initialise from the CDRMIP esm-ssp585-ocn-alk experiment in the year 2070.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398812, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'af1a5a22-3e85-4420-a469-cb0f78c424d8', 1, '2020-11-17 01:19:05.639745', true, '2015-2115 101yrs min', '101yrs2015-2115min', NULL, '2015/01/01-2115/12/31 minimum', 'Run from 2015 to 2115.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398813, 'cmip6', NULL, '--', 'cim.2.designing.Project', '8fef36e4-d604-4a57-b527-fd5838582d67', 1, '2020-11-17 01:19:05.639745', true, 'FAFMIP', 'fafmip', NULL, 'Flux-Anomaly-Forced Model Intercomparison Project', 'FAFMIP is a project for comparative analysis of ocean climate change using a suite of experiments that prescribe surface flux perturbations to the ocean component of AOGCMs', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398814, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'a34b7734-bf5c-4e14-856d-d50eb8a02936', 1, '2020-11-17 01:19:05.639745', true, 'Last-Millennium Additional Initialisation Perturbation', 'LastMillenniumAddInitialisationPert', NULL, 'Last millennium additional initialisation perturbation', 'Two additional initialisations, for 1st January 1790 of the PMIP past1000 simulation via the introduction of small perturbations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398866, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '65d58719-858c-4a23-ba17-c4004c9c67c1', 1, '2020-11-17 01:19:05.639745', true, 'esm-piControl Initialisation', 'esm-piControlInit', NULL, 'Initialisation from the ESM Pre-Industrial Control', 'Initialisation from the esm-piControl simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398867, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'e28a46fe-1bde-4c12-898b-e8ef7f2de085', 1, '2020-11-17 01:19:05.639745', true, 'Global data sets of vegetation leaf area index (LAI) 3g and fraction of photosynthetically active radiation (FPAR) 3g derived from global inventory modeling and mapping studies (GIMMS) normalized difference vegetation index (NDVI3g) for the period 1981 to 2011', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398868, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'bfb290f2-2aba-4fba-965a-2ce77a76842d', 1, '2020-11-17 01:19:05.639745', true, '2015-7014 5000yrs max', '5000yrs2015-7014max', NULL, '2015/01/01-7014/12/31 maximum', 'Run from 2015 for a maximum of 5000 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398879, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'dc3716db-e9a6-47cf-a398-faf181643e66', 1, '2020-11-17 01:19:05.639745', true, '2014 Anthropogenic Aerosols', '2014AnthropAerosol', NULL, '2014 anthropogenic aerosol concentrations / emissions', 'Impose present day (2014) anthropogenic aerosol concentrations / emissions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398815, 'cmip6', '<ls3mip>', '--', 'cim.2.designing.NumericalExperiment', 'e707d9fd-53a0-485c-bc81-acbdef1d5875', 1, '2020-11-17 01:19:05.639745', true, 'land-ssp434', 'land-ssp434', 'Land-Future', 'Future SSP4-34 land-only', 'Offline land surface simulations forced with ScenarioMIP SSP4-34.  Three realisations required.  A trend preserving statistical bias correction method is applied to 3-hourly surface meteorological variables from the scenario output to generate a set of ensemble forcing data.  Gridded forcings will be provided by LS3MIP. The land model configuration should be identical to that used in the DECK and CMIP6 historical simulations for the parent coupled model.  Spin-up of the land-only simulations should follow the TRENDY protocol.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398816, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '0600f830-1dfc-4bc6-8fbd-9b90403e4158', 1, '2020-11-17 01:19:05.639745', true, 'The Geoengineering Model Intercomparison Project (GeoMIP): A control perspective', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398817, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '66168d97-4ffb-4112-bbf5-f49606edf43e', 1, '2020-11-17 01:19:05.639745', true, 'TRENDY spin up for CRU-NCEP', 'trendySpinUpCRU-NCEP', NULL, 'TRENDY protocol for the spin up with CRU-NCEP forcing', 'Spin up of the land surface model should follow the TRENDY protocol which calls for recycling of the climate mean and variability from two decades of the CRU-NCEP forcing dataset (1901–1920). Land use should be held constant at 1850 as in the DECK 1850 coupled control simulation (piControl). CO2 and all other forcings should be held constant at 1850 levels during spin-up.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398818, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'eb692bd8-8bd1-47b7-a385-5ee85d84297b', 1, '2020-11-17 01:19:05.639745', true, '2x 1850 wetland Methane', '2x1850wetlandCH4', NULL, 'Doubled 1850 emissions of wetland methane', 'Impose 1850 doubled wetland methane emissions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398819, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '8ac0a6c4-9033-4086-8471-2b664c269bc5', 1, '2020-11-17 01:19:05.639745', true, '4xCO2 for Radiation', '4xCO2Radiation', NULL, 'Quadrupling of atmospheric carbon dioxide concentration only affects radiative code.', 'Impose a quadrupling of pre-industrial carbon dioxide (CO2) concentrations to radiative code.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398820, 'cmip6', '<rfmip>', '--', 'cim.2.designing.NumericalExperiment', '0145cd8c-69a7-4b48-9a99-0417b5fc2498', 1, '2020-11-17 01:19:05.639745', true, 'piClim-lu', 'piClim-lu', 'RFMIP-ERF-LU', 'effective radiative forcing by present day land use', 'An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperature (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  Land use is set to present day (2014) values, other forcing agents are specified at pre-industrial values.  Run for 30 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398821, 'cmip6', NULL, '--', 'cim.2.shared.Party', '0f69aad3-5f47-4dfc-a6b3-d7b22de4051a', 1, '2020-11-17 01:19:05.639745', true, 'Katja Matthes', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398822, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'f9d9b8f3-ef2e-4a92-a589-da04eaccf160', 1, '2020-11-17 01:19:05.639745', true, 'EMICs', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398823, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '35460a97-37a6-4ebd-8152-3acd9daaf46c', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Solar Irradiance Forcing', 'piSolarIrradiance', NULL, 'Pre-Industrial Solar Irradiance Forcing', 'Pre-Industrial solar forcing. The standard solar forcing dataset recommended for usage is the solar reference scenario dataset which includes pre-industrial solar forcing (1850-1873 mean).  Includes total solar irradiance, F10.7 cm solar radio flux, and spectral solar irradiance for 10-100000 nm range.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398824, 'cmip6', '<highresmip>', '--', 'cim.2.designing.NumericalExperiment', '61c7ede7-4b11-4371-9c58-126f5338e919', 1, '2020-11-17 01:19:05.639745', true, 'highresSST-smoothed', 'highresSST-smoothed', NULL, 'smoothed SST version of highresSST-present', 'Similar to the HighResMIP highresSST-present experiment but with smoothed sea surface temperature (SST). Historical atmosphere-only simulations of the near past (1979-2014) using spatially filtered sea surface temperatures (SSTs). Use spatially low-pass filtered HadISST2.2 SSTs (Kennedy et al. 2017, in prep). The SST filter should be the LOESS filter used by Ma et al. (2015) and Chelton and Xie (2010). Run the experiment parallel to highresSST-present.
INSERT INTO docs.tbl_document VALUES (398825, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c0f3922d-a908-429d-8fbc-05e12e106afc', 1, '2020-11-17 01:19:05.639745', true, 'Historical Methane Concentrations', 'HistoricalMethaneConc', NULL, 'Historical Concentrations of Methane', 'Impose historical concentrations of methane (CH4).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398826, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '2091ce79-de25-48e3-a509-943db008aa6d', 1, '2020-11-17 01:19:05.639745', true, 'LFMIP present day land-hist-princeton forcing', 'LFMIP-pd-land-hist-princeton', NULL, 'Present day climate land surface forcing from land-hist-princeton', 'Land surface forcing climatology for present climate (1980-2014) from the land-hist-princeton simulation.  Note the climatological median of soil water and snow water is to be used instead of climatological means.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398827, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'ba024e25-bce6-46d9-a321-5eaa77d75903', 1, '2020-11-17 01:19:05.639745', true, 'Historical Emissions For CMIP6 (v1.0)', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398828, 'cmip6', '<lumip>', '--', 'cim.2.designing.NumericalExperiment', 'd4fef651-5023-4ef5-b54a-9ca5a27813c7', 1, '2020-11-17 01:19:05.639745', true, 'land-noWoodHarv', 'land-noWoodHarv', NULL, 'historical land-only with no wood harvest', 'Land surface model simulation. Same as land-hist except with wood harvest maintained at 1850 amounts/areas.  Start year either 1850 or 1700 depending on standard practice for particular model.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398829, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '6611ae32-4b23-422b-b9d9-e226ab56f7bc', 1, '2020-11-17 01:19:05.639745', true, '1850 non-BC Aerosol Emissions', '1850nonBCAerosol', NULL, '1850 Emissions of non-BC Aerosol', 'Impose pre-industrial (1850) emissions of non-BC aerosols.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398830, 'cmip6', '<geomip>', '--', 'cim.2.designing.NumericalExperiment', 'a3bbb972-69bd-4f16-800c-1db57ec818c7', 1, '2020-11-17 01:19:05.639745', true, 'futureSST-4xCO2-solar', 'futureSST-4xCO2-solar', 'G1extSlice2', 'year 100 SSTs from abrupt4xCO2 with quadrupled CO2 + solar reduction', 'Time slice at year 100 of the GeoMIP G1 experiment with fixed sea surface temperature climatology calculated from the abrupt-4xCO2 experiment after 100 years. Run for 10 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398831, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ab53a71d-b3d6-486d-b1aa-be64f638abb1', 1, '2020-11-17 01:19:05.639745', true, 'RCP Volcanic', 'RCPVol', NULL, 'Representative Concentration Pathway Volcanic Forcing', 'Impose changing volcanic forcing for RCP scenarios.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398832, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '17265a6d-6c41-48c7-89b5-4e419629f308', 1, '2020-11-17 01:19:05.639745', true, 'RCP60 Aerosols', 'RCP60aer', NULL, 'Representative Concentration Pathway 6.0 Aerosols', 'Impose changing emissions of RCP6.0 aerosols including BC and OC.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398833, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '1dc98da2-b915-47d4-85c4-aa9416380973', 1, '2020-11-17 01:19:05.639745', true, 'RCP70 Well Mixed GHG no CH4', 'RCP70wmGHGnoCH4', NULL, 'Representative Concentration Pathway 7.0 Well Mixed Greenhouse Gases except Methane', 'Impose changing concentrations of RCP7.0 long-lived gases, including CO2, N2O and halogenated gases. Do not include methane (CH4).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398849, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'f3ffecd6-689a-4760-9ce6-ef19831e32f0', 1, '2020-11-17 01:19:05.639745', true, 'TRENDY spin up for WFDEI', 'trendySpinUpWFDEI', NULL, 'TRENDY protocol for the spin up with WFDEI forcing', 'Spin up of the land surface model should follow the TRENDY protocol which calls for recycling of the climate mean and variability from two decades of the WFDEI forcing dataset (1901–1920). Land use should be held constant at 1850 as in the DECK 1850 coupled control simulation (piControl). CO2 and all other forcings should be held constant at 1850 levels during spin-up.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398834, 'cmip6', '<fafmip>', '--', 'cim.2.designing.NumericalExperiment', '6a493f69-9d69-405a-8ae4-ea976be4f534', 1, '2020-11-17 01:19:05.639745', true, 'faf-antwater-stress', 'faf-antwater-stress', NULL, 'control plus perturbative surface fluxes of momentum and freshwater into ocean, the latter around the coast of Antarctica only', '1xCO2 experiment, parallel to piControl, forced over the ocean with the momentum flux perturbation field of faf-stress and a surface freshwater flux of 0.1 Sv (100000 m3 s−1) in total to be applied uniformly around the coast of Antarctica in whatever way is most suitable in the model. 
INSERT INTO docs.tbl_document VALUES (398835, 'cmip6', NULL, '--', 'cim.2.shared.Party', 'c2959350-6c23-4fc3-8105-41dafe97c739', 1, '2020-11-17 01:19:05.639745', true, 'Ben Kravitz', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398836, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '4e04a5b3-0fcf-4dba-8a94-168a1013bd30', 1, '2020-11-17 01:19:05.639745', true, '1850 NTCF Emissions', '1850NTCFEmissions', NULL, '1850 Emissions of Near Term Climate Forcers', 'Impose 1850 emissions of Near Term Climate Forcers (NTCF): namely tropospheric aerosols and tropospheric ozone precursors.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398837, 'cmip6', NULL, '--', 'cim.2.designing.Project', 'ecdd7e96-a807-436d-a2db-bb6efb172558', 1, '2020-11-17 01:19:05.639745', true, 'DCPP', 'dcpp', NULL, 'Decadal Climate Prediction Project', 'DCPP is a suite of decadal hindcast and forecast experiments, and mechanism and case study experiments.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398838, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '5fcecdfc-8c3c-4b7f-ba0f-75e44c7dcc4f', 1, '2020-11-17 01:19:05.639745', true, 'RCP85 Aerosol Precursors', 'RCP85aerpre', NULL, 'Representative Concentration Pathway 8.5 Aerosol Precursors', 'Impose changing emissions of RCP8.5 aerosol precursors including SO2 and NHy.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398839, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '3f0df666-b345-4d92-a787-7543ad532bdd', 1, '2020-11-17 01:19:05.639745', true, 'SSP1 RCP19 Land Use', 'RCP19land', NULL, 'Representative Concentration Pathway 1.9 Land Use for Shared Socioeconomic Pathway 1', 'Impose changing concentrations of RCP1.9 land use including crops, pasture, urban area, vegetation and forest for SSP1.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398840, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '9090f4be-2c01-4051-84ec-bae12e740eaf', 1, '2020-11-17 01:19:05.639745', true, 'The Decadal Climate Prediction Project (DCPP) contribution to CMIP6', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398841, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', 'b98b86f8-756b-4576-99ab-2a5b39fc1374', 1, '2020-11-17 01:19:05.639745', true, 'dcppC-hindcast-noPinatubo', 'dcppC-hindcast-noPinatubo', 'C3.1', 'hindcast but with only background volcanic forcing', 'Prediction experiment without volcano forcing. Repeat DCCP-A1 1991 hindcast without Pinatubo forcing. Background volcanic aerosol to be the same as that used in the 2015 forecast. 10 ensemble members. Run each member for at least 5 years, preferably 10 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398842, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ecc11afe-375e-44e7-9ae3-95130e380fab', 1, '2020-11-17 01:19:05.639745', true, 'LFMIP-CAForcing', 'LFMIP-CAForcing', NULL, 'Present climate land surface forcing', 'Land surface forcing climatology for present climate (1980-2014).  Note the climatological median of soil water and snow water is to be used instead of climatological means.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398843, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '1dbb077e-5ecc-4bfa-86da-318f75db49f1', 1, '2020-11-17 01:19:05.639745', true, 'hist-bgc-Initialisation', 'hist-bgc-Initialisation', NULL, 'hist-bgc Initialisation', 'Initialisation is from the end of the hist-bgc experiment.  To provide continuity between simulations of the recent past and future scenario simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398844, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ea231e2b-a49b-4caa-80b4-26c81fe5d305', 1, '2020-11-17 01:19:05.639745', true, 'Historical Transient Irrigation', 'transientIrrigation', NULL, 'Transient Historical Irrigation', 'Historical transient irrigated area.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398845, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'f862b439-6537-4e6f-8a72-074c67d0cd7e', 1, '2020-11-17 01:19:05.639745', true, 'RCP34-extension-overshoot Aerosol Precursors', 'RCP34extoveraerpre', NULL, 'Representative Concentration Pathway 3.4 extension Overshoot Aerosol Precursors', 'Impose changing emissions of RCP3.4 extension overshoot aerosol precursors including SO2 and NHy.  Beginning in 2100, linearly reduce forcings from 3.4 W/m2 pathway to 2.6 W/m2 by 2250.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398846, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '612241b2-919d-4691-b58a-602eeaad1951', 1, '2020-11-17 01:19:05.639745', true, 'InitMip', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398847, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '5da9b964-7b0a-4e8e-8afd-a82e8b33a5d3', 1, '2020-11-17 01:19:05.639745', true, '10MemberSug-IC', 'Sug10Member-IC', NULL, 'Suggest 10 member initial condition ensemble', 'Ensemble beneficial, suggest 10 members, use initial condition (not PPE) ensemble technique. Model-by-model choice how to arrive at perturbed initial conditions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398848, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'e62ca685-4222-47ac-82d0-1c054c69f851', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial ESM Forcing', 'piESMForcing', NULL, 'Pre-industrial Earth System Model Forcing', 'pre-Industrial forcing for Earth System Models that can calculate carbon fluxes', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398869, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '9a77ba23-8f52-4d11-8e45-fc3b799972c2', 1, '2020-11-17 01:19:05.639745', true, 'Highlands 500', 'Highlands500', NULL, 'Highland elevations in Africa, North America and South America capped at 500m', 'Modify the topography of the East African Highlands, Sierra Madre in N. America and Andes in S. America in the model by setting surface elevations to 500m, with the surface properties unchanged. The highland regions are outlined in figure 5 of Zhou et al 2016.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398870, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c5e91b8b-23ba-41ad-bfd0-d52792d495a0', 1, '2020-11-17 01:19:05.639745', true, '2014 Land Use', '2014LU', NULL, '2014 land use', 'Impose present day (2014) land use (surface albedo/roughness, transpiration).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398871, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '9a237fb9-756d-4fe5-bfaf-60ed94f110c9', 1, '2020-11-17 01:19:05.639745', true, '1950-2014 65yrs', '65yrs1950-2014', NULL, '1950/01/01-2015/01/01', 'Historical, Recent past.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398872, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '3c1dafa9-2859-45c1-8943-4f36305e2a9d', 1, '2020-11-17 01:19:05.639745', true, '0.5xPICO2', '0.5xPICO2', NULL, '0.5 x Pre-industrial  CO2 concentration', 'Impose 0.5x pre-industrial (1850) concentration of Carbon Dioxide (CO2).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398957, 'cmip6', '<aerchemmip>,<c4mip>,<cdrmip>,<cfmip>,<cmip>,<damip>,<dcpp>,<fafmip>,<gmmip>,<geomip>,<highresmip>,<ismip6>,<ls3mip>,<lumip>,<omip>,<pamip>,<pmip>,<rfmip>,<scenariomip>,<volmip>', '--', 'cim.2.designing.Project', '1fe4696a-5a91-48ab-a987-8d75a4b25dd7', 1, '2020-11-17 01:19:05.639745', true, 'CMIP6', 'cmip6', NULL, 'Climate Model Intercomparison Project Number 6', 'Climate Model Intercomparison Project phase six.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398958, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'ac8905c1-c24a-4eff-a047-47f54d0f14c4', 1, '2020-11-17 01:19:05.639745', true, 'Past 2k Solar Variability', 'past2kSolar', NULL, 'Solar Variability for the first two millennia', 'Solar variability (TSI and SSI) for the first two millennia, 01 to 1849.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398850, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '4d59cf86-04d5-4dfb-95d8-ab823b3b5a07', 1, '2020-11-17 01:19:05.639745', true, '1850 N2O Concentration', '1850N2O', NULL, '1850 Nitrous Oxide Concentration', 'Impose 1850 concentration of Nitrous Oxide (N2O).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398851, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '94afc0a8-05e9-42c0-9f55-b022cb49bd38', 1, '2020-11-17 01:19:05.639745', true, 'C4MIP homepage', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398852, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', 'b24bdc3a-0a4e-427a-acc6-467a9abb604c', 1, '2020-11-17 01:19:05.639745', true, 'pdSST-futAntSIC', 'pdSST-futAntSIC', '1.8', 'Atmosphere time slice with present day SST and future Antarctic SIC', 'Atmosphere-only time slice experiment forced by climatological monthly mean sea surface temperature (SST) for the present day sea and future Antarctic sea ice concentration (SIC). Radiative forcing to be set to present day (year 2000) levels. Future SIC will be computed from the ensemble of CMIP5 projections by PAMIP. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398853, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '3f278664-fd38-48c2-9b17-0933d6958b1a', 1, '2020-11-17 01:19:05.639745', true, 'rad-pd-piN2O', 'rad-pd-piN2O', NULL, 'RFMIP-IRF', 'Offline radiative transfer calculations of vertically-resolved broadband-integrated longwave and shortwave fluxes for present-day (2015) clear sky (aerosol-free) conditions with present day (2015) greenhouse gas concentrations and pre-industrial nitrous oxide (N2O). Use specified atmospheric distributions of present day temperature and humidity and surface properties over many profiles.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398854, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '97490811-76e4-4c8b-b94d-56bae4f2abbf', 1, '2020-11-17 01:19:05.639745', true, 'Impose SST AMV pos extra tropical N Atlantic', 'ImposeSSTAMVposExTropNAtlantic', NULL, 'Impose positive AMV anomaly to sea surface temperatures in the extra-tropical north Atlantic', 'Alter surface fluxes to impose model climatology plus positive Atlantic Multidecadal Variability (AMV) anomalies of Sea Surface Temperature (SST) over the extra-tropical north Atlantic (30N-65N).  Idealised AMV anomalies of SST will be provided by DCPP.  For groups that are unable to restore SSTs.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398855, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a181d71c-b81e-43de-9e9a-f24e257f636f', 1, '2020-11-17 01:19:05.639745', true, 'Historical Cosmic Ray Forcing 1950s', 'HistoricalCosmicRayForcing1950s', NULL, 'Historical Cosmic Ray Forcing 1950s climatology', '1950s (10 year) climatology of cosmic ray forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398856, 'cmip6', '<ismip6>', '--', 'cim.2.designing.NumericalExperiment', '1c8e174c-c484-47b0-b25c-d04c50ae4462', 1, '2020-11-17 01:19:05.639745', true, 'ism-piControl-self', 'ism-piControl-self', NULL, 'Ice sheet model driven with pre-industrial forcing', 'Stand alone ice sheet model driven offline by a CMIP6 model with piControl forcing. The ice sheet model should be configured with the same settings as the ice sheet model in the piControl-withism experiment and should use the same initial conditions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398857, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd082b422-9e29-4743-9430-17515f4ba260', 1, '2020-11-17 01:19:05.639745', true, 'RCP45 Well Mixed GHG', 'RCP45wmGHG', NULL, 'Representative Concentration Pathway 4.5 Well Mixed Greenhouse Gases', 'Impose changing concentrations of RCP4.5 long-lived gases, including CO2, N2O and halogenated gases.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398858, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c8e98c43-26ca-4de5-859b-720dee5fe451', 1, '2020-11-17 01:19:05.639745', true, 'Historical Aerosol Deposition', 'historicalAerDep', NULL, 'Transient historical aerosol deposition', 'Impose time varying (transient) historical aerosol deposition.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398859, 'cmip6', '<c4mip>,<cdrmip>,<cmip>', '--', 'cim.2.designing.NumericalExperiment', '86c9d1bb-4e6c-457d-9354-9e04aaa4fbfc', 1, '2020-11-17 01:19:05.639745', true, 'esm-hist', 'esm-hist', NULL, 'all forcing simulation of the recent past with an Earth system model', 'Simulation of recent past (1850 to 2014) with atmospheric CO2 concentration calculated.
INSERT INTO docs.tbl_document VALUES (398860, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', '981093e7-cf56-444b-a29a-2d284c20dff5', 1, '2020-11-17 01:19:05.639745', true, 'amip-m4K', 'amip-m4K', NULL, 'AMIP minus 4K SSTs', 'AMIP experiment where SSTs are subject to a uniform cooling of 4K. This cooling should be applied to the ice free ocean surface only.  Sea ice and SSTs under sea ice remain the same as in the amip DECK experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398861, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a783eb61-d46e-479b-9022-08bf15670b0f', 1, '2020-11-17 01:19:05.639745', true, '2014 Anthropogenic O3', '2014AnthropO3', NULL, '2014 anthropogenic ozone', 'Impose present day (2014) anthropogenic ozone.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398862, 'cmip6', '<damip>', '--', 'cim.2.designing.NumericalExperiment', '4966bb28-934e-40d5-a1bf-91a2827c4aa6', 1, '2020-11-17 01:19:05.639745', true, 'hist-GHG', 'hist-GHG', NULL, 'historical well-mixed GHG-only runs', 'Historical greenhouse-gas only simulations resemble the historical simulations but instead are forced by well-mixed greenhouse gas changes only. 
INSERT INTO docs.tbl_document VALUES (398863, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd4b13574-1f1f-4c3b-b504-0e79e4a0dfa6', 1, '2020-11-17 01:19:05.639745', true, '2010 Land Use', '2010LandUse', NULL, '2010 Land Use', 'Apply the global gridded land-use forcing datasets for 2010.  This new generation of “land use harmonization” (LUH2) builds upon past work from CMIP5, and includes updated inputs, higher spatial resolution, more detailed land-use transitions, and the addition of important agricultural management layers.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398864, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '848b148c-e66f-4b56-aef1-11e1b47963be', 1, '2020-11-17 01:19:05.639745', true, '150yrs', '150yrs', NULL, '150 years', 'Run for 150 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398865, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'c7c70a4f-e401-4c17-820d-2136af0f71db', 1, '2020-11-17 01:19:05.639745', true, 'Daily Coupling', 'dailyCoupling', NULL, 'Minimum daily coupling frequency between the ocean and atmosphere', 'Minimum daily coupling between ocean and atmosphere.  Preferably more frequent, 3hr or 1hr.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398959, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a42c22a6-ddf9-4354-bd25-45491e89c9c8', 1, '2020-11-17 01:19:05.639745', true, 'PD+4K Surface Properties', 'PD+4KSurfaceProps', NULL, 'Present day plus 4K surface properties', 'Present day plus 4K surface properties.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398873, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', 'f4d11208-7c3c-42f0-930a-9da0b2e2ab4f', 1, '2020-11-17 01:19:05.639745', true, 'pdSST-futArcSICSIT', 'pdSST-futArcSICSIT', '1.1', 'Atmosphere time slice with present day SST and future Arctic SIC and sea ice thickness', 'Atmosphere-only time slice experiment forced by climatological monthly mean sea surface temperature (SST) for the present day, future Arctic sea ice concentration (SIC) and future Arctic sea ice thickness (SIT). Radiative forcing to be set to present day (year 2000) levels. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398874, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd467a0e0-e4f4-44f1-b66b-881d78755458', 1, '2020-11-17 01:19:05.639745', true, '2014 Ammonia', '2014NH3', NULL, 'Present Day 2014 Ammonia Emissions', 'Impose present day (2014) emissions of ammonia (NH3).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398875, 'cmip6', NULL, '--', 'cim.2.designing.MultiEnsemble', '79891656-1ada-49f5-bcb3-4520d03a79d9', 1, '2020-11-17 01:19:05.639745', true, 'extra1990sx10', 'extra1990sx10', NULL, 'Multi-initialisations of extra 1990s start dates', 'A multi-ensemble of 40 simulations with ten initialisations for each start date.  Start dates occur at the end of 1992, 1997, 1998 and 1999.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398882, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '43c767b7-b8ee-42f3-8fa3-afa9471a2cf2', 1, '2020-11-17 01:19:05.639745', true, 'rad-pd', 'rad-pd', NULL, 'RFMIP-IRF', 'Offline radiative transfer calculations of vertically-resolved broadband-integrated longwave and shortwave fluxes for present-day (2015) clear sky (aerosol-free) conditions. Present-day (PD) greenhouse gas concentrations with PD atmosphere. Use specified atmospheric distributions of temperature and humidity and surface properties over many profiles.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398960, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '6ed1423a-0f59-40bb-91dc-d7e695c8469f', 1, '2020-11-17 01:19:05.639745', true, '1850-2020 171yrs', '171yrs1850-2020', NULL, '1850/01/01-2021/01/01', 'Historical, pre-industrial to present and near future', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398961, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '967b17cc-0518-4809-aea5-f6bee77643e7', 1, '2020-11-17 01:19:05.639745', true, 'SSP1 RCP26-extension Land Use', 'RCP26extland', NULL, 'Representative Concentration Pathway 2.6 Extension Land Use for Shared Socioeconomic Pathway 1', 'Impose changing RCP2.6 extension land use including crops, pasture, urban area, vegetation and forest for SSP1. An extension of the negative carbon emissions reached in 2100, leading to slowly declining forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398962, 'cmip6', '<fafmip>', '--', 'cim.2.designing.NumericalExperiment', '189d16b7-db68-493d-a7e5-7363c0d7bbe5', 1, '2020-11-17 01:19:05.639745', true, 'faf-heat-NA50pct', 'faf-heat-NA50pct', NULL, 'control plus perturbative surface flux of heat into ocean', '1xCO2 experiment, parallel to piControl, forced over the ocean by the same method and with the same surface net heat flux perturbation field as in faf-heat, except that within part of the North Atlantic ocean the perturbation is multiplied by 0.5.
INSERT INTO docs.tbl_document VALUES (398963, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '222389cc-a41a-4619-a725-b03bec9724d3', 1, '2020-11-17 01:19:05.639745', true, 'MACv2-SP: a parameterization of anthropogenic aerosol optical properties and an associated Twomey effect for use in CMIP6', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398964, 'cmip6', '<damip>', '--', 'cim.2.designing.NumericalExperiment', 'a9dfefb0-de84-4fa5-bff5-b14180f9f7a2', 1, '2020-11-17 01:19:05.639745', true, 'ssp245-stratO3', 'ssp245-stratO3', NULL, 'stratospheric ozone-only SSP2-4.5 runs', 'Extension of stratospheric ozone-only run, hist-stratO3, under SSP2-4.5 forcing to the year 2100.
INSERT INTO docs.tbl_document VALUES (398965, 'cmip6', NULL, '--', 'cim.2.shared.Party', '57490af3-eb1a-4876-9aa9-404f16dbcc18', 1, '2020-11-17 01:19:05.639745', true, 'Claudia Tebaldi', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398966, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'ede60c41-5965-45a7-91a3-2452ad9de973', 1, '2020-11-17 01:19:05.639745', true, '1982-1986 5yrs', '5yrs1982-1986', NULL, '1991/12/31-1986/12/31', 'El Chichon historical.  Start date on or before 31st December 1981.  Start dates on or before 15th November recommended to allow for DJF seasonal forecast results. Run for 5 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398967, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '663018cd-28e8-4499-bd4c-5bdd78a81e13', 1, '2020-11-17 01:19:05.639745', true, '2014 Aerosolsx0.1', '2014Aerosolsx0.1', NULL, '2014 aerosols x 0.1', 'Impose present day (2014) aerosol concentration scaled by 0.1.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398968, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '4e3fb4d2-a652-412a-9e78-8de214165a95', 1, '2020-11-17 01:19:05.639745', true, 'CGCM Configuration', 'CGCMConfiguration', NULL, 'Coupled Ocean-Atmosphere General Circulation Model', 'A coupled ocean-atmosphere general circulation model', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398884, 'cmip6', '<geomip>', '--', 'cim.2.designing.NumericalExperiment', '470998d5-c134-4684-b18b-ef551fb67293', 1, '2020-11-17 01:19:05.639745', true, 'G1', 'G1', 'G1ext', 'abrupt quadrupling of CO2 plus reduction in total solar irradiance', 'Beginning from a preindustrial control simulation (picontrol) the net top of atmosphere (TOA) radiative flux imbalance due to an abrupt quadrupling of the CO2 concentration (abrupt4xCO2) would be balanced via a reduction in total solar irradiance. Here, "balance" is defined as  the global mean value of top-of-atmosphere net radiative flux being within ±0.1 W/m2 of the piControl experiment over an average of years 1-10 of the simulation. 
INSERT INTO docs.tbl_document VALUES (398885, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '895eeaef-8225-45c8-8c52-dafef6dc75be', 1, '2020-11-17 01:19:05.639745', true, 'Mid-Holocene CH4', 'midHoloceneCH4', NULL, 'Mid-Holocene CH4 concentration', 'Impose Mid-Holocene atmospheric methane (CH4) concentration.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398886, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '30fc5060-623d-46a5-b937-43b4ad3a1a7c', 1, '2020-11-17 01:19:05.639745', true, 'piControl SST Monthly Var Plus Uniform xK', 'piControlSSTMnthlyVarPlusUniformxK', NULL, 'Monthly-varying sea surface temperatures from the pre-industrial control simulation plus uniform xK', 'A uniform SST increase taken from each model''s global, climatological annual mean SST change between abrupt4xCO2 and the piControl (using the mean of years 111-140 of abrupt4xCO2, and the parallel 30-year section of piControl).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398887, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '14472206-0367-41d8-9fd5-20d30945c60c', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial WMGHG Concentrations excluding CO2', 'PreIndustrialWMGHGConcentrationsNoCO2', NULL, 'Pre-Industrial Well Mixed Greenhouse Gas (WMGHG) Concentrations excluding CO2', 'Constant pre-industrial atmospheric concentrations of long-lived greenhouse-gases, including CH4 and N2O but not including CO2. These should be representative of Earth around the year 1850.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398888, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', '9cd7da69-a65d-4c90-953e-02d38a04eef2', 1, '2020-11-17 01:19:05.639745', true, 'piClim-CH4', 'piClim-CH4', NULL, 'pre-industrial climatolgical SSTs and forcing, but with 2014 methane concentrations (including chemistry)', 'Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply present day (2014) concentrations of methane (CH4) all other WMGHG (well mixed greenhouse gas) concentrations set to pre-industrial levels.  Apply pre-industrial emissions of NTCF (near term climate forcers). This is a timeslice experiment of 30 years total. The model should have the capacity for interactive tropospheric and stratospheric chemistry.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398889, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b4810817-5b10-4e8a-89bf-696b6f888e99', 1, '2020-11-17 01:19:05.639745', true, 'Calculate Historical CO2 Concentration', 'CalcHistoricalCO2', NULL, 'Calculate Historical Carbon Dioxide (CO2) Concentration', 'Historical CO2 concentrations are calculated and anthropogenic sources of CO2 emisions are prescribed. For models that can calculate atmospheric CO2 concentration and account for the fluxes of CO2 between the atmosphere, the ocean, and biosphere. The atmospheric CO2 concentration should be representative of Earth around the year 1850.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398974, 'cmip6', NULL, '--', 'cim.2.shared.Party', '21c3d31e-0c52-4fc5-b086-8650a6f70b91', 1, '2020-11-17 01:19:05.639745', true, 'Michael Schulz', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398890, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '8620447e-85c2-4a46-857c-310d17504eeb', 1, '2020-11-17 01:19:05.639745', true, '1991-1995 5yrs', '5yrs1991-1995', NULL, '1990/12/31-1995/12/31', 'Pinatubo historical.  Start date on or before 31st December 1990.  Start dates on or before 15th November recommended to allow for DJF seasonal forecast results. Run for 5 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398891, 'cmip6', '<gmmip>', '--', 'cim.2.designing.NumericalExperiment', '320fc8e2-2227-40f9-a17b-2f4ec0fd4c06', 1, '2020-11-17 01:19:05.639745', true, 'amip-hist', 'amip-hist', NULL, 'AMIP-style simulation covering the period 1870-2014', 'Extended AMIP run that covers 1870-2014. 
INSERT INTO docs.tbl_document VALUES (398892, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a6d2b443-056c-40a7-b00f-aaa3c1fb08dc', 1, '2020-11-17 01:19:05.639745', true, 'RCP70 Reduced Tropospheric Ozone Precursors', 'ReducedRCP70O3pre', NULL, 'Reduced Representative Concentration Pathway 7.0 Tropospheric Ozone precursors', 'Impose changing concentrations of reduced RCP7.0 tropospheric ozone precursors. Beginning in 2014 with air quality policies (or maximum feasible reductions) applied to the SSP3-7 NTCF emissions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398893, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '82d6be50-30e5-4a3f-b1db-6e10d55c895c', 1, '2020-11-17 01:19:05.639745', true, '1979-2014 36yrs', '36yrs1979-2014', NULL, '1979/01/01-2015/01/01', 'Historical, Recent past, since satellite observations have been available', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398894, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'f3511baa-2896-458d-9c63-c1f725f1f612', 1, '2020-11-17 01:19:05.639745', true, 'Radiative flux and forcing parameterization error in aerosol-free clear skies', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398913, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '917d11f3-22b5-42f0-89f5-1bf65430234f', 1, '2020-11-17 01:19:05.639745', true, 'Restore SST Obs Trop E Pacific', 'RestoreSSTObsTropEPacific', NULL, 'Restore to observed anomalies of SST in the tropical eastern  Pacific', 'Sea Surface Temperatures (SSTs) are restored to model climatology plus observed historical anomalies by a Newtonian cooling over the deep tropical eastern Pacific. The restoring timescale is 10 days for a 50m deep mixed layer (or equivalent).  The restoring coefficient of 40 W/m2/K should decrease to zero over an 8 degree buffer zone bounding the restored region.  Monthly SST anomalies (1950-2014) will be provided by DCPP.  Follow the experiment design of Kosaka and Xie (2013).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398914, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '11f88fd3-9067-43f9-930b-08d6b1447a45', 1, '2020-11-17 01:19:05.639745', true, '750PgC-Initialisation', '750PgC-Initialisation', NULL, 'Initialise from the 1pctCO2 or esm-1pctCO2 simulation when carbon cumulative emissions reach 750 PgC', 'Initialise from the 1pctCO2 or esm-1pctCO2 simulation when cumulative carbon emissions reach 750 PgC.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398915, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '1396060a-5318-4dca-9126-e9c0a5e48b3f', 1, '2020-11-17 01:19:05.639745', true, 'RCP34 Well Mixed GHG', 'RCP34wmGHG', NULL, 'Representative Concentration Pathway 3.4 Well Mixed Greenhouse Gases', 'Impose changing concentrations of RCP3.4 long-lived greenhouse gases, including CO2, N2O and halogenated gases.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398916, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'd626e9ce-57d4-41cd-99fe-cf452a6eef80', 1, '2020-11-17 01:19:05.639745', true, 'GMMIP (v1.0) contribution to CMIP6: Global Monsoons Model Inter-comparison Project', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398917, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '8e092439-121c-42e0-9a11-18dfae8cb36c', 1, '2020-11-17 01:19:05.639745', true, 'CORE-II Heat Flux', 'core2HeatFlux', NULL, 'CORE-II air-sea heat flux', 'CORE-II air–sea heat flux, covers the 62-year period from 1948-2009.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398969, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '87dc5f1c-04cd-43ea-977d-93d1a8bccb91', 1, '2020-11-17 01:19:05.639745', true, 'Historical Sea Ice', 'HistoricalSeaIce', NULL, 'Transient Sea Ice from the historical experiment', 'Time-evolving monthly sea ice distribution taken from a coupled historical simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398895, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ab5487fb-6b21-4a76-950e-2d029b8af95e', 1, '2020-11-17 01:19:05.639745', true, 'Idealised Deforestation from Forest to Grassland', 'IdealisedDeforestation', NULL, 'Idealised linear deforestation from forest to unmanaged grassland', 'Decrease in forest area and increase in natural grassland from pre-industrial. 20 million square km forest area (covered by trees) is converted to natural unmanaged grassland over a period of 50 years with a linear rate of 400000 km2/yr followed by 30 years of constant forest cover.  Deforestation should be restricted to the top 30% of land grid cells in terms of their area of tree cover.  Effectively this concentrates deforestation in the tropical rainforest and boreal forest regions.  The replacement of forest with natural grassland should be done in such a way that carbon (and nitrogen if applicable) from the forested soil is maintained and allowed to evolve according to natural model processes.  If initial forest cover is less than 20 million square km then linearly remove all the forested area over 50 years and report the total area of forest removed.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398896, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '3f57d447-9eea-412e-8b2e-116f34246ae2', 1, '2020-11-17 01:19:05.639745', true, 'Historical Fossil Carbon Dioxide Emissions 1950s', 'HistoricalFossilCarbonDioxideEmissions1950', NULL, 'Historical Fossil Carbon Dioxide Emissions 1950s Climatology', '1950s (10 year) climatology of fossil fuel and cement CO2 emissions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398897, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '17304f1c-54a4-4f22-9fcc-380431efb66e', 1, '2020-11-17 01:19:05.639745', true, 'Laki SO2', 'LakiSO2', NULL, 'SO2 emissions equivalent to Laki eruption.', 'Emission of 100 Tg of SO2 into the high-latitude (60N) stratosphere in five active phases over five months. Roughly corresponding to the 1783-1784 Laki eruption in Iceland.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398898, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c6e8aa14-ca52-4f4f-9ebf-3c7978dec0cc', 1, '2020-11-17 01:19:05.639745', true, 'Increase Cirrus Sedimentation Velocity', 'increaseCirrusSedimentationVelocity', NULL, 'Increase cirrus sedimentation velocity', 'Add a local variable that replaces (in all locations where temperature is colder than 235K) the ice mass mixing ratio in the calculation of the sedimentation velocity with a value that is eight times the original ice mass mixing ratio.
INSERT INTO docs.tbl_document VALUES (398899, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '124a692b-f13c-44b4-b180-36f57407469d', 1, '2020-11-17 01:19:05.639745', true, '2020-2021 10yrs1', '10yrs2020-2021_yr1', NULL, '2020/01/01-2020/12/31', 'Idealised temporal constraint, repeating 2020 for 10 years, to coincide with the first year of the ScenarioMIP SSP5-85 experiment', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398900, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '2d708214-a6dc-49a9-9a84-80d39d68b6eb', 1, '2020-11-17 01:19:05.639745', true, '1950s Solar Spectral Irradiance', '1950sSolarSpectralIrradiance', NULL, '1950s Solar Spectral Irradiance Climatology', '1950s (10 year) climatology of Solar Spectral Irradiance (SSI).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398901, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', '42532016-2dda-4813-a739-84bb0a328bbd', 1, '2020-11-17 01:19:05.639745', true, 'piSST-4xCO2-rad', 'piSST-4xCO2-rad', NULL, 'control SSTs with radiation-only seeing 4xCO2', 'An AGCM experiment with monthly-varying SSTs and sea-ice taken from each model''s own piControl simulation (using the 30 years of piControl that are parallel to years 111-140 of its abrupt4xCO2 run) but with quadrupled CO2 concentration seen by the radiation code. Other atmospheric constituents and any other necessary boundary conditions (e.g. vegetation if required) taken from each model''s own piControl simulation (using the 30 years of piControl that are parallel to years 111-140 of its abrupt4xCO2 run). Dynamic vegetation should be turned off and the vegetation distribution that is output from the piControl simulation used.
INSERT INTO docs.tbl_document VALUES (398902, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', '116869ca-acbe-4082-a256-dc6dfebbd409', 1, '2020-11-17 01:19:05.639745', true, 'hist-1950HC', 'hist-1950HC', NULL, 'historical forcing, but with1950s halocarbon concentrations', 'Historical WMGHG concentrations and historical emissions of Near Term Climate Forcers (NTCFs:  tropospheric ozone and aerosols, and their precursors), halocarbons (Ozone Depleting Substances) to be fixed at 1950 concentration levels. These simulations parallel the "CMIP6 historical", and differ only by fixing the anthropogenic emissions or concentrations of a specified class of species.   All other forcing agents must evolve as in "CMIP6 historical".', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398903, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'ca1bb295-e348-446b-abc7-cd5d9b30f6b3', 1, '2020-11-17 01:19:05.639745', true, 'Atmosphere-Land Configuration', 'atmosLandConfig', NULL, 'Atmosphere-Land model configuration', 'An atmosphere-land model with interactive vegetation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398904, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '29049eb5-d467-4311-9b48-8537b504cda7', 1, '2020-11-17 01:19:05.639745', true, '2010 Ozone Concentrations', '2010StratosphereTroposphereOzoneConcentrations', NULL, '2010 Stratosphere-Troposphere Ozone Concentrations', 'Apply 2010 ozone concentrations encompassing both the stratosphere and the troposphere from the ozone concentration database.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398905, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '6fb25e92-8ebb-4cd3-9036-5b5263ead175', 1, '2020-11-17 01:19:05.639745', true, '2014-2099 86yrs minimum', '86yrs2014-2099min', NULL, '2014/01/01-2100/01/01', 'Scenario, from 2014 to at least the end of the 21st century.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398906, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '4812a565-3cc9-49d7-9cad-bca0b0cbbc50', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Solar Particle Forcing', 'piSolarParticleForcing', NULL, 'Pre-Industrial Solar Particle Forcing', 'Pre-Industrial solar particle forcing (1850-1873 mean). For models with interactive stratospheric chemistry.  Proton forcing: HOx and NOx production by solar protons. Electron forcing:  Kp- or Ap-index to describe ionisation from electron precipitation in the lower thermosphere and upper mesosphere. Cosmic ray forcing:  ion-pair production by galactic cosmic rays.  CMIP6 models that do not have interactive chemistry should  prescribe the CMIP6 recommended ozone forcing data set.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398907, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '54ac9857-1d3c-4480-ae3a-e61f9e55485f', 1, '2020-11-17 01:19:05.639745', true, '1850-2149 300yrs', '300yrs1850-2149', NULL, '1850/01/01-2150/01/01', 'Begin in pre-industrial era and run for 300 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398908, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '8e5e8684-cb10-45f4-821f-67fbabaecd7a', 1, '2020-11-17 01:19:05.639745', true, 'Calculate Past1000 CO2 Concentration', 'CalcPast1000CO2', NULL, 'Calculate Past1000 Carbon Dioxide (CO2) Concentration', 'Past 1000 years of CO2 concentrations are calculated and anthropogenic sources of CO2 emisions are prescribed. For models that can calculate atmospheric CO2 concentration and account for the fluxes of CO2 between the atmosphere, the ocean, and biosphere. The atmospheric CO2 concentration should be representative of Earth around the year 1850.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398909, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'ffae4142-edcf-44be-9003-37fa474fde3e', 1, '2020-11-17 01:19:05.639745', true, '2015-2099 85yrs', '85yrs2015-2099', NULL, '2015/01/01-2100/01/01', 'Scenario, from 2015 to the end of the 21st century.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398970, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'f167c07d-9152-4705-8869-756dba73a1ce', 1, '2020-11-17 01:19:05.639745', true, 'A multi-model assessment of last interglacial temperatures', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398971, 'cmip6', NULL, '--', 'cim.2.shared.Party', 'a9d60d8f-e950-4c3f-aab6-21e18b8f2acd', 1, '2020-11-17 01:19:05.639745', true, 'Chris Jones', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398918, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', '9f6c69ca-43c2-4f73-ba0f-313a5bf2cb08', 1, '2020-11-17 01:19:05.639745', true, 'futSST-pdSIC', 'futSST-pdSIC', '1.4', 'Atmosphere time slice with future SST and present day SIC', 'Atmosphere-only time slice experiment forced by climatological monthly mean sea ice concentration (SIC) for the present day and future sea surface temperature (SST) representing 2 degree global warming.  Radiative forcing to be set to present day (year 2000) levels. Future SST will be computed from the ensemble of CMIP5 projections by PAMIP. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398919, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ae46730a-9f5a-4f32-a5ed-5685d43a9750', 1, '2020-11-17 01:19:05.639745', true, 'Impose SST AMV pos N Atlantic', 'ImposeSSTAMVposNAtlantic', NULL, 'Impose positive AMV anomaly to sea surface temperatures in the north Atlantic', 'Alter surface fluxes to impose model climatology plus positive Atlantic Multidecadal Variability (AMV) anomalies of Sea Surface Temperature (SST) over the  North Atlantic (10N-65N).  Idealised AMV anomalies of SST will be provided by DCPP.  For groups that are unable to restore SSTs.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398920, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'ed2c1036-1f03-4cf6-b7a4-e0c4dca7fc91', 1, '2020-11-17 01:19:05.639745', true, '2010 O3 and Stratospheric H2O Concentrations', '2010O3andStratosphericH2OConcentrations', NULL, '2010 Ozone and Stratospheric Water Vapour Concentrations', '2010 ozone concentrations encompassing both the stratosphere and the troposphere and a stratospheric water vapour concentration.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398921, 'cmip6', '<c4mip>', '--', 'cim.2.designing.NumericalExperiment', '26ff4dc9-6c52-45e3-8c42-0afc828cc787', 1, '2020-11-17 01:19:05.639745', true, 'esm-1pct-brch-2000PgC', 'esm-1pct-brch-2000PgC', 'A.3', 'zero emissions simulation branched from 1% run after 2000 PgC cumulative emission', 'Abrupt-zero emissions experiment. Branch off from the 1pctCO2 experiment with interactive CO2 (emissions-driven configuration) but with CO2 emissions set to zero. The branch off point is when the cumulative carbon emissions reach 2000 PgC. Simulate the subsequent reduction in CO2 and change in climate for at least 100 years.  Earth System Models of Intermediate Complexity (EMICs) are requested to run longer simulations, up to 1000 years.  Note some Earth System Models (ESMs) may need to re-run an emissions-driven version of 1pctCO2 to branch-off from.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398922, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ffecf5ce-9df0-415a-a6b4-e517de7d03e1', 1, '2020-11-17 01:19:05.639745', true, 'LGM CO2', 'LGMCO2', NULL, 'Last Glacial Maximum CO2 concentration', 'Impose Last Glacial Maximum (21 kyr ago) atmospheric carbon dioxide (CO2) concentration.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398923, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'a097e811-3419-4160-bc7c-76a1b7614084', 1, '2020-11-17 01:19:05.639745', true, 'RCP70 Forcing', 'rcp70Forcing', NULL, 'Representative Concentration Pathway 7.0 W/m2 Forcing', 'Impose RCP7.0 forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398924, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'da30be88-7284-4794-8ddb-e29ee0dd60a3', 1, '2020-11-17 01:19:05.639745', true, 'Solar Balance of 4xCO2', 'solarBalance4xCO2', NULL, 'Solar irradiance reduction to balance abrupt 4xCO2', 'Reduce the solar constant such that the top of atmosphere radiative flux remains within ±0.1 W/m2 of the piControl experiment when the CO2 concentration is quadrupled. Specifically, the global mean value of top-of-atmosphere net radiative flux must lie within ±0.1 W/m2 of the piControl experiment over an average of years 1-10 of the simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398942, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '1cb5fa22-3221-4a23-8c9c-528097a300a8', 1, '2020-11-17 01:19:05.639745', true, 'Historical GSWP3 Meteorological Forcing', 'historicalGSWP3Forcing', NULL, 'Historical forcing with GSWP3 data', 'Apply Global Soil Wetness Project phase three (GSWP3) forcing data for offline land surface models running the LS3MIP historical simulation land-hist is provided by the LS3MIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398943, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '304b4f90-d44f-450a-814d-1b6a5fbbdbce', 1, '2020-11-17 01:19:05.639745', true, 'Impose SST running mean extra tropical N Atlantic', 'ImposeSSTrunningMeanExtraTropNAtlantic', NULL, 'Impose 12-month running mean of SST in the extra tropical north Atlantic', 'Alter surface fluxes to impose model climatology plus 12-month running mean anomalies of Sea Surface Temperature (SST) over the extra tropical North Atlantic (45N-65N).  No SST modification if sea ice is present.  SST anomalies (1950-2014) will be provided by DCPP.  For groups that are unable to restore SSTs.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398944, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'f1cea0f3-c793-4ba4-8b2a-59255c484030', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP future SIC climatology', 'PAMIP-fut-SIC-clim', NULL, 'PAMIP monthly mean climatology of future sea ice concentration', 'Future monthly mean cimatology of sea ice concentration, data provided by PAMIP is representative of 2K global warming.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398945, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '029110e4-7e24-484b-a9e4-19bf715d4fb8', 1, '2020-11-17 01:19:05.639745', true, '1980-2014 35yrs', '35yrs1980-2014', NULL, '1980/01/01-2015/01/01', 'Historical, from 1980 to 2014.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398946, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '736ed531-c390-4ed4-aac0-33c520c05e1c', 1, '2020-11-17 01:19:05.639745', true, '1850 Nitrogen Deposition', '1850NitrogenDep', NULL, '1850 nitrogen deposition', 'Nitrogen deposition held fixed at pre-industrial values.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398947, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '1ee53cd0-e8c8-41d4-988e-ef9404a3334c', 1, '2020-11-17 01:19:05.639745', true, 'Present day 2014 stratospheric Ozone as a substitute for solar particle forcing', 'PDStratO3', NULL, 'Present day (2014) stratospheric Ozone concentrations as a substitue for solar particle forcing for models without interactive chemistry', 'Impose present day (2014) stratospheric ozone as a substitute for solar particle forcing.  To be used by CMIP6 models that do not have interactive chemistry, they should instead prescribe the CMIP6 recommended ozone forcing data set.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398948, 'cmip6', '<damip>', '--', 'cim.2.designing.NumericalExperiment', '1c8ecd80-f1af-4d20-8dcb-e19eae335977', 1, '2020-11-17 01:19:05.639745', true, 'ssp245-GHG', 'ssp245-GHG', NULL, 'well-mixed GHG-only SSP2-4.5 runs', 'Extension of well-mixed GHG-only run (hist-GHG) under SSP2-4.5 forcing to the year 2100.
INSERT INTO docs.tbl_document VALUES (398949, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '27f26916-d45a-43bc-b385-d2b269ef9291', 1, '2020-11-17 01:19:05.639745', true, 'RCP Solar', 'RCPSol', NULL, 'Representative Concentration Pathway Solar Forcing', 'Impose changing (natural) solar forcing for RCP scenarios.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398988, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'abefffef-f343-4b37-adb1-edd5f6b24841', 1, '2020-11-17 01:19:05.639745', true, '2x 1850 DMS Aerosol Emissions', '2x1850DMSAer', NULL, 'Doubled 1850 emissions of oceanic DMS Aerosols', 'Impose 1850 doubled oceanic DMS emission fluxes. Or double the oceanic DMS aerosol emissions of the 1850 climatological data.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399369, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '0d3fdc4c-85f9-4544-b784-2a547c0a8230', 1, '2020-11-17 01:19:05.639745', true, 'JRA55-do Air-Sea Fluxes', 'JRA55air-seaFluxes', NULL, 'JRA55-do air-sea fluxes', 'Five/six repetitions of the JRA55-do air–sea fluxes of momentum, heat, freshwater and their components which cover the 61-year period from 1958-2018.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398925, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', '0d7e1dc0-116d-4225-8ffa-137b39116707', 1, '2020-11-17 01:19:05.639745', true, 'piSST-pxK', 'piSST-pxK', NULL, 'control plus xK SSTs', 'An AGCM experiment with monthly-varying SSTs and sea-ice taken from each model''s own piControl simulation (using the 30 years of piControl that are parallel to years 111-140 of its abrupt4xCO2 run) but with a spatially and temporally uniform SST amomaly applied on top of the monthly-varying piSST-control SSTs.  The magnitude of the uniform increase is taken from each model''s global, climatological annual mean SST change between abrupt4xCO2 and the piControl (using the mean of years 111-140 of abrupt4xCO2, and the parallel 30-year section of piControl).  Atmospheric constituents and any other necessary boundary conditions (e.g. vegetation if required) taken from each model''s own piControl simulation (using the 30 years of piControl that are parallel to years 111-140 of its abrupt4xCO2 run). Dynamic vegetation should be turned off and the vegetation distribution that is output from the piControl simulation used.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398926, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '1322bd7c-af86-47e9-ae41-fc20a99e3b73', 1, '2020-11-17 01:19:05.639745', true, 'JRA55-do Freshwater Flux', 'jra55-doFreshwaterFlux', NULL, 'JRA55-do air-sea freshwater flux', 'JRA55-do air–sea freshwater flux, covers the 61-year period from 1958-2018.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398927, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '68170bd5-8270-43b2-97b9-a303be18032e', 1, '2020-11-17 01:19:05.639745', true, 'AGCM Slab Configuration', 'AGCMSlabConfiguration', NULL, 'Atmosphere General Circulation Configuration with Slab Ocean', 'Use an atmosphere general circulation model coupled with a slab ocean.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398928, 'cmip6', '<ls3mip>', '--', 'cim.2.designing.NumericalExperiment', '71aca87b-8c29-4b83-915b-8720106852ac', 1, '2020-11-17 01:19:05.639745', true, 'lfmip-pdLC-princeton', 'lfmip-pdLC-princeton', NULL, 'prescribed land conditions (from current climate climatology) derived from land-hist-princeton and initialized from "historical" run year 1980', 'Scenario forced experiment with prescribed land surface climatology derived from land-hist-princeton (1980-2014). The experiment is comprised of transient coupled atmosphere-ocean simulations in which a selection of land surface characteristics is prescribed rather than interactively calculated in the model.  The "climatological" land surface forcing is calculated as the mean annual cycle in the period 1980-2014 from the land-hist-princeton simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398929, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '82591aba-aadf-4fdd-8a94-ceb966a1580e', 1, '2020-11-17 01:19:05.639745', true, 'Alternative RCP45 Solar', 'altRCP45Sol', NULL, 'Alternative RCP45 solar forcing', 'Alternative estimate of RCP4.5 solar forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398930, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '39b0bef2-53b6-4d6d-b9b3-b4ebe0bf01ab', 1, '2020-11-17 01:19:05.639745', true, 'Variance and Predictability of Precipitation at Seasonal-to-Interannual Timescales', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398931, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b8871b13-b167-42a4-8c3d-2629d178c19f', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Land Cover', 'PreIndustrialLandCover', NULL, 'Pre-Industrial Land Cover', 'Constant pre-industrial (1850) land-cover forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398932, 'cmip6', '<pmip>', '--', 'cim.2.designing.NumericalExperiment', '6aff2b00-74df-490f-a3bf-cfe6089d6534', 1, '2020-11-17 01:19:05.639745', true, 'midHolocene', 'midHolocene', NULL, 'mid-Holocene', 'Impose Mid-Holocene (6 kyr ago) boundary conditions for orbital parameters and the atmospheric concentration of well-mixed greenhouse gases. Run for at least 100 years after spin-up. It is mandatory that the model versions used for the PMIP-CMIP6 experiments are the exactly the same as for the other CMIP6 experiments, in particular the DECK and historical simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398933, 'cmip6', '<lumip>', '--', 'cim.2.designing.NumericalExperiment', '25a71feb-68bd-464f-a06f-29ea55cde26e', 1, '2020-11-17 01:19:05.639745', true, 'land-noFire', 'land-noFire', NULL, 'historical land-only with no human fire land management', 'Land surface model simulation. Same as land-hist except with fire management maintained at 1850 levels. Start year either 1850 or 1700 depending on standard practice for particular model.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398934, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'cad0c168-e935-4a4b-999d-8ffc70b796bb', 1, '2020-11-17 01:19:05.639745', true, 'Climate forcing reconstructions for use in PMIP simulations of the last millennium (v1.0)', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398935, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b31e2bc7-9b5e-4d79-beae-e23de6bb0f02', 1, '2020-11-17 01:19:05.639745', true, 'Pre-industrial stratospheric Ozone as a substitute for solar particle forcing', 'piStratO3', NULL, 'Pre-industrial stratospheric Ozone concentrations as a substitue for solar particle forcing for models without interactive chemistry', 'Impose pre-industrial stratospheric ozone as a substitute for solar particle forcing.  To be used by CMIP6 models that do not have interactive chemistry, they should instead prescribe the CMIP6 recommended ozone forcing data set.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398936, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '3c12221f-de28-4420-b0af-d3c675467368', 1, '2020-11-17 01:19:05.639745', true, 'pre1961-2016 56yrs min', 'min56yrsPre1961-2016', NULL, 'pre1961/01/01-2017/01/01', 'Historical, from pre1961 to 2016', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398937, 'cmip6', NULL, '--', 'cim.2.shared.Party', '51408b60-6696-44b3-96e5-73028d2ed3d6', 1, '2020-11-17 01:19:05.639745', true, 'Doug Smith', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398938, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '71619c35-c62a-4dc4-b13d-d3e6ce8d96b5', 1, '2020-11-17 01:19:05.639745', true, 'Antarctic Coast Fresh Water Flux', 'AntarcticaFreshWaterFlux', NULL, 'Freshwater flux applied around the coast of Antarctica', 'A surface freshwater flux of 0.1 Sv (100000 m3 s−1) in total to be applied uniformly around the coast of Antarctica in whatever way is most suitable in the model.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398939, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', '06b40980-cd4e-406d-bd9f-a8c0e9301289', 1, '2020-11-17 01:19:05.639745', true, 'dcppA-assim', 'dcppA-assim', 'A2.3', 'assimilations initialized from observations with historical forcing', 'Ensemble of “assimilation” run(s) (if available). These are simulations used to incorporate observation-based data into the model in order to generate initial conditions for hindcasts. They parallel the historical simulations and use the same forcing. The number of years (60-600) depends on the number of independent assimilation runs.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398940, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '90cfc411-5cee-4592-9610-6c92aff2cc28', 1, '2020-11-17 01:19:05.639745', true, 'Future Solar Irradiance Forcing', 'FutureSolarIrradiance', NULL, 'Future Solar Irradiance Forcing', 'The standard solar forcing dataset recommended for usage is the solar reference scenario dataset which includes future solar forcing (2015-2299).  Includes total solar irradiance, F10.7 cm solar radio flux, and spectral solar irradiance for 10-100000 nm range.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398941, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', '16ed5711-10e0-4866-b2c5-a1552ab1baae', 1, '2020-11-17 01:19:05.639745', true, 'dcppC-ipv-neg', 'dcppC-ipv-neg', 'C1.6', 'idealised negative IPV anomaly pattern', 'Restore the Pacific sea surface temperature to negative Pacific Decadal Variability (PDV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members. SST signal may also be imposed by altering surface fluxes.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398950, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', '9d41fd6b-641c-45c5-975b-2a3b3b6156a4', 1, '2020-11-17 01:19:05.639745', true, 'piClim-HC', 'piClim-HC', NULL, 'pre-industrial climatolgical SSTs and forcing, but with 2014 halocarbon concentrations (including chemistry)', 'Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply present day (2014) concentrations of ozone depleting halocarbons (ODS) all other WMGHG (well mixed greenhouse gas) concentrations set to pre-industrial levels.  Apply pre-industrial emissions of NTCF (near term climate forcers). This is a timeslice experiment of 30 years total. Only models with stratospheric chemistry should run this experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398951, 'cmip6', '<ls3mip>', '--', 'cim.2.designing.NumericalExperiment', 'e1ef0f35-3efe-49ef-96e0-887f1093a29a', 1, '2020-11-17 01:19:05.639745', true, 'lfmip-rmLC-cruNcep', 'lfmip-rmLC-cruNcep', NULL, 'prescribed land conditions (from running mean climatology) derived land-hist-cruNcep and initialized from "historical" run year 1980', 'Scenario forced experiment with prescribed land surface climatology derived from transient 30 year running mean from land-hist-cruNcep.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398952, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '6bc7d4eb-87a0-4bb3-a2e2-e0ff19a39f07', 1, '2020-11-17 01:19:05.639745', true, 'Present Day 2014 Solar Particle Forcing', 'PD2014SolarParticleForcing', NULL, 'Present Day 2014 Solar Particle Forcing', 'Present day solar particle forcing (2014). For models with interactive stratospheric chemistry.  Proton forcing: HOx and NOx production by solar protons. Electron forcing:  Kp- or Ap-index to describe ionisation from electron precipitation in the lower thermosphere and upper mesosphere. Cosmic ray forcing:  ion-pair production by galactic cosmic rays.  CMIP6 models that do not have interactive chemistry should  prescribe the CMIP6 recommended ozone forcing data set.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398953, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '2dd3bf87-d405-4bc2-a5f8-2b29158944e4', 1, '2020-11-17 01:19:05.639745', true, 'Managed Cropland', 'croplandManaged', NULL, 'Managed Cropland', 'Crop area uses prognostic crop model with crop management (e.g. planting and harvesting) rather than simulating cropland vegetation as a natural grassland.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398954, 'cmip6', '<lumip>', '--', 'cim.2.designing.NumericalExperiment', '9188972c-e2af-452c-875a-d88261f4ccfc', 1, '2020-11-17 01:19:05.639745', true, 'ssp126-ssp370Lu', 'ssp126-ssp370Lu', NULL, 'SSP1-2.6 with SSP3-7.0 land use', 'Keep all forcings the same as ScenarioMIP SSP1-2.6 (aforestation scenario), but replace land use with SSP3-7.0 (deforestation) scenario.  Concentration driven.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398955, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '0e2a23b3-5956-4742-9f92-cc733c1d13b3', 1, '2020-11-17 01:19:05.639745', true, 'SSP1 RCP60 Land Use', 'RCP60land', NULL, 'Representative Concentration Pathway 6.0 Land Use for Shared Socioeconomic Pathway 1', 'Impose changing RCP6.0 land use including crops, pasture, urban area, vegetation and forest for SSP1.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398956, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'cd84bbaa-ff32-4042-b8fb-9fa3ca4be505', 1, '2020-11-17 01:19:05.639745', true, 'StratAerPreRCP85extovertoRCP45Internal', 'stratAerPreRCP85extover-RCP45internal', NULL, 'Stratospheric aerosol precursor injection to reduce RCP8.5ext overforcing to RCP4.5 levels, internal aerosol treatment', 'Injection of stratospheric sulfate aerosol precursors to reduce the radiative forcing of ScenarioMIP high forcing overshoot extension scenario (SSP5-85ext-over) to match that of the ScenarioMIP medium forcing scenario (SSP2-45).  
INSERT INTO docs.tbl_document VALUES (398972, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', '8c42ab00-1ef2-4d5b-ade1-8bf8803cb6d4', 1, '2020-11-17 01:19:05.639745', true, 'dcppC-hindcast-noElChichon', 'dcppC-hindcast-noElChichon', 'C3.2', 'hindcast but with only background volcanic forcing', 'Prediction experiment without volcano forcing. Repeat DCCP-A1 1982 hindcast without El Chichon forcing. Background volcanic aerosol to be the same as that used in the 2015 forecast. 10 ensemble members. Run each member for at least 5 years, preferably 10 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398975, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b3859c77-5442-462b-a8c3-dd50ec0fe06b', 1, '2020-11-17 01:19:05.639745', true, 'amip SST plus patterned 4K derived from 4xCO2 monthly varying SST anomalies', 'amipPatternedSSTp4KFrom4xCO2', NULL, 'amip sea surface temperature patterned 4K increase derived from the 4xCO2 monthly varying sea surface temperature anomalies.', 'Impose a +4K warming pattern anomaly to the amip SST.  The SST pattern anomaly is derived from years 91-140 of the model''s own abrupt4xCO2 experiment, with respect to the piControl, and scaled to have a global mean increase of 4K. The SST pattern anomaly is to be expressed as seasonally varying monthly means.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398976, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '616a63af-9b53-4ed9-b5a1-27bfd0e81636', 1, '2020-11-17 01:19:05.639745', true, 'ssp245-cov-aer Short Lived Species', 'ssp245-cov-aerSLS', NULL, 'ssp245-cov-aer Short Lived Species', 'ssp245-cov-aer short lived species: BC, CO, OC, SO2, NH3, NOx, NMVOCs', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398977, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'f542b231-2a04-42fa-83df-2fa4b3f4543f', 1, '2020-11-17 01:19:05.639745', true, 'Restore SST AMV pos Tropical N Atlantic', 'RestoreSSTAMVposTropNAtlantic', NULL, 'Restore tropical north Atlantic sea surface temperature to positive AMV', 'Sea Surface Temperatures (SSTs) are restored to model climatology plus positive AMV anomaly by Newtonian cooling over the tropical north Atlantic (10N-30N). The restoring timescale is 10 days for a 50m deep mixed layer (or equivalent). The restoring coefficient of 40 W/m2/K should decrease to zero over an 8 degree buffer zone bounding the restored region.  No restoring if sea ice is present. Idealised AMV anomalies of SST will be provided by DCPP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398978, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '0ca936a2-8235-4bbf-a062-f4bfd87a48fc', 1, '2020-11-17 01:19:05.639745', true, 'Transient Wood Harvest', 'transientWoodHarvest', NULL, 'Transient historical wood harvest', 'Realistic transient wood harvest.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398979, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '083c559f-b40e-48a0-8735-8a14f4682242', 1, '2020-11-17 01:19:05.639745', true, 'RCP85-extension Well Mixed GHG Emissions', 'RCP85extWmGHGEm', NULL, 'Representative Concentration Pathway 8.5 Extension Emissions of Well Mixed Greenhouse Gases', 'Impose changing emissions of RCP8.5 extension long-lived greenhouse gases, including CO2, N2O and halogenated gases.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398980, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c9989119-5227-470d-b03e-ed22503d098c', 1, '2020-11-17 01:19:05.639745', true, 'Pinatubo Radiative Heating', 'PinatuboRadiativeHeating', NULL, 'Radiative heating of the stratosphere equivalent to the Mt. Pinatubo eruption.', 'Prescribed perturbation to the (SW+LW) radiative heating rates to mimic the radiative heating of the stratosphere by volcanic aerosols associated with the 1991 Mt. Pinatubo eruption in the Philippines.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398981, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '8f21fc60-a8b0-4638-a9ef-ba054d556ce0', 1, '2020-11-17 01:19:05.639745', true, 'Historical N2O Concentrations', 'HistoricalN2OConc', NULL, 'Historical Concentrations of Nitrous Oxide', 'Impose historical concentrations of Nitrous Oxide (N2O).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398982, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'e6b910ff-594a-4244-860f-b0cf8a3163c6', 1, '2020-11-17 01:19:05.639745', true, 'G6sulfurInitialisation', 'g6sulfurInitialisation', NULL, 'GeoMIP G6Sulfur Initialisation', 'Initialisation is made from the final year of the GeoMIP G6sulfur experiment', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398983, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', '8ece3924-ccd2-4015-b158-f080ef2e0d4e', 1, '2020-11-17 01:19:05.639745', true, 'ssp370-lowNTCF', 'ssp370-lowNTCF', NULL, 'SSP3-7.0, with low NTCF emissions', 'SSP-based RCP scenario following approximately RCP7.0 global forcing pathway but with reduced Near Term Climate Forcer (NTCF) emissions. SSP3 socioeconomic conditions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398984, 'cmip6', '<highresmip>', '--', 'cim.2.designing.NumericalExperiment', '2728afe7-0a40-4616-ab65-f07918c79e29', 1, '2020-11-17 01:19:05.639745', true, 'highresSST-present', 'highresSST-present', NULL, 'forced atmosphere experiment for 1950-2014', 'Historical atmosphere-only simulations of the near past (1950-2014). HadISST2.2 sea surface temperature and sea ice concentrations at daily 1/4 degree resolution to be used (Kennedy et al. 2017, in prep).  For optimal comparison between models the use of plume aerosol cocentrations are recommended (rather than emissions).
INSERT INTO docs.tbl_document VALUES (398985, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', '249206e4-2722-4d97-bebf-9deec054cec2', 1, '2020-11-17 01:19:05.639745', true, 'dcppC-atl-spg', 'dcppC-atl-spg', 'C2.1', 'predictability of 1990s warming of Atlantic sub-polar gyre', 'Repeat DCCP-A1 hindcasts with altered initial conditions. Initialise with climatology (1960-2009 average) in the north Atlantic "sub-polar ocean" (95W-30E, 45N-90N).  Linear transition between climatology and actual observations over a 10 deg buffer zone (35N-45N).  10 ensemble members.  Run each member for at least 5 years, preferably 10 years.  Start dates end of 1993, 1994, 1995, 1996.  Additional start dates at end of 1992, 1997, 1998, 1999.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398986, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c0e29a20-326a-457c-a5c3-bbfbdf62428e', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP present day SST for use with pre-industrial arctic SIC', 'PAMIP-pd-SST-clim-for-pi-arc-SIC', NULL, 'PAMIP monthly mean climatology of present day sea surface temperature for use with pre-industrial arctic sea ice concentration', 'Present day monthly mean cimatology of sea surface temperatue for use with pre-industrial arctic sea ice. Data provided by PAMIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398987, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b0e06541-6387-4330-9a9d-de8b14559530', 1, '2020-11-17 01:19:05.639745', true, 'RCP70 Reduced Aerosol Precursors', 'ReducedRCP70aerpre', NULL, 'Reduced Representative Concentration Pathway 7.0 Aerosol Precursors', 'Impose changing concentrations of reduced RCP7.0 aerosol precursors. Beginning in 2014 with air quality policies (or maximum feasible reductions) applied to the SSP3-7 NTCF emissions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398989, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e0e8a482-e6dd-4263-8683-0c8dd6836fdd', 1, '2020-11-17 01:19:05.639745', true, 'Restore SST PDV neg NexTrop Pacific', 'RestoreSSTPDVnegNexTropPacific', NULL, 'Restore northern extra-tropical Pacific sea surface temperature to negative PDV', 'Sea Surface Temperatures (SSTs) are restored to model climatology plus negative PDV anomaly by Newtonian cooling over the northern extra-tropical Pacific (10N-65N). The restoring timescale is 10 days for a 50m deep mixed layer (or equivalent). The restoring coefficient of 40 W/m2/K should decrease to zero over an 8 degree buffer zone bounding the restored region.  No restoring if sea ice is present. Idealised AMV anomalies of SST will be provided by DCPP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398990, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ada68b33-1057-41fa-945f-5cc19f8775ef', 1, '2020-11-17 01:19:05.639745', true, 'Pre-industrial Atronomical Parameters', 'piAstroParams', NULL, 'Astronomical parameters for the year 1850', 'Pre-industrial astronomical parameters for the year 1850', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398991, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '7158f691-0995-49c2-a4df-4458188bdd49', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Forcing Excluding Volcanic Aerosols and Solar Forcing', 'preIndForcingExclVolcAerSol', NULL, 'Pre-industrial forcing, excluding volcanic aerosols and solar forcing', 'Pre-Industrial forcing excluding volcanic aerosols and solar forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399015, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c73fcacb-7db1-40bc-aa5e-ced9126fc2d9', 1, '2020-11-17 01:19:05.639745', true, 'Abrupt 0.5xCO2', 'Abrupt0.5xCO2', NULL, 'Abrupt halving of atmospheric carbon dioxide', 'Impose an instantaneous halving of atmospheric carbon dioxide concentration, then hold fixed.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398992, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '93960f5a-c09b-497f-97ad-680a6e68a004', 1, '2020-11-17 01:19:05.639745', true, 'ssp534-over Well Mixed GHG Emissions', 'ssp534-overWmGhgEm', NULL, 'Representative Concentration Pathway 3.4-over Well Mixed Greenhouse Gas Emissions for Shared Socioeconomic Pathway 5', 'Impose changing emissions of esm-ssp534-over long-lived greenhouse gases, including CO2, N2O and halogenated gases.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398993, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '8070b113-2f65-47dc-881e-310da0aa12d5', 1, '2020-11-17 01:19:05.639745', true, '2020-2050 31yrs', '31yrs2020-2050', NULL, '2020/01/01-2050/12/31', 'Run for 31 years from 2020 to 2050', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398994, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', '807864c6-c06d-42c7-a048-ee0ed530a154', 1, '2020-11-17 01:19:05.639745', true, 'dcppC-atl-pacemaker', 'dcppC-atl-pacemaker', 'C1.10', 'pacemaker atlantic experiment', 'Restore 12-month running mean, anomalies of sea surface temperature in the north Atlantic. Outside the restored region the model evolves freely allowing full climate system response. Historical values of atmospheric composition/emissions and solar forcing. Time period: 1950-2014 (run from 1920 if possible). 10 ensemble members (up to 25 members requested).  SST signal may also be imposed by altering surface fluxes.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398995, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a7802765-2277-4e31-9c3c-9271ce95775b', 1, '2020-11-17 01:19:05.639745', true, 'Simplified Historical Solar Forcing', 'simplifiedHistoricalSolarForcing', NULL, 'Simplified Historical Solar Forcing', 'Simplified historical solar forcing requirement for models that represent solar forcing as a constant rather than with specifications for spectral irradiance, proton forcing, electron forcing and cosmic ray forcing.  e.g. land surface models.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398996, 'cmip6', NULL, '--', 'cim.2.shared.Party', '1377b975-3c2d-4ff8-a11a-d8ceb13ff653', 1, '2020-11-17 01:19:05.639745', true, 'Peter Gleckler', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398997, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '1f773c66-fee7-4834-8113-c6e66269f1f9', 1, '2020-11-17 01:19:05.639745', true, 'Historical Open Burning Emissions', 'HistoricalOpenBurningEmissions', NULL, 'Historical Open Burning Emissions', 'Emissions from fires in forests and grasslands', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398998, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e576685c-d820-4c3c-886c-e41deb7926a9', 1, '2020-11-17 01:19:05.639745', true, 'LS3MIP ssp585 Sea-Ice', 'LS3MIPssp585SeaIce', NULL, 'Sea-ice from the first ensemble member of the ssp585 experiment', 'Sea-ice from the first ensemble member of the ssp585 experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (398999, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '9b0c0124-97f4-4b69-ba33-811c5929be67', 1, '2020-11-17 01:19:05.639745', true, '310yrs', '310yrs1700-2009', NULL, '1700/01/01-2010/01/01', 'Historical, five repetitions of the 62 year CORE-II (1948-2009) with simulations beginning in 1700.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399000, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '8985bd46-a1c0-46f5-98cc-23452dd4534d', 1, '2020-11-17 01:19:05.639745', true, 'SOLARIS-HEPPA Proton Fluxes', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399001, 'cmip6', NULL, '--', 'cim.2.shared.Party', 'fbb829e3-dc21-42d6-b8d4-6dc9949e1a34', 1, '2020-11-17 01:19:05.639745', true, 'Louise Chini', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399002, 'cmip6', '<ismip6>', '--', 'cim.2.designing.NumericalExperiment', 'f4c4c0c2-5317-47df-a85c-6d875d992443', 1, '2020-11-17 01:19:05.639745', true, 'ism-amip-std', 'ism-amip-std', NULL, 'offline ice sheet model forced by ISMIP6-specified AGCM AMIP output', 'Stand alone ice sheet model driven offline by ISMIP6 CMIP6 standard input for the DECK amip climate experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399003, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '42dd6585-3450-46cb-90d1-2fd5944e4ca1', 1, '2020-11-17 01:19:05.639745', true, '1960Annual', '1960annual', NULL, '1960 Annual', 'Start date every year from 1960 to the present.  Start date on or before 31st December of the year preceding the forecast period.  Start dates on or before 15th November recommended to allow for DJF seasonal forecast results.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399004, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '83a7e7c7-f9df-41e8-b4e1-bed768738296', 1, '2020-11-17 01:19:05.639745', true, 'SSP1-60Initialisation2020', 'ssp1-60Initialisation2020', NULL, 'SSP1-6.0 Initialisation year 2020', 'Initialisation is from the beginning of year 2020 of the SSP1-6.0 experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399005, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'f1cf6c2b-42ee-4455-be5c-a80812999b8e', 1, '2020-11-17 01:19:05.639745', true, 'Historical land surface forcings except fire management', 'historicalLandSurfaceForcingsNoFire', NULL, 'historical land surface  forcings except fire management', 'Apply all transient historical forcings that are relevant for the land surface model except for fire management.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399006, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '7001149e-2902-4796-92ca-821a7228aa36', 1, '2020-11-17 01:19:05.639745', true, '2010 Solar Irradiance Forcing', '2010SolarIrradiance', NULL, '2010 Solar Irradiance Forcing', '2010 solar irradiance. The standard solar forcing dataset recommended for usage is the solar reference scenario dataset which consists of historical reconstructions (1850-2014).  Includes total solar irradiance, F10.7 cm solar radio flux, and spectral solar irradiance for 10-100000 nm range.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399007, 'cmip6', '<ls3mip>', '--', 'cim.2.designing.NumericalExperiment', 'd19defbe-3f27-40e1-a8ae-46943c69e752', 1, '2020-11-17 01:19:05.639745', true, 'amip-lfmip-pdLC', 'amip-lfmip-pdLC', 'LFMIP-pdLC+SST', 'prescribed modern land surface climatology from historical, prescribed SST and sea-ice from historical plus scenario runs', 'Scenario forced experiment with prescribed land surface climatology derived from modern conditions from the first historical ensemble member (1980-2014). SST and sea-ice from the first ensemble members of the historical and ssp585 experiments.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399008, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'd21fb25b-e305-4a39-ab11-ffafc342633d', 1, '2020-11-17 01:19:05.639745', true, '2015-2050 36yrs', '36yrs2015-2050', NULL, '2015/01/01-2051/01/01', 'Future scenario, begin in 2015 and run for 36 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399009, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '015baa6a-e404-4e9d-a658-73ad458a0cde', 1, '2020-11-17 01:19:05.639745', true, 'hist-aer initialisation', 'hist-aerInitialisation', NULL, 'hist-aer Initialisation', 'Initialisation data is taken from the end of the hist-aer simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399010, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', 'bdf8dcff-601a-421d-8e6b-43cb2b75b00d', 1, '2020-11-17 01:19:05.639745', true, 'pdSST-futOkhotskSIC', 'pdSST-futOkhotskSIC', '3.1', 'Atmosphere time slice with present day SST and future Sea of Okhotsk SIC', 'Atmosphere-only time slice experiment to investigate regional forcing. Time slice forced by climatological monthly mean sea surface temperature (SST) for the present day and future Arctic sea ice concentration (SIC) only in the Sea of Okhotsk. Radiative forcing to be set to present day (year 2000) levels. Future SIC will be computed from the ensemble of CMIP5 projections by PAMIP. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399011, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ddd4dbf1-f16f-47ab-b440-9caae8c4a497', 1, '2020-11-17 01:19:05.639745', true, '2014 Water Vapour', '2014H2O', NULL, '2014 water vapour concentrations', 'Impose present-day (2014) concentrations of water vapour.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399012, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e57bcc29-7fb2-4552-bf85-e7854aea8ce3', 1, '2020-11-17 01:19:05.639745', true, 'Historical Aerosol Precursor Emissions', 'HistoricalAerosolPre', NULL, 'Historical Emissions of Aerosol Precursors', 'Impose historical emissions of aerosol precursors.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399013, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '6f79a84e-d5a1-49c6-8d0e-f48c664602ce', 1, '2020-11-17 01:19:05.639745', true, 'ERA-20C', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399014, 'cmip6', NULL, '--', 'cim.2.designing.Project', '5a7df10f-5da7-4f3a-889e-7f6c05ccc8e0', 1, '2020-11-17 01:19:05.639745', true, 'DAMIP', 'damip', NULL, 'Detection and Attribution Model Intercomparison Project', 'DAMIP is a suite of historical and scenario experiments using individual and subsets of forcings.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399017, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'ad0d9d8b-e79d-439a-b871-97410952694f', 1, '2020-11-17 01:19:05.639745', true, 'GSWP3 forcing with high land use', 'GSWP3HighLandUse', NULL, 'GSWP3 forcing with high land use estimates', 'High land use reconstruction, assumes high historical estimates for crop and pasture and wood harvest relative to the reference GSWP3 dataset.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399018, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'd3ee49d3-f9f7-47da-9cc8-ecf3a451b59d', 1, '2020-11-17 01:19:05.639745', true, '1850-1851 50yrs91-140', '50yrs1850-1851_91-140', NULL, '1850/01/01-1850/12/31', 'Idealised temporal constraint, repeating 1850 for 50 years, to coincide with years 91 to 140 of the abrupt 4xCO2 experiment', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399032, 'cmip6', '<fafmip>', '--', 'cim.2.designing.NumericalExperiment', 'cf6bca92-5679-4f60-8daf-ba4f58335aac', 1, '2020-11-17 01:19:05.639745', true, 'faf-passiveheat', 'faf-passiveheat', NULL, 'control plus surface flux of passive heat tracer into ocean', 'Add a surface flux of passive tracer at the same rate as the surface heat flux perturbation, calculated from the ensemble mean of the CMIP5 1pctCO2 simulations at the time of CO2 doubling.
INSERT INTO docs.tbl_document VALUES (399033, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '8b2a1a07-e616-4e77-9bd3-6c31749fce58', 1, '2020-11-17 01:19:05.639745', true, 'TenLandInitialisations', 'TenMemberLandSurfaceInitialisation', NULL, 'Ten Member Ensemble initialised with batch of land surface models', 'An ensemble of ten members initialised via a batch of 10 land surface models', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399034, 'cmip6', NULL, '--', 'cim.2.designing.NumericalExperiment', 'f74196fa-19b0-4b29-b62f-51ce21cdb45e', 1, '2020-11-17 01:19:05.639745', true, 'ssp370SST-lowNTCFCH4', 'ssp370SST-lowNTCFCH4', NULL, 'SSP3-7.0, prescribed SSTs, with low NTCF emissions and low CH4 concentrations', 'SSP-based RCP scenario following approximately RCP7.0 global forcing pathway but with reduced NTCF emissions and SSP3 socioeconomic conditions. Methane concentrations also follow the "low" scenario.  Atmosphere only with SST from ScenarioMIP experiment SSP3-70.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399035, 'cmip6', NULL, '--', 'cim.2.shared.Party', '393caf4c-be16-47e1-8f8c-57605df84f89', 1, '2020-11-17 01:19:05.639745', true, 'Detlef van Vuuren', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399036, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'a9ea670e-1f73-463d-b51e-fbc3f32eb246', 1, '2020-11-17 01:19:05.639745', true, 'Ice Sheet Model Intercomparison Project (ISMIP6) contribution to CMIP6', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399037, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', 'f322cac8-d990-458a-9d50-9713feac4366', 1, '2020-11-17 01:19:05.639745', true, 'piClim-2xDMS', 'piClim-2xDMS', NULL, 'pre-industrial climatolgical SSTs and forcing, but with doubled emissions of DMS', 'Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases). The oceanic DMS (dimethyl sulphide) aerosol emission fluxes in the interactive parameterisation are double their pre-industrial value.  All other NTCF (near term climate forcers) are set to pre-industrial levels. For models that do not interactively parameterise particular emissions, the fluxes from the 1850 climatological dataset should be doubled. This is a timeslice experiment of 30 years total.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399038, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '92a19ee6-2f6c-43a4-ab6e-5a39dfb17cc4', 1, '2020-11-17 01:19:05.639745', true, '1850 Fertilisation', '1850Fertilisation', NULL, '1850 fertilisation', 'Maintain 1850 fertiliser area/amount.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399039, 'cmip6', NULL, '--', 'cim.2.designing.Project', 'b368a192-efa7-4721-910d-06edeb4a6a58', 1, '2020-11-17 01:19:05.639745', true, 'CDRMIP', 'cdrmip', NULL, 'The Carbon Dioxide Removal Model Intercomparison Project', 'The Carbon Dioxide Removal Model Intercomparison Project (CDR-MIP) brings together models of the Earth system in a common framework to explore the potential, impacts, and challenges of CDR. CDR-MIP experiments are designed to address questions concerning CDR-induced climate "reversibility", the response of the Earth system to direct atmospheric CO2 removal (direct air capture and storage), and the CDR potential of proposed schemes such as afforestation/reforestation and ocean alkalinization.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399040, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e5282378-6348-4dcd-8468-c970080dc279', 1, '2020-11-17 01:19:05.639745', true, '2014 Organic Carbon', '2014OC', NULL, 'Present Day 2014 Organic Carbon Emissions', 'Impose present day (2014) emissions of organic carbon (OC).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399041, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '284318c8-08eb-4a7e-a544-175f253bbe35', 1, '2020-11-17 01:19:05.639745', true, 'The Pliocene Model Intercomparison Project (PlioMIP) Phase 2: scientific objectives and experimental design', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399073, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '4b48bd9a-215a-4a89-8e11-209dbc49971c', 1, '2020-11-17 01:19:05.639745', true, 'RCP34-overshoot Aerosols', 'RCP34overaer', NULL, 'Representative Concentration Pathway 3.4 Overshoot Aerosols', 'Impose changing emissions of RCP3.4 overshoot aerosols including BC and OC.  Beginning in 2040, reduce forcings from 8.5 W/m2 pathway to 3.4 W/m2 by 2100.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399019, 'cmip6', '<ismip6>', '--', 'cim.2.designing.NumericalExperiment', '997b80c8-fc01-411c-85d1-7d5155785152', 1, '2020-11-17 01:19:05.639745', true, 'ism-bsmb-std', 'ism-bsmb-std', NULL, 'offline ice sheet forced by initMIP synthetic oceanic experiment', 'InitMIP basal melt anomaly experiment. Apply a prescribed anomaly of basal melting rate under floating ice, provided by ISMIP6, which simulates a doubling of sub-ice-shelf melting after 40 years of simulation for models with initial melting rates close to today’s observations. Keep the Surface Mass Balance (SMB) the same as in the ism-ctrl-std experiment.  All other model parameters and forcings are the same as those used for initialization.
INSERT INTO docs.tbl_document VALUES (399020, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '4ac6115f-66ee-4ed7-a98f-5912f25a6e5f', 1, '2020-11-17 01:19:05.639745', true, 'Last-Millennium Initialisation', 'LastMillenniumInitialisation', NULL, 'Last millennium initialisation', 'Initialisations made from 1st January 1790 of a PMIP past1000 simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399021, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'bd3d3aa1-9609-41d8-b346-9d7da03ac210', 1, '2020-11-17 01:19:05.639745', true, 'RCP26-extension Aerosol Precursors', 'RCP26extaerpre', NULL, 'Representative Concentration Pathway 2.6 Extension Aerosol Precursors', 'Impose changing emissions of RCP2.6 extension aerosols precursors including SO2 and NHy.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399022, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '9da52eab-3c30-44b0-b394-79d89a7ef869', 1, '2020-11-17 01:19:05.639745', true, 'RCP34-extension-overshoot Aerosols', 'RCP3.4extoveraer', NULL, 'Representative Concentration Pathway 3.4 extension Overshoot Aerosols', 'Impose changing emissions of RCP3.4 extension overshoot aerosols including BC and OC.  Beginning in 2100, linearly reduce forcings from 3.4 W/m2 pathway to 2.6 W/m2 by 2250.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399023, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd1d0cc4e-f5fb-470d-b849-dd62edbc3b37', 1, '2020-11-17 01:19:05.639745', true, 'piControl SST Monthly Var', 'piControlSSTMnthlyVar', NULL, 'Monthly-varying sea surface temperatures from the pre-industrial control simulation', 'Monthly-varying sea surface temperatures from years 111 to 140 of the pre-industrial control (piControl) experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399024, 'cmip6', NULL, '--', 'cim.2.shared.Party', '8034b5ae-926d-46d1-a1fe-ac08fb35c012', 1, '2020-11-17 01:19:05.639745', true, 'James Orr', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399025, 'cmip6', '<cmip>', '--', 'cim.2.designing.NumericalExperiment', '35338d2b-4664-46b1-b304-8966860702f7', 1, '2020-11-17 01:19:05.639745', true, 'historical-ext', 'historical-ext', NULL, 'post-2014 all-forcing simulation', 'Extension beyond 2014 of the CMIP6 historical simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399026, 'cmip6', '<cdrmip>', '--', 'cim.2.designing.NumericalExperiment', 'ad82b8bc-ff6c-46c1-9385-de806c8f346e', 1, '2020-11-17 01:19:05.639745', true, 'esm-yr2010CO2-noemit', 'esm-yr2010CO2-noemit', 'CDR-yr2010-pulse', 'branches from esm-yr2010CO2-control with zero emissions', 'Control run that branches from esm-yr2010CO2-control in the year 2015. At the beginning of 2015 the CO2 emissions are fixed at zero; all other forcings are fixed at 2010 levels.  Include all anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399027, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '3f93d2b5-cd40-4cd4-b127-19d7b3d315a2', 1, '2020-11-17 01:19:05.639745', true, 'The Radiative Forcing Model Intercomparison Project (RFMIP): experimental protocol for CMIP6', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399028, 'cmip6', '<volmip>', '--', 'cim.2.designing.NumericalExperiment', '2255dbef-2ec5-4238-8bbf-7aa31b815ad8', 1, '2020-11-17 01:19:05.639745', true, 'volc-long-hlS', 'volc-long-hlS', NULL, 'Idealized Southern Hemisphere high-latitude eruption emitting 28.1 Tg of SO2', 'Idealised high-latitude (60S) southern hemisphere eruption corresponding to an initial emission of 28.1 Tg of SO2 (equal to half the total amount injected for volc-long-eq).  The experiment is designed to span very different initial climate states to systematically assess uncertainties in post-eruption behaviour that are related to background climate conditions.   If, for instance, year Y of the control integration matches the desired conditions for the initial condition sampling, then the corresponding VolMIP simulation should start with restart data from year Y-1 of the control.  Run nine ensemble members for at least 20 years, but preferably longer (50 years) to cover the multi-decadal oceanic response. Initialisation date from the piControl start year is 1st April.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399029, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '33d63bcd-80eb-4ff4-84f2-cb1f2cc0f473', 1, '2020-11-17 01:19:05.639745', true, 'First Millennium Astronomical Parameters', 'FirstMillenniumAstroParams', NULL, 'Astronomical parameters for the first millennium', 'Astronomical parameters for the first millennium 01-849. The PMIP past1000 forcings data sets include the first millennium.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399030, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '22141ef6-5c10-4b84-bb6f-6130f87b7dc4', 1, '2020-11-17 01:19:05.639745', true, '2010 Cosmic Ray Forcing', '2010CosmicRayForcing', NULL, '2010 Cosmic Ray Forcing', '2010 cosmic ray forcing. CMIP6 recommends the use of the CRAC:CRII (Cosmic Ray induced Cascade: Application for Cosmic Ray Induced Ionization) model extended toward the upper atmosphere (Usoskin et al. 2010).  The results of the CRAC:CRII model are parameterized (see Usoskin and Kovaltsov 2006) to give ion pair production rate as a function of the altitude (quantified via the barometric pressure), geomagnetic latitude (quantified via geomagnetic cut-off rigidity), and solar activity (quantified via the modulation potential θ).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399031, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '3bbaa08c-946e-40aa-b056-e430ecc6e38b', 1, '2020-11-17 01:19:05.639745', true, 'extra1990s', 'extra1990s', NULL, 'extra 1990s start dates', 'Start dates from the end of 1992, 1997, 1998, 1999.  Start date on or before 31st December, start dates on or before 15th November recommended to allow for DJF seasonal forecast results.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399067, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', '30ee8eae-c1ee-492f-9f95-58e9a60da625', 1, '2020-11-17 01:19:05.639745', true, 'aqua-p4K', 'aqua-p4K', NULL, 'aquaplanet plus 4K SSTs', 'Continuation of CFMIP-2 AMIP experiments and CMIP5 experiment 6.7c. 
INSERT INTO docs.tbl_document VALUES (399068, 'cmip6', NULL, '--', 'cim.2.shared.Party', 'addfec58-9d7f-4a9c-81b7-1a25b2a27c59', 1, '2020-11-17 01:19:05.639745', true, 'Rob Chadwick', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399069, 'cmip6', NULL, '--', 'cim.2.designing.Project', '2cf0d709-28b9-4dbd-a323-713e273851f7', 1, '2020-11-17 01:19:05.639745', true, 'OMIP', 'omip', NULL, 'Ocean Model Inter-comparison Project', 'OMIP merges the CORE-II (Coordinated Ocean-Ice Reference Experiments) and OCMIP (Ocean-Carbon Cycle Model Inter-comparison Project) projects. OMIP coordinates CMIP6 ocean diagnostics for all CMIP6 simulations that include an ocean component. OMIP provides a protocol for ocean/sea-ice simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399042, 'cmip6', '<fafmip>', '--', 'cim.2.designing.NumericalExperiment', '6c22d0d7-6a27-4f60-990c-6ba3e8228142', 1, '2020-11-17 01:19:05.639745', true, 'faf-heat-NA0pct', 'faf-heat-NA0pct', NULL, 'control plus perturbative surface flux of heat into ocean', '1xCO2 experiment, parallel to piControl, forced over the ocean by the same method and with the same surface net heat flux perturbation field as in faf-heat, except that within part of the North Atlantic ocean the perturbation is zero.
INSERT INTO docs.tbl_document VALUES (399043, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', '77a9918b-d9e2-409e-8d21-a5272d24b1ce', 1, '2020-11-17 01:19:05.639745', true, 'piSST-piSIC', 'piSST-piSIC', '1.2', 'Atmosphere time slice with pre-industrial SST and SIC', 'Atmosphere-only time slice pre-industrial control experiment forced by climatological
INSERT INTO docs.tbl_document VALUES (399044, 'cmip6', '<geomip>', '--', 'cim.2.designing.NumericalExperiment', 'a7cd966f-1e3a-4b15-a8e0-527f312315b7', 1, '2020-11-17 01:19:05.639745', true, 'G6solar', 'G6solar', NULL, 'total solar irradiance reduction to reduce net forcing from SSP585 to SSP245', 'Using solar irradiance reduction, return the radiative forcing from a background of the ScenarioMIP high forcing (SSP5-85) to the ScenarioMIP middle forcing (SSP2-45).  Geoengineering will be simulated over years 2020 to 2100.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399045, 'cmip6', '<rfmip>', '--', 'cim.2.designing.NumericalExperiment', 'ffd4c3e7-472b-4a71-9b67-b9a4bc1ff6e8', 1, '2020-11-17 01:19:05.639745', true, 'piClim-spAer-anthro', 'piClim-spAer-anthro', 'RFMIP-SpAerO3-anthro', 'effective radiative forcing at present day with specified anthropogenic aerosol optical properties, anthropogenic forcings', 'An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperatures (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology. Anthropogenic forcing agents are specified at present day 2014 values. Aerosols are specified by RFMIP. Run for 30 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399059, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '63daaa8a-0d4b-46d1-8889-5c215ffe4fa8', 1, '2020-11-17 01:19:05.639745', true, 'Mid-Holocene CO2', 'midHoloceneCO2', NULL, 'Mid-Holocene CO2 concentration', 'Impose Mid-Holocene atmospheric carbon dioxide (CO2) concentration.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399087, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'c81b195e-4cd5-46c0-9a88-ce83f4be169f', 1, '2020-11-17 01:19:05.639745', true, 'ThreeMember', 'ThreeMemberEnsemble', NULL, 'Three Member Ensemble', 'An ensemble of three simulations', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399046, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '2fff3e3f-c13d-4a5c-8ac1-a6c4650a5186', 1, '2020-11-17 01:19:05.639745', true, 'Princeton recycling of climate mean and variability', 'PrincetonRecycleClimateMeanAndVariability', NULL, 'Princeton recycling of climate mean and variability from the forcing dataset', 'Recycling of the climate mean and variability from two decades (1901–1920) of the Princeton global forcing dataset.  The recycled variables are the forcing variables needed to drive an offline land module. So these are wind speed in two directions at 10m height, atmosphere temperature and humidity at 2m height, incoming shortwave and longwave radiation, incoming rainfall and snowfall, surface pressure.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399047, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', '882a9b3b-a74f-4956-9a4f-8f8d38850814', 1, '2020-11-17 01:19:05.639745', true, 'dcppA-hindcast-niff', 'dcppA-hindcast-niff', 'A4.1', 'hindcasts initialized from observations without observed forcing after initialization', 'A coordinated set of multi-member ensembles of retrospective forecasts (hindcasts) initialised each year from 1960 to the present (otherwise every second year). Radiative and other forcing information (e.g. greenhouse gas concentrations, aerosols etc.) maintained at initial state value or projected in a simple way.  No inclusion of volcano or other short term forcing unless available at initial time.  Initialise from observations.  Run each member for at least 5 years, preferably 10 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399048, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '71b0c25f-0603-417d-8077-06294fdc5d57', 1, '2020-11-17 01:19:05.639745', true, 'Historical Emission Based Grid-Point Aerosol Forcing 1950s', 'HistoricalEmissionBasedGrid-PointAerosolForcing1950s', NULL, 'Historical Emission Based Grid-Point Aerosol Forcing 1950s', '1950s (10 year) climatology of mass mixing ratio fields at 1x1 degree resolution for main aerosol components (sulphate, black carbon, organic carbon, nitrate, sea salt, mineral dust),  along with effective radius per species.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399049, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '3179aa37-c8de-45cf-b016-6e4335671d4a', 1, '2020-11-17 01:19:05.639745', true, 'Flux-Anomaly-Forced Model Intercomparison Project (FAFMIP)', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399050, 'cmip6', '<c4mip>,<cdrmip>,<cmip>,<deck>', '--', 'cim.2.designing.NumericalExperiment', '12840358-fe43-48d8-8964-dcf65f85c7cd', 1, '2020-11-17 01:19:05.639745', true, 'esm-piControl', 'esm-piControl', NULL, 'pre-industrial control simulation with CO2 concentration calculated', 'A pre-industrial control simulation with non-evolving pre-industrial conditions and atmospheric CO2 calculated. Conditions chosen to be representative of the period prior to the onset of large-scale industrialization, with 1850 being the reference year.  The piControl starts after an initial climate spin-up, during which the climate begins to come into balance with the forcing. The recommended minimum length for the piControl is 500 years. To be performed with an Earth System Model (ESM) that can calculate atmospheric CO2 concentration and account for the fluxes of CO2 between the atmosphere, the ocean, and biosphere.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399051, 'cmip6', '<damip>', '--', 'cim.2.designing.NumericalExperiment', '8be0dc26-8837-461c-879f-67039a7f37d2', 1, '2020-11-17 01:19:05.639745', true, 'ssp245-cov-aer', 'ssp245-cov-aer', NULL, '2-year Covid-19 emissions blip including anthropogenic aerosols only, based upon ssp245', 'Detection and attribution experiment: aerosol-only run based on ssp245-covid, with 2-year perturbation to emissions for 2020 and 2021 due to Covid-19 pandemic restrictions. Concentration-driven. Branch from ssp245 at 1 Jan 2020.  Near-term impact simulations run for 5 years with a minimum of 10 ensemble members. Longer-term impact of recovery scenarios to be run for 30 years with 10 ensemble members if possible.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399052, 'cmip6', NULL, '--', 'cim.2.designing.MultiEnsemble', 'cc1702c7-3df3-4af0-928e-ec0635713482', 1, '2020-11-17 01:19:05.639745', true, '1960Annualx10', '1960annualx10', NULL, 'Multi-initialisations of 1960 Annual start date ensemble', 'A multi-ensemble of 600 simulations with ten initialisations for each start date occurring every year from 1960 to the present.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399053, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'dcad9c82-40aa-40e4-8974-30aae71ed7f5', 1, '2020-11-17 01:19:05.639745', true, 'Historical Land Use Low', 'historicalLandUseLow', NULL, 'historical land use with low estimates of  crop, pasture and wood harvest', 'Historical land use with low estimates of crop cultivation, pasture land and wood harvest.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399070, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'eabaf5bc-2f1f-4d1f-951f-0221338f9b41', 1, '2020-11-17 01:19:05.639745', true, 'The Met Office Hadley Centre Sea Ice and Sea-Surface Temperature data set, version 2.2.0.0', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399074, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '00ab713e-c314-4a45-9e4a-214355171ce5', 1, '2020-11-17 01:19:05.639745', true, 'Historical Aerosol Emissions', 'HistoricalAerosol', NULL, 'Historical Emissions of Aerosols', 'Impose historical emissions of aerosols.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399054, 'cmip6', '<highresmip>', '--', 'cim.2.designing.NumericalExperiment', '0c050947-e4f7-4608-8ffc-25f579464930', 1, '2020-11-17 01:19:05.639745', true, 'highres-future', 'highres-future', NULL, 'HighResMIP SSP5-85 Coupled ocean atmosphere', 'High forcing (ScenarioMIP SSP5-85) future scenario (2015-2050) coupled ocean atmosphere simulations at high and standard resolution.
INSERT INTO docs.tbl_document VALUES (399055, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '021f9832-e221-486d-88ac-834dd45d583e', 1, '2020-11-17 01:19:05.639745', true, '1950-2014Init 100yrs', '100yrs1950-2014Init', NULL, '100 years after initialization sometime between 1950 and 2014', 'Initialise some time between 1950 and 2014 and run for 100 years. The specific year of initialisation is unconstrained to allow the use of different observational data sets that may be tied to certain time periods.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399056, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '3e048b26-2551-4119-a376-63ec5a520f7b', 1, '2020-11-17 01:19:05.639745', true, 'piControlInitialisation', 'piControlInitialisation', NULL, 'piControl Initialisation', 'The pre-industrial control experiment, piControl, is intitialised from the pre-industrial control spinup piControl-spinup.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399057, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', '8b9e4c32-1fab-4881-800e-50f735b93220', 1, '2020-11-17 01:19:05.639745', true, 'pa-piAntSIC', 'pa-piAntSIC', '2.4', 'Partially-coupled time slice with pre-industrial Antarctic SIC', 'Coupled ocean-atmosphere time slice experiment forced by climatological monthly mean sea surface temperature (SST) for the present day and pre-industrial Antarctic sea ice concentration (SIC). Sea ice concentration to be nudged into coupled model with a relaxation time-scale of 1 day. Radiative forcing to be set to present day (year 2000) levels.  Initial conditions for coupled model experiments to be taken from year 2000 of coupled model CMIP6 historical simulations. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399058, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', '4848f4dd-92b6-4a66-951c-6a19d8b0bc97', 1, '2020-11-17 01:19:05.639745', true, 'aqua-control-lwoff', 'aqua-control-lwoff', NULL, 'aquaplanet with longwave cloud radiative effects off', 'Continuation of CFMIP-2 AMIP experiments and CMIP5 experiment 6.7a. 
INSERT INTO docs.tbl_document VALUES (399060, 'cmip6', '<c4mip>', '--', 'cim.2.designing.NumericalExperiment', '14a73a4f-b84c-4625-85f3-3f74fc47a1ef', 1, '2020-11-17 01:19:05.639745', true, 'esm-1pct-brch-1000PgC', 'esm-1pct-brch-1000PgC', 'A.1', 'zero emissions simulation branched from 1% run after 1000 PgC cumulative emission', 'Abrupt-zero emissions experiment. Branch off  from the 1pctCO2 experiment with interactive CO2 (emissions-driven configuration) but with CO2 emissions set to zero. The branch off point is when the cumulative carbon emissions reach 1000 PgC.  Simulate the subsequent reduction in CO2 and change in climate for at least 100 years.  Earth System Models of Intermediate Complexity (EMICs) are requested to run longer simulations, up to 1000 years.  Note some Earth System Models (ESMs) may need to re-run an emissions-driven version of 1pctCO2 to branch-off from.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399061, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '8e611f2b-4633-4ee3-9437-d362e6438773', 1, '2020-11-17 01:19:05.639745', true, 'Maintain 4xCO2 concentration', '4xCO2maintained', NULL, '4xCO2 concentration is maintained', 'After a period of 1% per year increase in CO2 to 4xCO2, maintain CO2 concentrations at 4x pre-industrial concentrations until the end of the simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399062, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '5b755b35-c631-42b8-ada2-65594509d5c5', 1, '2020-11-17 01:19:05.639745', true, 'TRENDY spin up for GSWP3', 'trendySpinUpGSWP3', NULL, 'TRENDY protocol for the spin up with GSWP3 forcing', 'Spin up of the land surface model should follow the TRENDY protocol which calls for recycling of the climate mean and variability from two decades of the GSWP3 forcing dataset (1831–1850). Land use should be held constant at 1850 as in the DECK 1850 coupled control simulation (piControl). CO2 and all other forcings should be held constant at 1850 levels during spin-up.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399063, 'cmip6', '<ls3mip>', '--', 'cim.2.designing.NumericalExperiment', '18bea327-792e-4d83-b9c2-4e5f4016de20', 1, '2020-11-17 01:19:05.639745', true, 'land-ssp585', 'land-ssp585', 'Land-Future', 'Future SSP5-85 land-only', 'Offline land surface simulations forced with ScenarioMIP SSP5-85.  Three realisations required.  A trend preserving statistical bias correction method is applied to 3-hourly surface meteorological variables from the scenario output to generate a set of ensemble forcing data.  Gridded forcings will be provided by LS3MIP. The land model configuration should be identical to that used in the DECK and CMIP6 historical simulations for the parent coupled model.  Spin-up of the land-only simulations should follow the TRENDY protocol.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399064, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'f64f77cd-66ab-45a8-8390-2028eef85e86', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP present day SST for use with future Antarctic SIC', 'PAMIP-pd-SST-clim-for-fut-ant-SIC', NULL, 'PAMIP monthly mean climatology of present day sea surface temperature for use with future Antarctic sea ice concentration', 'Present day monthly mean cimatology of sea surface temperatue for use with future antarctic sea ice. Data provided by PAMIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399065, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '265d35fa-de54-4018-9df8-b8fad7b11be4', 1, '2020-11-17 01:19:05.639745', true, '4xCO2 for Vegetation', '4xCO2Veg', NULL, 'Quadrupling of atmospheric carbon dioxide concentration only affects vegetation code.', 'Impose a quadrupling of pre-industrial carbon dioxide (CO2) concentrations to vegetation code.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399066, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', '7763650a-c31e-4628-a004-b2f473f65246', 1, '2020-11-17 01:19:05.639745', true, 'dcppC-forecast-addElChichon', 'dcppC-forecast-addElChichon', 'C3.5', '2015 forecast with added El Chichon forcing', 'Prediction experiment for 2015 with volcano forcing.  Repeat DCPP-A1 2015 forecast (from the dcppA-hindcast experiment) with El Chichon forcing. Background volcanic aerosol to be the same as that used in the 1992 hindcast. 10 ensemble members. Run each member for at least 5 years, preferably 10 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399071, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '583fd83c-32f5-4f9c-a14b-57390323d3ce', 1, '2020-11-17 01:19:05.639745', true, 'LIG CO2', 'LIGCO2', NULL, 'Last Inter-Glacial CO2 concentration', 'Impose Last Interglacial (127 kyr ago) atmospheric carbon dioxide (CO2) concentration.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399072, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'b39eeada-7d8c-4208-abeb-cad913417266', 1, '2020-11-17 01:19:05.639745', true, 'FAFMIP mailing list', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399075, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '5b70c16b-bbaf-4521-8d18-58304ac9120b', 1, '2020-11-17 01:19:05.639745', true, 'Fire Management', 'fireManagement', NULL, 'Fire Management', 'Human fire land management.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399076, 'cmip6', '<c4mip>', '--', 'cim.2.designing.NumericalExperiment', 'b532ec92-d7c8-4959-84fa-f2a6fe906968', 1, '2020-11-17 01:19:05.639745', true, '1pctCO2-bgc', '1pctCO2-bgc', NULL, 'biogeochemically-coupled version of 1 percent per year increasing CO2 experiment', 'Biogeochemically-coupled version of 1% per year increasing CO2 up to 4XCO2 simulation. CO2 increase only affects carbon cycle models, radiative code sees pre-industrial CO2. Nitrogen deposition held fixed at pre-industrial values.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399077, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '6a30f6a6-7baf-4411-8607-f7aadc582ec9', 1, '2020-11-17 01:19:05.639745', true, '1950-1959 10yrs', '10yrs1950-1959', NULL, '1950/01/01-1960/01/01', 'Timeslice, begin in 1950 and run for 10 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399078, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'b717d65c-10a5-41bc-a525-8f8add180e96', 1, '2020-11-17 01:19:05.639745', true, 'RCP70 Forcing Excluding Land Use', 'rcp70ForcingExcludingLandUse', NULL, 'Representative Concentration Pathway 7.0 W/m2 Forcing excluding land use', 'Impose RCP7.0 forcing excluding land use. Concentration driven.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399079, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', '8ff7a328-e031-49f1-862c-68be2c5648e8', 1, '2020-11-17 01:19:05.639745', true, 'abrupt-0p5xCO2', 'abrupt-0p5xCO2', NULL, 'Abrupt halving of the atmospheric concentration of carbon dioxide', 'Impose an instantaneous halving of the concentration of atmospheric carbon dioxide, then hold fixed.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399080, 'cmip6', '<c4mip>', '--', 'cim.2.designing.NumericalExperiment', '86074037-4eb2-4f99-bc25-04385a3520ab', 1, '2020-11-17 01:19:05.639745', true, '1pctCO2Ndep', '1pctCO2Ndep', NULL, '1 percent per year increasing CO2 experiment with increasing N-deposition', 'Fully-coupled concentration driven 1% per year increasing CO2 up to 4XCO2 simulation with time varying nitrogen deposition.  Only applicable to models whose simulation will be affected by the deposition of reactive nitrogen either due to terrestrial or marine nitrogen cycle effects on carbon fluxes and store.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399081, 'cmip6', NULL, '--', 'cim.2.shared.Party', '11abf916-4aa9-48bd-b3bf-c93eced2ccb9', 1, '2020-11-17 01:19:05.639745', true, 'Gokhan Danabasoglu', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399082, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'facc5135-2ae3-4d1c-8744-7d95c25575f4', 1, '2020-11-17 01:19:05.639745', true, 'LSM Configuration', 'LSM-Configuration', NULL, 'Land Surface Model', 'Offline land surface model', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399083, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '850ff96b-9802-45cc-9f45-972d74063d0a', 1, '2020-11-17 01:19:05.639745', true, 'Temperate Deforestation', 'IdealisedTemperateDeforestation', NULL, 'Temperate Deforestation', 'Idealised regional deforestation: Temperate region.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399084, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '8b8f6f59-2c1b-4851-8f68-99f6d11d39d8', 1, '2020-11-17 01:19:05.639745', true, '2014 AerPrex0.1', '2014AerPrex0.1', NULL, '2014 aerosol precursors x 0.1', 'Impose present day (2014) aerosol precursors scaled by 0.1.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399085, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ce90f27c-0282-49e2-b498-138ba6702a40', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP future Arctic SIC', 'PAMIP-fut-arc-SIC-clim', NULL, 'PAMIP monthly mean climatology of future Arctic sea ice concentration', 'Future monthly mean cimatology of arctic sea ice concentration, data provided by PAMIP. When used in coupled models it is recommended to constrain sea ice by nudging but with a weak relaxation timescale of 2 months. However, appropriately calibrated long-wave fluxes applied to the sea ice model may also be used.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399088, 'cmip6', '<cfmip>,<cmip>,<deck>,<gmmip>,<highresmip>,<ismip6>,<pamip>', '--', 'cim.2.designing.NumericalExperiment', 'f1048bbe-5eef-4dda-88ca-d1053cf9ea18', 1, '2020-11-17 01:19:05.639745', true, 'amip', 'amip', NULL, 'Atmospheric Model Intercomparison Project', 'An atmosphere only climate simulation using prescribed sea surface temperature and sea ice concentrations but with other conditions as in the Historical simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399089, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '2bb81d64-d696-44f4-a5af-df8eabaca7ad', 1, '2020-11-17 01:19:05.639745', true, '1790-1858 69yrs', '69yrs1790-1858', NULL, '1790/01/01-1859/01/01', 'Begin in 1790 and run for 69 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399090, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '7b3f0cc1-607f-49e5-badd-a585f950e44f', 1, '2020-11-17 01:19:05.639745', true, 'All Land Management Active', 'allLandManagement', NULL, 'All management of land active in the model configuration', 'All applicable land management active in the land surface model configuration.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399091, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', 'a1d681d2-3d50-4575-8298-c8b666d1fd64', 1, '2020-11-17 01:19:05.639745', true, 'dcppC-pac-pacemaker', 'dcppC-pac-pacemaker', 'C1.9', 'pacemaker pacific experiment', 'Restore to observed anomalies of sea surface temperature in the tropical eastern Pacific. Outside the restored region the model evolves freely allowing full climate system response. Historical values of atmospheric composition/emissions and solar forcing. Time period: 1950-2014 (run from 1920 if possible). 10 ensemble members.  SST signal may also be imposed by altering surface fluxes.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399092, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'e73ec359-0759-4d26-b90c-8966dc526055', 1, '2020-11-17 01:19:05.639745', true, '1870-2013 144yrs', '144yrs1870-2013', NULL, '1870/01/01-2014/01/01', 'Historical temporal constraint, pre-industrial to 2013', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399093, 'cmip6', NULL, '--', 'cim.2.designing.NumericalExperiment', 'd3c3b1f9-6782-4a4b-8fd7-c710983b5bd7', 1, '2020-11-17 01:19:05.639745', true, 'ssp370-lowNTCFCH4', 'ssp370-lowNTCFCH4', NULL, 'SSP3-7.0, with low NTCF emissions and low CH4 concentrations', 'SSP-based RCP scenario following approximately RCP7.0 global forcing pathway but with reduced Near Term Climate Forcer (NTCF) emissions and SSP3 socioeconomic conditions. Methane concentraitons also follow the "low" scenario.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399094, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '3c598cfb-5843-4b83-901d-9a0e0549f707', 1, '2020-11-17 01:19:05.639745', true, '2010 Aerosol Emissions', '2010AerosolEm', NULL, '2010 Emission Based Grid-Point Aerosol Forcing', 'Apply 2010 mass mixing ratio fields at 1x1 degree resolution for main aerosol components (sulphate, black carbon, organic carbon, nitrate, sea salt, mineral dust),  along with effective radius per species.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399095, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '6d03dd38-21c7-4420-8b67-94f4a77a1f1c', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP transient AMIP SST', 'PAMIP-AMIP-SST', NULL, 'PAMIP transient AMIP historical sea surface temperature', 'Transient AMIP sea surface temperature.  Data provided by PAMIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399096, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '70bf6b56-c959-4de4-8d66-683f5bcaf1b6', 1, '2020-11-17 01:19:05.639745', true, '2014 Anthropogenic Forcing Specified Aerosols', '2014anthropForcingSpecAer', NULL, '2014 anthropogenic forcing agents with specified aerosol', 'Agents of anthropogenic forcing, GHGs, Land Use etc. with Aerosols specified by RFMIP', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399097, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '991676cd-eec0-4927-973b-035fba96a418', 1, '2020-11-17 01:19:05.639745', true, '2014 Aerosol Precursor Emissions', '2014AerosolPre', NULL, '2014 Emissions of Aerosol Precursors', 'Impose 2014 emissions of aerosol precursors.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399098, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '031e105f-433b-44ee-9569-c8ee816e55f6', 1, '2020-11-17 01:19:05.639745', true, 'piControl SST Climatology', 'PIControlSSTClim', NULL, 'Pre-Industrial Control Sea Surface Temperature climatology', 'Pre-Industrial monthly averaged climatology of sea surface temperatures (SST) generated from at least a 30-year segment of the piControl experiment integration.  These should be prescribed according to the AMIP protocols, whereby interpolated daily data are generated preserving the prescribed monthly average fields.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399099, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd444dae9-0280-46c4-ba06-ab5e09cd2862', 1, '2020-11-17 01:19:05.639745', true, 'CO2 bell 1000 PgC', 'CO2Bell1000PgC', NULL, '1000 PgC bell-shaped CO2 emissions profile', 'Use a bell-shaped CO2 emissions profile designed to give cumulative emissions of 1000 PgC after 100 years, then hold CO2 emissions at zero. The time series of global CO2 for the bell-shape emission profiles will be provided by ZECMIP via the C4MIP and CDRMIP websites.  A model decision is required on the spatial pattern of CO2 emissions, ZECMIP suggest globally uniform at surface.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399100, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'f8a4d469-fa2b-4dae-80a5-02d82a1d0a9a', 1, '2020-11-17 01:19:05.639745', true, 'RCP26 overshoot Forcing', 'rcp26overForcing', NULL, 'Representative Concentration Pathway 2.6 W/m2 Overshoot  Forcing', 'Impose RCP2.6-overshoot forcing.
INSERT INTO docs.tbl_document VALUES (399101, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '3b593255-cacc-46ef-bf54-219bfa6f38bb', 1, '2020-11-17 01:19:05.639745', true, 'RCP70 Well Mixed GHG', 'RCP70wmGHG', NULL, 'Representative Concentration Pathway 7.0 Well Mixed Greenhouse Gases', 'Impose changing concentrations of RCP7.0 long-lived gases, including CO2, N2O and halogenated gases.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399102, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd21a0824-4a12-43f7-ba87-f83144edd638', 1, '2020-11-17 01:19:05.639745', true, 'Present Day Atmospheric States', 'PDAtmosStates', NULL, 'Present day atmospheric states', 'Specified atmospheric states (vertical distribution of temperature and humidity) over many profiles for present day (2014).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399103, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '4f543291-f4dd-4a26-bd5d-2320c615f2f4', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Ozone Concentrations', 'Pre-IndustrialO3Concentrations', NULL, 'Pre-Industrial  Ozone Concentrations', 'Constant pre-industrial tropospheric and stratospheric ozone climatology.
INSERT INTO docs.tbl_document VALUES (399104, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '034ee577-b8e2-41ce-8703-7d2ff4d9289f', 1, '2020-11-17 01:19:05.639745', true, 'OCMIP2 inert chemical tracers', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399105, 'cmip6', '<c4mip>', '--', 'cim.2.designing.NumericalExperiment', '7fdfe37e-43b7-4271-8f9a-4986460d1c02', 1, '2020-11-17 01:19:05.639745', true, 'esm-1pct-brch-750PgC', 'esm-1pct-brch-750PgC', 'A.2', 'zero emissions simulation branched from 1% run after 750 PgC cumulative emission', 'Abrupt-zero emissions experiment. Branch off from the 1pctCO2 experiment with interactive CO2 (emissions-driven configuration) but with CO2 emissions set to zero.  The branch off point is when the cumulative carbon emissions reach 750 PgC.  Simulate the subsequent reduction in CO2 and change in climate for at least 100 years.  Earth System Models of Intermediate Complexity (EMICs) are requested to run longer simulations, up to 1000 years.  Note some Earth System Models (ESMs) may need to re-run an emissions-driven version of 1pctCO2 to branch-off from.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399106, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '055c1db2-a7f2-4b10-814b-0cd9c07b4573', 1, '2020-11-17 01:19:05.639745', true, 'More hurricanes to hit Western Europe due to global warming', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399137, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'a4591beb-45c4-4e89-841a-47c9fc74703d', 1, '2020-11-17 01:19:05.639745', true, 'RCP19 Forcing', 'rcpYForcing', NULL, 'Representative Concentration Pathway 1.9 W/m2 Forcing', 'Impose RCP Y forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399107, 'cmip6', '<rfmip>', '--', 'cim.2.designing.NumericalExperiment', 'c67e52d8-6877-4d5f-935a-f9341ff17ed8', 1, '2020-11-17 01:19:05.639745', true, 'rad-irf', 'rad-irf', 'RFMIP-IRF', 'Offline assessment of radiative transfer parmaeterizations in clear skies', 'Offline radiative transfer calculations of vertically-resolved broadband-integrated longwave and shortwave fluxes for present-day (2015) clear sky (aerosol-free) conditions. Use RFMIP specified atmospheric distributions of temperature and humidity and surface properties over many profiles.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399108, 'cmip6', NULL, '--', 'cim.2.shared.Party', '853e789d-c1f2-44fb-b794-7994010e773d', 1, '2020-11-17 01:19:05.639745', true, 'OMIP email', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399109, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'a2b6129c-3a9d-4a49-8636-2f5be9a0c9c7', 1, '2020-11-17 01:19:05.639745', true, 'The Scenario Model Intercomparison Project (ScenarioMIP) for CMIP6', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399110, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'f97ff840-2173-430c-9792-3eae370717f0', 1, '2020-11-17 01:19:05.639745', true, '2020esm-ssp585Initialisation', '2020esm-ssp585Initialisation', NULL, 'Initialisation from year 2020 of the esm-ssp585 simulation', 'Initialise from the C4MIP esm-ssp585 experiment in the year 2020.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399111, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', '7d45003e-3406-4ca4-a409-4bc3d896d914', 1, '2020-11-17 01:19:05.639745', true, 'dcppC-ipv-pos', 'dcppC-ipv-pos', 'C1.5', 'idealised positive IPV anomaly pattern', 'Restore the Pacific sea surface temperature to positive Pacific Decadal Variability (PDV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members. SST signal may also be imposed by altering surface fluxes.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399112, 'cmip6', NULL, '--', 'cim.2.designing.MultiEnsemble', '88c22c41-7aa5-4cfd-b378-9e04af4a8a40', 1, '2020-11-17 01:19:05.639745', true, 'RCP85RCP70RCP45atHighAndStandardRes', 'RCP85RCP70RCP45atHighAndStandardRes', NULL, 'high and standard resolutions of high, medium and low radiative forcing scenarios', 'A multi-ensemble of at 6 simulations with standard and high resolution model configurations forced with high, medium and low radiative forcing scenarios (RCP8.5, RCP7.0, RCP4.5).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399113, 'cmip6', '<volmip>', '--', 'cim.2.designing.NumericalExperiment', '2489fdae-e95a-4cf9-8f2c-223da893da41', 1, '2020-11-17 01:19:05.639745', true, 'volc-cluster-mill', 'volc-cluster-mill', 'past1000-volc-cluster', '19th century volcanic cluster initialized from past1000', 'Parallel experiment to volc-cluster-ctrl but with initial conditions taken from last-millennium simulation to account for the effects of a more realistic history of past natural forcing.  Initialisation on 1 January 1790 to avoid interferences due to the decadal drop of solar activity associated with the Dalton Minimum.  The first eruption of the cluster begins in 1809 as in volc-cluster-ctrl. All external forcings, except volcanic forcing, are set as a perpetual repetition of the year 1790 for the full duration of the experiment. At least one, preferably three, ensemble members.  69 years for each ensemble member.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399114, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '90563a01-5107-4f4f-8a5c-0ff40d0d5a00', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Forcing Excluding CO2', 'piForcingExcludingCO2', NULL, 'Pre-industrial forcing, excluding carbon dioxide', 'Pre-Industrial forcing excluding carbon dioxide (CO2).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399115, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'd2de7cc4-4b52-45b8-b850-1a4162aaf0cb', 1, '2020-11-17 01:19:05.639745', true, 'The global climatology of interannually varying air-sea flux data set', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399116, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '178e0d56-6757-4fdb-98fd-b53e1a8615d1', 1, '2020-11-17 01:19:05.639745', true, '1% per year CO2 Decrease', '1%yrCO2Decrease', NULL, '1% per year decrease in atmospheric CO2 to pre-industrial concentration', 'Impose a 1% per year decrease in the concentration of atmospheric carbon dioxide (CO2)  from 4X pre-industrial CO2 concentration to original pre-industrial CO2 concentration.  Then hold the CO2 concentration fixed at the pre-industrial level for as long as possible.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399117, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '6204e5b6-bb0e-4320-b79c-28a0c324aee3', 1, '2020-11-17 01:19:05.639745', true, 'rad-pd-p4K', 'rad-pd-p4K', NULL, 'RFMIP-IRF', 'Offline radiative transfer calculations of vertically-resolved broadband-integrated longwave and shortwave fluxes for present-day (2015) clear sky (aerosol-free) conditions with plus 4K atmosphere. Present-day (PD) greenhouse gas concentrations with PD plus 4K atmosphere. Use specified atmospheric distributions of temperature and humidity and surface properties over many profiles.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399118, 'cmip6', '<ls3mip>', '--', 'cim.2.designing.NumericalExperiment', '71b1dc6f-50e2-4cdf-9425-ab57cc6d031e', 1, '2020-11-17 01:19:05.639745', true, 'amip-lfmip-rmLC', 'amip-lfmip-rmLC', 'LFMIP-rmLC+SST', 'prescribed land surface climatology from historical plus scenario 30yr running mean, prescribed SST and sea-ice from historical plus scenario runs', 'Scenario forced experiment with prescribed land surface climatology derived from 30yr running mean from the first ensemble members of the historical and ssp585 experiments. SST and sea-ice from the first ensemble members of the historical and ssp585 experiments', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399119, 'cmip6', '<cdrmip>', '--', 'cim.2.designing.NumericalExperiment', '6e89cfc2-6abb-4906-bff6-d1333586603b', 1, '2020-11-17 01:19:05.639745', true, 'esm-pi-cdr-pulse', 'esm-pi-cdr-pulse', 'CDR-pi-pulse', 'pulse removal of 100 Gt carbon from pre-industrial atmosphere', 'An esm-piControl but with 100 Gt C instantaneously (within 1 timestep) removed from the  atmosphere in year 10. If models have CO2 spatially distributed throughout the atmosphere the CO2 the removal should happen in a uniform manner. The CO2 concentration is calculated (i.e. freely evolving). After the negative pulse, ESMs should continue the run for at least 100 years, while EMICs (Earth System Models of Intermediate Complexity) and box models are encouraged to continue the run for at least 1000 years (max 5000 years). Additional ensemble members are requested with tier 2 priority.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399120, 'cmip6', '<omip>', '--', 'cim.2.designing.NumericalExperiment', 'e3178983-0fdd-4c98-93ba-fb0b7954555f', 1, '2020-11-17 01:19:05.639745', true, 'omip1', 'omip1', NULL, 'OMIP experiment forced by Large & Yeager (CORE-2, NCEP) atmospheric data set and initialized with observed physical and biogeochemical ocean data', 'Global ocean - sea-ice - coupled experiment forced with the CORE-II (Coordinated Ocean - ice Reference Experiments) inter-annually varying atmospheric and river data sets for years 1948-2009.  Initial ocean tracer fields are based on observations. Simulation length for at least 5 cycles of the 62-year forcing is required.
INSERT INTO docs.tbl_document VALUES (399180, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '63850e82-8c1b-4080-ac89-27ff7b4c4121', 1, '2020-11-17 01:19:05.639745', true, 'RFMIP 2014 Aerosols', 'RFMIP2015Aerosols', NULL, 'RFMIP specified aerosols f0r 2015', 'RFMIP specified aerosol optical and cloud active properties based on the MACv2-SP prescription for the "present day" which averages aerosol properties for the period between 1985 and 2005.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399121, 'cmip6', '<ls3mip>', '--', 'cim.2.designing.NumericalExperiment', '5ed5b5f7-4344-4a90-9d2d-b47bbb8b6875', 1, '2020-11-17 01:19:05.639745', true, 'land-hist-princeton', 'land-hist-princeton', 'Land-Hist-princeton', 'Historical land-only with Princeton forcings', 'Land only simulations using Princeton forcing data and a standard bias correction strategy. As LUMIP land-hist but with princeton forcing dataset. The Princeton Global Forcing data is based on NCEP-NCAR reanalysis data. The land model configuration should be identical to that used in the DECK and CMIP6 historical simulations for the parent coupled model.  Spin-up of the land-only simulations should follow the TRENDY protocol.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399122, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', 'fbecc405-e3c7-4fad-80cb-c56b7a8ee410', 1, '2020-11-17 01:19:05.639745', true, 'dcppB-forecast', 'dcppB-forecast', 'B1', 'forecast initialized from observations', 'Ensembles of ongoing real-time 5-year forecsasts. Initialisation based on observations. Atmospheric composition and/or emissions (and other conditions including volcanic aerosols) to follow prescribed SSP2-4.5 forcing scenario. Run each member for 5 years, extend the duration to 10 years with Tier-2 priority. Additional ensemble members for each start date are requested with Tier-2 priority.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399123, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '08ea8ea9-f4b1-4cf5-8079-c281f785e8c8', 1, '2020-11-17 01:19:05.639745', true, '8Tg SO2 per year', '8TgSO2yr', NULL, 'Stratospheric aerosol injection of 8 Tg SO2 per year', 'What:  Inject a layer of stratospheric aerosols into the model at a rate of 8 Tg SO2 per year. The distribution of surface area density and other parameters will be provided by GeoMIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399124, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', '36d9b152-169a-4fb2-98b4-b778855d86a4', 1, '2020-11-17 01:19:05.639745', true, 'pdSST-pdSIC', 'pdSST-pdSIC', '1.1', 'Atmosphere time slice with present day SST and SIC', 'Atmosphere-only time slice present day control experiment forced by climatological
INSERT INTO docs.tbl_document VALUES (399125, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'fb0d65ec-89de-48dc-8763-ed2663cfbd32', 1, '2020-11-17 01:19:05.639745', true, 'Restore SST Clim Pacific', 'RestoreSSTclimPacific', NULL, 'Restore Pacific sea surface temperature to model climatology', 'Sea Surface Temperatures (SSTs) are restored to model control run climatology by Newtonian cooling over the Pacific (15S-65N). The restoring timescale is 10 days for a 50m deep mixed layer (or equivalent). The restoring coefficient of 40 W/m2/K should decrease to zero over an 8 degree buffer zone bounding the restored region.  No restoring if sea ice is present.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399126, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '81ecc943-1b33-4ee4-8737-32ef6f71df03', 1, '2020-11-17 01:19:05.639745', true, '2x 1850 Lightning NOx', '2x1850lightningNOx', NULL, 'Doubled 1850 emissions of NOx from lightning', 'Impose 1850 doubled lightning NOx emission fluxes. Or double the lightning NOx emissions of the 1850 climatological data.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399127, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'f24f58b4-1a72-4ab9-aacb-e23c70e3a6d2', 1, '2020-11-17 01:19:05.639745', true, '1980-2100 121yrs', '121yrs1980-2100', NULL, '1980/01/01-2101/01/01', 'Historical scenario, from 1980 to the end of the 21st century', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399128, 'cmip6', '<volmip>', '--', 'cim.2.designing.NumericalExperiment', 'fc04f8eb-feff-4fa4-ba91-41cf9041a2ef', 1, '2020-11-17 01:19:05.639745', true, 'volc-long-eq', 'volc-long-eq', NULL, 'Idealized equatorial volcanic eruption emitting 56.2 Tg SO2', 'Idealised equatorial eruption corresponding to an initial emission of 56.2 Tg of SO2. This eruption has a magnitude roughly corresponding to the 1815 Mt Tambora eruption in Indonesia, which was linked to the so-called "year without a summer" in 1816.  Maintain the same constant boundary forcing as the pre-industrial control integration, except for the volcanic forcing. The experiment will not account for the actual climate conditions when the real event occured (e.g., presence and strength of additional forcing factors). Instead, the experiment is designed to span very different initial climate states to systematically assess uncertainties in the post-eruption behaviour that are related to background climate conditions.  If, for instance, year Y of the control integration matches the desired conditions for the initial condition sampling, then the corresponding VolMIP simulation should start with restart data from year Y-1 of the control.  Run nine ensemble members for at least 20 years, but preferably longer', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399129, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '83e2ae57-6fc7-4508-b844-ba46e78fb0d8', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Land Use Excluding Forest And Grassland', 'piLandUseExcludingForestGrassland', NULL, 'Pre-Industrial land-use excluding forest and natural unmanaged grassland', 'Constant pre-industrial land use, excluding forest and natural grassland.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399130, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '9131690c-f9a9-4920-b969-a2e8714f9009', 1, '2020-11-17 01:19:05.639745', true, 'TRENDY Interim Forcing for Princeton', 'trendyInterimForcingPrinceton', NULL, 'TRENDY protocol for 1850 to the first year of the Princeton forcing dataset', 'For the interim period from 1850 to the first year of the Princeton global forcing dataset, the forcing data should continue to be recycled but all other forcings (land-use, CO2, etc.) should be as in the CMIP6 historical simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399131, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '2ff6c103-3832-4d83-b74e-1ac70b907da2', 1, '2020-11-17 01:19:05.639745', true, 'RCP26-overshoot Aerosol Precursors', 'RCP26overaerpre', NULL, 'Representative Concentration Pathway 2.6 Overshoot Aerosol Precursors', 'Impose changing emissions of RCP2.6-overshoot aerosol precursors including SO2 and NHy.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399132, 'cmip6', '<geomip>', '--', 'cim.2.designing.NumericalExperiment', 'a0095fb6-e50a-45b6-8d1c-7e2863e2f6d0', 1, '2020-11-17 01:19:05.639745', true, 'G7SST2-cirrus', 'G7SST2-cirrus', 'G7cirrusSlice2', 'SSTs from year 2100 of SSP5-8.5; forcings and other prescribed conditions from year 2100 of G7cirrus', 'Time slice at year 2100 GeoMIP G7cirrus.  Run for 10 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399133, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '569727f9-1234-4051-9592-88baf6b78432', 1, '2020-11-17 01:19:05.639745', true, 'Impose SST AMV neg extra tropical N Atlantic', 'ImposeSSTAMVnegExTropNAtlantic', NULL, 'Impose negative AMV anomaly to sea surface temperatures in the extra-tropical north Atlantic', 'Alter surface fluxes to impose model climatology plus negative Atlantic Multidecadal Variability (AMV) anomalies of Sea Surface Temperature (SST) over the extra-tropical north Atlantic (30N-65N).  Idealised AMV anomalies of SST will be provided by DCPP.  For groups that are unable to restore SSTs.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399134, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '7328a2d3-eb2a-4fc8-bf2e-05cd6fb8fd10', 1, '2020-11-17 01:19:05.639745', true, 'Minimise AMOC change', 'MinimiseAMOCchange', NULL, 'Minimise changes to Atlantic Meridional Overturning Circulation', 'Minimise changes to Atlantic Meridional Overturning Circulation (AMOC).  Can be achieved by applying additional salinity restoring such that the upper ocean density remains unchanged. Can also be achieved via 3D restoring of temperature and salinity below the mixed layer.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399135, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'ed380cf6-63b4-447f-991c-242b40da8703', 1, '2020-11-17 01:19:05.639745', true, '50yrs', '50yrs', NULL, '50 years', 'Run for 50 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399136, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd3d9c222-09bc-4a8f-9bb5-a8cf77c3fd8e', 1, '2020-11-17 01:19:05.639745', true, 'RCP26-overshoot Aerosols', 'RCP26overaer', NULL, 'Representative Concentration Pathway 2.6 Overshoot Aerosols', 'Impose changing emissions of RCP2.6-overshoot aerosols including BC and OC.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399138, 'cmip6', '<aerchemmip>,<rfmip>', '--', 'cim.2.designing.NumericalExperiment', '20049db8-49e9-4779-bbb9-501030e3d110', 1, '2020-11-17 01:19:05.639745', true, 'piClim-aer', 'piClim-aer', 'RFMIP-ERF-AerO3', 'effective radiative forcing by present day aerosols', 'An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperature (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  Aerosols are set to present day (2014) values, other forcing agents are specified at pre-industrial values.  Run for 30 years. Note that this experiment is considered to be tier 1 by RFMIP but tier 2 by AerChemMIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399139, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '7885015b-9124-481d-8329-66ebcc45f370', 1, '2020-11-17 01:19:05.639745', true, 'Restore SST AMV neg tropical N Atlantic', 'RestoreSSTAMVnegTropNAtlantic', NULL, 'Restore tropical north Atlantic sea surface temperature to negative AMV', 'Sea Surface Temperatures (SSTs) are restored to model climatology plus positive AMV anomaly by Newtonian cooling over the tropical north Atlantic (10N-30N). The restoring timescale is 10 days for a 50m deep mixed layer (or equivalent). The restoring coefficient of 40 W/m2/K should decrease to zero over an 8 degree buffer zone bounding the restored region.  No restoring if sea ice is present.  Idealised AMV anomalies of SST will be provided by DCPP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399140, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'f4689d91-4f80-47cd-a999-1ad83894e037', 1, '2020-11-17 01:19:05.639745', true, '1850-2100 251yrs', '251yrs1850-2100', NULL, '1850/01/01-2101/01/01', 'Historical scenario, from 1850 to the end of the 21st century', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399141, 'cmip6', '<aerchemmip>,<scenariomip>', '--', 'cim.2.designing.NumericalExperiment', 'afd07a0e-b759-4ee8-abbd-f0bfd6ddd3dd', 1, '2020-11-17 01:19:05.639745', true, 'ssp370', 'ssp370', NULL, 'gap-filling scenario reaching 7.0 based on SSP3', 'Gap-filling baseline scenario with a medium to high radiative forcing by the end of century. Following approximately RCP7.0 global forcing pathway with SSP3 socioeconomic conditions. Radiative forcing reaches a level of 7.0 W/m2 in 2100.  Concentration-driven.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399142, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '838ebf11-b1fc-4d58-a6e8-6fd073f0bb04', 1, '2020-11-17 01:19:05.639745', true, 'ScenarioMIP experimental protocols', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399143, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'e01469aa-dd05-486b-943e-acd0a7557f28', 1, '2020-11-17 01:19:05.639745', true, 'PMIP4-CMIP6 solar forcing data', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399144, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '075f40a1-b0aa-43df-ac66-f5ea697ffefd', 1, '2020-11-17 01:19:05.639745', true, 'ssp245-covid Well Mixed GHG', 'ssp245-covidWMGHG', NULL, 'ssp245-covid Well Mixed Greenhouse Gases', 'Monthly concentrations of ssp245-covid well mixed greenhouse gases (WMGHG): CO2, CH4 and N2O.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399150, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', 'f83b4c1e-1b3b-44e6-a692-2800f41da685', 1, '2020-11-17 01:19:05.639745', true, 'dcppC-ipv-NexTrop-neg', 'dcppC-ipv-NexTrop-neg', 'C1.9', 'idealised negative northern extratropical IPV anomaly pattern', 'Restore the extra-tropical north Pacific sea surface temperature to negative Pacific Decadal Variability (PDV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members. SST signal may also be imposed by altering surface fluxes.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399151, 'cmip6', '<highresmip>', '--', 'cim.2.designing.NumericalExperiment', 'fbae6f32-d4ad-47c1-939f-f9162b874d2a', 1, '2020-11-17 01:19:05.639745', true, 'highresSST-4xCO2', 'highresSST-4xCO2', 'highresSST-4co2', 'highresSST-present SST with 4xCO2 concentrations', 'Similar to the CFMIP amip-4xCO2 experiment but with CO2 concentations quadrupled. Historical atmosphere-only simulations of the near past (1979-2014).  HadISST2.2 sea surface temperature and sea ice concentrations at daily 1/4 degree resolution to be used (Kennedy et al. 2017, in prep). The CO2 concentration seen by the radiation scheme is quadrupled with respect to the CMIP6 amip experiment. If the carbon cycle remains active, it should continue to "see" highresSST-present CO2 concentrations.  For optimal comparison between models the use of plume aerosol cocentrations are recommended (rather than emissions).
INSERT INTO docs.tbl_document VALUES (399152, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '211331ff-7b78-4eb3-9d12-f845ae2dee9b', 1, '2020-11-17 01:19:05.639745', true, 'CMIP6 historical stratospheric Ozone', 'CMIP6historicalStratosphereO3', NULL, 'CMIP6 historical ensemble mean monthly mean stratospheric ozone concentrations', 'Impose ensemble mean monthly mean of 3D stratospheric ozone from the CMIP6 historical  simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399153, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '49bdbd75-3a41-40cd-b186-42db541c4eef', 1, '2020-11-17 01:19:05.639745', true, 'Pinatubo Solar Attenuation', 'PinatuboSolarAttenuation', NULL, 'Short Wave solar attenuation equivalent to the Mt. Pinatubo eruption.', 'Prescribed perturbation to the shortwave flux to mimic the attenuation of solar radiation by volcanic aerosols associated with the 1991 Mt. Pinatubo eruption in the Philippines.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399154, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', '1d0829d8-fe2f-42af-a827-82872bcdb77e', 1, '2020-11-17 01:19:05.639745', true, 'dcppC-amv-neg', 'dcppC-amv-neg', 'C1.3', 'idealised negative AMV anomaly pattern', 'Restore the north Atlantic sea surface temperature to negative Atlantic Multidecadal Variability (AMV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members. SST signal may also be imposed by altering surface fluxes.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399155, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'fe3dba69-5cd0-4c42-a111-bacd0ceca9d4', 1, '2020-11-17 01:19:05.639745', true, 'A combined mitigation/geoengineering approach to climate stabilization', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399156, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'dc5e321e-c5a5-49b7-84eb-f1775937eb7d', 1, '2020-11-17 01:19:05.639745', true, '2015-2020 5yrs', '5yrs2015-2020', NULL, '2015/11/01-2021/01/01', 'Scenario. Start date 1st November 2015 or any other date in November or December for which initialised hindcasts are available.  Run for 5 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399157, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'fa28791e-cc4d-4a09-bf6c-cabda3f29555', 1, '2020-11-17 01:19:05.639745', true, 'RCP45 Forcing', 'rcp45Forcing', NULL, 'Representative Concentration Pathway 4.5 W/m2 Forcing', 'Impose RCP4.5 forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399158, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'cb0c82c9-d2b0-4f34-9bd1-bfb6195f51d9', 1, '2020-11-17 01:19:05.639745', true, 'Thermal controls on the Asian summer monsoon', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399159, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b4ff5b96-7f0e-43fa-998f-cc2ad709b1f2', 1, '2020-11-17 01:19:05.639745', true, 'Restore SST running mean Extra Tropical N Atlantic', 'RestoreSSTrunningMeanExtraTropNAtlantic', NULL, 'Restore to 12-month running mean of SST in the extra tropical north Atlantic', 'Sea Surface Temperatures (SSTs) are restored to model climatology plus a 12-month running mean of SST anomalies by a Newtonian cooling over the extra tropical North Atlantic (45N-60N).  The restoring timescale is 10 days for a 50m deep mixed layer (or equivalent). The restoring coefficient of 40 W/m2/K should decrease to zero over an 8 degree buffer zone bounding the restored region.  No restoring if sea ice is present.  SST  anomalies (1950-2014) will be provided by DCPP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399181, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '2d5d7b6e-2582-4ffa-94b6-8d393a6380fa', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP transient AMIP SIC', 'PAMIP-AMIP-SIC', NULL, 'PAMIP transient AMIP historical sea ice concentration', 'Transient AMIP sea ice concentration.  Data provided by PAMIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399182, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'a0fead9c-0207-4b1c-aef0-78e5c9a527ab', 1, '2020-11-17 01:19:05.639745', true, 'The JRA-55 Reanalysis: General Specifications and Basic Characteristics', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399160, 'cmip6', '<ls3mip>,<lumip>', '--', 'cim.2.designing.NumericalExperiment', 'a77b98df-92df-453f-a506-735ba743ca74', 1, '2020-11-17 01:19:05.639745', true, 'land-hist', 'land-hist', NULL, 'historical land-only', 'Land surface model simulation.  Use the same land model configuration as used in the coupled CMIP6 historical simulations. Include representation of land cover, land use and land management. All applicable land use features should be active. Forced with historical observed climate. Include all transient forcings that are relevant for the land model such as CO2 concentration, Nitrogen deposition, aerosol deposition, population density. Start year either 1850 or 1700 depending on standard practice for particular model. This experiment is shared with the LS3MIP, note that LS3MIP expects the start year to be 1850.   
INSERT INTO docs.tbl_document VALUES (399161, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b4e5f665-4039-4469-97b2-56f9e8ec5975', 1, '2020-11-17 01:19:05.639745', true, 'past1000 Land Use', 'past1000LandUse', NULL, 'Land use in the last millennium', 'Land use in the last millennium 850-1850.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399162, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b2529976-f9ac-4170-b1d7-9a8a717f5682', 1, '2020-11-17 01:19:05.639745', true, 'perpetual Equinox', 'perpetualEquinox', NULL, 'Perpetual equinoctial conditions', 'Apply perpetual equinoctial conditions (no seasonal forcing).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399163, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', 'cd87eb8f-eba2-44cb-9252-a14f1120ad81', 1, '2020-11-17 01:19:05.639745', true, 'a4SSTice', 'a4SSTice', NULL, 'control plus warming pattern SSTs and SIC', 'As piSST, but with monthly-varying SSTs and sea ice taken from years 111-140 of each model''s own abrupt4xCO2 experiment instead of from piControl.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399164, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '342357fa-c639-4e97-bea8-c920d4f65275', 1, '2020-11-17 01:19:05.639745', true, 'LS3MIP historical SST', 'LS3MIPhistoricalSST', NULL, 'SST from the first ensemble member of the historical experiment', 'Sea surface temperature (SST) from the first ensemble member of the historical experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399165, 'cmip6', '<geomip>', '--', 'cim.2.designing.NumericalExperiment', '1cd56aff-45c6-4657-a1ae-224d0360c8d7', 1, '2020-11-17 01:19:05.639745', true, 'G6SST2-sulfur', 'G6SST2-sulfur', 'G6sulfurSlice2', 'SSTs from year 2100 of SSP5-8.5; forcings and other prescribed conditions from year 2100 of G6sulfur', 'Time slice at year 2100 of GeoMIP G6sulfur. Run for 10 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399166, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '4fd7ff06-b4f9-4c3e-936e-19ec26980d13', 1, '2020-11-17 01:19:05.639745', true, 'past1000 Astronomical Parameters', 'past1000AstroParams', NULL, 'Astronomical parameters for the last millennium', 'Astronomical parameters for the last millennium 850-1850.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399167, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '825d3523-3e09-4cf3-8379-556aba57685a', 1, '2020-11-17 01:19:05.639745', true, 'Impose SST AMV pos tropical N Atlantic', 'ImposeSSTAMVposTropNAtlantic', NULL, 'Impose positive AMV anomaly to sea surface temperatures in the tropical north Atlantic', 'Alter surface fluxes to impose model climatology plus positive Atlantic Multidecadal Variability (AMV) anomalies of Sea Surface Temperature (SST) over the extra-tropical north Atlantic (10N-30N).  Idealised AMV anomalies of SST will be provided by DCPP.  For groups that are unable to restore SSTs.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399168, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'f22348aa-00bc-4125-b7f3-e828dbc1de44', 1, '2020-11-17 01:19:05.639745', true, 'Alternative Historical Solar', 'altHistSol', NULL, 'Alternative historical solar forcing', 'Alternative estimate of historical solar forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399169, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', '27772d0d-e3bf-44f0-a81c-4ef3d8ceeae8', 1, '2020-11-17 01:19:05.639745', true, 'amip-piForcing', 'amip-piForcing', NULL, 'AMIP SSTs with control forcing', 'AMIP experiment (with SSTs and Sea Ice the same as in the amip experiment in the DECK) but with constant pre-industrial forcing levels (anthropogenic & natural) and run from 1870-present.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399170, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '0aad4196-2142-479b-8323-b54a62b854e1', 1, '2020-11-17 01:19:05.639745', true, 'Cluster SO2', 'ClusterSO2', NULL, 'SO2 emissions equivalent to early 19th C eruptions.', 'Emissions of SO2 into the tropical stratosphere to reproduce the volcanic forcing generated by the early 19th century volcanic cluster.  Include the 1809 eruption of unknown location, 1815 Tambora eruption and 1835 Consigüina eruption.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399171, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '96f8803c-14c0-4dfc-b458-7f8196a77909', 1, '2020-11-17 01:19:05.639745', true, '2021-2100 80yrs', '80yrs2021-2100', NULL, '2021/01/01-2101/01/01', 'Scenario, from 2021 to the end of the 21st century', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399172, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a4f40a23-5ea0-4e84-9c23-bdad5ed17e73', 1, '2020-11-17 01:19:05.639745', true, 'CO2 Historical', 'CO2Historical', NULL, 'Historical Carbon Dioxide Concentration', 'Impose historical concentrations of atmospheric Carbon Dioxide (CO2).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399173, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', 'b41c5b03-7fcd-4340-aa07-7c321ac68c12', 1, '2020-11-17 01:19:05.639745', true, 'a4SST', 'a4SST', NULL, 'control plus warming pattern SSTs', 'As piSST, but with monthly-varying SSTs taken from years 111-140 of each model''s own abrupt4xCO2 experiment instead of from piControl. Sea-ice is unchanged from the piSST.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399174, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '53fe8a79-2502-489a-bbac-339a4259caf8', 1, '2020-11-17 01:19:05.639745', true, 'Historical Aerosol Plume Climatology 1950s', 'HistoricalSimpleAerosolPlumeClimatology1950s', NULL, 'Historical Simple Aerosol Plume Climatology 1950s', '1950s (10 year) climatology of aerosol optical properties (fine and coarse mode aerosol optical depth (AOD), single scattering albedo (SSA), asymmetry parameter (ASY)) and cloud activity (anthropogenic increment in drop number, dN/N), which are easy to use and to configure (i.e., scale in amplitude for hypothesis testing).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399175, 'cmip6', NULL, '--', 'cim.2.designing.NumericalExperiment', 'ed91cf97-2c9e-416c-8793-0d33af6de303', 1, '2020-11-17 01:19:05.639745', true, 'ssp370pdSST', 'ssp370pdSST', NULL, 'SSP3-7.0, with SSTs prescribed as present day', 'Experimental set up as ssp370SST except sea surface temperatures (SST) and sea ice concentrations (SICONC) are from a 2005-2014 climatology. Diagnostics are as ssp370SST', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399176, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'd80137b2-a289-4fe9-9e30-f560bef44d37', 1, '2020-11-17 01:19:05.639745', true, 'Ocean-SeaIce-BioGeoChem Config', 'Ocean-SeaIce-BGCConfig', NULL, 'OMIP ocean-sea ice-biogeochemistry configuration', 'An ocean-sea ice model coupled with a biogeochemistry component', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399177, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '08d6afd8-c768-48a7-a057-00260ab455f7', 1, '2020-11-17 01:19:05.639745', true, '2000-2001 14mnths', '14mnths2000-2001', NULL, '2000/04/01-2001/06/01', 'PAMIP time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399178, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '1c5c1afb-5352-4f8e-b414-f39058665f76', 1, '2020-11-17 01:19:05.639745', true, 'Present Day Land Surface Forcing with LAI3g LAI', 'presentDayLandSurfaceForcingLAI3g', NULL, 'land surface present day forcing with LAI3g leaf area index data', 'Land surface properties will use a common of leaf area index dataset (LAI3g) at 1/4 degree resolution provided by HighResMIP. No dynamic vegetation and a constant land use/land cover consistent with the present-day period, centered around 2000.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399179, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', 'e8886df8-76ea-4b14-ae60-a7eb6fba8497', 1, '2020-11-17 01:19:05.639745', true, 'ssp370SST-lowBC', 'ssp370SST-lowBC', NULL, 'SSP3-7.0, prescribed SSTs, with low black carbon emissions', 'SSP-based RCP scenario following approximately RCP7.0 global forcing pathway but with reduced black carbon emissions. SSP3 socioeconomic conditions. Atmosphere only with SST from ScenarioMIP experiment SSP3-70.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399184, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd9d492b2-6bc6-4f28-854f-09aded7d4b42', 1, '2020-11-17 01:19:05.639745', true, 'Impose SST PDV pos NexTrop Pacific', 'ImposeSSTPDVposNexTropPacific', NULL, 'Impose positive PDV anomaly to sea surface temperatures in the northern extra-tropical Pacific', 'Alter surface fluxes to impose model climatology plus positive Pacific Decadal Variability (PDV) anomalies of Sea Surface Temperature (SST) over the northern extra-tropical Pacific (10N-65N).    Idealised PDV anomalies of SST will be provided by DCPP.  For groups that are unable to restore SSTs.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399185, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '28522995-35f5-42e6-a99a-1a9d37d08662', 1, '2020-11-17 01:19:05.639745', true, '1963-1967 5yrs', '5yrs1963-1967', NULL, '1962/12/31-1967/12/31', 'Agung historical.  Start date on or before 31st December 1962.  Start dates on or before 15th November recommended to allow for DJF seasonal forecast results. Run for 5 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399186, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '6fa09901-c2c9-4584-b241-0328f8eea873', 1, '2020-11-17 01:19:05.639745', true, 'A new scenario framework for Climate Change Research: scenario matrix architecture.', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399187, 'cmip6', '<scenariomip>', '--', 'cim.2.designing.NumericalExperiment', '794b6427-3227-4b14-b3b5-406fbde69679', 1, '2020-11-17 01:19:05.639745', true, 'ssp119', 'ssp119', NULL, 'low-end scenario reaching 1.9 W m-2, based on SSP1', 'SSP-based RCP scenario with very-low forcing by the end of the century.  Following approximately RCP1.9 global forcing pathway with SSP1 socioeconomic conditions. Radiative forcing reaches a level of 1.9 W/m2 in 2100. Concentration-driven.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399188, 'cmip6', NULL, '--', 'cim.2.designing.Project', '21d39256-49e5-4297-b16c-88563ed31fa2', 1, '2020-11-17 01:19:05.639745', true, 'GMMIP', 'gmmip', NULL, 'Global Monsoons Modeling Inter-comparison Project', 'GMMIP addresses the contributions of internal variability (IPO-Interdecadal Pacific Oscillation, AMO-Atlantic Multidecadal Oscillation) and external anthropogenic forcing to the historical evolution of global monsoons.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399189, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '4cf521c3-69ad-4b83-ba0e-82cc97a98f85', 1, '2020-11-17 01:19:05.639745', true, 'LFMIP running mean land-hist-princeton forcing', 'LFMIP-rm-land-hist-princeton', NULL, '30yr running mean land surface forcing from land-hist-princeton', '30 year running mean land surface forcing calculated from the land-hist-princeton simulation.  Note the climatological median of soil water and snow water is to be used instead of climatological means.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399190, 'cmip6', NULL, '--', 'cim.2.shared.Party', 'b6c852df-c8f5-4751-a0e8-5ba192680c34', 1, '2020-11-17 01:19:05.639745', true, 'Tim Andrews', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399191, 'cmip6', '<cmip>', '--', 'cim.2.designing.NumericalExperiment', '1b7a0755-9736-4e80-8f5d-c8a28ba37107', 1, '2020-11-17 01:19:05.639745', true, 'esm-hist-ext', 'esm-hist-ext', NULL, 'post-2014 all-forcing simulation with an Earth system model', 'Extension beyond 2014 of the CMIP6 historical simulation with atmospheric CO2 concentration calculated. To be performed with an Earth System Model (ESM) that can calculate atmospheric CO2 concentration and account for the fluxes of CO2 between the atmosphere, the ocean, and biosphere.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399192, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'dd144f97-29b0-487d-b7a6-f14c5518b5b8', 1, '2020-11-17 01:19:05.639745', true, 'mid-Holocene WMGHG', 'mid-HoloceneWMGHG', NULL, 'Atmospheric concentrations of well-mixed greenhouse gases in the mid-holocene.', 'Impose Mid-Holocene (6 kyr ago) atmospheric concentrations of well-mixed greenhouse gases.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399193, 'cmip6', '<damip>', '--', 'cim.2.designing.NumericalExperiment', '8f6012f2-c241-4254-a635-8f8dc7cdc328', 1, '2020-11-17 01:19:05.639745', true, 'hist-all-nat2', 'hist-all-nat2', NULL, 'historical ALL-forcing run with alternate estimates of natural forcing', 'Very like the hist-all (histALL) simulations except that they contain alternative estimates of solar and volcanic forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399194, 'cmip6', '<geomip>', '--', 'cim.2.designing.NumericalExperiment', 'ab949b54-d56e-48e7-9657-44262d51c2fb', 1, '2020-11-17 01:19:05.639745', true, 'piSST-4xCO2-solar', 'piSST-4xCO2-solar', 'G1extSlice1', 'preindustrial control SSTs with quadrupled CO2 + solar reduction', 'Time slice for the first year of the GeoMIP G1 experiment with fixed sea surface temperature climatology calculated from the piControl. Run for 10 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399195, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a24ab5ec-1ff0-4372-a209-33c981c76824', 1, '2020-11-17 01:19:05.639745', true, 'First millennium land use', 'FirstMillenniumLU', NULL, 'First millennium land-use', 'Forcng data for the first 849 years of the past2k runs. A linear ramp-up of land-use from 1CE values to 850CE values.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399196, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '891b8fdb-fc9a-40e0-ab24-3495ced122ef', 1, '2020-11-17 01:19:05.639745', true, 'Distant Influence of Kuroshio Eddies on North Pacific Weather Patterns?', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399197, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'e57ec2f5-4945-4ed7-9a03-33e168708d73', 1, '2020-11-17 01:19:05.639745', true, '25Member', '25memberEnsemble', NULL, '25 member ensemble', 'Ensemble members generated by perturbing atmospheric conditions', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399198, 'cmip6', NULL, '--', 'cim.2.shared.Party', '54fb6198-5227-4271-89cd-f307bb6c598d', 1, '2020-11-17 01:19:05.639745', true, 'Alexander Nauels', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399199, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'cd1c8957-650b-47ff-87f1-3ed3a3d1a7dc', 1, '2020-11-17 01:19:05.639745', true, 'SSP2-45Initialisation2021', 'ssp2-45Initialisation2021', NULL, 'SSP2-4.5 Initialisation year 2021', 'Initialisation is from the beginning of year 2021 of the SSP2-4.5 experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399200, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '0dff69a4-eb11-45c0-8f63-51f7e6e8a28f', 1, '2020-11-17 01:19:05.639745', true, 'AerChemMIP Diagnostics', 'AerChemMIPDiagnostics', NULL, 'Aerosol Chemistry MIP Diagnostics', 'AerChemMIP output diagnostics.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399201, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '160a1b64-b98b-41df-b339-6011febe5971', 1, '2020-11-17 01:19:05.639745', true, 'The Land Use Model Intercomparison Project (LUMIP) contribution to CMIP6: rationale and experimental design', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399202, 'cmip6', '<geomip>', '--', 'cim.2.designing.NumericalExperiment', '877aeb3c-1e12-43cd-a587-a273cc53dbe7', 1, '2020-11-17 01:19:05.639745', true, 'G7cirrus', 'G7cirrus', NULL, 'G7cirrus ­ increase cirrus ice crystal fall speed to reduce net forcing in SSP585 by 1 W m-2', 'Against a background of the ScenarioMIP high forcing (SSP5-85), reduce cirrus cloud optical depth by a constant amount. Geoengineering will be simulated over years 2020 to 2100.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399203, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'cdcd279a-aa53-451d-8ce5-cdfd970308bf', 1, '2020-11-17 01:19:05.639745', true, '500yrs', '500yrs', NULL, '500 years', 'Run for 500 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399204, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '14236edb-8e31-4498-8af5-3124361340fb', 1, '2020-11-17 01:19:05.639745', true, '1809-1858 50yrs', '50yrs1809-1858', NULL, '1809/01/01-1859/01/01', 'Begin in 1809 (early 19th century volcanic eruption of unknown location) and run for a minimum of 50 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399205, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '65518570-ac69-4aa1-a918-b241e7a50944', 1, '2020-11-17 01:19:05.639745', true, '2020-2070 51yrs', '51yrs2020-2070', NULL, '2020/01/01-2071/01/01', 'Scenario, from 2020 to 2070', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399206, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '97d830dd-eee0-4e7c-90a8-b63ba63eafb3', 1, '2020-11-17 01:19:05.639745', true, 'TRENDY Interim Forcing for WFDEI', 'trendyInterimForcingWFDEI', NULL, 'TRENDY protocol for 1850 to the first year of the WFDEI forcing dataset', 'For the interim period from 1850 to the first year of the WFDEI forcing dataset, the forcing data should continue to be recycled but all other forcings (land-use, CO2, etc.) should be as in the CMIP6 historical simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399207, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '57221a83-98be-4dbb-aaa7-011569a7a96f', 1, '2020-11-17 01:19:05.639745', true, 'SSP585-bgc-Initialisation2040', 'ssp585-bgc-Initialisation2040', NULL, 'SSP5-8.5 BGC Initialisation 2040', 'Initialisation is from year 2040 of the ssp585-bgc experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399554, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'a13babcb-aef8-4b07-9394-6cd6b8677626', 1, '2020-11-17 01:19:05.639745', true, 'G1extInitialisation', 'g1extInitialisation', NULL, 'GeoMIP G1ext Initialisation', 'Initialisation is made from the final year of the GeoMIP G1 (G1ext) experiment', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399576, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '560d5187-2f24-4882-a964-9fc9a6e8d129', 1, '2020-11-17 01:19:05.639745', true, '1850 WMGHG for Radiation', '1850WMGHGRadiation', NULL, '1850 well mixed greenhouse gas concentrations only affect radiative code.', 'Impose repeating 1850 well mixed greenhouse gas (WMGHG) concentrations to radiative code.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399577, 'cmip6', NULL, '--', 'cim.2.shared.Party', '4cf9acb0-95cf-4129-b04f-30e458a7f72b', 1, '2020-11-17 01:19:05.639745', true, 'Sandrine Bony', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399208, 'cmip6', '<cmip>,<deck>', '--', 'cim.2.designing.NumericalExperiment', '41696dc8-96d3-4912-bd53-09f59e32e991', 1, '2020-11-17 01:19:05.639745', true, 'esm-piControl-spinup', 'esm-piControl-spinup', NULL, 'pre-industrial control simulation with CO2 concentration calculated (spin-up)', 'A pre-industrial control spin-up simulation with non-evolving pre-industrial forcing and atmospheric CO2 calculated. Conditions chosen to be representative of the period prior to the onset of large-scale industrialization, with 1850 being the reference year.  This experiment describes an initial climate spin-up, during which the climate begins to come into balance with the forcing.  To be performed with an Earth System Model (ESM) that can calculate atmospheric CO2 concentration and account for the fluxes of CO2 between the atmosphere, the ocean, and biosphere.  Run until Earth System reaches equilibrium.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399209, 'cmip6', '<c4mip>', '--', 'cim.2.designing.NumericalExperiment', '2326d4cc-58cd-4e6d-8130-08a9a2eabf9b', 1, '2020-11-17 01:19:05.639745', true, 'esm-1pctCO2', 'esm-1pctCO2', NULL, 'emissions driven 1% run', 'The emissions-driven version of 1pctCO2 is an alternative branching experiment for ZEC-1pctCO2-750, ZEC-1pctCO2-1000 and ZEC-1pctCO2-2000. Compatible 1pctCO2 emissions  should be calculated year-by-year and used from pi-Control to approximately replicate the 1% profile up to the desired cumulative emission (750 PgC, 1000 PgC, 2000 PgC).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399210, 'cmip6', NULL, '--', 'cim.2.designing.MultiEnsemble', '4fecc92f-482f-44e1-992e-992b2f1ce41b', 1, '2020-11-17 01:19:05.639745', true, 'mid1990sAnnualx10', 'mid1990sAnnualx10', NULL, 'Multi-initialisations of mid-1990s Annual start date ensemble', 'A multi-ensemble of 40 simulations with ten initialisations for each start date occurring every year from 1993 to 1996.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399211, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '76b1867f-ae32-4230-a67a-56d7f19908c8', 1, '2020-11-17 01:19:05.639745', true, 'Historical Tropospheric Ozone Precursor Emissions', 'HistoricalTropO3pre', NULL, 'Historical Emissions of Tropospheric Ozone Precursors', 'Impose historical emissions of tropospheric ozone precursors (e.g. NOx).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399212, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '106b3270-f17e-4f0c-b154-1f4868586a1b', 1, '2020-11-17 01:19:05.639745', true, 'Abrupt 4xCO2 Increase', 'Abrupt4XCO2', NULL, 'Abrupt Quadrupling of Atmospheric Carbon Dioxide', 'Impose an instantaneous quadrupling of atmospheric carbon dioxide concentration, then hold fixed.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399213, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'c1f9b322-b40e-4e08-acff-8839adebd571', 1, '2020-11-17 01:19:05.639745', true, 'hist-GHG initialisation', 'hist-GHGInitialisation', NULL, 'hist-GHG Initialisation', 'Initialisation data is taken from the end of the hist-GHG simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399214, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ee5bd221-bea6-47ee-a935-193cb07c4d08', 1, '2020-11-17 01:19:05.639745', true, 'CRU-NCEP recycling of climate mean and variability', 'CRU-NCEPRecycleClimateMeanAndVariability', NULL, 'CRU-NCEP recycling of climate mean and variability from the forcing dataset', 'Recycling of the climate mean and variability from two decades (1901–1920) of the CRU-NCEP dataset.  The recycled variables are the forcing variables needed to drive an offline land module. So these are wind speed in two directions at 10m height, atmosphere temperature and humidity at 2m height, incoming shortwave and longwave radiation, incoming rainfall and snowfall, surface pressure.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399215, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '8b67c84e-1f2d-4244-bf66-c53899753ec6', 1, '2020-11-17 01:19:05.639745', true, 'abrupt-4xCO2 SIC year 100', 'abrupt-4xCO2SIC100', NULL, 'DECK abrupt4xCO2 sea ice concentration after 100 years', 'Sea ice concentration climatology calculated from the DECK abrupt-4xCO2 experiment after 100 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399216, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '70f4497a-86f1-4705-84b6-d7f6a684720c', 1, '2020-11-17 01:19:05.639745', true, 'Unmanaged Cropland', 'croplandUnmanaged', NULL, 'Unmanaged Cropland', 'Crop area uses prognostic crop model with NO crop management (e.g. planting and harvesting) rather than simulating cropland vegetation as a natural grassland.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399217, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '363aff96-c0bf-4d4e-b2b7-6e3302f91202', 1, '2020-11-17 01:19:05.639745', true, '2014 Anthropogenic Land Use', '2014AnthropLandUse', NULL, '2014 anthropogenic land use', 'Impose present day (2014) anthropogenic land use.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399218, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '4886899a-d4f9-45f7-8e40-e577c6f992fe', 1, '2020-11-17 01:19:05.639745', true, 'NAtlanticClimInitialisation', 'NAtlanticClimInitialisation', NULL, 'Initialisation with climatology in the north Atlantic and with observations elsewhere', 'Initialise with climatology (1960-2009 average) in the north Atlantic "sub-polar ocean" (95W-30E, 45N-90N).  Linear transition between climatology and actual observations over a 10 deg buffer zone (35N-45N).  Elsewhere initialisation is based on observations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399219, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '2b60d66b-1452-47d7-9fa5-73d178cd5857', 1, '2020-11-17 01:19:05.639745', true, 'ISMIP6-specified 1pctCO2to4x input', 'ISMIP61pctCO2to4xInput', NULL, 'ISMIP6-specified input from an AOGCM  1 percent per year increase in CO2 to quadrupling', 'ISMIP6-specified input from the output of an AOGCM 1pctCO2to4x (1 percent per year increase in CO2 to quadrupling CO2 and then held at quadruple levels) experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399220, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'de192b6a-2d15-418a-9f21-1848e09c319a', 1, '2020-11-17 01:19:05.639745', true, '372yrs', '372yrs1638-2009', NULL, '1638/01/01-2010/01/01', 'Historical,six repetitions of the 62 year CORE-II (1948-2009) with simulations beginning in 1638.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399221, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'af9ec5c1-9e65-4b92-8133-8da0a1ba828d', 1, '2020-11-17 01:19:05.639745', true, '1850 O3 for Radiation', '1850O3Radiation', NULL, '1850 ozone climatology concentrations only affect radiative code.', 'Impose repeating 1850 ozone climatology concentrations to radiative code.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399222, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd816b252-a863-42d5-8419-e3e2e2700a55', 1, '2020-11-17 01:19:05.639745', true, 'RCP60 Well Mixed GHG', 'RCP60wmGHG', NULL, 'Representative Concentration Pathway 6.0 Well Mixed Greenhouse Gases', 'Impose changing concentrations of RCP6.0 long-lived greenhouse gases, including CO2, N2O and halogenated gases.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399223, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '1b2b570a-2a74-47c9-91d7-944d2addf109', 1, '2020-11-17 01:19:05.639745', true, 'HistoricalInterimInitialisation', 'historicalInterimInitialisation', NULL, 'Initialisation from within the historical simulation', 'Initiation based on the historical simulation.  Initiation time to be determined by the experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399224, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a7ec550d-06cf-4afc-8ca0-66e7cfe01bec', 1, '2020-11-17 01:19:05.639745', true, 'SSP5-85 SST 2020', 'SSP5-85SST2020', NULL, 'SSP5-8.5 Sea Surface Temperature for the year 2020', 'Sea surface temperature climatology calculated from the ScenarioMIP SSP5-85 experiment for the year 2020.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399225, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '6ef0a183-66bb-4b63-b9ee-c6de84823b08', 1, '2020-11-17 01:19:05.639745', true, 'CFMIP Diagnostics', 'CFMIPDiagnostics', NULL, 'Cloud Feedback  MIP Diagnostics', 'CFMIP output diagnostics.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399226, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'c0055fa7-5816-4aad-8e83-5da868157f0d', 1, '2020-11-17 01:19:05.639745', true, 'The PMIP4 contribution to CMIP6 - Part 2: Two Interglacials, Scientific Objective and Experimental Design for Holocene and Last Interglacial Simulations', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399578, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'af963cc5-6967-44bf-89cb-951b43b33eef', 1, '2020-11-17 01:19:05.639745', true, 'TwoMember', 'TwoMemberEnsemble', NULL, 'Two Member Ensemble', 'An ensemble of two simulations', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399228, 'cmip6', '<damip>', '--', 'cim.2.designing.NumericalExperiment', 'd1de3063-c07d-456a-ae1b-7672aef13e88', 1, '2020-11-17 01:19:05.639745', true, 'ssp245-cov-modgreen', 'ssp245-cov-modgreen', NULL, '2-year Covid-19 emissions blip followed by moderate-green stimulus recovery, based upon ssp245', 'Future scenario based on ssp245, but following a path of reduced emissions due to a moderate-green stimulus economic recovery from the Covid-19 pandemic restrictions. Concentration-driven. Branch from ssp245 at 1 Jan 2020 and run for 30 years with 10 ensemble members if possible.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399229, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '33d70a15-d355-46f0-b33b-e480eacf9c4c', 1, '2020-11-17 01:19:05.639745', true, 'Impose SST PDV neg Pacific', 'ImposeSSTPDVnegPacific', NULL, 'Impose negative PDV anomaly to sea surface temperatures in the Pacific', 'Alter surface fluxes to impose model climatology plus negative Pacific Decadal Variability (PDV) anomalies of Sea Surface Temperature (SST) over the  Pacific (15S-65N).    Idealised PDV anomalies of SST will be provided by DCPP.  For groups that are unable to restore SSTs.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399230, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '27a2a4c7-827c-4303-a7c9-2c0a38411375', 1, '2020-11-17 01:19:05.639745', true, '2014 GHG', '2014GHG', NULL, '2014 greenhouse gas concentrations', 'Impose present-day (2014) concentrations of greenhouse gases.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399231, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b5c398e1-e520-4ab9-8ec3-1c201bd6624a', 1, '2020-11-17 01:19:05.639745', true, 'RCP60 Short Lived Gas Species', 'RCP60sls', NULL, 'Representative Concentration Pathway 6.0 Short Lived Gas Species', 'Impose changing emissions of RCP6.0 short lived gas species including CH4, NOx, VOCs and CO.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399232, 'cmip6', '<lumip>', '--', 'cim.2.designing.NumericalExperiment', 'e5ae35a3-3eac-4812-8e5e-544746a41554', 1, '2020-11-17 01:19:05.639745', true, 'land-crop-noFert', 'land-crop-noFert', NULL, 'historical land-only with no fertiliser', 'Land surface model simulation.  Same as land-hist except with fertilisation area held at 1850 levels/distribution. Only relevant if land-hist utilises at least some form of crop management (e.g. planting and harvesting).  Start year either 1850 or 1700 depending on standard practice for particular model.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399233, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', 'ca3d2742-310d-4e96-ab1a-c183225eaba3', 1, '2020-11-17 01:19:05.639745', true, 'pdSST-piArcSIC', 'pdSST-piArcSIC', '1.5', 'Atmosphere time slice with present day SST and pre-industrial Arctic SIC', 'Atmosphere-only time slice experiment forced by climatological monthly mean sea surface temperature (SST) for the present day sea and pre-industrial Actic sea ice concentration (SIC). Radiative forcing to be set to present day (year 2000) levels. Past SIC will be computed from the ensemble of CMIP5 simulations by PAMIP. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399234, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'e6469630-e04f-4167-8ff2-b32a689f941c', 1, '2020-11-17 01:19:05.639745', true, '2015-2100 86yrs min', '86yrs2015-2100min', NULL, '2015/01/01-2100/12/31 minimum', 'Run from 2015 to at least the end of the 21st century.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399235, 'cmip6', NULL, '--', 'cim.2.shared.Party', 'd7334f39-9e51-42be-b0dc-7dcc2127eb15', 1, '2020-11-17 01:19:05.639745', true, 'Rein Haarsma', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399236, 'cmip6', NULL, '--', 'cim.2.shared.Party', '73af0371-157d-4c33-b623-9fea2d910874', 1, '2020-11-17 01:19:05.639745', true, 'Hyungjun Kim', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399237, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '40116ec2-db3e-425a-968c-7445ca5c4ed2', 1, '2020-11-17 01:19:05.639745', true, 'Ice core inferred volcanic stratospheric sulfur injection from 500 BCE to 1900 CE.', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399238, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', '13ebec86-9d75-4e22-95f7-dadc1072aaca', 1, '2020-11-17 01:19:05.639745', true, 'amip-climSST', 'amip-climSST', '5.1', 'AMIP with climatological SST', 'Atmosphere-only transient experiment. Repeat CMIP6 AMIP (1979-2014) but with climatological monthly mean sea surface temperature (SST) provided by PAMIP.  Prescribe historical sea ice concentration (SIC) as used in the AMIP experiment.  Other conditions as in the CMIP6 Historical simulation. Minimum ensemble size is 3 simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399239, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '6db353f7-d3a8-4cbf-b908-13e7ddbfa622', 1, '2020-11-17 01:19:05.639745', true, 'Three Predefined Initialisations', 'threePredefinedInitialisations', NULL, 'VolMIP ensemble of three predefined initialisations', 'An ensemble of at least three predefined initialisations states which describe different states of dominant modes of variability. Namely: warm/cold/neutral El Niño-Southern Oscillation (ENSO) states and strong/weak/neutral  Atlantic Meridional Overturning Circulation (AMOC) states.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399240, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'aefa076d-6383-4aae-957e-fecac5f49c56', 1, '2020-11-17 01:19:05.639745', true, 'OMIP contribution to CMIP6: experimental and diagnostic protocol for the physical component of the Ocean Model Intercomparison Project', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399241, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b55bd3e6-f730-4527-8d06-33df31ea81e9', 1, '2020-11-17 01:19:05.639745', true, 'ssp245-cov-fossil Short Lived Species', 'ssp245-cov-fossilSLS', NULL, 'ssp245-cov-fossil Short Lived Species', 'ssp245-cov-fossil short lived species: BC, CO, OC, SO2, NH3, NOx, NMVOCs', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399242, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'dd782cf3-4521-4bcb-8c71-e5caf45eaf27', 1, '2020-11-17 01:19:05.639745', true, '366yrs', '366yrs1653-2018', NULL, '1653/01/01-2019/01/01', 'Historical, six repetitions of the 61 year JRA-55 (1958-2018) with simulations beginning in 1653.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399243, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'a5e344c2-6078-4ba2-b4b0-6b0d1fe07cc5', 1, '2020-11-17 01:19:05.639745', true, '2014 Anthropogenic Forcing', '2014anthropForcing', NULL, '2014 anthropogenic forcing agents', 'Agents of anthropogenic forcing, GHGs, Aerosols, Ozone, Land Use.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399263, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '8d81df95-fcce-49bd-895c-3c5be03197d8', 1, '2020-11-17 01:19:05.639745', true, 'rad-pd-piCH4', 'rad-pd-piCH4', NULL, 'RFMIP-IRF', 'Offline radiative transfer calculations of vertically-resolved broadband-integrated longwave and shortwave fluxes for present-day (2015) clear sky (aerosol-free) conditions with present day (2015) greenhouse gas concentrations and pre-industrial methane (CH4). Use specified atmospheric distributions of present day temperature and humidity and surface properties over many profiles.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399264, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '2bc23d48-3268-4a1b-84f1-d3dccede2cad', 1, '2020-11-17 01:19:05.639745', true, '2014 GHG Concentrations excluding O3', '2014GHGExclO3', NULL, 'Present Day Greenhouse Gas concentrations excluding Ozone', 'Impose Present day (2014) concentrations of greenhouse gases  (CO2, CH4, N2O, CFCs, HFCs, …) excluding ozone (O3).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399424, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'e1d515dd-57cc-470d-a690-cfad3715da76', 1, '2020-11-17 01:19:05.639745', true, '2014 NTCF Emissions', '2014NTCFEmissions', NULL, '2014 Emissions of Near Term Climate Forcers', 'Impose 2014 emissions of Near Term Climate Forcers (NTCF): namely tropospheric aerosols and tropospheric ozone precursors.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399425, 'cmip6', NULL, '--', 'cim.2.shared.Party', '16deaf8f-04bf-4fe3-a268-608a63e1cd22', 1, '2020-11-17 01:19:05.639745', true, 'Bart van den Hurk', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399426, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '3addcf0e-8302-4e86-9ac3-48e40a8fc53d', 1, '2020-11-17 01:19:05.639745', true, 'Cold decade (AD 1810–1819) caused by Tambora (1815) and another (1809) stratospheric volcanic eruption', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399244, 'cmip6', '<volmip>', '--', 'cim.2.designing.NumericalExperiment', '3adf9d4a-d148-4cc2-972f-c85af1a3656c', 1, '2020-11-17 01:19:05.639745', true, 'volc-pinatubo-surf', 'volc-pinatubo-surf', NULL, 'Pinatubo experiment with only short-wave forcing', '1991 Pinatubo forcing is expressed with a prescribed perturbation to the shortwave flux to mimic the attenuation of solar radiation by volcanic aerosols and therefore the cooling of the surface. Maintain the same constant boundary forcing as the pre-industrial control integration, except for the volcanic forcing. Requires special diagnostics of parameterised and resolved wave forcings, radiative and latent heating rates. The experiment will not account for the actual climate conditions when the real event occured (e.g., presence and strength of additional forcing factors). Instead, the experiment is designed to span very different initial climate states to systematically assess uncertainties in the post-eruption behaviour that are related to background climate conditions. Sampling of an eastern phase of the Quasi-Biennial Oscillation (QBO), as observed after the 1991 Pinatubo eruption is preferred for those models that spontaneously generate such mode of stratospheric variability. Run at least 25 ensemble me', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399245, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c77c0d57-4faa-4711-b17c-8a820c88cdfe', 1, '2020-11-17 01:19:05.639745', true, 'Historical AerChemMIP hist-piNTCF SSTs', 'HistoricalAerChemMIPSST', NULL, 'Historical Transient Sea Surface Temperature from the Aerosol Chemistry MIP experiment hist-piNTCF', 'Historical transient sea surface temperature from AerChemMIP experiment hist-piNTCF.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399246, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '4959a2c3-1582-4baf-a5b6-7bafb09bc1c7', 1, '2020-11-17 01:19:05.639745', true, '2014 GHG pi O3', '2014GHGpiO3', NULL, '2014 greenhouse gas concentrations with pre-industrial ozone', 'Impose present day (2014) greenhouse gas concentrations with ozone (O3) set to it''s pre-industrial value.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399247, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a564044a-188f-481f-8730-6a933a6c979a', 1, '2020-11-17 01:19:05.639745', true, 'ssp245-cov-modgreen Well Mixed GHG', 'ssp245-cov-modgreenWMGHG', NULL, 'ssp245-cov-modgreen Well Mixed Greenhouse Gases', 'Monthly concentrations of ssp245-cov-modgreen well mixed greenhouse gases (WMGHG): CO2, CH4 and N2O.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399248, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd29e9406-29df-476b-8374-6f6988e2dbf0', 1, '2020-11-17 01:19:05.639745', true, 'RCP70 Aerosols No Black Carbon', 'RCP70aernoBC', NULL, 'RCP7.0 Aerosols but no Black Carbon', 'Impose changing concentrations of RCP7.0 aerosols  (but no Black Carbon).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399249, 'cmip6', '<damip>', '--', 'cim.2.designing.NumericalExperiment', '91cb1bc0-b50b-495e-a169-d7157791d4da', 1, '2020-11-17 01:19:05.639745', true, 'hist-all-aer2', 'hist-all-aer2', NULL, 'historical ALL-forcing run with alternate estimates of aerosol forcing', 'Very like the hist-all (histALL) simulations except that they contain alternative estimates of aerosol forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399250, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', 'b8ca64fa-10b0-4661-b7da-ed08c4a4c167', 1, '2020-11-17 01:19:05.639745', true, 'pdSST-pdSICSIT', 'pdSST-pdSICSIT', '1.9', 'Atmosphere time slice constrained by present day conditions including sea ice thickness', 'Atmosphere-only time slice present day control experiment with sea ice thickness.  Time slice forced by climatological monthly mean sea surface temperature (SST), sea ice concentration (SIC) and sea ice thickness (SIT) for the present day.  Radiative forcing to be set to present day (year 2000) levels. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399251, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'be51da59-b05c-47ce-b2c3-8712a870c500', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP present day SST climatology', 'PAMIP-pd-SST-clim', NULL, 'PAMIP monthly mean climatology of sea surface temperature for the present day', 'Present day monthly mean cimatology of sea surface temperatue, data provided by PAMIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399252, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '9066bc84-fd51-40ec-8e9e-fc94de81c723', 1, '2020-11-17 01:19:05.639745', true, 'Overview of the Decadal Climate Prediction Project', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399253, 'cmip6', NULL, '--', 'cim.2.shared.Party', '66689953-1587-4198-bafe-fc0ea366b256', 1, '2020-11-17 01:19:05.639745', true, 'Hideo Shiogama', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399254, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '3436d0a9-c17c-4f21-87df-59cff0031d43', 1, '2020-11-17 01:19:05.639745', true, '2015-2019 5yrs', '5yrs2014-2019', NULL, '2014/12/31-2019/12/31', 'Scenario. Start date on or before 31st December 2014.  Start dates on or before 15th November recommended to allow for DJF seasonal forecast results. Run for 5 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399255, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'dbb0e184-ed27-4a48-bc8c-c73c45e19139', 1, '2020-11-17 01:19:05.639745', true, 'esm 1% per year CO2 increase', 'esm1%yrCO2Increase', NULL, 'CO2 emissions for 1% per year increase in atmospheric CO2 until quadrupling', 'Impose CO2 emissions diagnosed to produce a 1% per year increase in the concentration of atmospheric carbon dioxide until quadrupling.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399256, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '342dbac5-8cd8-4cca-b384-b2232e45add8', 1, '2020-11-17 01:19:05.639745', true, '1850 CO2 for Carbon Cycle', '1850COCarbonCycle', NULL, '1850 carbon dioxide concentration only affects carbon cycle', 'Impose repeating 1850 carbon dioxide (CO2) concentrations to carbon cycle model.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399257, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd8ec02b7-953a-47e8-924d-46f0a702c70f', 1, '2020-11-17 01:19:05.639745', true, 'Impose SST running mean sub tropical N Atlantic', 'ImposeSSTrunningMeanSubTropNAtlantic', NULL, 'Impose 12-month running mean of SST in the sub tropical north Atlantic', 'Alter surface fluxes to impose model climatology plus a 12-month running mean anomalies of Sea Surface Temperature (SST) over the sub tropical North Atlantic (10N-35N).   SST anomalies (1950-2014) will be provided by DCPP.  For groups that are unable to restore SSTs.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399258, 'cmip6', '<rfmip>', '--', 'cim.2.designing.NumericalExperiment', 'b0f06348-6bf9-4ec6-b504-76633d5f4ce2', 1, '2020-11-17 01:19:05.639745', true, 'piClim-4xCO2', 'piClim-4xCO2', 'RFMIP-ERF-4xCO2', 'effective radiative forcing by 4xCO2', 'An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperatures (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology. Carbon Dioxide concentrations set to 4 times Pre-Industrial values, other forcing agents are specified at pre-industrial values. Run for 30 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399259, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '7c144323-494e-4da4-85a4-2375c6791112', 1, '2020-11-17 01:19:05.639745', true, '1850 GHG', '1850GHG', NULL, '1850 greenhouse gas concentrations', 'Impose pre-industrial (1850) concentrations of greenhouse gases.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399260, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'abfafdf9-69e0-4c1f-9ed4-9bf8fa2a8b58', 1, '2020-11-17 01:19:05.639745', true, 'O2 Constant', 'O2Constant', NULL, 'OCMIP3 Constant Atmospheric Concentration of Oxygen', 'Impose constant atmospheric concentration of oxygen, O2, (mole fraction of 0.20946).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399261, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'fb78ba75-ed76-4566-9974-dd263e3ccd8a', 1, '2020-11-17 01:19:05.639745', true, 'ssp245-cov-fossil Well Mixed GHG', 'ssp245-cov-fossilWMGHG', NULL, 'ssp245-cov-fossil Well Mixed Greenhouse Gases', 'Monthly concentrations of ssp245-cov-fossil well mixed greenhouse gases (WMGHG): CO2, CH4 and N2O.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399262, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '629a228d-cd76-48ca-87d0-299b2ac47d0a', 1, '2020-11-17 01:19:05.639745', true, 'SOLARIS-HEPPA Solar Forcing for CMIP6', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399265, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '51fc5f77-4eb9-4371-a05b-1b18c0fbe650', 1, '2020-11-17 01:19:05.639745', true, 'Restore SST AMV neg N Atlantic', 'RestoreSSTAMVnegNAtlantic', NULL, 'Restore north Atlantic sea surface temperature to negative AMV', 'Sea Surface Temperatures (SSTs) are restored to model climatology plus positive AMV anomaly by Newtonian cooling over the North Atlantic (10N-65N). The restoring timescale is 10 days for a 50m deep mixed layer (or equivalent). The restoring coefficient of 40 W/m2/K should decrease to zero over an 8 degree buffer zone bounding the restored region.  No restoring if sea ice is present.  Idealised AMV anomalies of SST will be provided by DCPP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399266, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '1bd3c9e3-c5ab-4b6e-a9aa-0815874524be', 1, '2020-11-17 01:19:05.639745', true, '200yrs min', '200yrsmin', NULL, 'minimum 200 years', 'Run for a minimum of 200 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399267, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', '83090de9-eed0-4e46-b5d9-a8c046724788', 1, '2020-11-17 01:19:05.639745', true, 'dcppC-amv-ExTrop-neg', 'dcppC-amv-ExTrop-neg', 'C1.7', 'idealised negative extratropical AMV anomaly pattern', 'Restore the extra-tropical north Atlantic sea surface temperature to negative Atlantic Multidecadal Variability (AMV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members. SST signal may also be imposed by altering surface fluxes.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399268, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'f928757f-fe40-41f6-ba50-aceb4020f5aa', 1, '2020-11-17 01:19:05.639745', true, 'Global Soil Wetness Project Phase 3', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399269, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '1783bc38-ac74-4f98-86d8-b2d7fd0b47e7', 1, '2020-11-17 01:19:05.639745', true, 'BGCInitialisation', 'BGCInitialisation', NULL, 'Biogeochemical Initialisation', 'Initialisation of biogeochemical fields for oxygen, dissolved inorganic nitrogen, phosphorus and silica with data from the Wold Ocean Atlas 2013.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399270, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '415dcb78-3fd6-4de8-b654-161a59b95a65', 1, '2020-11-17 01:19:05.639745', true, 'GEOTRACES', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399271, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b7d2c3e0-2577-401c-bfc4-7ca2c5bc4e28', 1, '2020-11-17 01:19:05.639745', true, 'RCP85-extension Short Lived Gas Species', 'RCP85extsls', NULL, 'Representative Concentration Pathway 8.5 Extension Short Lived Gas Species', 'Impose changing emissions of RCP8.5 extension short lived gas species including CH4, NOx, VOCs and CO.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399272, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '2c986a97-bfd3-499c-bbed-b42d57313ec3', 1, '2020-11-17 01:19:05.639745', true, 'AGCM-Aer-Chem Configuration', 'AGCM-Aer-ChemConfiguration', NULL, 'Atmosphere only General Circulation Model with Interactive Aerosols and Chemistry', 'Use an Atmosphere model with interactive aerosols and chemistry', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399273, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'b973a0d4-89a4-4e04-85b7-5abfec103309', 1, '2020-11-17 01:19:05.639745', true, 'Past 2k Land Use', 'past2kLandUse', NULL, 'Land use for the first two millennia', 'Land use for the first two millennia, 01 to 1849.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399274, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '1429c435-2329-4d85-b89d-2ffc1ea84406', 1, '2020-11-17 01:19:05.639745', true, 'Historical Aerosol Plume Climatology', 'HistoricalSimpleAerosolPlumeClimatology', NULL, 'Historical Simple Aerosol Plume Climatology', 'Apply fields of aerosol optical properties (fine and coarse mode aerosol optical depth (AOD), single scattering albedo (SSA), asymmetry parameter (ASY)) and cloud activity (anthropogenic increment in drop number, dN/N), which are easy to use and to configure (i.e., scale in amplitude for hypothesis testing).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399296, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', '3f706ecc-e039-48c9-ae1b-63c6e529757b', 1, '2020-11-17 01:19:05.639745', true, 'histSST-1950HC', 'histSST-1950HC', NULL, 'historical SSTs and historical forcing, but with1950 halocarbon concentrations', 'Historical atmosphere only simulation with historical WMGHG, transient historical SSTs. Ozone depleting substances fixed at 1950 emission levels. The model should have the capacity to simulate stratospheric chemsitry.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399297, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '3987237f-d62d-4d7c-8887-2eb3655ba16b', 1, '2020-11-17 01:19:05.639745', true, 'No Sea Ice', 'noSeaIce', NULL, 'No Sea Ice', 'No sea ice at high latitudes.  Sea surface temperature should be set to a spatially uniform 0°C poleward of 60°.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399298, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '479a6bc9-0dc4-4e40-8de2-f0a83b1f97a0', 1, '2020-11-17 01:19:05.639745', true, 'Historical CO2 Concentrations', 'HistoricalCO2Concentration', NULL, 'Historical Carbon Dioxide Concentration', 'Forcing data for historical CMIP6 runs. Time varying global annual mean concentrations for CO2 (carbon dioxide).', NULL, NULL);
