INSERT INTO docs.tbl_document VALUES (399300, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '10860584-06ea-4417-ae1a-811ef9415dd9', 1, '2020-11-17 01:19:05.639745', true, 'The Cloud Feedback Model Intercomparison Project (CFMIP) contribution to CMIP6', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399301, 'cmip6', '<cdrmip>', '--', 'cim.2.designing.NumericalExperiment', '8bbf69b4-9202-4606-9398-63fdb11a7e0e', 1, '2020-11-17 01:19:05.639745', true, 'esm-yr2010CO2-control', 'esm-yr2010CO2-control', 'CDR-yr2010-pulse', 'historical emissions followed by fixed 2010 emissions (both model-diagnosed)', 'A diagnosed emissions control experiment forced with CO2 emissions diagnosed from historical and yr2010CO2 simulations. All other forcings are the same as in the historical and yr2010CO2 simulations.  Include all anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven). Run from 1850 to approx 2115 for ESMs and longer (up to 5000 years) for EMICs (Earth System Models of Intermediate Complexity) and box models.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399302, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '698c52b9-b91c-495c-a817-33dc58815dde', 1, '2020-11-17 01:19:05.639745', true, '500yrs', '500yrs', NULL, '500 years', 'Run for 500 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399303, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '790e4beb-d6a0-4e60-879e-4a1d4b208789', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP - Polar Amplification Model Intercomparison Project', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399304, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '41629317-f948-434f-815b-781f430a8bf9', 1, '2020-11-17 01:19:05.639745', true, 'LUMIP', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399325, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '840c7a6a-8bb3-4c9b-a016-15ea4c76c465', 1, '2020-11-17 01:19:05.639745', true, 'WFDEI historical forcing', 'WFDEIHistoricalForcing', NULL, 'Land surface historical forcing with WFDEI Forcing data', 'Apply WFDEI (WATCH Forcing Data methodology applied to ERA-Interim reanalysis data) forcing to offline land surface models running the LS3MIP land-hist-wfdei historical simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399305, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', '1a861eb0-9fbe-4640-b6c2-d47de4a00437', 1, '2020-11-17 01:19:05.639745', true, 'dcppC-amv-pos', 'dcppC-amv-pos', 'C1.2', 'idealised positive AMV anomaly pattern', 'Restore the north Atlantic sea surface temperature to positive Atlantic Multidecadal Variability (AMV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members.  SST signal may also be imposed by altering surface fluxes.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399275, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '3dd07f6c-1059-4cfe-808c-b393c571a1dc', 1, '2020-11-17 01:19:05.639745', true, 'External Stratospheric Aerosol Precursors RCP85 to RCP45', 'stratAerPreRCP85-RCP45external', NULL, 'Stratospheric aerosol precursor injection to reduce RCP8.5 forcing to RCP4.5 levels, external aerosol treatment', 'Injection of stratospheric sulfate aerosol precursors to reduce the radiative forcing of ScenarioMIP high forcing scenario (SSP5-85) to match that of the ScenarioMIP medium forcing scenario (SSP2-45).  
INSERT INTO docs.tbl_document VALUES (399276, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', '97751fd7-f0da-45f3-8354-3c809f8ba2dd', 1, '2020-11-17 01:19:05.639745', true, 'dcppC-forecast-addAgung', 'dcppC-forecast-addAgung', 'C3.6', '2015 forecast with added Agung forcing', 'Prediction experiment for 2015 with volcano forcing.  Repeat DCPP-A1 2015 forecast (from the dcppA-hindcast experiment) with Agung forcing. Background volcanic aerosol to be the same as that used in the 1963 hindcast. 10 ensemble members. Run each member for at least 5 years, preferably 10 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399277, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', 'eb29ff74-874a-4c6d-8e80-ec0254bf1b8f', 1, '2020-11-17 01:19:05.639745', true, 'amip-p4K', 'amip-p4K', NULL, 'AMIP with uniform 4K SS increase', 'Continuation of CFMIP-2 AMIP experiments and CMIP5 experiment 6.8.  Add a uniform +4 K to the sea surface temperatures (SSTs) of the AMIP experiment. This warming should be applied to the ice free ocean surface only.  Sea ice and SSTs under sea ice remain the same as in the amip DECK experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399278, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '0c8ef2d9-8afa-4dee-9d1f-6a7e9ff6d4fc', 1, '2020-11-17 01:19:05.639745', true, 'RCP34 Aerosol Precursors', 'RCP34aerpre', NULL, 'Representative Concentration Pathway 3.4 Aerosol Precursors', 'Impose changing emissions of RCP3.4 aerosol precursors including SO2 and NHy.', NULL, NULL);
