INSERT INTO docs.tbl_document VALUES (399280, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '95c466c8-352f-4142-a391-e57c17b88dcb', 1, '2020-11-17 01:19:05.639745', true, 'TenHistoricalInitialisation', 'TenMemberHistoricalInitialisation', NULL, 'Ten member ensemble initialised with historical simulations', 'Ensemble members generated by taking initial conditions from different historical simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399281, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '38285073-2951-4e04-874b-6260f72e6fbc', 1, '2020-11-17 01:19:05.639745', true, 'Smoothed HadISST2.2', 'SmoothedHadISST2.2', NULL, 'Spatially low-pass filtered HadISST2.2 data', 'Spatially Low-Pass Filtered HasISST2.2 sea surface temperature (SST) data. The SST filter should be the LOESS filter used by Ma et al. (2015) and Chelton and Xie (2010).', NULL, NULL);
