INSERT INTO docs.tbl_document VALUES (399326, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ca02a79b-be1b-4f90-b4c8-bc64702b4224', 1, '2020-11-17 01:19:05.639745', true, 'RCP85 Well Mixed GHG', 'RCP85wmGHG', NULL, 'Representative Concentration Pathway 8.5 Well Mixed Greenhouse Gases', 'Impose changing concentrations of RCP8.5 long-lived greenhouse gases, including CO2, N2O and halogenated gases.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399306, 'cmip6', '<pmip>', '--', 'cim.2.designing.NumericalExperiment', '40aca620-92d2-4db7-a74c-dc00904ad9c2', 1, '2020-11-17 01:19:05.639745', true, 'past1000-solaronly', 'past1000-solaronly', NULL, 'last millennium experiment using only solar forcing', 'The past1000-solaronly experiment is a parallel experiment to the past1000 experiment. Instead of the complete forcing set, only solar TSI (Total Solar Irradiance) and solar SSI (Solar Spectral Irradiane) forcing is considered.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399309, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '65f73515-30bd-4ce1-876f-f362e67ff146', 1, '2020-11-17 01:19:05.639745', true, '1pctCO2 Wind Stress Anomaly At Doubling', '1pctCO2WindStressAtDoubling', NULL, '1pctCO2 ensemble mean wind stress anomaly at time of CO2 doubling', 'Impose zonal and meridional momentum flux (wind stress) anomalies to the ocean surface, created from the CMIP5 diagnostics of surface downward fluxes of eastward (tauu) and northward (tauv) momentum. The surface flux anomalies are calculated from the ensemble mean of the CMIP5 1pctCO2 simulations at the time of CO2 doubling.  Surface flux anomalies (a function of longitude, latitude and time of year) are to remain constant throughout the experiment.  Note that the fluxes themselves are not replaced because this would typically cause a very large climate drift and possible instability. The stress perturbation is added to the momentum balance of the ocean water surface, it should not directly perturb any turbulent mixing scheme that depends on the windstress and should not be applied to the sea-ice momentum balance, although presumably the sea-ice velocity will be indirectly affected.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399310, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd8b67f96-2edf-423f-88d2-81471542500f', 1, '2020-11-17 01:19:05.639745', true, '2014 GHG pi CO2', '2014GHGpiCO2', NULL, '2014 greenhouse gas concentrations with pre-industrial carbon dioxide', 'Impose present day (2014) greenhouse gas concentrations with carbon dioxide (CO2) set to it''s pre-industrial value.', NULL, NULL);
