INSERT INTO docs.tbl_document VALUES (399313, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '2dbd603f-9846-414f-ac8a-36311b8ea0c2', 1, '2020-11-17 01:19:05.639745', true, 'Future stratospheric Ozone as a substitute for solar particle forcing', 'futureStratO3', NULL, 'Future stratospheric Ozone concentrations as a substitue for solar particle forcing for models without interactive chemistry', 'Impose future stratospheric ozone as a substitute for solar particle forcing.  To be used by CMIP6 models that do not have interactive chemistry, they should instead prescribe the CMIP6 recommended ozone forcing data set.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399314, 'cmip6', '<ls3mip>', '--', 'cim.2.designing.NumericalExperiment', '9b5f8a3f-867b-44e0-9ef6-0b37b80b5283', 1, '2020-11-17 01:19:05.639745', true, 'lfmip-initLC', 'lfmip-initLC', 'LFMIP-Pobs', 'initialized from "historical" run year 1980, but with land conditions initialized from pseudo-observations', '"pseudo-observed boundary condition" experiment that uses that uses batch offline land models (in line with the GLACE2 set-up) to initialize historical runs with prescribed reconstructed land surface states, either derived from offline simulations or from various observational data sources.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399315, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '3fc4d98f-d353-4c4f-a812-8dbb6fbf31a2', 1, '2020-11-17 01:19:05.639745', true, 'Remove 100 Gt Carbon', 'remove100GtC', NULL, 'Instantly remove 100 Gt Carbon', 'Instantaneously (within 1 time step) remove 100 Gt of Carbon from the atmosphere. If models have CO2 spatially distributed throughout the atmosphere, remove the carbon in a uniform manner.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399316, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '6d5ac9b0-cc98-4f1d-afa6-81db12e602f5', 1, '2020-11-17 01:19:05.639745', true, '2020-2024 5yrs', '5yrs2020-2024', NULL, '2020/01/01-2024/12/31', 'Run for 5 years from 2020 to 2024', NULL, NULL);
