INSERT INTO docs.tbl_document VALUES (399318, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '62956faf-e409-46e2-a48e-b3ba4b06d082', 1, '2020-11-17 01:19:05.639745', true, 'piControlSpinupInitialisation', 'piControlSpinupInitialisatoin', NULL, 'piControl Spinup Initialisation', 'Usually a piControl simulation is intitialised from the control run of a different model or from observations. The chosen method should be documented.', NULL, NULL);
