INSERT INTO docs.tbl_document VALUES (399327, 'cmip6', NULL, '--', 'cim.2.shared.Party', 'ca1c06e3-2dcd-415f-87bb-ca4589a5ca20', 1, '2020-11-17 01:19:05.639745', true, 'Pierre Friedlingstein', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399329, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ead2b18f-5121-464c-974e-012c72184235', 1, '2020-11-17 01:19:05.639745', true, 'Restore SST clim N Atlantic', 'RestoreSSTclimNAtlantic', NULL, 'Restore north Atlantic sea surface temperature to model climatology', 'Sea Surface Temperatures (SSTs) are restored to model control run climatology by Newtonian cooling over the North Atlantic (10N-65N). The restoring timescale is 10 days for a 50m deep mixed layer (or equivalent). The restoring coefficient of 40 W/m2/K should decrease to zero over an 8 degree buffer zone bounding the restored region.  No restoring if sea ice is present.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399330, 'cmip6', '<fafmip>', '--', 'cim.2.designing.NumericalExperiment', '7399e937-1032-43ef-84be-f6c5749fb9a6', 1, '2020-11-17 01:19:05.639745', true, 'faf-heat', 'faf-heat', NULL, 'control plus perturbative surface flux of heat into ocean', 'Impose surface net heat flux anomalies over the ocean, calculated from the ensemble mean of the CMIP5 1pctCO2 simulations at the time of CO2 doubling. Use a passive tracer to prevent negative climate feedback on the heat flux applied.
INSERT INTO docs.tbl_document VALUES (399331, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '9df40023-a25b-4a91-b80b-ac1d444d15ea', 1, '2020-11-17 01:19:05.639745', true, '2014 AerPrex2', '2014AerPrex2', NULL, '2014 aerosol precursors x 2', 'Impose present day (2014) aerosol precursors scaled by 2.', NULL, NULL);
