INSERT INTO docs.tbl_document VALUES (399332, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', '38a97dd5-5b0b-4702-a3b4-9f02bc3ea3e2', 1, '2020-11-17 01:19:05.639745', true, 'ssp370SST-lowCH4', 'ssp370SST-lowCH4', NULL, 'SSP3-7.0, prescribed SSTs, with low methane concentrations', 'SSP-based RCP scenario following approximately RCP7.0 global forcing pathway but with reduced  methane emissions. SSP3 socioeconomic conditions. Atmosphere only with SST from experiment SSP3-70.  The model should have the capacity for interactive tropospheric chemistry.', NULL, NULL);
