INSERT INTO docs.tbl_document VALUES (399338, 'cmip6', '<damip>', '--', 'cim.2.designing.NumericalExperiment', 'f9f336e1-b817-480e-8ddf-47a2fb8bb7d7', 1, '2020-11-17 01:19:05.639745', true, 'hist-sol', 'hist-sol', NULL, 'historical solar-only runs', 'This experiment resembles hist-nat (histNat) except that simulations are driven by solar forcing only.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399339, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'aa60015e-b1e9-448e-82de-35062f25ad6f', 1, '2020-11-17 01:19:05.639745', true, 'SolarRCP85extovertoRCP45', 'solarRCP85extover-RCP45', NULL, 'Solar irradiance reduction to reduce RCP8.5extover forcing to RCP4.5 levels', 'Reduce solar irradiance to reduce the radiative forcing of ScenarioMIP high forcing scenario (SSP5-85) to match that of the ScenarioMIP medium forcing scenario (SSP2-45).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399340, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ad92af6c-00f4-4a51-b4e0-dac208cdda46', 1, '2020-11-17 01:19:05.639745', true, 'Historical land use except no shifting cultivation', 'historicalLandUseNoShiftCultivation', NULL, 'historical land use except no shifting cultivation', 'Historical land use except shifting cultivation is turned off. (i.e. crop and pasture use net transitions instead of gross).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399341, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'cd9436b4-fca7-43f3-9111-5c7263fdb530', 1, '2020-11-17 01:19:05.639745', true, 'SSP5 RCP85-extension Land Use', 'RCP85extland', NULL, 'Representative Concentration Pathway 8.5 Extension Land Use for Shared Socioeconomic Pathway 5', 'Impose changing  RCP8.5 extension land use including crops, pasture, urban area, vegetation and forest for SSP5.', NULL, NULL);
