INSERT INTO docs.tbl_document VALUES (399343, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '81989b0e-3dbc-4371-a249-7124dbbf6623', 1, '2020-11-17 01:19:05.639745', true, 'RCP26 Aerosol Precursors', 'RCP26aerpre', NULL, 'Representative Concentration Pathway 2.6 Aerosol Precursors', 'Impose changing emissions of RCP2.6 aerosol precursors including SO2 and NHy.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399344, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'c2104158-07e2-49b6-afdf-1b4290462b70', 1, '2020-11-17 01:19:05.639745', true, 'CCMI Forcing Databases in Support of CMIP6', NULL, NULL, NULL, '', NULL, NULL);
