INSERT INTO docs.tbl_document VALUES (399346, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'f93c3b0d-f327-408a-b26c-56460d7ca2cb', 1, '2020-11-17 01:19:05.639745', true, '1851-2200 350yrs minimum', '350yrs1851-2200min', NULL, '1851/01/01-2201/01/01', 'Begin in pre-industrial era and run for a minimum of 350 years, up to 500 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399347, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'be2f5ce9-6003-49ed-be12-2b921ad8fe0e', 1, '2020-11-17 01:19:05.639745', true, '2000HistoricalInitialisation', '2000historicalInitialisation', NULL, 'Initialisation from year 2000 of the historical simulation', 'Initialisation from the historical simulation in the year 2000.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399348, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '6e0acf74-a98b-4d81-9f47-61ce2fbe0ddf', 1, '2020-11-17 01:19:05.639745', true, 'Restore SST PDV neg Pacific', 'RestoreSSTPDVnegPacific', NULL, 'Restore Pacific sea surface temperature to negative PDV', 'Sea Surface Temperatures (SSTs) are restored to model climatology plus negative PDV anomaly by Newtonian cooling over the Pacific (10S-65N). The restoring timescale is 10 days for a 50m deep mixed layer (or equivalent). The restoring coefficient of 40 W/m2/K should decrease to zero over an 8 degree buffer zone bounding the restored region.  No restoring if sea ice is present. Idealised AMV anomalies of SST will be provided by DCPP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399349, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'f52f9e15-1cb2-4694-ab0e-cad1a83a7e88', 1, '2020-11-17 01:19:05.639745', true, 'RCP34-overshoot Well Mixed GHG', 'RCP34overwmGHG', NULL, 'Representative Concentration Pathway 3.4 Overshoot Well Mixed Greenhouse Gases', 'Impose changing concentrations of RCP3.4 overshoot long-lived greenhouse gases, including CO2, N2O and halogenated gases.  Beginning in 2040, reduce forcings from 8.5 W/m2 pathway to 3.4 W/m2 by 2100.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399350, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '18a9178f-3c3c-427a-9121-634857d7c608', 1, '2020-11-17 01:19:05.639745', true, 'RFMIP Pre-Industrial Forcing Excluding Aerosols and O3', 'RFMIP-preIndForcingExclAerO3', NULL, 'RFMIP Pre-industrial forcing excluding aerosols and ozone', 'Pre-Industrial forcing excluding aerosols and ozone.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399427, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'cf551cb9-731d-457b-bebe-486888b06f96', 1, '2020-11-17 01:19:05.639745', true, 'ThreeScenario', 'ThreeScenarioEnsemble', NULL, 'Three Scenario Ensemble', 'An ensemble of three simulations forced with different scenarios', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399351, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '6c595bbc-4550-429e-be57-6d7f2580d289', 1, '2020-11-17 01:19:05.639745', true, 'AGCM-Aer Configuration', 'AGCM-AerConfiguration', NULL, 'Atmosphere only General Circulation Model with interactive Aerosols', 'Use an Atmosphere general circulation model with interactive aerosols. The model should at least calculate tropospheric aerosols driven by emission fluxes.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399352, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '08d3fcff-479e-487d-a266-ed622df1b3a6', 1, '2020-11-17 01:19:05.639745', true, 'TIP 500', 'NTIP500', NULL, 'Tibetan Plateau and elevations across Asia capped at 500m', 'Modify the topography of the Tibetan Plateau (TIP) and other highland regions across Asia by setting surface elevations to 500m.  The topography above 500m is set to 500m in the following regions: 35°-45°N, 25°-50°E; 30°-35°N, 40°-50°E; 20°-75°N, 50°-70°E; 15°-75°N, 70°-180°E.  The surface properties unchanged.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399353, 'cmip6', NULL, '--', 'cim.2.shared.Party', 'ed6e8dcf-33b0-4b0b-aa0e-37911145da0b', 1, '2020-11-17 01:19:05.639745', true, 'Vivian Scott', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399354, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '43011cf7-c700-4505-b60c-da69e0c13bfa', 1, '2020-11-17 01:19:05.639745', true, 'AGCM-StratChem Configuration', 'AGCM-StratChemConfiguration', NULL, 'Atmosphere only General Circulation Model with stratospheric chemistry', 'Use an Atmosphere general circulation model that includes stratospheric chemistry', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399355, 'cmip6', NULL, '--', 'cim.2.designing.MultiEnsemble', '8300a41c-3a67-4507-9406-3cb20cbb2079', 1, '2020-11-17 01:19:05.639745', true, '1960BiennialxN', '1960biennialxn', NULL, 'Multi-initialisations of 1960 Biennial start date ensemble', 'A multi-ensemble with N initialisations for each start date occurring every other year from 1960 to the present.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399356, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b91cfbec-86e2-4a8d-9e6b-6f78f8e80935', 1, '2020-11-17 01:19:05.639745', true, 'StratAerPreRCP85extovertoRCP45External', 'stratAerPreRCP85extover-RCP45external', NULL, 'Stratospheric aerosol precursor injection to reduce RCP8.5extover forcing to RCP4.5 levels, external aerosol treatment', 'Injection of stratospheric sulfate aerosol precursors to reduce the radiative forcing of ScenarioMIP high forcing overshoot extension scenario (SSP5-85ext-over) to match that of the ScenarioMIP medium forcing scenario (SSP2-45).  
INSERT INTO docs.tbl_document VALUES (399357, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'b19b46f8-6355-40ef-9ca8-9a4e8b630ab1', 1, '2020-11-17 01:19:05.639745', true, 'Historical Emissions', 'HistoricalEmissions', NULL, 'Historical Emissions', 'Core emissions datasets.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399358, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'f50b2357-8e64-492f-92a7-af3f3bfd89e8', 1, '2020-11-17 01:19:05.639745', true, 'EN4: Quality controlled ocean temperature and salinity profiles and monthly objective analyses with uncertainty estimates', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399359, 'cmip6', '<aerchemmip>,<rfmip>', '--', 'cim.2.designing.NumericalExperiment', '4248f0fc-b546-4da7-a617-6b78a6df0b6b', 1, '2020-11-17 01:19:05.639745', true, 'piClim-control', 'piClim-control', 'RFMIP-ERF-PI-Cntrl', 'control simulation providing baseline for evaluating effective radiative forcing (ERF)', 'Preindustrial conditions. An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperatures (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology. Run for 30 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399360, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '7d10e5b0-665c-4946-bfe8-3b864bce72da', 1, '2020-11-17 01:19:05.639745', true, 'RFMIP Pre-Industrial Forcing Excluding Aerosols', 'RFMIP-preIndForcingExclAer', NULL, 'RFMIP Pre-industrial forcing excluding aerosols', 'Pre-Industrial forcing excluding aerosols.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399361, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '100ea521-9333-432b-9bdc-0eb54fc152f4', 1, '2020-11-17 01:19:05.639745', true, 'Permafrost carbon climate feedback is sensitive to deep soil carbon decomposability but not deep soil nitrogen dynamics', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399362, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'fcf71eb2-4d95-4f42-b141-b18344195698', 1, '2020-11-17 01:19:05.639745', true, 'SSP5 RCP34-overshoot Land Use', 'RCP34overland', NULL, 'Representative Concentration Pathway 3.4 Overshoot Land Use for Shared Socioeconomic Pathway 5', 'Impose changing RCP3.4 overshoot land use including crops, pasture, urban area, vegetation and forest for SSP5.  Beginning in 2040, reduce forcings from 8.5 W/m2 pathway to 3.4 W/m2 by 2100.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399363, 'cmip6', '<cdrmip>', '--', 'cim.2.designing.NumericalExperiment', 'ec7ab77d-61c3-4a70-9ef7-8571b81fc0f1', 1, '2020-11-17 01:19:05.639745', true, 'esm-yr2010CO2-cdr-pulse', 'esm-yr2010CO2-cdr-pulse', 'CDR-yr2010-pulse', 'instantaneous 100 Gt C removal from industrial era atmosphere', 'Branches from esm-yr2010CO2-control in the year 2015. At the beginning of 2015 instantaneously (within 1 time step) remove 100 Gt C from the atmosphere. Include all anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399364, 'cmip6', '<c4mip>,<cdrmip>,<cmip>,<deck>,<fafmip>,<highresmip>,<ismip6>', '--', 'cim.2.designing.NumericalExperiment', '74a0936a-68d6-4c5b-8acc-ac9f31c8a8bd', 1, '2020-11-17 01:19:05.639745', true, '1pctCO2', '1pctCO2', NULL, '1 percent per year increase in CO2', 'Increase atmospheric CO2 concentration gradually at a rate of 1 percent per year. The concentration of atmospheric carbon dioxide is increased from the global annual mean 1850 value until quadrupling.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399365, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '961d3f70-3e62-4591-ac0f-7a2d64273abf', 1, '2020-11-17 01:19:05.639745', true, '1850-1852 3yrs', '3yrs1850-1852', NULL, '1850/01/01-1853/01/01', 'Begin in 1850 and run for 3 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399366, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a7b16e80-0d20-4c17-ba96-30633ef7f9a8', 1, '2020-11-17 01:19:05.639745', true, 'Zonally Uniform SST', 'zonalSST', NULL, 'Zonally Uniform Sea Surface Temperature', 'Impose non-varying and zonally-uniform distribution of SST as specified in appendix B of Webb et. al., 2016.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399367, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '4697c9bf-4053-484b-ae34-886260cb8dc5', 1, '2020-11-17 01:19:05.639745', true, 'SSP5-85 SIC 2100', 'SSP5-85SIC2100', NULL, 'SSP5-8.5 Sea Ice for the year 2100', 'Sea ice concentration climatology calculated from the ScenarioMIP SSP5-85 experiment for the year 2100.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399368, 'cmip6', NULL, '--', 'cim.2.designing.MultiEnsemble', '3b3537dc-4868-47d9-8db1-215d700bc21e', 1, '2020-11-17 01:19:05.639745', true, 'realTimeAnnualxN', 'realTimeAnnualxn', NULL, 'Multi-initialisations of real time annual start date ensemble', 'A multi-ensemble with N initialisations for each start date in real time and ongoing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399428, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'a23795d5-1544-4729-8eec-d21ef47b76a8', 1, '2020-11-17 01:19:05.639745', true, '1996-1996 5yrs', '5yrs1996-1996', NULL, '1996/01/01-1997/01/01', 'Idealised temporal constraint, repeating 1996 for 5 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399370, 'cmip6', '<omip>', '--', 'cim.2.designing.NumericalExperiment', '6f809aee-0198-49cc-8433-7653db20204c', 1, '2020-11-17 01:19:05.639745', true, 'omip2', 'omip2', NULL, 'OMIP experiment forced by JRA-55 atmospheric data set and initialized with observed physical and biogeochemical ocean data', 'Global ocean - sea-ice - coupled experiment forced with the JRA55-do inter-annually varying atmospheric and river data sets for years 1958-2018. Initial ocean tracer fields are based on observations. Simulation length for at least 6 cycles of the 61-year forcing is required.  The 6-cycle length is recommended to facilitate intercomparison within the experiment by using a common simulation length, but a longer simulation length is also accepted. In each simulation, set the beginning of the simulation (e.g., 1653 for the 6-cycle simulation) as the ‘base time’ of the time axis.
INSERT INTO docs.tbl_document VALUES (399371, 'cmip6', '<damip>', '--', 'cim.2.designing.NumericalExperiment', '09fcf58d-3420-4f47-85a2-2902839a4f83', 1, '2020-11-17 01:19:05.639745', true, 'hist-nat', 'hist-nat', NULL, 'historical natural-only runs', 'Historical natural-only simulations resemble the historical simulations but instead are forced with only solar and volcanic forcing from the historical simulations.
INSERT INTO docs.tbl_document VALUES (399392, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '5c828256-c03c-4f8c-a811-fe26b11f08fd', 1, '2020-11-17 01:19:05.639745', true, 'Global Gridded Land Use Forcing Datasets', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399372, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '9e4689e8-f96b-4115-9a93-a4763eda9da4', 1, '2020-11-17 01:19:05.639745', true, 'rad-pi', 'rad-pi', NULL, 'RFMIP-IRF', 'Offline radiative transfer calculations of vertically-resolved broadband-integrated longwave and shortwave fluxes for pre-industrial (1850) clear sky (aerosol-free) conditions. Pre-Industrial (PI) greenhouse gas concentrations with PI atmosphere. Use specified atmospheric distributions of temperature and humidity and surface properties over many profiles.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399373, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'c5240bde-e86a-43b6-9773-bd952426f6f1', 1, '2020-11-17 01:19:05.639745', true, 'TRENDY spin up for GSWP3 low land use', 'trendySpinUpGSWP3LowLandUse', NULL, 'TRENDY protocol for the spin up with GSWP3 low land use forcing', 'Spin up of the land surface model should follow the TRENDY protocol which calls for recycling of the climate mean and variability from two decades of the GSWP3 forcing dataset (1831–1850). CO2 and all other forcings should be held constant at 1850 levels during spin-up.  Land use should be held constant with low estimates for 1850 crop cultivation, pasture land and wood harvest.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399374, 'cmip6', '<pmip>', '--', 'cim.2.designing.NumericalExperiment', '1c29c62f-912c-489b-b007-503a27dacfb3', 1, '2020-11-17 01:19:05.639745', true, 'midPliocene-eoi400', 'midPliocene-eoi400', 'midPliocene-Eoi400', 'mid-Pliocene warm period', 'Impose Mid-Pliocene Warm Period (3.2 Ma ago) boundary conditions for ice sheet and land-sea mask, topography (smaller ice sheets),  the atmospheric concentration of well-mixed greenhouse gases and orbital parameters.  Run for at least 100 years after spin-up. It is mandatory that the model versions used for the PMIP-CMIP6 experiments are the exactly the same as for the other CMIP6 experiments, in particular the DECK and historical simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399375, 'cmip6', NULL, '--', 'cim.2.shared.Party', '0eba3d64-d58f-4ae1-8b26-9dc28ea58e0c', 1, '2020-11-17 01:19:05.639745', true, 'Larry Thomason', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399376, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '5fb4b020-9061-4594-b7f0-de3625caf25e', 1, '2020-11-17 01:19:05.639745', true, 'TRENDY Interim Forcing for GSWP3 low land use', 'trendyInterimForcingGSWP3LowLandUse', NULL, 'TRENDY protocol for 1700 to the first year of the GSWP3 forcing dataset with low land use', 'For the interim period from 1700 to the first year of the GSWP3 high land use forcing, the forcing data should continue to be recycled but all other forcings (CO2, etc.) should be as in the piControl simulation. Use high estimates for land use  (crop, pasture and wood harvest).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399377, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '05a1c8ab-2c0d-4df2-91bb-c7ce1b10b78a', 1, '2020-11-17 01:19:05.639745', true, 'LIG N2O', 'LIGN2O', NULL, 'Last Inter-Glacial N2O concentration', 'Impose Last Interglacial (127 kyr ago) atmospheric Nitrous Oxide (N2O) concentration.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399378, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', '6f56d04c-2f1a-4620-a052-5c777f4d4c11', 1, '2020-11-17 01:19:05.639745', true, 'histSST-piN2O', 'histSST-piN2O', NULL, 'historical SSTs and historical forcings, but with pre-industrial N2O concentrations', 'Historical atmosphere only simulation with historical  forcings but with nitrous oxide (N2O) fixed at 1850 concentration levels.  The model should have the capacity for interactive stratospheric chemistry.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399379, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '3ac033c9-c05e-4bde-aaf0-f30ee034d39e', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP present day SST climatology for use with AMIP SIC', 'PAMIP-pd-SST-clim-for-AMIP-SIC', NULL, 'PAMIP monthly mean climatology of present day sea surface temperature for use with AMIP sea ice', 'Present day monthly mean climatology of sea surface temperature (SST) for use with transient AMIP sea ice. Data provided by PAMIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399380, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '6babafe5-dd7c-4f9f-81ca-1f5ff5163530', 1, '2020-11-17 01:19:05.639745', true, 'A combined dataset for ecosystem modelling', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399381, 'cmip6', NULL, '--', 'cim.2.shared.Party', '9172b80c-1080-4f0c-930a-e98d5959413a', 1, '2020-11-17 01:19:05.639745', true, 'Nathan Gillet', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399382, 'cmip6', '<ismip6>', '--', 'cim.2.designing.NumericalExperiment', '9923f905-c1c8-4279-85cf-db41a3fe4734', 1, '2020-11-17 01:19:05.639745', true, 'ism-1pctCO2to4x-std', 'ism-1pctCO2to4x-std', NULL, 'offline ice sheet model forced by ISMIP6-specified AOGCM 1pctCO2to4x output', 'Stand alone ice sheet model driven offline by ISMIP6 CMIP6 standard input for the idealised 1% per year atmospheric carbon dioxide increase to quadrupling and held fixed climate change experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399383, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '583fc5f9-afe0-4eda-8f2a-1d2a3d0725d2', 1, '2020-11-17 01:19:05.639745', true, '2020-7019 5000yrs max', '5000yrs2020-7019max', NULL, '2020/01/01-7019/12/31 maximum', 'Run from 2020 for a maximum of 5000 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399384, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '867e94f6-f2b9-435c-84f9-01ec96b5ee34', 1, '2020-11-17 01:19:05.639745', true, 'Initial RCP45 Forcing Maintained', 'InitialRCPForcingMaintained', NULL, 'Initial RCP 4.5 forcing information maintained', 'RCP4.5 forcing information (e.g. greenhouse gas concentrations, aerosols etc.) maintained at initial state values, or projected in a simple way. No inclusion of volcano or other short term forcing unless available at initial time.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399403, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '905f6a28-4a37-48bd-b266-7b46b575a909', 1, '2020-11-17 01:19:05.639745', true, '2010 Aerosol Forcing', '2010AerosolForcing', NULL, '2010 Aerosol Forcing', 'Apply 2010 mass mixing ratio fields at 1x1 degree resolution for main aerosol components (sulphate, black carbon, organic carbon, nitrate, sea salt, mineral dust),  along with effective radius per species.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399385, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '6693bd2f-b3e5-4fd9-8424-34fb3930795e', 1, '2020-11-17 01:19:05.639745', true, '100Gt Carbon added to 2010 atmosphere', 'add100GtCarbonTo2010Atmos', NULL, '2010 CO2 emissions are instantaneously increased in 2015 by adding 100 Gt Carbon', 'CO2 emissions (as used from 2010 onwards in the esm-yr2010CO2-control experiment) held at 2010 levels for 5 years.  At the begining of 2015 100 Gt of Carbon is added instantaneously to the atmosphere within one timestep. 
INSERT INTO docs.tbl_document VALUES (399386, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '6c01a443-e78e-47d2-8822-c5af2827f9e1', 1, '2020-11-17 01:19:05.639745', true, 'GSWP3 forcing with low land use', 'GSWP3LowLandUse', NULL, 'GSWP3 forcing with low land use estimates', 'Low land use reconstruction, assumes low historical estimates for crop and pasture and wood harvest relative to the reference GSWP3 dataset.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399387, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '7d23850a-9c4d-4231-adea-813c04287f4e', 1, '2020-11-17 01:19:05.639745', true, '2014 CO VOC Emissions', '2014COVOC', NULL, '2014 Emissions of carbon monoxide and volatile organic compounds', 'Impose 2014 concentrations of carbon monoxide and volatile organic compounds (CO/VOC).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399388, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '66f4152e-df90-43b7-9413-5e8d14e91293', 1, '2020-11-17 01:19:05.639745', true, 'SH Eruption SO2', 'SHEruptionSO2', NULL, 'SO2 emissions for a large Southern Hemisphere eruption', 'Emission of 28.1 Tg of SO2 into the southern hemisphere stratosphere (60S).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399389, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a89ee40a-0f94-4a8a-9483-99c694dddd7d', 1, '2020-11-17 01:19:05.639745', true, 'Impose SST PDV neg NexTrop Pacific', 'ImposeSSTPDVnegNexTropPacific', NULL, 'Impose negative PDV anomaly to sea surface temperatures in the northern extra-tropical Pacific', 'Alter surface fluxes to impose model climatology plus negative Pacific Decadal Variability (PDV) anomalies of Sea Surface Temperature (SST) over the northern extra-tropical Pacific (10N-65N).    Idealised PDV anomalies of SST will be provided by DCPP.  For groups that are unable to restore SSTs.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399393, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', '9a7f8ee7-fd52-4229-aa22-d26d665f0d2d', 1, '2020-11-17 01:19:05.639745', true, 'modelSST-pdSIC', 'modelSST-pdSIC', '4.1', 'Atmosphere time slice present day control with coupled model SST', 'Atmosphere-only time slice experiment to investigate the role of the background state. Time slice forced by present day sea ice concentration (SIC) and present day sea surface temperature (SST) from the coupled model experiment pa-pdSIC (2.1) rather than from observations. Radiative forcing to be set to present day (year 2000) levels. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399394, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b608c9e4-4f2b-4af6-8dba-f20d2b4b2ccd', 1, '2020-11-17 01:19:05.639745', true, 'Mid-Holocene N2O', 'midHoloceneN2O', NULL, 'Mid-Holocene N2O concentration', 'Impose Mid-Holocene atmospheric nitrous oxide (N2O) concentration.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399395, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'ebbbaa14-c27a-4e78-9faa-ef26c4c914d0', 1, '2020-11-17 01:19:05.639745', true, 'High Resolution Model Intercomparison Project (HighResMIP v1.0) for CMIP6', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399396, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', '343b1908-7695-42c0-8f95-2f399d0f467a', 1, '2020-11-17 01:19:05.639745', true, 'pa-pdSIC-ext', 'pa-pdSIC-ext', '6.1', 'Partially-coupled extended simulation constrained by present day SIC', 'Coupled ocean-atmosphere transient experiment.  Coupled model extended simulation constrained with present day sea ice.   Present day sea ice to be the same as used in experiment pdSST-pdSIC (1.1).  It is recommended to constrain sea ice by nudging but with a weak relaxation timescale of 2 months. However, appropriately calibrated long-wave fluxes applied to the sea ice model may also be used.  Radiative forcing to be set to present day (year 2000) levels. Initial conditions for coupled model experiments to be taken from year 2000 of coupled model historical simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399397, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'a992029c-bc4d-47c9-a412-5ce31e700ffc', 1, '2020-11-17 01:19:05.639745', true, 'EMIC Configuration', 'EMICConfiguration', NULL, 'Earth System Model of Intermediate Complexity', 'An Earth system model of intermediate complexity.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399398, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c52193b6-c608-4f34-91ff-f945243a21f2', 1, '2020-11-17 01:19:05.639745', true, 'Future SST SIC', 'FutureSSTSIC', NULL, 'HighResMIP future sea surface temperature and sea ice concentration', 'Future SST and sea-ice forcing follows the methodology of Mizuta et al. (2008).  The rate of future warming is a blend of variability from the 0.25 degree HadISST2-based dataset (Rayner et al., 2016) and the climate change signal from CMIP5 RCP8.5 simulations.  Technical details for the implementation of future SST and SIC forcing in HighResMIP can be found in appendix 9.2 of Haarsma et al. (2016).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399399, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '4327bbc8-7635-43fd-9e35-2305386e3e8d', 1, '2020-11-17 01:19:05.639745', true, 'AOGCM-Aer Configuration', 'AOGCM-AerConfiguration', NULL, 'Atmosphere-Ocean General Circulation Model with interactive Aerosols', 'Use a coupled Atmosphere-Ocean general circulation model with interactive aerosols. The model should at least calculate tropospheric aerosols driven by emission fluxes.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399400, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ca571313-a8f3-4f84-ad67-2bd2174947f6', 1, '2020-11-17 01:19:05.639745', true, 'Agung Aerosol', 'agungAerosol', NULL, 'Agung volcanic aerosol forcing', 'Aerosol forcing from the 1963 Agung volcanic eruption.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399401, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'faf0d6ed-5920-4cfe-875d-038bd155e23a', 1, '2020-11-17 01:19:05.639745', true, 'LFMIP running mean land-hist-cruNcep forcing', 'LFMIP-rm-land-hist-cruNcep', NULL, '30yr running mean land surface forcing from land-hist-cruNcep', '30 year running mean land surface forcing calculated from the land-hist-cruNcep simulation.  Note the climatological median of soil water and snow water is to be used instead of climatological means.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399402, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '837cdf84-1de7-47b1-81a2-9811a5ee077e', 1, '2020-11-17 01:19:05.639745', true, 'Solar Forcing for CMIP6', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399446, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '6cbae0ae-f869-493b-9b64-49c07e8d4f85', 1, '2020-11-17 01:19:05.639745', true, 'Ocean Alkalinization Off', 'oceanAlkalinizationOff', NULL, 'Ocean alkalinization ceases in year 2070', 'Ocean alkalinisation modification ceases.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399404, 'cmip6', '<highresmip>', '--', 'cim.2.designing.NumericalExperiment', 'ffd5ecf7-4a65-4140-a26a-42dfd25774a1', 1, '2020-11-17 01:19:05.639745', true, 'highresSST-p4K', 'highresSST-p4K', NULL, 'uniform 4K warmin of highresSST-present SST', 'Similar to the CFMIP amip-p4K experiment but with a uniform warming of 4K added to the sea surface temperatures (SSTs).  Historical atmosphere-only simulations of the near past (1979-2014). Use HadISST2.2 sea surface temperature and sea ice concentrations at daily 1/4 degree resolution with a uniform warming of 4K added to SSTs (Kennedy et al. 2017, in prep).  Run the experiment parallel to highresSST-present.
INSERT INTO docs.tbl_document VALUES (399405, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd79be94b-e050-494c-a2b5-4a724f0f5149', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP present day SIC climatology', 'PAMIP-pd-SIC-clim', NULL, 'PAMIP monthly mean climatology of sea ice concentration for the present day', 'Present day monthly mean cimatology of sea ice concentration, data provided by PAMIP. When used in coupled models it is recommended to constrain sea ice by nudging but with a weak relaxation timescale of 2 months. However, appropriately calibrated long-wave fluxes applied to the sea ice model may also be used.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399406, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '7af98410-3122-4783-b421-d9e38bd31b3b', 1, '2020-11-17 01:19:05.639745', true, '850-1849 1000yrs', '1000yrs850-1849', NULL, '850/01/01-1850/01/01', 'Last Millennium, run for 1000 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399407, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '5594d134-f911-4af0-a7c2-acd9c07fae06', 1, '2020-11-17 01:19:05.639745', true, 'ESM Configuration', 'ESMconfiguration', NULL, 'Earth System Model Configuration', 'Use a fully coupled Earth system model', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399408, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '6748d0f3-dbb8-484e-aed7-2d0982c8ace3', 1, '2020-11-17 01:19:05.639745', true, 'mid-Holocene Astronomical Parameters', 'midHoloceneAstroParams', NULL, 'Astronomical parameters for the mid-holocene', 'Impose astronomical parameters for the mid-holocene (6 kyr ago).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399409, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '9b96d46c-4da4-4caf-aba0-7a42c7f68c24', 1, '2020-11-17 01:19:05.639745', true, 'RCP45 Stratospheric Ozone', 'RCP45StratosphereO3', NULL, 'Representative Concentration Pathway 4.5 stratospheric Ozone', 'Impose changing stratospheric ozone concentrations consistent with RCP4.5 forcing scenario.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399410, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '7b9cd8ae-10f1-4630-93be-0f93e508b478', 1, '2020-11-17 01:19:05.639745', true, 'AMIP SIC', 'amipSIC', NULL, 'Prescribed AMIP Sea Ice Concentration Boundary Condition', 'Apply AMIP sea ice boundary conditions derived from observational data.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399411, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '4627649f-8879-4c6c-b859-2c067a9dae90', 1, '2020-11-17 01:19:05.639745', true, 'Grassland Net', 'grasslandNet', NULL, 'Grassland with net transitions', 'Grassland crop/pasture with net transitions (exclude shifting cultivation) instead of gross transitions (include shifting cultivation). no management.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399572, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '14c9c269-395d-4def-8c4f-b51fe042e0f8', 1, '2020-11-17 01:19:05.639745', true, '2014 GHG no CO2', '2014GHGnoCO2', NULL, '2014 greenhouse gas concentrations without CO2', 'Impose present-day (2014) concentrations of greenhouse gases but with no Carbon Dioxide (CO2).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399412, 'cmip6', '<highresmip>', '--', 'cim.2.designing.NumericalExperiment', 'da51d603-b6d0-45e3-bfad-0a6e00138730', 1, '2020-11-17 01:19:05.639745', true, 'highresSST-future', 'highresSST-future', NULL, 'HighResMIP AMIP SSP5-85', 'High forcing (ScenarioMIP SSP5-85) future scenario (2015-2050) atmosphere only simulations at high and standard resolution, with an option to continue to 2100.
INSERT INTO docs.tbl_document VALUES (399413, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '9dc806a7-ce67-4858-863c-ce2b65577cbd', 1, '2020-11-17 01:19:05.639745', true, 'land-hist output', 'land-histOutput', NULL, 'Output form the land-hist simulation', 'Forcing is from the output of the land-hist experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399414, 'cmip6', NULL, '--', 'cim.2.designing.NumericalExperiment', '1718c7a7-ee54-4193-b706-ff45128d4936', 1, '2020-11-17 01:19:05.639745', true, 'piClim-OC', 'piClim-OC', NULL, 'pre-industrial climatological SSTs and forcing, but with 2014 organic carbon emissions', 'Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases), pre-industrial emissions of aersols and aerosol precursors, present day (2014) emissions of organic carbon (OC). This is a timeslice experiment of 30 years total. Pre-Industrial ozone climatology should be used for models that don’t model the ozone interactively.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399415, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'bf9ce44f-723b-42f2-b33f-e238e969c6d7', 1, '2020-11-17 01:19:05.639745', true, 'ssp245-cov-modgreen Short Lived Species', 'ssp245-cov-modgreenSLS', NULL, 'ssp245-cov-modgreen Short Lived Species', 'ssp245-cov-modgreen short lived species: BC, CO, OC, SO2, NH3, NOx, NMVOCs', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399416, 'cmip6', '<ls3mip>,<scenariomip>', '--', 'cim.2.designing.NumericalExperiment', '15dc5a43-6c88-43f2-b379-b94a25ea361b', 1, '2020-11-17 01:19:05.639745', true, 'ssp434', 'ssp434', NULL, 'gap-filling scenario reaching 3.4 based on SSP4', 'Gap-filling mitigation scenario with low radiative forcing by the end of the century.  Following approximately RCP3.4 global forcing pathway with SSP4 socioeconomic conditions. Radiative forcing reaches a level of 3.4 W/m2 in 2100. Concentration-driven.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399417, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'e36c2ea0-f3b7-493b-b59a-c0f494d8704e', 1, '2020-11-17 01:19:05.639745', true, 'Aerosol forcing fields for CMIP6', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399418, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '752ac62d-0910-47cc-bc1d-3a4ff5694d6a', 1, '2020-11-17 01:19:05.639745', true, 'piControl SIC Climatology', 'PIControlSICClim', NULL, 'Pre-Industrial Control Sea Ice climatology', 'Pre-Industrial monthly averaged climatology of sea ice concentrations (SIC) generated from at least a 30-year segment of the piControl experiment integration.  These should be prescribed according to the AMIP protocols, whereby interpolated daily data are generated preserving the prescribed monthly average fields.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399419, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ff0fa3f9-5d4c-48f9-b107-89e9d4a36f45', 1, '2020-11-17 01:19:05.639745', true, 'JRA55-do Momentum Flux', 'jra55-doMomentumFlux', NULL, 'JRA55-do air-sea momentum flux', 'JRA55-do air–sea momentum flux, covers the 61-year period from 1958-2018.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399420, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'c9bf0ecc-a6a2-47ad-adec-7de919a6985c', 1, '2020-11-17 01:19:05.639745', true, 'SSP5-85Initialisation2021', 'ssp5-85Initialisation2021', NULL, 'SSP5-8.5 Initialisation year 2021', 'Initialisation is from the beginning of year 2021 of the SSP5-8.5 experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399421, 'cmip6', NULL, '--', 'cim.2.shared.Party', '1d0e0f6b-e9c5-47ca-be4d-d488dc73762a', 1, '2020-11-17 01:19:05.639745', true, 'Myriam Khodri', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399422, 'cmip6', '<geomip>', '--', 'cim.2.designing.NumericalExperiment', '9012519d-1116-4f20-8ef4-93154515ba39', 1, '2020-11-17 01:19:05.639745', true, 'G6SST2-solar', 'G6SST2-solar', 'G6solarSlice2', 'SSTs from year 2100 of SSP5-8.5; forcings and other prescribed conditions from year 2100 of G6solar', 'Time slice at year 2100 of GeoMIP G6solar. Run for 10 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399423, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'af1d555b-81a1-4a9c-be16-0e07d80b0df2', 1, '2020-11-17 01:19:05.639745', true, '2014 NOx Emissions', '2014NOx', NULL, '2014 Emissions of NOx (Nitrogen Oxides)', 'Impose 2014 emissions of nitrogen oxides (NOx).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399429, 'cmip6', '<pmip>', '--', 'cim.2.designing.NumericalExperiment', '3cf25d38-1333-4e86-98ae-97b66a15dc2e', 1, '2020-11-17 01:19:05.639745', true, 'past2k', 'past2k', NULL, 'last two millennia experiment', 'The past2k experiment extends the past1000 simulation back in time to include the first millenium CE. Main forcings: trace gases, volcanoes, solar variability, land-use. The past1000 forcings data sets include the first millennium, except for land-use.  For the latter, a linear ramp-up to 850CE values is recommended.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399430, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'b7d6de28-2238-45af-b199-2b2f68ae4437', 1, '2020-11-17 01:19:05.639745', true, 'Historical O3 and Stratospheric H2O Concentrations', 'HistoricalO3andStratosphericH2OConcentrations', NULL, 'Historical Ozone and Stratospheric Water Vapour Concentrations', 'An ozone concentration database encompassing both the stratosphere and the troposphere and a stratospheric water vapour concentration database.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399431, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b76a31fd-0919-4f4b-b8c2-ca88f61648a4', 1, '2020-11-17 01:19:05.639745', true, 'RCP19 Aerosol Precursors', 'RCP19aerpre', NULL, 'Representative Concentration Pathway 1.9 Aerosol Precursors', 'Impose changing emissions of RCP1.9 aerosol precursors including SO2 and NHy.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399432, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '0afbdba8-e4ee-42c7-8960-c5dd01c20ba6', 1, '2020-11-17 01:19:05.639745', true, 'AOGCM-Aer-Chem Configuration', 'AOGCM-Aer-ChemConfiguration', NULL, 'Atmosphere-Ocean General Circulation Model with Interactive Aerosls and Chemistry', 'Use a coupled Atmosphere-Ocean general circulation model with interactive aerosols and chemistry', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399433, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '5e7e8e09-222a-456f-bc05-38580b1effea', 1, '2020-11-17 01:19:05.639745', true, 'MinimumThree', 'MinimumThreeMemberEnsemble', NULL, 'At least three member Ensemble', 'An ensemble of at least three simulations', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399434, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '269c15d3-900f-42d3-a725-359ddd498109', 1, '2020-11-17 01:19:05.639745', true, 'RCP34-overshoot Aerosol Precursors', 'RCP34overaerpre', NULL, 'Representative Concentration Pathway 3.4 Overshoot Aerosol Precursors', 'Impose changing emissions of RCP3.4 overshoot aerosol precursors including SO2 and NHy.  Beginning in 2040, reduce forcings from 8.5 W/m2 pathway to 3.4 W/m2 by 2100.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399435, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ebb8b4ec-5ac1-4aca-967c-43c8f32f0c62', 1, '2020-11-17 01:19:05.639745', true, 'LS3MIP ssp585 SST', 'LS3MIPssp585SST', NULL, 'SST from the first ensemble member of the ssp585 experiment', 'Sea surface temperature (SST) from the first ensemble member of the ssp585 experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399436, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'f0fbe2a5-bf85-4390-b9f8-8be75b28190d', 1, '2020-11-17 01:19:05.639745', true, 'DIC Tracer', 'DICTracer', NULL, 'Dissolved Inorganic Carbon (DIC) tracer', 'Dissolved Inorganic Carbon (DIC) tracer for a parallel preindustrial world where atmospheric CO2 is fixed at 278 ppm.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399437, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '76284188-80a2-4909-9fc1-2e1d79a975e7', 1, '2020-11-17 01:19:05.639745', true, 'PreIndustrialISMInitialisation', 'piControlISMInitialisation', NULL, 'Initialisation from the pre-industrial control with interactive ice sheets', 'Initialisation is from the pre-industrial control with interactive ice sheets', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399438, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', '31b4cc13-b665-40c0-885d-a8ef5ae08f4b', 1, '2020-11-17 01:19:05.639745', true, 'dcppA-hindcast', 'dcppA-hindcast', 'A1', 'hindcasts initialized from observations with historical forcing', 'A coordinated set of multi-member ensembles of retrospective forecasts (hindcasts) initialised each year from 1960 to the present (otherwise every second year). Prescribed CMIP6 historical values of atmospheric composition and/or emissions (and other conditions including volcanic aerosols).  Future forcing as the SSP2-4.5 scenario. Run each member for at least 5 years, extend the duration to 10 years with Tier-2 priority.  Additional ensemble members for each start date are requested with Tier-3 priority.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399439, 'cmip6', '<rfmip>', '--', 'cim.2.designing.NumericalExperiment', '9ea5fe3f-c980-46e8-8591-d109be3ba0e0', 1, '2020-11-17 01:19:05.639745', true, 'piClim-histghg', 'piClim-histghg', 'RFMIP-ERF-HistGHG', 'transient effective radiative forcing by greenhouse gases', 'An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperatures (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  Transient forcing with non-ozone greenhouse gases (GHG) to be consistent with the historical forcing used in the DAMIP hist-all experiment and future forcing in the ScenarioMIP SSP2 RCP4.5 scenario. A small ensemble of three simulations from 1850-2100.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399440, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b5736a96-f1b9-4d82-8b70-fc9ee7d58a11', 1, '2020-11-17 01:19:05.639745', true, 'HadISST in IPO', 'HadISSTinIPO', NULL, 'HadISST anomalies applied in the tropical lobe of the IPO', 'Sea surface temperatures is restored to the model climatology plus HadISST observed historical anomaly in the tropical lobe of the IPO domain (20°S-20°N, 175°E-75°W).  The weight=1 in the inner box (15°S-15°N, 180°E-80°W) and linearly reduces to zero in the buffer zone from the inner to the outer box. Technical details for the restoring method for SSTs can be found in the appendix of Zhou et al 2014.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399441, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '8036db7b-243a-42c2-8ee8-79c0799257a7', 1, '2020-11-17 01:19:05.639745', true, 'NineMember', 'NineMemberEnsemble', NULL, 'Nine Member Ensemble', 'An ensemble of nine members (if not 9, then as many as possible).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399442, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '9bfb3684-8cd8-49a3-9fc9-022a12af9b87', 1, '2020-11-17 01:19:05.639745', true, '1MemberCoupled', '1MemberCoupledEnsemble', NULL, '1 Member Coupled Ensemble', 'A minimum ensemble size of one simulation. Initial conditions should be based on 1st April 2000 from the CMIP6 historical simulation, note that the first two months of the simulations will be ignored. Ideally, different ocean states will be sampled by using different ensemble members of the CMIP6 historical simulation if these are available.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399443, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'fbb414c3-d00b-455f-9892-047606343864', 1, '2020-11-17 01:19:05.639745', true, '2010 CO2 emissions for 5 years then zero CO2 emissions', '2010ToZeroCO2Em', NULL, '2010 CO2 emissions diagnosed from the yr2010CO2 simulation are reduced to zero after 5 years', 'CO2 emissions (as used from 2010 onwards in the esm-yr2010CO2-control experiment) held at 2010 levels for 5 years then reduced to zero for the remainder of the simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399444, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '2f1af07f-a073-45e7-83b8-b4e4e40f1703', 1, '2020-11-17 01:19:05.639745', true, 'diagnosed historical CO2 emissions', 'diagnosedHistoricalCO2Em', NULL, 'historical CO2 emissions diagnosed from the historical simulation', 'CO2 emissions diagnosed from the historical simulation. i.e., year 1850 to 2010.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399445, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '026b191e-c2b8-4079-b19e-47800b76c760', 1, '2020-11-17 01:19:05.639745', true, 'Reduced RCP70 Methane CH4', 'ReducedRCP70CH4', NULL, 'Reduced Representative Concentration Pathway 7.0 Methane (CH4)', 'Impose changing concentrations of reduced RCP7.0 methane (CH4). Beginning in 2014 with air quality policies (or maximum feasible reductions) applied to the SSP3-7 CH4 emissions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399463, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', 'c84b9060-0553-4a14-b39c-ee00f17fbc18', 1, '2020-11-17 01:19:05.639745', true, 'pa-futAntSIC-ext', 'pa-futAntSIC-ext', '6.3', 'Partially-coupled extended simulation with future Antarctic SIC', 'Coupled ocean-atmosphere transient experiment.  Coupled model extended simulation constrained with present day sea ice.   Present day and future sea ice to be the same as used in experiment pdSST-futAntSIC (1.8).  It is recommended to constrain sea ice by nudging but with a weak relaxation timescale of 2 months. However, appropriately calibrated long-wave fluxes applied to the sea ice model may also be used.  Radiative forcing to be set to present day (year 2000) levels. Initial conditions for coupled model experiments to be taken from year 2000 of coupled model historical simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399464, 'cmip6', '<gmmip>', '--', 'cim.2.designing.NumericalExperiment', 'dda6cbdd-6876-444c-8699-e98623583246', 1, '2020-11-17 01:19:05.639745', true, 'amip-TIP-nosh', 'amip-TIP-nosh', NULL, 'same as "amip" run, but sensible heat not allowed for elevations of the Tibetan-Iranian Plateau and Himalayas above 500m', 'Surface sensible heat released at the elevation above 500m over the Tibetan Plateau (TIP) is not allowed to heat the atmosphere. 
INSERT INTO docs.tbl_document VALUES (399465, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '3598befc-64b4-400b-b366-5f6f0dd49ec2', 1, '2020-11-17 01:19:05.639745', true, 'SSP5-85 SIC 2020', 'SSP5-85SIC2020', NULL, 'SSP5-8.5 Sea Ice for the year 2020', 'Sea ice concentration climatology calculated from the ScenarioMIP SSP5-85 experiment for the year 2020.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399466, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', 'f12f211a-bc68-4967-a7e4-d83ee4f93e5c', 1, '2020-11-17 01:19:05.639745', true, 'amip-future4K', 'amip-future4K', NULL, 'AMIP plus warming pattern SSTs', 'Continuation of CFMIP-2 AMIP experiments and CMIP5 experiment 6.6.  
INSERT INTO docs.tbl_document VALUES (399467, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '96131ca5-7ad9-4064-bf05-724de953d33c', 1, '2020-11-17 01:19:05.639745', true, 'RCP4.5 Forcing Excluding Volcanic Aerosols', 'rcp45ForcingExclVolcAer', NULL, 'Representative Concentration Pathway 4.5 W/m2 Forcing excluding volcanic aerosol', 'Impose RCP4.5 forcing, excluding volcanic aerosols (aerosol precursor).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399468, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', '5f1d1983-1e37-4690-9a71-edac8b2204e8', 1, '2020-11-17 01:19:05.639745', true, 'pa-pdSIC', 'pa-pdSIC', '2.1', 'Partially-coupled time slice contrained by present day SIC', 'Coupled ocean-atmosphere time slice present day control experiment constrained by oberved sea ice.  Coupled model time slice constrained by climatological monthly mean sea surface temperature (SST) and sea ice concentration (SIC) for the present day.  Sea ice concentration to be nudged into coupled model with a relaxation time-scale of 1 day. Radiative forcing to be set to present day (year 2000) levels. Initial conditions for coupled model experiments to be taken from year 2000 of coupled model CMIP6 historical simulations. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399469, 'cmip6', '<highresmip>', '--', 'cim.2.designing.NumericalExperiment', 'df900c79-da16-4ab5-9f71-b98ad3e93283', 1, '2020-11-17 01:19:05.639745', true, 'highresSST-LAI', 'highresSST-LAI', NULL, 'common LAI dataset within the highresSST-present experiment', 'Similar to the HighResMIP highresSST-present experiment but using an common LAI dataset across models.  Historical atmosphere-only simulations of the near past (1979-2014).  HadISST2.2 sea surface temperature and sea ice concentrations at daily 1/4 degree resolution to be used (Kennedy et al. 2017, in prep).  Land surface forcing to use a common 1/4 degree resolution mean LAI3g dataset provided by HighResMIP.
INSERT INTO docs.tbl_document VALUES (399470, 'cmip6', NULL, '--', 'cim.2.designing.Project', 'ec9243df-26b7-4ed5-ba77-beb65bc13276', 1, '2020-11-17 01:19:05.639745', true, 'LS3MIP', 'ls3mip', NULL, 'Land Surface, Snow and Soil Moisture MIP', 'LS3MIP is a suite of complementary experiments that make use of offline land surface models, atmosphere only models and Earth system models for simulations of the recent past and projected futures to 2100.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399471, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '39169c4b-10af-49ef-a1b4-234013c47212', 1, '2020-11-17 01:19:05.639745', true, 'past1000 Volcanic Aerosols', 'past1000VolcAer', NULL, 'Volcanic aerosols in the last millennium', 'Time varying radiative forcing due to volcanic stratospheric aerosols in the last millennium 850-1850.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399472, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '38cabd0d-781f-4972-acee-64f7d9ea3631', 1, '2020-11-17 01:19:05.639745', true, 'Overview of the Coupled Model Intercomparison Project Phase 6 (CMIP6) experimental design and organization', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399473, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '4af21366-caf4-43c2-9ff3-60ab05271a3c', 1, '2020-11-17 01:19:05.639745', true, '2010 Stratospheric Aerosol', '2010StratosphericAerosol', NULL, '2010 Stratospheric Aerosol', 'Apply 2010 stratospheric aerosol concentrations from the stratospheric aerosol data set (SADS Version 2)', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399474, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '9d6c761e-55e6-422b-9563-d68fc17ba440', 1, '2020-11-17 01:19:05.639745', true, '2020-2029 10yrs', '10yrs2020-2029', NULL, '2020/01/01-2030/01/01', 'Timeslice, begin in 2020 and run for 10 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399475, 'cmip6', NULL, '--', 'cim.2.shared.Party', '366fa9d8-db5b-43cd-b8d1-6a9ec8fdf3c9', 1, '2020-11-17 01:19:05.639745', true, 'Jean-Yves Peterschmitt', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399476, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e251e3e8-20b2-4598-a440-ce4d6d6f23f2', 1, '2020-11-17 01:19:05.639745', true, 'First millennium WMGHG', 'FirstMillenniumWMGHG', NULL, 'First millennium well mixed greenhouse gas (WMGHG)', 'Atmospheric concentrations of well-mixed green house gas concentrations in the first millennium 01-849. The PMIP past1000 forcings data sets include the first millennium.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399477, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '034c7e4d-f506-4c89-ac4d-9a7cd9718eac', 1, '2020-11-17 01:19:05.639745', true, '50yrs', '50yrs', NULL, '50 years', 'Run for 50 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399478, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c46e9e36-0501-4a90-9179-ba0aaea007ba', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Stratospheric Aerosol', 'Pre-industrialStratosphericAerosol', NULL, 'Pre-Industrial Stratospheric Aerosol', 'Constant background stratospheric aerosol for piControl. A background volcanic aerosol should be specified that results in radiative forcing matching, as closely as possible, that experienced, on average, during the historical simulation (i.e. 1850-2014 mean).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399481, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'd9062b1d-0132-4cc8-b09a-81e0d4bcfbce', 1, '2020-11-17 01:19:05.639745', true, 'TRENDY spin up for GSWP3 high land use', 'trendySpinUpGSWP3HighLandUse', NULL, 'TRENDY protocol for the spin up with GSWP3 high land use forcing', 'Spin up of the land surface model should follow the TRENDY protocol which calls for recycling of the climate mean and variability from two decades of the GSWP3 forcing dataset (1831–1850). CO2 and all other forcings should be held constant at 1850 levels during spin-up.  Land use should be held constant with high estimates for 1850 crop cultivation, pasture land and wood harvest.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399482, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '6789980f-4051-40b6-ae1c-58dc01bf41c0', 1, '2020-11-17 01:19:05.639745', true, 'piControl SST Monthly Var Plus Uniform 4K', 'piControlSSTMnthlyVarPlusUniform4K', NULL, 'Monthly-varying sea surface temperatures from the pre-industrial control simulation plus uniform 4K', 'Monthly-varying sea surface temperatures from years 111 to 140 of the pre-industrial control (piControl) experiment plus uniform 4K.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399483, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', 'c628bd38-80e4-45db-8a66-edbbfbc994d5', 1, '2020-11-17 01:19:05.639745', true, 'histSST-piAer', 'histSST-piAer', NULL, 'historical SSTs and historical forcing, but with pre-industrial aerosol emissions', 'Historical atmosphere only simulation with historical WMGHG, transient historical SSTs.  Aerosol emissions (except NOx) fixed at 1850 emission levels.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399484, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'db26b92a-8576-4759-b43a-b7e4428cda54', 1, '2020-11-17 01:19:05.639745', true, 'ISM Configuration', 'ISM-Configuration', NULL, 'Ice Sheet Model', 'Stand-alone ice sheet model', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399485, 'cmip6', '<rfmip>', '--', 'cim.2.designing.NumericalExperiment', '7f9d8db2-26db-419f-ac09-8f1360d30402', 1, '2020-11-17 01:19:05.639745', true, 'piClim-anthro', 'piClim-anthro', 'RFMIP-ERF-anthro', 'effective radiative forcing by present day anthropogenic agents', 'An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperature (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  Anthropogenic forcing agents (greenhouse gases, aerosols, ozone, and land use) are specified at present day, 2015, values. Run for 30 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399486, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c9d65601-c08b-42ff-b96f-9165381002f7', 1, '2020-11-17 01:19:05.639745', true, 'ISMIP6-specified pdControl input', 'ISMIP6pdControlInput', NULL, 'ISMIP6-specified input from an AOGCM present day control', 'ISMIP6-specified input from the output of an AOGCM present day control experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399487, 'cmip6', '<cdrmip>', '--', 'cim.2.designing.NumericalExperiment', '77ed746a-c838-4349-9fe9-8d3b52415c4f', 1, '2020-11-17 01:19:05.639745', true, 'yr2010CO2', 'yr2010CO2', 'CDR-yr2010-pulse', 'concentration-driven fixed 2010 forcing', 'Branch from beginning of year 2010 of the historical simulation with CO2 concentration held constant at 389 ppm. All other forcings (anthropogenic, solar and volcanic)  are held fixed at 2010 levels. Anthropogenic forcing includes aerosols, non-CO2 greenhouse gasses, and land use changes.  During this run, compatible emissions should be frequently diagnosed (at least annually). 
INSERT INTO docs.tbl_document VALUES (399488, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '6445513d-7f52-41b2-b312-4d28796ce01f', 1, '2020-11-17 01:19:05.639745', true, '2010-7009 5000yrs max', '5000yrs2010-7009max', NULL, '2010/01/01-7009/12/31 maximum', 'Run from 2010 for a maximum of 5000 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399489, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '015dacca-38b7-4996-8d1d-aec20718044d', 1, '2020-11-17 01:19:05.639745', true, 'Carbon dioxide and climate impulse response functions for the computation of greenhouse gas metrics: a multi-model analysis', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399490, 'cmip6', '<damip>', '--', 'cim.2.designing.NumericalExperiment', 'c5f9219b-ae34-4837-96fb-d7a28eab8be3', 1, '2020-11-17 01:19:05.639745', true, 'hist-CO2', 'hist-CO2', NULL, 'historical co2-only runs', 'Historical simulations driven by changes in CO2 concentration only as used in hist-all (histAll) experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399491, 'cmip6', '<damip>,<dcpp>,<geomip>,<rfmip>,<scenariomip>', '--', 'cim.2.designing.NumericalExperiment', '5de5fb58-d596-4345-84f7-e392f5d71541', 1, '2020-11-17 01:19:05.639745', true, 'ssp245', 'ssp245', NULL, 'update of RCP4.5 based on SSP2', 'SSP-based RCP scenario with medium radiative forcing by the end of the century.  Following approximately RCP4.5 global forcing pathway with SSP2 socioeconomic conditions. Radiative forcing reaches a level of 4.5 W/m2 in 2100. Concentration-driven.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399492, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '5a941036-c28c-41e7-919b-b577249f586e', 1, '2020-11-17 01:19:05.639745', true, 'RCP70ReducedTroposphericOzonePrecursorsNotMethane', 'ReducedRCP70O3prenotCH4', NULL, 'Reduced RCP7.0 Tropospheric ozone precursors but not methane', 'Impose reduced RCP7.0 tropospheric ozone precursor emissions (not Methane).  Beginning in 2014 with air quality policies (or maximum feasible reductions) applied to the SSP3-70 tropospheric ozone precursor NTCF emissions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399493, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '57f6d92e-1661-4475-bc40-0d2ebe59cc6d', 1, '2020-11-17 01:19:05.639745', true, 'RCP Alternative Natural Forcing', 'rcpAltNat', NULL, 'Representative Concentration Pathway alternative natural forcing estimation', 'Impose alternative estimates of natural forcing for RCP scenarios i.e. solar irradiance change and volcanic activity.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399494, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '5ff2a184-d38d-42e2-819e-61a6b709f60f', 1, '2020-11-17 01:19:05.639745', true, '2100-2299 200yrs', '200yrs2100-2300', NULL, '2100/01/01- 2300/01/01', 'Scenario, from 2100 to 2300.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399495, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '133e3cc5-12e5-47fa-9f6c-b826961ab2b6', 1, '2020-11-17 01:19:05.639745', true, 'CORE-II Freshwater Flux', 'core2FreshwaterFlux', NULL, 'CORE-II air-sea freshwater flux', 'CORE-II air–sea freshwater flux, covers the 62-year period from 1948-2009.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399496, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '46ce5fc6-e28f-4276-9da5-d6c27425081a', 1, '2020-11-17 01:19:05.639745', true, 'Historical WMGHG Concentrations Excluding CO2', 'HistoricalWMGHGConcNoCO2', NULL, 'Historical Well Mixed Greenhouse Gas (WMGHG) Concentrations Excluding Carbon Dioxide (CO2)', 'Forcing data for historical CMIP6 runs. Time varying global annual mean concentrations for the long-lived greenhouse-gases excluding CO2, but including: CH4, N2O, HFCs, PFCs, SF6, several ODS, and NF3 to serve as input for the CMIP6 Historical simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399497, 'cmip6', '<dcpp>,<volmip>', '--', 'cim.2.designing.NumericalExperiment', 'f5514e50-b726-45ac-8b7a-37b59ab63ab8', 1, '2020-11-17 01:19:05.639745', true, 'dcppC-forecast-addPinatubo', 'dcppC-forecast-addPinatubo', 'C3.4', '2015 forecast with added Pinatubo forcing', 'Prediction experiment for 2015 with volcano forcing.  Repeat DCPP-A1 2015 forecast (from the dcppA-hindcast experiment) with Pinatubo forcing. Background volcanic aerosol to be the same as that used in the 1991 hindcast. 10 ensemble members. Run each member for at least 5 years, preferably 10 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399498, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '84d9eb4d-1a62-4c11-8d7b-259ef17fb6ef', 1, '2020-11-17 01:19:05.639745', true, 'Current and future global climate impacts resulting from COVID-19', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399505, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'e5c23f42-5fce-47cf-a1ea-e534698b52b1', 1, '2020-11-17 01:19:05.639745', true, 'RealTimeAnnual', 'realTimeAnnual', NULL, 'Real-Time Annual', 'Start date every year ongoing.  Start date on or before 31st December of the year preceding the forecast period.  Start dates on or before 15th November recommended to allow for DJF seasonal forecast results.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399506, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '98718f13-ee35-40a1-84f1-2c625deeaa31', 1, '2020-11-17 01:19:05.639745', true, 'TRENDY spin up', 'TRENDYSpinUp', NULL, 'TRENDY spin up protocol', 'Recycling of the climate mean and variability from two decades of the forcing dataset.  The recycled variables are the forcing variables needed to drive an offline land module. So these are wind speed in two directions at 10m height, atmosphere temperature and humidity at 2m height, incoming shortwave and longwave radiation, incoming rainfall and snowfall, surface pressure.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399507, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '206648fd-802e-41e2-ad07-b6faec3d51c7', 1, '2020-11-17 01:19:05.639745', true, 'Impose SST clim N Atlantic', 'ImposeSSTclimNAtlantic', NULL, 'Impose model climatology sea surface temperatures in the north Atlantic', 'Alter surface fluxes to impose model control climatology Sea Surface Temperatures (SSTs) over the North Atlantic (10N-65N).  No SST modification if sea ice is present.  For groups that are unable to restore SSTs.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399508, 'cmip6', '<cdrmip>', '--', 'cim.2.designing.NumericalExperiment', '633d241d-818f-411f-9f11-9f7ddfb8de2c', 1, '2020-11-17 01:19:05.639745', true, 'esm-ssp585ext', 'esm-ssp585ext', 'CDR-afforestation', 'emission-driven long-term extension of the SSP5-8.5 scenario', 'Long term extension of ScenarioMIP esm-ssp585 simulation.  A CO2 emissions driven SSP5-8.5 scenario. Include all anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399509, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd4c65f27-7f0b-4ff5-aa9c-019721486762', 1, '2020-11-17 01:19:05.639745', true, '1% per year CO2 for Radiation', '1%CO2Radiation', NULL, '1% per year increase in atmospheric CO2 until quadrupling only affects radiative code', '1% per year increase in the concentration of atmospheric carbon dioxide until quadrupling seen by radiative code only.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399510, 'cmip6', NULL, '--', 'cim.2.designing.NumericalExperiment', 'fb569174-6e88-4a03-a138-f6717af7f7f9', 1, '2020-11-17 01:19:05.639745', true, 'ism-historical-self', 'ism-historical-self', NULL, 'Ice sheet model driven with historical forcing', 'Stand alone ice sheet model driven offline by a CMIP6 model with historical forcing.  The ice sheet model should be configured with the same settings as the ice sheet model in the historical-withism experiment and should use the same initial conditions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399511, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '6f4c00b6-aaf2-40c3-b735-7c4bba7576b5', 1, '2020-11-17 01:19:05.639745', true, 'GSWP3 recycling of climate mean and variability', 'GSWP3RecycleClimateMeanAndVariability', NULL, 'GSWP3 recycling of climate mean and variability from the forcing dataset', 'Recycling of the climate mean and variability from two decades (1831–1850) of the GSWP3 dataset (Global Soil Wetness Project Phase 3). The recycled variables are the forcing variables needed to drive an offline land module. So these are wind speed in two directions at 10m height, atmosphere temperature and humidity at 2m height, incoming shortwave and longwave radiation, incoming rainfall and snowfall, surface pressure.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399512, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '33fa29c9-9cac-4ef9-85cf-a06e1317269d', 1, '2020-11-17 01:19:05.639745', true, '2020-2100 81yrs', '81yrs2020-2100', NULL, '2020/01/01-2101/01/01', 'Scenario, from 2020 to the end of the 21st century', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399513, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '785353e2-4fcd-4ce8-bd0b-a865b07b6970', 1, '2020-11-17 01:19:05.639745', true, '1850 Aerosol Emissions', '1850Aerosol', NULL, '1850 Emissions of Aerosols', 'Impose pre-industrial (1850) emissions of aerosols.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399514, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '35053c71-457f-4c76-9114-f63a08d73f92', 1, '2020-11-17 01:19:05.639745', true, '2014 Aerosol Precursors', '2014AerPre', NULL, '2014 aerosol precursors', 'Impose present day (2014) aerosol precursors.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399515, 'cmip6', NULL, '--', 'cim.2.shared.Party', '7540a237-bd83-4522-9bd9-790d5e8ff355', 1, '2020-11-17 01:19:05.639745', true, 'Pascale Braconnot', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399573, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '298badc1-b1ed-44f2-bac3-195bd634ef0b', 1, '2020-11-17 01:19:05.639745', true, 'Coupled ocean-atmosphere interaction at oceanic mesoscales', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399516, 'cmip6', '<rfmip>', '--', 'cim.2.designing.NumericalExperiment', '233bd027-e159-42df-99f9-965f0abe6629', 1, '2020-11-17 01:19:05.639745', true, 'piClim-histall', 'piClim-histall', 'RFMIP-ERF-HistAll', 'transient effective radiative forcing', 'An uncoupled (atmosphere and land) experiment with interactive vegetation in which sea surface temperatures (SST) and sea ice concentrations (SIC) are fixed at model-specific pre-industrial control climatology.  Transient forcing to be consistent with historical forcing used in the DAMIP hist-all experiment and future forcing to be consistent with the ScenarioMIP SSP2 RCP4.5 scenario forcing.  A small ensemble of three simulations from 1850-2100.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399517, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '24a5479b-7ee7-4258-bfaf-e5a558e8ea16', 1, '2020-11-17 01:19:05.639745', true, '2010esm-yr2010CO2-controlInitialisation', '2010esm-yr2010CO2-controlInitialisation', NULL, 'Initialisation from year 2010 of the esm-yr2010CO2-control simulation', 'Initialisation from the esm-yr2010CO2-control simulation in the year 2010.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399518, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'fad3e541-917f-4b88-95d8-483032fb4b64', 1, '2020-11-17 01:19:05.639745', true, 'InitMIP Ensemble', 'InitMIPEnsemble', NULL, 'InitMIP perturbation ensemble', 'Ensemble members vary for example by changing the sliding law, stress balance approximation, model resolution, or datasets (such as using different bedrocks).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399519, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '9b6b336d-2b7b-4757-ba85-d3bf8ac15604', 1, '2020-11-17 01:19:05.639745', true, 'Restore SST AMV neg Extra Tropical N Atlantic', 'RestoreSSTAMVnegExTropNAtlantic', NULL, 'Restore extra-tropical north Atlantic sea surface temperature to negative AMV', 'Sea Surface Temperatures (SSTs) are restored to model climatology plus positive AMV anomaly by Newtonian cooling over the extra-tropical north Atlantic (30N-65N). The restoring timescale is 10 days for a 50m deep mixed layer (or equivalent). The restoring coefficient of 40 W/m2/K should decrease to zero over an 8 degree buffer zone bounding the restored region.  No restoring if sea ice is present.  Idealised AMV anomalies of SST will be provided by DCPP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399520, 'cmip6', '<damip>', '--', 'cim.2.designing.NumericalExperiment', '3f1f837d-ad38-4969-aa27-a0b8f55614a6', 1, '2020-11-17 01:19:05.639745', true, 'hist-stratO3', 'hist-stratO3', NULL, 'historical stratospheric ozone-only runs', 'This experiment''s simulations resemble the historical simulations but are forced with stratospheric ozone concentrations only.
INSERT INTO docs.tbl_document VALUES (399521, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '8f91b72b-e987-4d87-8930-e080501d42a5', 1, '2020-11-17 01:19:05.639745', true, 'Initial Historical Forcing Maintained', 'InitialHistoricalForcingMaintained', NULL, 'Initial Historical forcing information maintained', 'Historical forcing information (e.g. greenhouse gas concentrations, aerosols etc.) maintained at initial state values, or projected in a simple way. No inclusion of volcano or other short term forcing unless available at initial time.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399522, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c980c693-fd46-46e1-87ad-0d299c84c5c6', 1, '2020-11-17 01:19:05.639745', true, '2010 Aerosol Precursor Emissions', '2010AerosolPre', NULL, '2010 Emissions of Aerosol Precursors', 'Apply 2010 emissions of aerosol precursors.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399523, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'bfd20315-bb50-40c4-b692-38ddf23531b6', 1, '2020-11-17 01:19:05.639745', true, 'Historical Non-CO2 Anthropogenic Reactive Gas Emissions', 'HistoricalAnthropogenicReactiveGasEmissions', NULL, 'Historical Anthropogenic Non-CO2 Reactive Gas Emissions', 'Apply aggregated historical emissions of non-CO2 anthropogenic reactive gases (SO2, NOx, NH3, CH4, CO, NMVOC, BC, OC) by region and RCP sector.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399524, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', '5cdb3e57-431b-45e7-8f83-f05149473e1f', 1, '2020-11-17 01:19:05.639745', true, 'amip-p4k-lwoff', 'amip-p4k-lwoff', NULL, 'AMIP plus 4K SSTs with longwave cloud radiative effects off', 'Continuation of CFMIP-2 amip4K experiment and CMIP5 experiment 6.8.  Add a uniform +4 K to the sea surface temperatures (SSTs) of the AMIP experiment but with cloud-radiative effects switched off in the LW radiation code. The SST warming should be applied to the ice free ocean surface only.  Sea ice and SSTs under sea ice remain the same as in the amip DECK experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399525, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', 'b2641ebe-182c-4163-a2e7-1c2d9598a284', 1, '2020-11-17 01:19:05.639745', true, 'ssp370SST-ssp126Lu', 'ssp370SST-ssp126Lu', NULL, 'SSP3-7.0, prescribed SSTs, with SSP1-2.6 land use', 'SSP-based RCP scenario following approximately RCP7.0 global forcing pathway but with low land use change from exeperiment ssp126. Atmosphere only with SST from experiment SSP3-70.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399526, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '1d09fb27-6c9c-45f4-bdde-d6f099a82728', 1, '2020-11-17 01:19:05.639745', true, 'AMIP SST Plus Uniform 4K', 'uniformSSTp4K', NULL, 'Uniform plus 4K to AMIP Sea Surface Temperature increase', 'AMIP sea surface temperature boundary conditions derived from observational data, plus uniform 4K.
INSERT INTO docs.tbl_document VALUES (399527, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '19094b7d-8b7f-4a75-8a6b-29552ac0bd7c', 1, '2020-11-17 01:19:05.639745', true, 'RCP70 Reduced Black Carbon', 'ReducedRCP70BC', NULL, 'Reduced RCP7.0 Black Carbon', 'Impose reduced RCP7.0 black carbon emissions. Beginning in 2014 with air quality policies (or maximum feasible reductions) applied to the SSP3-70 black carbon NTCF emissions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399528, 'cmip6', '<ismip6>', '--', 'cim.2.designing.NumericalExperiment', 'ac29b48e-4635-4e0d-aa3c-9e4cb02666bf', 1, '2020-11-17 01:19:05.639745', true, 'piControl-withism', 'piControl-withism', NULL, 'Pre-industrial control with interactive ice sheets', 'The pre-industrial control in a model with interactive ice sheet model.   The experiment should be identical to the corresponding standard CMIP AOGCM experiment except for the treatment of ice sheets.
INSERT INTO docs.tbl_document VALUES (399529, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'ebffb468-960b-480a-9e37-6b9c7370165d', 1, '2020-11-17 01:19:05.639745', true, 'Radiative Transfer', 'radiativeTransfer', NULL, 'Radiative Transfer Model', 'One dimensional radiative transfer model, identical to the radiative transfer scheme used in the Atmosphere model.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399530, 'cmip6', '<ls3mip>', '--', 'cim.2.designing.NumericalExperiment', '8531841c-0950-40b3-bee2-54602e005a62', 1, '2020-11-17 01:19:05.639745', true, 'amip-lfmip-pObs', 'amip-lfmip-pObs', 'LFMIP-Pobs+SST', 'prescribed land from pseudo-observations and AMIP SSTs', 'Simulations with observed SST and land-hist output.  A "pseudo-observed boundary condition" experiment that uses AMIP SSTs and land boundary conditions generated by the land-hist experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399531, 'cmip6', NULL, '--', 'cim.2.shared.Party', '9802de21-3fa0-4f4b-8632-5ed8236fb836', 1, '2020-11-17 01:19:05.639745', true, 'Jean-François Lamarque', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399532, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '94f36844-ecbf-41bd-b6b5-77c114e23a4b', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Forcing Excluding Solar', 'piForcingExcludingSolar', NULL, 'Pre-industrial forcing, excluding solar forcing', 'Pre-Industrial forcing excluding  solar forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399533, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '8a81351d-32e2-4fbb-918c-25c45e791f78', 1, '2020-11-17 01:19:05.639745', true, 'Impose SST AMV neg N Atlantic', 'ImposeSSTAMVnegNAtlantic', NULL, 'Impose negative AMV anomaly to sea surface temperatures in the north Atlantic', 'Alter surface fluxes to impose model climatology plus negative Atlantic Multidecadal Variability (AMV) anomalies of Sea Surface Temperature (SST) over the  North Atlantic (10N-65N).  Idealised AMV anomalies of SST will be provided by DCPP.  For groups that are unable to restore SSTs.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399534, 'cmip6', '<cdrmip>,<lumip>', '--', 'cim.2.designing.NumericalExperiment', '2c8c71b3-f914-4f6c-b8e1-7fb5fc8b5ff7', 1, '2020-11-17 01:19:05.639745', true, 'esm-ssp585-ssp126Lu', 'esm-ssp585-ssp126Lu', NULL, 'emissions-driven SSP5-8.5 with SSP1-2.6 land use', 'Keep all forcings the same as C4MIP esm-ssp585 scenario, but replace land use with ScenarioMIP SSP1-2.6  (aforestation) scenario. Emission driven.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399555, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '0cf7b473-90da-4f3d-b80c-537c5540be91', 1, '2020-11-17 01:19:05.639745', true, 'RCP34-extension-overshoot Short Lived Gas Species', 'RCP34extoversls', NULL, 'Representative Concentration Pathway 3.4 extension Overshoot Short Lived Gas Species', 'Impose changing emissions of RCP3.4 extension overshoot short lived gas species including CH4, NOx, VOCs and CO.  Beginning in 2100, linearly reduce forcings from 3.4 W/m2 pathway to 2.6 W/m2 by 2250.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399556, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '762e382e-7932-4306-80c4-5881a33a6bfb', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Forcing Excluding CO2 and Solar', 'piForcingExcludingCO2solar', NULL, 'Pre-industrial forcing, excluding carbon dioxide and solar forcing', 'Pre-Industrial forcing excluding carbon dioxide (CO2) and solar forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399535, 'cmip6', '<ismip6>', '--', 'cim.2.designing.NumericalExperiment', '9699b7b3-b320-40fc-936d-61d32ffcf7ab', 1, '2020-11-17 01:19:05.639745', true, 'ism-ctrl-std', 'ism-ctrl-std', NULL, 'offline ice sheet model initMIP control', 'Offline ice sheet control run for the ISMIP6 InitMIP experiments. A stand-alone ice sheet model is initialized using a modelling groups'' own initialisation technique.  ism-ctrl-std is an unforced forward experiment where the surface mass balance remains identical to the one used during the initialization procedure. The choice of model input data is unconstrained to allow participants the use of their preferred model setup without modification.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399536, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'f2c1be02-3195-4b67-85f5-f5fd1f19b08a', 1, '2020-11-17 01:19:05.639745', true, 'Improved Atlantic winter blocking in a climate model', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399537, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '7a258d2e-b6a6-40a7-a3d9-c64221521e10', 1, '2020-11-17 01:19:05.639745', true, 'RFMIP Rad-irf', 'RFMIP-rad-irf', NULL, 'Eighteen member forcing ensemble to test parameterisation error in radiation models.', 'An 18 member forcing ensemble to assess parameterisation error in clear-sky top-of-atmosphere flux changes.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399538, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '4b54301a-c560-4ec9-9619-2a08efdba222', 1, '2020-11-17 01:19:05.639745', true, 'Future Cosmic Ray Forcing', 'FutureCosmicRayForcing', NULL, 'Future Cosmic Ray Forcing', 'CMIP6 recommends the use of the CRAC:CRII (Cosmic Ray induced Cascade: Application for Cosmic Ray Induced Ionization) model extended toward the upper atmosphere (Usoskin et al. 2010).  The results of the CRAC:CRII model are parameterized (see Usoskin and Kovaltsov 2006) to give ion pair production rate as a function of the altitude (quantified via the barometric pressure), geomagnetic latitude (quantified via geomagnetic cut-off rigidity), and solar activity (quantified via the modulation potential θ).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399539, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ea0361d7-dffa-4471-8517-931de48e3256', 1, '2020-11-17 01:19:05.639745', true, 'Restore SST PDV pos Pacific', 'RestoreSSTPDVposPacific', NULL, 'Restore Pacific sea surface temperature to positive PDV', 'Sea Surface Temperatures (SSTs) are restored to model climatology plus positive PDV anomaly by Newtonian cooling over the Pacific (10S-65N). The restoring timescale is 10 days for a 50m deep mixed layer (or equivalent). The restoring coefficient of 40 W/m2/K should decrease to zero over an 8 degree buffer zone bounding the restored region.  No restoring if sea ice is present. Idealised AMV anomalies of SST will be provided by DCPP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399540, 'cmip6', '<ismip6>', '--', 'cim.2.designing.NumericalExperiment', '6ca05b4b-d22a-4b4a-b5fc-06fbef30e731', 1, '2020-11-17 01:19:05.639745', true, '1pctCO2to4x-withism', '1pctCO2to4x-withism', NULL, 'Experiment with interactive ice sheets forced by 1 percent per year increase in CO2 to 4xCO2 (subsequently held fixed)', 'Increase atmospheric carbon dioxide by 1% per year to quadrupling then hold fixed for 200 years in a model with interactive ice sheets. The experiment should be identical to the corresponding standard CMIP AOGCM experiment except for the treatment of ice sheets. 1pctCO2to4x-withism forcing differs from the 1% increase in CO2 experiment in that  after year 140 , when the CO2 levels = 4xCO2, the concentration of CO2 remains set to 4xCO2 for the remainder of the experiment
INSERT INTO docs.tbl_document VALUES (399541, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'fbae8bd7-0a07-4478-b524-7e2b9e9462a2', 1, '2020-11-17 01:19:05.639745', true, 'RCP19 Short Lived Gas Species', 'RCP19sls', NULL, 'Representative Concentration Pathway 1.9 Short Lived Gas Species', 'Impose changing emissions of RCP1.9 short lived gas species including CH4, NOx, VOCs and CO.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399542, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '792bd995-edac-4d0f-81fc-32f07ef124a2', 1, '2020-11-17 01:19:05.639745', true, '1850-2029 180yrs', '180yrs1840-2029', NULL, '1850/01/01-2030/01/01', 'Historical scenario, from pre-industrial to near future', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399543, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', '48780791-821a-49bc-8433-1814d70ce5bd', 1, '2020-11-17 01:19:05.639745', true, 'ssp370SST-lowNTCF', 'ssp370SST-lowNTCF', NULL, 'SSP3-7.0, prescribed SSTs, with low NTCF emissions', 'SSP-based RCP scenario following approximately RCP7.0 global forcing pathway but with reduced NTCF emissions. SSP3 socioeconomic conditions.  Atmosphere only with SST from ScenarioMIP experiment SSP3-70.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399544, 'cmip6', NULL, '--', 'cim.2.shared.Party', '389532a9-55d1-4176-9e1b-2be8c81684a6', 1, '2020-11-17 01:19:05.639745', true, 'Stefan Kinne', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399545, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', '75488836-8d40-48bf-82ab-379749e3e1bd', 1, '2020-11-17 01:19:05.639745', true, 'dcppC-pac-control', 'dcppC-pac-control', 'C1.4', 'idealised pacific control', 'Restore the Pacific sea surface temperature to the model control run climatology.  Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members. SST signal may also be imposed by altering surface fluxes.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399546, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '3c11f69e-13e1-493b-9a31-336142952043', 1, '2020-11-17 01:19:05.639745', true, 'rad-pd-0p5xCO2', 'rad-pd-0p5xCO2', NULL, 'RFMIP-IRF', 'Offline radiative transfer calculations of vertically-resolved broadband-integrated longwave and shortwave fluxes for present-day (2015) clear sky (aerosol-free) conditions with half the pre-industrial carbon dioxide concentrations. Use specified atmospheric distributions of temperature and humidity and surface properties over many profiles.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399547, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '49e44029-7453-468d-a05a-656a1186e8f1', 1, '2020-11-17 01:19:05.639745', true, 'RCP70 Aerosols', 'RCP70aer', NULL, 'Representative Concentration Pathway 7.0 Aerosols', 'Impose changing emissions of RCP7.0 aerosols including BC and OC.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399647, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a28fa82a-c38e-4dd8-9631-94aa4cbd5625', 1, '2020-11-17 01:19:05.639745', true, '2x 1850 Dust Aerosol Emissions', '2x1850dustAer', NULL, 'Doubled 1850 emissions of dust', 'Impose 1850 doubled dust emission fluxes.  Or double the dust aerosol emissions of the 1850 climatological data.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399548, 'cmip6', '<ismip6>', '--', 'cim.2.designing.NumericalExperiment', '4a784209-154d-46cd-b10e-7923c9b2e026', 1, '2020-11-17 01:19:05.639745', true, 'ism-1pctCO2to4x-self', 'ism-1pctCO2to4x-self', NULL, 'Ice sheet model driven with 1% per yr CO2 increase to quadrupling forcing', 'Stand alone ice sheet model driven offline by a CMIP6 model with 1% per year atmospheric carbon dioxide increased to quadrupling then held fixed for 200 years.
INSERT INTO docs.tbl_document VALUES (399549, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'faf0106d-7f01-425a-ab6d-3b96e5232940', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP present day SIC climatology for use with AMIP SST', 'PAMIP-pd-SIC-clim-for-AMIP-SST', NULL, 'PAMIP monthly mean climatology of present day sea ice concentration for use with AMIP sea surface temperature', 'Present day monthly mean climatology of sea ice concentration (SIC) for use with transient AMIP sea surface temperature. Data provided by PAMIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399550, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '353e3b88-cd00-426a-9ef3-320e05eda461', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Forcing Excluding Aerosols', 'preIndForcingExclAer', NULL, 'Pre-industrial forcing, excluding aerosols', 'Pre-Industrial forcing excluding aerosols.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399551, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '21cac0e1-1860-46d5-83bc-865ed6f94a19', 1, '2020-11-17 01:19:05.639745', true, 'Recent global-warming hiatus tied to equatorial Pacific surface cooling', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399575, 'cmip6', NULL, '--', 'cim.2.shared.Party', '51e78e9a-c10d-4162-a93f-5c05aac8cafd', 1, '2020-11-17 01:19:05.639745', true, 'Tony Payne', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399557, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '9c26f0ff-6ab0-48af-b3bc-23c342e378fe', 1, '2020-11-17 01:19:05.639745', true, 'All Land Management except with pasture as grassland', 'allLandManagementPastureAsGrassland', NULL, 'All management active except treat pasture as grassland in the model configuration', 'All applicable land management active in the land surface model configuration. Treat pastureland as unmanaged grassland.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399558, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '8a955f04-3347-4950-a0ef-4c346dbdb17a', 1, '2020-11-17 01:19:05.639745', true, '2014 N2O Concentration', '2014N2O', NULL, '2014 Nitrous Oxide Concentration', 'Impose 2014 concentration of Nitrous Oxide (N2O).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399559, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '4a9d9c60-463f-4a1f-9196-13841344cd64', 1, '2020-11-17 01:19:05.639745', true, 'RCP85 extension Forcing', 'rcp85extForcing', NULL, 'Representative Concentration Pathway 8.5 W/m2 Extension Forcing', 'Impose RCP8.5 extension forcing. Emissions are reduced linearly starting in 2100 to less than 10 GtCO2/yr in 2250, a level that is estimated to produce equilibrated radiative forcing at a high level (around 14 W/m2) over the period 2200-2300.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399560, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '03ff3a6f-25f0-4849-b9a3-693da4a0ab75', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Forcing Excluding Solar and Aerosols', 'preIndForcingExclSolAer', NULL, 'Pre-industrial forcing, excluding aerosols and solar', 'Pre-Industrial forcing excluding aerosols and solar.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399561, 'cmip6', '<gmmip>', '--', 'cim.2.designing.NumericalExperiment', 'e656bd37-f799-4e53-9551-fb7e34419319', 1, '2020-11-17 01:19:05.639745', true, 'hist-resIPO', 'hist-resIPO', NULL, 'initialized from "historical" run year 1870 and SSTs in tropical lobe of the IPO domain (20degS-20degN, 175degE-75degW) restored to AMIP SSTs with historical forcings', 'Pacemaker 20th century historical run that includes all forcings as used in CMIP6 historical simulation.
INSERT INTO docs.tbl_document VALUES (399562, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'f03d6116-db47-49bc-93dd-6171dc856720', 1, '2020-11-17 01:19:05.639745', true, 'Last Inter-Glacial WMGHG', 'LIGWMGHG', NULL, 'Atmospheric concentrations of well-mixed greenhouse gases for the Last Interglacial', 'Impose Last Interglacial (127 kyr ago) atmospheric concentrations of well-mixed greenhouse gases.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399563, 'cmip6', NULL, '--', 'cim.2.designing.Project', 'f83db5ce-af53-4c2e-8cf8-ff4f38e49c3d', 1, '2020-11-17 01:19:05.639745', true, 'CMIP', 'cmip', NULL, 'Climate Model Intercomparison Project', 'Core experiments for the Climate Model Intercomparison Project.  CMIP includes the DECK (Diagnosis, Evaluation, and Characterization of Klima (Climate)) experiments:  1pctCO2, abrupt-4xCO2, amip, piControl and esm-piControl. CMIP also includes the historical experiments: historical, esm-hist, historical-ext, esm-hist-ext.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399564, 'cmip6', '<aerchemmip>,<cmip>,<deck>,<geomip>,<highresmip>,<ismip6>', '--', 'cim.2.designing.NumericalExperiment', 'b67e8d2f-93fc-41d9-91d8-420eac7b0052', 1, '2020-11-17 01:19:05.639745', true, 'abrupt-4xCO2', 'abrupt-4xCO2', NULL, 'Abrupt quadrupling of the atmospheric concentration of carbon dioxide', 'Impose an instantaneous quadrupling of the concentration of atmospheric carbon dioxide from the global annual mean 1850 value, then hold fixed.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399565, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'bdc54ce1-adc2-4992-87c9-3c797eb725f7', 1, '2020-11-17 01:19:05.639745', true, 'rad-pd-piCO2', 'rad-pd-piCO2', NULL, 'RFMIP-IRF', 'Offline radiative transfer calculations of vertically-resolved broadband-integrated longwave and shortwave fluxes for present-day (2015) clear sky (aerosol-free) conditions with present day (2015) greenhouse gas concentrations and pre-industrial carbon dioxide (CO2). Use specified atmospheric distributions of present day temperature and humidity and surface properties over many profiles.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399566, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', 'a5cca357-46d4-4abb-9767-bb421432ed05', 1, '2020-11-17 01:19:05.639745', true, 'piClim-VOC', 'piClim-VOC', NULL, 'pre-industrial climatolgical SSTs and forcing, but with 2014 VOC emissions', 'Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases), pre-industrial emissions of aersols and aerosol precursors, present day (2014) emissions of CO/VOC, all other emissions of tropospheric ozone precursors set to pre-industrial levels. This is a timeslice experiment of 30 years total. The model should have the capacity for interactive tropospheric chemistry.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399567, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '6e8c4c22-0663-46f4-a4ef-d7f6832542d2', 1, '2020-11-17 01:19:05.639745', true, 'Decadal Climate Prediction Project Homepage', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399568, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '81a9848d-d45e-4aba-9fd5-2f772cc169c4', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP pre-industrial SST climatology', 'PAMIP-pi-SST-clim', NULL, 'PAMIP monthly mean climatology of pre-industrial sea surface temperature', 'Pre-industrial monthly mean cimatology of sea surface temperatue, data computed from the ensemble of CMIP5 simulations by PAMIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399569, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '868d753b-7fa7-4617-ab91-5fde9eab3373', 1, '2020-11-17 01:19:05.639745', true, 'The Detection and Attribution Model Intercomparison Project (DAMIP v1.0) contribution to CMIP6', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399570, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '9b294866-b843-4056-9591-212da73ad9d0', 1, '2020-11-17 01:19:05.639745', true, 'abrupt +4 percent Solar', 'abruptp4pcSol', NULL, 'Abrupt increase in solar constant of 4 percent', 'Impose an abrupt 4% increase in the solar constant', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399571, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e8deaf53-162d-42ec-8840-07f7ea514f80', 1, '2020-11-17 01:19:05.639745', true, 'RCP19 Well Mixed GHG', 'RCP19wmGHG', NULL, 'Representative Concentration Pathway 1.9 Well Mixed Greenhouse Gases', 'Impose changing concentrations of RCP 1.9 long-lived greenhouse gases including CO2, N2O and halogenated gases.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399574, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '6bbd43ec-8c00-4876-a05f-0af3edb03464', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP future Antarctic SIC', 'PAMIP-fut-ant-SIC-clim', NULL, 'PAMIP monthly mean climatology of future Antarctic sea ice concentration', 'Future monthly mean cimatology of antarctic sea ice concentration, data provided by PAMIP. When used in coupled models it is recommended to constrain sea ice by nudging but with a weak relaxation timescale of 2 months. However, appropriately calibrated long-wave fluxes applied to the sea ice model may also be used.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399579, 'cmip6', '<lumip>', '--', 'cim.2.designing.NumericalExperiment', '6b98a9d0-d1da-499a-9f28-600c62b698ff', 1, '2020-11-17 01:19:05.639745', true, 'land-crop-noIrrigFert', 'land-crop-noIrrigFert', NULL, 'historical land-only with no irrigation and no fertilisation', 'Land surface model simulation.  Same as land-hist except irrigated area and fertiliser area/use should be held constant at 1850 levels.  Irrigation amounts within the 1850 irrigated area are allowed to change.  Only relevant if land-hist utilises at least some form of crop management (e.g. planting and harvesting).  Start year either 1850 or 1700 depending on standard practice for particular model.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399580, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'f68f06f6-dd53-440e-aa06-a9ffd36f8298', 1, '2020-11-17 01:19:05.639745', true, '2014 GHG pi N2O', '2014GHGpiN2O', NULL, '2014 greenhouse gas concentrations with pre-industrial nitrous oxide', 'Impose present day (2014) greenhouse gas concentrations with nitrous oxide (N2O) set to it''s pre-industrial value.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399581, 'cmip6', '<c4mip>', '--', 'cim.2.designing.NumericalExperiment', '46c40a57-532f-42d0-8dab-e1c1ced91f25', 1, '2020-11-17 01:19:05.639745', true, 'ssp534-over-bgc', 'ssp534-over-bgc', NULL, 'biogeochemically-coupled version of the RCP3.4 overshoot scenario branching from SSP58.5', 'Biogeochemically-coupled version of the mitigated overshoot scenario with medium/low radiative forcing by the end of the 21st century.  The scenario follows SSP5-8.5, an unmitigated baseline scenario, through 2040, and then substantially negative net emissions thereafter.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399582, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '56762430-820c-4d77-884e-a7970489bf43', 1, '2020-11-17 01:19:05.639745', true, 'RCP85RCP34', 'rcp85rcp34', NULL, 'Two Scenario Ensemble of RCP8.5 and RCP23.4', 'A two member forcing scenario with simulations forced with ScenarioMIP forcings RCP8.5 and RCP3.4 for LS3MIP land surface models', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399583, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'f33306eb-493b-4d88-b8e5-c507473daeca', 1, '2020-11-17 01:19:05.639745', true, '2101-2300 200yrs min', '200yrs2101-2300', NULL, '2101/01/01-2300/12/31 minimum', 'Run from 2101 to 2300.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399584, 'cmip6', NULL, '--', 'cim.2.shared.Party', '20ddaaa1-0163-4850-bae5-4b30d4105b75', 1, '2020-11-17 01:19:05.639745', true, 'Karsten Peters', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399585, 'cmip6', NULL, '--', 'cim.2.shared.Party', '87564fae-e6a1-4983-a676-3188e8167284', 1, '2020-11-17 01:19:05.639745', true, 'Claire Granier', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399586, 'cmip6', '<dcpp>', '--', 'cim.2.designing.NumericalExperiment', '8e43c3f3-72b0-406f-96eb-01a751f13500', 1, '2020-11-17 01:19:05.639745', true, 'dcppC-amv-Trop-neg', 'dcppC-amv-Trop-neg', 'C1.8', 'idealised negative tropical AMV anomaly pattern', 'Restore the tropical north Atlantic sea surface temperature to negative Atlantic Multidecadal Variability (AMV) perturbation. Outside the restored region the model evolves freely allowing full climate system response. No interannual changes in external forcing. Time period: 10 years. 25 ensemble members. SST signal may also be imposed by altering surface fluxes.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399587, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '9553b808-1974-49b2-ad5c-93dffa283c80', 1, '2020-11-17 01:19:05.639745', true, 'LS3MIP (v1.0) contribution to CMIP6: the Land Surface, Snow and Soil moisture Model Intercomparison Project – aims, setup and expected outcome', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399588, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '4a1de94a-a973-49a0-8fe6-833a3197a25b', 1, '2020-11-17 01:19:05.639745', true, 'Alternative Historical Volcano', 'altHistVol', NULL, 'Alternative historical volcanic  forcing', 'Alternative estimate of historical volcanic forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399589, 'cmip6', '<ismip6>', '--', 'cim.2.designing.NumericalExperiment', '7048c0d0-b0d4-4a91-aa17-320884e49341', 1, '2020-11-17 01:19:05.639745', true, 'ism-lig127k-std', 'ism-lig127k-std', NULL, 'offline ice sheet model forced by ISMIP6-specified AGCM last interglacial output', 'Stand alone ice sheet model driven offline by ISMIP6 CMIP6 standard input for the PMIP4 Last Interglacial experiment, lig124k.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399590, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '4083440a-c54e-4663-a60f-0e2997e14d9a', 1, '2020-11-17 01:19:05.639745', true, '1850 non-OC Aerosol Precursor Emissions', '1850nonOCAerPre', NULL, '1850 Emissions of Aerosol Precursors Excluding Organic Carbon', 'Impose pre-industrial (1850) emissions of aerosol precursors excluding organic carbon (OC).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399591, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '3f612888-09a3-48f5-a7c2-f9686cb1fb58', 1, '2020-11-17 01:19:05.639745', true, '1950s Stratospheric H2O Concentrations', '1950sStratosphericH2OConcentrations', NULL, '1950s Stratospheric Water Vapour Concentrations Climatology', '1950s (10 year) climatology of stratospheric water vapour concentration data.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399592, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '154ab8f3-5b05-433f-ab38-506a8a1c83a2', 1, '2020-11-17 01:19:05.639745', true, '10MemberMin-IC', 'Min10Member-IC', NULL, 'Minimum 10 member initial condition ensemble', 'As large an ensemble as possible with a minimum of 10 members using initial condition (not PPE) ensemble technique. Model-by-model choice how to arrive at perturbed initial conditions.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399593, 'cmip6', '<cdrmip>', '--', 'cim.2.designing.NumericalExperiment', '9a8c1b8d-5250-47c4-9e47-d1c1e191e759', 1, '2020-11-17 01:19:05.639745', true, 'esm-pi-CO2pulse', 'esm-pi-CO2pulse', 'CDR-pi-pulse', 'pulse addition of 100 Gt carbon to pre-industrial atmosphere', 'An esm-piControl but with 100 Gt C instantaneously (within 1 timestep) added to the atmosphere.  If models have CO2 spatially distributed throughout the atmosphere the CO2 the addition should happen in a uniform manner. The CO2 concentration is calculated (i.e. freely evolving). After the posative pulse, ESMs should continue the run for at least 100 years, while EMICs (Earth System Models of Intermediate Complexity) and box models are encouraged to continue the run for at least 1000 years (max 5000 years).  Additional ensemble members are requested with tier 2 priority.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399594, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', 'e1371d89-798c-462c-acbe-ea7c3c472e86', 1, '2020-11-17 01:19:05.639745', true, 'ssp370SST-lowO3', 'ssp370SST-lowO3', NULL, 'SSP3-7.0, prescribed SSTs, with low ozone precursor emissions', 'SSP-based RCP scenario following approximately RCP7.0 global forcing pathway but with reduced tropospheric ozone precursors (not methane). SSP3 socioeconomic conditions. Atmosphere only with SST from experiment SSP3-70. The model should have the capacity for interactive tropospheric chemistry.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399595, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', '4ebf90c2-9d56-4417-bbe2-1d9922d3654f', 1, '2020-11-17 01:19:05.639745', true, 'hist-piAer', 'hist-piAer', NULL, 'historical forcing, but with pre-industrial aerosol emissions', 'Historical WMGHG and Halocarbon concentrations.  Historical ozone precursor emissions (e.g. NOx).  Aerosols and aerosol precursors fixed at 1850 emission levels.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399596, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '538a9041-ce64-46af-b2a3-d4eeb7a62e0f', 1, '2020-11-17 01:19:05.639745', true, '2015-2049  35yrs', '35yrs2015-2049', NULL, '2015/01/01-2050/01/01', 'Scenario, from 2015 to the mid 21st century.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399597, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd9963592-1687-47e3-9cbf-89c6038b9843', 1, '2020-11-17 01:19:05.639745', true, 'RCP45 Aerosols', 'RCP45aer', NULL, 'Representative Concentration Pathway 4.5 Aerosols', 'Impose changing emissions of RCP4.5 aerosols including BC and OC.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399598, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '120ace2f-78c6-45fc-9600-7b078afff55f', 1, '2020-11-17 01:19:05.639745', true, 'SSP5 RCP34 overshoot emissions', 'rcp34overEmissions', NULL, 'Representative Concentration Pathway 3.4 W/m2 Overshoot  Forcing for Shared Socioeconomic Pathway 5', 'Impose RCP3.4 overshoot emissions.  Beginning in 2040, reduce emissions from the 8.5 W/m2 pathway to 3.4 W/m2 by 2100.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399599, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'ba6ad29e-4798-4b7d-82fb-932a81bc885b', 1, '2020-11-17 01:19:05.639745', true, 'SSP4 RCP34 Land Use', 'RCP34land', NULL, 'Representative Concentration Pathway 3.4 Land Use for Shared Socioeconomic Pathway 4', 'Impose changing RCP3.4 land use including crops, pasture, urban area, vegetation and forest for SSP4.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399600, 'cmip6', '<lumip>', '--', 'cim.2.designing.NumericalExperiment', 'e9e51e5a-a8b1-49f5-b043-ab4a1542143d', 1, '2020-11-17 01:19:05.639745', true, 'land-noLu', 'land-noLu', NULL, 'historical land-only with no land-use change', 'Land surface model simulation. Historical forcing with land use held constant at 1850. Same as land-hist except no land use change.  Include representation of land cover, land use and land management. All applicable land use features should be active. Forced with historical observed climate. Include transient CO2, Nitrogen deposition, aerosol deposition etc. Start year either 1850 or 1700 depending on standard practice for particular model. This experiment is shared with the LS3MIP, note that LS3MIP expects the start year to be 1850.   
INSERT INTO docs.tbl_document VALUES (399601, 'cmip6', NULL, '--', 'cim.2.shared.Party', '907efb4d-7000-4bc7-8973-fdc0eba19939', 1, '2020-11-17 01:19:05.639745', true, 'Eric Larour', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399602, 'cmip6', '<c4mip>', '--', 'cim.2.designing.NumericalExperiment', 'b1f4350d-4f3a-4953-8c39-9f11b70d0dfa', 1, '2020-11-17 01:19:05.639745', true, 'ssp585-bgc', 'ssp585-bgc', NULL, 'biogeochemically-coupled version of the updated emission-driven RCP8.5 based on SSP5', 'SSP-based RCP scenario with high radiative forcing by the end of century. Following approximately RCP8.5 global forcing pathway with SSP5 socioeconomic conditions. Concentration-driven.  Radiative effects of CO2 disabled - i.e. the radiation code is fed the time-invariant CO2 concentration from the control run.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399603, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'eaf1ba2f-3c34-414b-b62e-fc4857ccc2fa', 1, '2020-11-17 01:19:05.639745', true, 'amip SST plus patterned anomaly derived from 4xCO2 - piControl SST change', 'amipPatternedSST4xCO2piControlDiff', NULL, 'amip sea surface temperature plus patterned SST anomaly derived from 4xCO2 - piControl SST change', 'A patterned SST anomaly is applied on top of the monthly-varying amip SSTs. This anomaly is a monthly climatology, taken from each model''s own abrupt 4xCO2 run minus piControl (using the mean of years 111-140 of abrupt4xCO2, and the parallel 30 year section of piControl).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399604, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '5908f31c-ede7-4899-9355-8ac4757545f5', 1, '2020-11-17 01:19:05.639745', true, '2040esm-ssp585Init', '2040esm-ssp585Init', NULL, 'Initialisation from year 2040 of the esm-ssp585 simulation', 'Initialisation from esm-ssp585 simulation at the beginning of year 2040.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399605, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'a96dc720-d5bf-42ea-a1f9-20378590fda9', 1, '2020-11-17 01:19:05.639745', true, '1991-2000 10yrs', '10yrs1991-2000', NULL, '1990/12/31-2000/12/31', 'Pinatubo historical.  Start date on or before 31st December 1990.  Start dates on or before 15th November recommended to allow for DJF seasonal forecast results. Run for 10 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399606, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'b1c93b7c-9ed5-4567-a42e-23029c71d94d', 1, '2020-11-17 01:19:05.639745', true, '1950s Solar Forcing', '1950sSolarForcing', NULL, '1950s Solar Forcing Climatology', '1950s (10 year) climatology of solar forcing of the Earth system consistent with historical observations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399607, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '6be0f997-185b-4eb2-9224-8014ab2b0fc1', 1, '2020-11-17 01:19:05.639745', true, 'past1000 WMGHG', 'past1000WMGHG', NULL, 'Atmospheric concentrations of well-mixed greenhouse gases in the last millennium', 'Atmospheric concentrations of well-mixed green house gas concentrations in the last millennium 850-1850.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399608, 'cmip6', '<damip>', '--', 'cim.2.designing.NumericalExperiment', '1a49af3c-b478-4d52-8019-10d189068902', 1, '2020-11-17 01:19:05.639745', true, 'ssp245-cov-GHG', 'ssp245-cov-GHG', NULL, '2-year Covid-19 emissions blip including well mixed GHG only, based upon ssp245', 'Detection and attribution experiment: well-mixed GHG-only run based on ssp245-covid, with 2-year perturbation to emissions for 2020 and 2021 due to Covid-19 pandemic restrictions. Concentration-driven. Branch from ssp245 at 1 Jan 2020.  Near-term impact simulations run for 5 years with a minimum of 10 ensemble members. Longer-term impact of recovery scenarios to be run for 30 years with 10 ensemble members if possible.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399609, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd9ca34ea-7add-471e-8c8d-24d57f0a02de', 1, '2020-11-17 01:19:05.639745', true, 'Historical Solar Irradiance Forcing', 'HistoricalSolarIrradiance', NULL, 'Historical Solar Irradiance Forcing', 'The standard solar forcing dataset recommended for usage is the solar reference scenario dataset which consists of historical reconstructions (1850-2014).  Includes total solar irradiance, F10.7 cm solar radio flux, and spectral solar irradiance for 10-100000 nm range.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399610, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '1f295d22-c681-4c03-b8d5-9bb9a083f2ea', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP pre-industrial Antarctic SIC', 'PAMIP-pi-ant-SIC-clim', NULL, 'PAMIP monthly mean climatology of pre-industrial Antarctic sea ice concentration', 'Pre-industrial monthly mean cimatology of antarctic sea ice concentration, data provided by PAMIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399611, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'a0a9378a-0461-4289-98c1-7132ea872172', 1, '2020-11-17 01:19:05.639745', true, 'RCP85 Aerosol Emissions', 'RCP85aerEm', NULL, 'Representative Concentration Pathway 8.5 Aerosol Emissions', 'Impose changing emissions of RCP8.5 aerosols.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399612, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'fffa4181-b747-492c-86b8-3caf83a24d43', 1, '2020-11-17 01:19:05.639745', true, 'Historical Electron Forcing 1950s', 'HistoricalElectronForcing1950s', NULL, 'Historical Electron Forcing 1950s climatology', '1950s (10 year) climatology of solar forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399613, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'eebf60d3-f2d0-4aee-a02d-ba828e3efcec', 1, '2020-11-17 01:19:05.639745', true, '2014 Aerosols', '2014Aerosols', NULL, '2014 aerosols', 'Impose present day (2014) aerosol concentrations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399614, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '023cf8a2-d1a0-420e-a925-8bb323ef2e95', 1, '2020-11-17 01:19:05.639745', true, 'Ozone and stratospheric water vapour concentration databases for CMIP6', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399648, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b0b1226d-1060-4cc3-82c7-6320c2bbbc18', 1, '2020-11-17 01:19:05.639745', true, 'AMIP SST minus uniform 4K', 'uniformSSTm4K', NULL, 'Uniform minus 4K to AMIP  Sea Surface Temperature', 'AMIP sea surface temperature boundary conditions derived from observational data, minus uniform 4K.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399675, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e2d4e3ba-a458-4ef4-9503-74f15c9e1e0f', 1, '2020-11-17 01:19:05.639745', true, '1850 Aerosol Precursor Emissions', '1850AerosolPre', NULL, '1850 Emissions of Aerosol Precursors', 'Impose pre-industrial (1850) emissions of aerosol precursors.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399679, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '04ba2229-ee92-45b7-b60b-541c8e437aaa', 1, '2020-11-17 01:19:05.639745', true, '2014 O3', '2014O3', NULL, '2014 ozone', 'Impose present day (2014) ozone.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399680, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'f154fcac-ca5c-4799-8656-59dd97ede62e', 1, '2020-11-17 01:19:05.639745', true, 'RCP85 Aerosol Precursor Emissions', 'RCP85aerpreEm', NULL, 'Representative Concentration Pathway 8.5 Aerosol Precursor Emissions', 'Impose changing emissions of RCP8.5 aerosol precursors.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399615, 'cmip6', '<ismip6>', '--', 'cim.2.designing.NumericalExperiment', '30142856-0a60-4936-a22d-335fab2bf53f', 1, '2020-11-17 01:19:05.639745', true, 'ism-asmb-std', 'ism-asmb-std', NULL, 'offline ice sheet forced by initMIP synthetic atmospheric experiment', 'InitMIP surface mass balance (SMB) anomaly experiment. Apply a prescribed SMB anomaly, provided by ISMIP6,  which mimics the expected SMB change from the end of the 20th century to the end of the 21st century. All other model parameters and forcings are the same as those used for initialization.
INSERT INTO docs.tbl_document VALUES (399616, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'c412539b-787e-4a1a-8195-353de306b6ba', 1, '2020-11-17 01:19:05.639745', true, '1963-1972 10yrs', '10yrs1963-1972', NULL, '1962/12/31-1972/12/31', 'Agung historical.  Start date on or before 31st December 1962.  Start dates on or before 15th November recommended to allow for DJF seasonal forecast results. Run for 10 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399617, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '9ffa11c9-6447-4d46-a320-6e36f7b25dae', 1, '2020-11-17 01:19:05.639745', true, '2010 Stratospheric H2O Concentrations', '2010StratosphericH2OConcentrations', NULL, '2010 Stratospheric Water Vapour Concentrations', 'Apply 2010 stratospheric water vapour concentrations from the stratospheric water vapour concentration database.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399618, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '7381cc84-e556-4d9a-9ec2-10ebaefc6880', 1, '2020-11-17 01:19:05.639745', true, 'TenMember', 'TenMemberEnsemble', NULL, 'Ten Member Ensemble', 'An ensemble of at least ten simulations', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399619, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'b31223d3-150c-4486-a64a-3d2f65c2bee3', 1, '2020-11-17 01:19:05.639745', true, '2070-7019 4950yrs max', '4950yrs2070-7019max', NULL, '2070/01/01-7019/12/31 maximum', 'Run from 2070 for a maximum of 4950 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399620, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '5e81e891-dc80-42d3-816c-73f9225391ed', 1, '2020-11-17 01:19:05.639745', true, '2015 Aerosol Forcing', '2015AerosolForcing', NULL, '2015 Aerosol Forcing', '2015 Mass mixing ratio fields at 1x1 degree resolution for main aerosol components (sulphate, black carbon, organic carbon, nitrate, sea salt, mineral dust),  along with effective radius per species.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399621, 'cmip6', '<aerchemmip>,<c4mip>,<cdrmip>,<cmip>,<damip>,<dcpp>,<deck>,<fafmip>,<geomip>,<highresmip>,<ismip6>,<lumip>,<pmip>,<rfmip>,<volmip>', '--', 'cim.2.designing.NumericalExperiment', '7dd72de5-c5b6-412c-9b4c-540f09538d9a', 1, '2020-11-17 01:19:05.639745', true, 'piControl', 'piControl', NULL, 'Pre-Industrial Control', 'A pre-industrial control simulation with non-evolving pre-industrial conditions. Conditions chosen to be representative of the period prior to the onset of large-scale industrialization, with 1850 being the reference year.  The piControl starts after an initial climate spin-up, during which the climate begins to come into balance with the forcing. The recommended minimum length for the piControl is 500 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399622, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', 'd4219a8e-4d64-40f4-886f-aa05f0972316', 1, '2020-11-17 01:19:05.639745', true, 'pa-piArcSIC', 'pa-piArcSIC', '2.2', 'Partially-coupled time slice constrained by pre-industrial Arctic SIC', 'Coupled ocean-atmosphere time slice experiment forced by climatological monthly mean sea surface temperature (SST) for the present day and pre-industrial Actic sea ice concentration (SIC). Sea ice concentration to be nudged into coupled model with a relaxation time-scale of 1 day. Radiative forcing to be set to present day (year 2000) levels.  Initial conditions for coupled model experiments to be taken from year 2000 of coupled model CMIP6 historical simulations. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399623, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '284e4436-d803-480e-9a03-d0fa89547b47', 1, '2020-11-17 01:19:05.639745', true, 'abrupt-4xCO2 SST', 'abrupt4xCO2SST', NULL, 'Monthly-varying sea surface temperatures from the abrupt4xCO2 simulation', 'Monthly-varying sea surface temperature from years 111 to 140 of the abrupt-4xCO2 simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399624, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'f26fd0d2-3944-489e-981c-cad45abc7040', 1, '2020-11-17 01:19:05.639745', true, '1850 CO2 for Radiation', '1850CO2Radiation', NULL, '1850 carbon dioxide concentration only affects radiative code.', 'Impose repeating 1850 carbon dioxide (CO2) concentrations to radiative code.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399649, 'cmip6', '<pmip>', '--', 'cim.2.designing.NumericalExperiment', '4bf8122f-7e14-4fd6-84e3-b9ea20e07eb3', 1, '2020-11-17 01:19:05.639745', true, 'lig127k', 'lig127k', NULL, 'last interglacial (127k)', 'Impose Last Interglacial (127 kyr ago) boundary conditions for the atmospheric concentration of well-mixed greenhouse gases and orbital parameters.  Run for at least 100 years after spin-up. It is mandatory that the model versions used for the PMIP-CMIP6 experiments are the exactly the same as for the other CMIP6 experiments, in particular the DECK and historical simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399650, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'f15906d1-9151-4aa1-93d9-b1019c90949f', 1, '2020-11-17 01:19:05.639745', true, '1950s Ocean Initialisation', '1950sOceanInitialisation', NULL, 'Ocean initialisation from the EN4 ocean analysis', 'Initial ocean conditions are taken from the EN4 (Good et al, 2013) ocean analysis over an average period of 1950-1954.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399651, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '86977056-14e5-410f-9e84-7a774a34fc91', 1, '2020-11-17 01:19:05.639745', true, '1979-2014 36yrs', '36yrs1979-2014', NULL, '1979/01/01-2015/01/01', 'Historical, Recent past, since satellite observations have been available', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399652, 'cmip6', '<scenariomip>', '--', 'cim.2.designing.NumericalExperiment', '63021e70-a9df-4c29-b8af-0a40168a771e', 1, '2020-11-17 01:19:05.639745', true, 'ssp534-over', 'ssp534-over', NULL, 'RCP3.4 overshoot scenario branching from SSP58.5', 'Gap-filling mitigated overshoot scenario with medium/low radiative forcing by the end of the 21st century.  The scenario follows SSP5-8.5, an unmitigated baseline scenario, through 2040, and then substantially negative net emissions thereafter.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399653, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '0f64bd7d-4407-45c1-bfec-92b900937f8d', 1, '2020-11-17 01:19:05.639745', true, 'LIG Astronomical Parameters', 'LIGAstroParams', NULL, 'Astronomical parameters for the Last Interglacial', 'Impose Last Interglacial (127 kyr ago) orbital astronomical parameters.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399654, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '695c1713-ce10-4595-aaf1-a63dd2cc5901', 1, '2020-11-17 01:19:05.639745', true, 'Last Glacial Maximum WMGHG', 'LGMWMGHG', NULL, 'Atmospheric concentrations of well-mixed greenhouse gases for the Last Glacial Maximum', 'Impose Last Glacial Maximum (21 kyr ago) atmospheric concentrations of well-mixed greenhouse gases.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399676, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '69df5073-8a7f-4cb5-8a8a-d39c527eb3a0', 1, '2020-11-17 01:19:05.639745', true, 'CORE-II Momentum Flux', 'core2MomentumFlux', NULL, 'CORE-II air-sea momentum flux', 'CORE-II air–sea momentum flux, covers the 62-year period from 1948-2009.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399681, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', '6594e679-b6ba-4cb6-a0b9-eaa4c17fdab8', 1, '2020-11-17 01:19:05.639745', true, 'piClim-NTCF', 'piClim-NTCF', NULL, 'pre-industrial climatolgical SSTs and forcing, but with 2014 NTCF emissions', 'Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases) and present day (2014) emissions of NTCF (near-term climate forcers). This is a timeslice experiment of 30 years total.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399625, 'cmip6', '<lumip>', '--', 'cim.2.designing.NumericalExperiment', '369fd0f0-7f64-4b79-8442-d1e84f609274', 1, '2020-11-17 01:19:05.639745', true, 'land-hist-altStartYear', 'land-hist-altStartYear', NULL, 'historical land-only alternate start year', 'Land surface model simulation. Same as land-hist except starting from either 1700 (for models that typically start in 1850) or 1850 (for models that typically start in 1700).   Use the same land model configuration as used in the coupled CMIP6 historical simulations. Include representation of land cover, land use and land management. All applicable land use features should be active.  Forced with historical observed climate. Include transient CO2, Nitrogen deposition, aerosol deposition and population density. 
INSERT INTO docs.tbl_document VALUES (399626, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c6617474-3432-44e2-9549-af465a3a6713', 1, '2020-11-17 01:19:05.639745', true, 'ssp245-cov-aer Well Mixed GHG', 'ssp245-cov-aerWMGHG', NULL, 'ssp245-cov-aer Well Mixed Greenhouse Gases', 'Monthly concentrations of ssp245-cov-aer well mixed greenhouse gases (WMGHG): CO2, CH4 and N2O.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399627, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'aec65a64-d8ed-449c-a0b1-5dc3953678fb', 1, '2020-11-17 01:19:05.639745', true, 'RCP Natural', 'RCPNat', NULL, 'Representative Concentration Pathway Natural Forcing', 'Impose changing natural forcing for RCP scenarios i.e. solar irradiance change and volcanic activity.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399628, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c17d9ae4-8f32-402b-81b8-cc70a52405e9', 1, '2020-11-17 01:19:05.639745', true, 'Present Day 2014 Proton Forcing', 'PD2014ProtonForcing', NULL, 'Present Day 2014 Proton Forcing', 'Present day (2014) proton forcing. Include HOx and NOx productions by solar protons in models with interactive stratospheric chemistry by using the daily ionization data available from the SOLARIS-HEPPA website.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399629, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '410bd1a2-d2aa-41a2-9d16-868109e144ca', 1, '2020-11-17 01:19:05.639745', true, 'RCP26-extension Aerosols', 'RCP26extaer', NULL, 'Representative Concentration Pathway 2.6 Extension Aerosols', 'Impose changing emissions of RCP2.6 extension aerosols including BC and OC.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399630, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '63fc4fab-9842-4b81-ba3a-0c7fff249bc0', 1, '2020-11-17 01:19:05.639745', true, 'SSP1-26Initialisation', 'ssp1-26Initialisation', NULL, 'SSP1-2.6 Initialisation', 'Initialisation is from the end of the SSP1-2.6 experiment.  To provide continuity between the 21st century portion of the SSP1-2.6  experiment and it''s extension to 2300.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399631, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'e59d13fe-84e8-44f5-a6ef-5dc9273559c8', 1, '2020-11-17 01:19:05.639745', true, 'HistoricalISMInitialisation', 'historicalISMInitialisation', NULL, 'Initialisation from the historical simulation with interactive ice sheets', 'Initialisation is from the end of an historical simulation with interactive ice sheets', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399632, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '4b4f7a88-9964-4773-8fd2-62e37856c8ef', 1, '2020-11-17 01:19:05.639745', true, '2010 Non-CO2 Well Mixed GHG', '2010WmGHG', NULL, '2010 Non-CO2 Well Mixed GHG', 'Global annual mean 2010 concentrations for non-CO2 long-lived greenhouse-gases, including CH4, N2O, HFCs, PFCs, SF6, several ODS, and NF3 to serve as input for the CMIP6 Historical simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399633, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd71e0e7f-a898-4d89-aea2-fe95e9f7924f', 1, '2020-11-17 01:19:05.639745', true, 'RCP70 Tropospheric Ozone Precursors', 'RCP70O3pre', NULL, 'RCP7.0 Tropospheric ozone precursors', 'Impose changing concentrations of RCP7.0 tropospheric ozone precursors.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399634, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'b6c8213b-0cec-451c-9092-75166bd4a5f0', 1, '2020-11-17 01:19:05.639745', true, '2014 GHG pi HFC', '2014GHGpiHFC', NULL, '2014 greenhouse gas concentrations with pre-industrial HFC', 'Impose present day (2014) greenhouse gas concentrations with hydrofluorocarbons (HFCs) set to pre-industrial values.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399635, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'd233708a-6f20-4fbf-8862-cbfd503dcab1', 1, '2020-11-17 01:19:05.639745', true, 'C4MIP mailing list', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399636, 'cmip6', '<ismip6>', '--', 'cim.2.designing.NumericalExperiment', 'f6498b0f-9cf8-4f83-a372-f756896a4e50', 1, '2020-11-17 01:19:05.639745', true, 'ism-ssp585-std', 'ism-ssp585-std', NULL, 'offline ice sheet model forced by ISMIP6-specified AOGCM ssp585 output', 'Stand alone ice sheet model driven offline by ISMIP6 CMIP6 standard input for the SSP5-85 climate forcing scenario.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399637, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '8e9c0caa-d534-4e26-86b1-98bae932c97d', 1, '2020-11-17 01:19:05.639745', true, 'ESMHistoricalInitialisation', 'ESMHistoricalInitialisation', NULL, 'ESM Historical Initialisation', 'Initialisation is from the end of the esm-hist experiment.  To provide continuity between simulations of the recent past and  future scenario simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399638, 'cmip6', '<rfmip>', '--', 'cim.2.designing.NumericalExperiment', '94b9a982-bb53-4615-ae1b-fcae2641025b', 1, '2020-11-17 01:19:05.639745', true, 'hist-spAer-aer', 'hist-spAer-aer', 'RFMIP-SpAer-aer', 'historical simulations with specified anthropogenic aerosols, no other forcings', 'A historical (1850-2014) experiment using a coupled AOGCM in which aerosol optical properties including cloud-radiation interactions are prescribed by RFMIP.  Aerosol forcings to be consistent with the historical forcing used in the DAMIP experiments. Only to be performed by models who are also running simulations for DAMIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399639, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '1d70e7eb-c726-4611-a4c1-6835b01c73d9', 1, '2020-11-17 01:19:05.639745', true, 'Alternative Historical Aerosols', 'altHistAer', NULL, 'Alternative historical aerosol forcing', 'Alternative estimation of historical aerosol forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399640, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '7111ba5a-0e65-40ea-b623-4d53d66a2e73', 1, '2020-11-17 01:19:05.639745', true, 'OMIP Inert Chemical Tracers', 'OMIPinertChemicalTracers', NULL, 'OMIP inert chemical tracers', 'Online simulation of CFC11, CFC12 and CF6 inert chemical tracers.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399641, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '4ae039d7-6905-4021-a536-1c9d5e9953d2', 1, '2020-11-17 01:19:05.639745', true, 'High Res HadISST2.2', 'HighResHadISST2.2', NULL, 'High resolution HadISST data version 2.2', 'Force with the high resolution (0.25 degree) daily HadISST2.2  sea surface temperature (SST) and sea ice concentration (SIC) data set.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399642, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '4002a9ab-17b5-472b-86d3-c49a73b68bc8', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Forcing', 'piForcing', NULL, 'Pre-industrial forcing', 'Pre-Industrial forcing', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399643, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '7244f7d5-0faa-4217-96bf-1470dc465a66', 1, '2020-11-17 01:19:05.639745', true, 'SSP5-85Initialisation', 'ssp5-85Initialisation', NULL, 'SSP5-8.5 Initialisation', 'Initialisation is from the end of the SSP5-8.5 experiment.  To provide continuity between the 21st century portion of the SSP5-8.5 experiment and it''s extension to 2300.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399644, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '1753a74e-8bb2-4c09-ab50-9cdd702f6a92', 1, '2020-11-17 01:19:05.639745', true, 'JRA-55 based surface dataset for driving ocean-sea-ice models (JRA55-do)', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399645, 'cmip6', NULL, '--', 'cim.2.shared.Party', '7179f6a4-208c-4465-9c03-2182edd37d6c', 1, '2020-11-17 01:19:05.639745', true, 'Naomi Vaughan', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399646, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '200e78a7-a8ff-4c87-8e03-f377a14a3caf', 1, '2020-11-17 01:19:05.639745', true, 'AMIP Sea Surface Temperature and Sea Ice Concentration Boundary Conditions', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399682, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'be9ace3c-2c84-43c3-bea5-2aa9aa83d36e', 1, '2020-11-17 01:19:05.639745', true, 'C4MIP - The Coupled Climate-Carbon Cycle Model Intercomparison Project: experimental protocol for CMIP6', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399655, 'cmip6', '<lumip>', '--', 'cim.2.designing.NumericalExperiment', '1908b12f-4c58-4752-b505-7b35a0d14936', 1, '2020-11-17 01:19:05.639745', true, 'land-cCO2', 'land-cCO2', NULL, 'historical land-only constant CO2', 'Land surface model simulation.  Same as land-hist except with CO2 held constant. Branch from end of land-hist spin-up period.  Use the same land model configuration as used in the coupled CMIP6 historical simulations. Include representation of land cover, land use and land management. All applicable land use features should be active. Start year either 1850 or 1700 depending on standard practice for particular model. 
INSERT INTO docs.tbl_document VALUES (399656, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '4b8dec71-8b26-4ba0-b59c-7a0d3f324b6a', 1, '2020-11-17 01:19:05.639745', true, 'Present Day Surface Properties', 'PDSurfaceProps', NULL, 'Present day surface properties', 'Specified surface properties for present day (2014).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399657, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '803fa6f5-55a6-4af4-a5ce-c4c2664ed0ff', 1, '2020-11-17 01:19:05.639745', true, 'VolMIP', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399658, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', '5ef18ee4-eae6-4d7c-b2eb-293217c4bdef', 1, '2020-11-17 01:19:05.639745', true, 'pa-futArcSIC', 'pa-futArcSIC', '2.3', 'Partially-coupled time slice constrained by future Arctic SIC', 'Coupled ocean-atmosphere time slice experiment forced by climatological monthly mean sea surface temperature (SST) for the present day and future Actic sea ice concentration (SIC). Sea ice concentration to be nudged into coupled model with a relaxation time-scale of 1 day. Radiative forcing to be set to present day (year 2000) levels.  Initial conditions for coupled model experiments to be taken from year 2000 of coupled model CMIP6 historical simulations. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399659, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', 'c11bf356-bdb9-4725-847a-cb297c3fb3aa', 1, '2020-11-17 01:19:05.639745', true, 'pa-futAntSIC', 'pa-futAntSIC', '2.5', 'Partially-coupled time slice constrained by future Antarctic SIC', 'Coupled ocean-atmosphere time slice experiment forced by climatological monthly mean sea surface temperature (SST) for the present day and future Antarctic sea ice concentration (SIC). Sea ice concentration to be nudged into coupled model with a relaxation time-scale of 1 day. Radiative forcing to be set to present day (year 2000) levels.  Initial conditions for coupled model experiments to be taken from year 2000 of coupled model CMIP6 historical simulations. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399660, 'cmip6', NULL, '--', 'cim.2.designing.Project', 'b2368e99-26ae-4bf5-915e-504a702b1f4f', 1, '2020-11-17 01:19:05.639745', true, 'VolMIP', 'volmip', NULL, 'Model Intercomparison Project on the climatic response to Volcanic forcing', 'VolMIP will assess to what extent responses of the coupled ocean-atmosphere system to the same applied strong volcanic forcing are robustly simulated across state-of-the-art coupled climate models and identify the causes that limit robust simulated behaviour, especially differences in their treatment of physical processes.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399661, 'cmip6', NULL, '--', 'cim.2.shared.Party', 'ea2fbcd9-6527-4d18-9522-155652febd2d', 1, '2020-11-17 01:19:05.639745', true, 'WGCM', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399662, 'cmip6', NULL, '--', 'cim.2.shared.Party', '2cea954f-bf6e-4406-895e-fe40a5a0ec23', 1, '2020-11-17 01:19:05.639745', true, 'Sophie Nowicki', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399663, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'b4fad89c-422f-4150-b5af-0aa14e43382b', 1, '2020-11-17 01:19:05.639745', true, 'Last-Millennium Additional Initialisation Ensemble', 'LastMillenniumAddInitialisationEns', NULL, 'Last millennium additional initialisation ensemble', 'Initialisations made from 1st January 1790 of additional PMIP past1000 ensemble members.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399664, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '360877ec-672d-405b-bd9d-543578abaff1', 1, '2020-11-17 01:19:05.639745', true, '3yrs', '3yrs', NULL, '3 years', 'Run for 3 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399665, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '82ea86c0-2f73-4323-b85e-9833e8696878', 1, '2020-11-17 01:19:05.639745', true, 'SSP5 RCP85 extension emissions', 'rcp85extEmissions', NULL, 'Representative Concentration Pathway 8.5 W/m2 Extension Forcing for Shared Socioeconomic Pathway 5', 'Impose RCP8.5 extension forcing. Emissions are reduced linearly starting in 2100 to less than 10 GtCO2/yr in 2250, a level that is estimated to produce equilibrated radiative forcing at a high level (around 14 W/m2) over the period 2200-2300.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399666, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'ff943cb9-313f-4fc8-b0b3-7e1144a311d2', 1, '2020-11-17 01:19:05.639745', true, 'Estimation of the future distribution of sea surface temperature and sea ice using the CMIP3 multi-model ensemble mean', NULL, NULL, NULL, '', NULL, NULL);
