INSERT INTO docs.tbl_document VALUES (399668, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '78c23f1d-b093-4672-b0e0-415380892e48', 1, '2020-11-17 01:19:05.639745', true, 'Present day radiative forcing', 'PD2000RadiativeForcing', NULL, 'Present day radiative forcing', 'Present day (2000) radiative forcing.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399669, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '86c5d08f-bb46-4fc1-bb61-ddf8b116c1d8', 1, '2020-11-17 01:19:05.639745', true, 'RCP34-overshoot Short Lived Gas Species', 'RCP34oversls', NULL, 'Representative Concentration Pathway 3.4 Overshoot Short Lived Gas Species', 'Impose changing emissions of RCP3.4 overshoot short lived gas species including CH4, NOx, VOCs and CO.  Beginning in 2040, reduce forcings from 8.5 W/m2 pathway to 3.4 W/m2 by 2100.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399670, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'aba7e6cc-519b-4365-9838-05d2cd573bb8', 1, '2020-11-17 01:19:05.639745', true, '2014 Anthropogenic GHG', '2014AnthropGHG', NULL, '2014 anthropogenic greenhouse gas concentrations', 'Impose present day (2014) anthropogenic greenhouse gas concentrations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399671, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '27ebed46-8e6d-4cb7-92dd-22e28bd2647b', 1, '2020-11-17 01:19:05.639745', true, 'InitMIP SMB anomaly', 'InitMIPSMB', NULL, 'Surface Mass Balance anomaly for the ISMIP6 InitMIP experiments', 'Apply a prescribed Surface Mass Balance (SMB) anomaly, provided by ISMIP6,  which mimics the expected SMB change from the end of the 20th century to the end of the 21st century.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399672, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'fada9c8f-adcb-4a5c-95cb-cd28db04b6c7', 1, '2020-11-17 01:19:05.639745', true, 'Future Proton Forcing', 'FutureProtonForcing', NULL, 'Future Proton Forcing', 'Include HOx and NOx productions by solar protons in models with interactive stratospheric chemistry by using the daily ionization data available from the SOLARIS-HEPPA website.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399673, 'cmip6', NULL, '--', 'cim.2.shared.Party', '45cfe753-77e4-480e-8c61-1e84ce38604b', 1, '2020-11-17 01:19:05.639745', true, 'David Williamson', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399674, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '0b63525b-b7f5-4c50-acc3-1187ce856ffd', 1, '2020-11-17 01:19:05.639745', true, 'Anthropogenic Nitrogen Deposition', 'anthropNdep', NULL, 'Time varying anthropogenic nitrogen deposition', 'Impose time varying (transient) anthropogenic nitrogen (N) deposition.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399677, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '691d767e-b90c-4e27-b2d7-499fcb4d500e', 1, '2020-11-17 01:19:05.639745', true, 'Historical Stratospheric Ozone Concentrations', 'HistoricalStratosphereO3Concentrations', NULL, 'Historical Stratospheric Ozone Concentrations', 'Impose ozone concentrations from the ozone concentration database for the stratosphere.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399678, 'cmip6', NULL, '--', 'cim.2.shared.Party', '9840a500-9446-42d6-8f5c-fe3ef5134729', 1, '2020-11-17 01:19:05.639745', true, 'Bernd Funke', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399683, 'cmip6', '<ls3mip>', '--', 'cim.2.designing.NumericalExperiment', '4d8b6ddc-cbb0-49b6-9bdb-6cbeac2a141b', 1, '2020-11-17 01:19:05.639745', true, 'lfmip-rmLC-wfdei', 'lfmip-rmLC-wfdei', NULL, 'prescribed land conditions (from running mean climatology) derived from land-hist-wfdei and initialized from "historical" run year 1980', 'Scenario forced experiment with prescribed land surface climatology derived from transient 30 year running mean from land-hist-wfdei.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399684, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'fd5e5aca-df86-44ea-9cba-42ba05bab849', 1, '2020-11-17 01:19:05.639745', true, 'OMIP Biogeochemical Tracers', 'OMIPBGCTracers', NULL, 'OMIP biogeochemical tracers', 'Simulation of biogeochemical tracers DIC and ALK.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399685, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '2777f787-9689-4800-967d-f3d98798b3eb', 1, '2020-11-17 01:19:05.639745', true, '2010 Proton Forcing', '2010ProtonForcing', NULL, '2010 Proton Forcing', '2010 proton forcing. Include HOx and NOx productios by solar protons in models with interactive stratospheric chemistry by using the daily ionization data available from the SOLARIS-HEPPA website.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399686, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '4df33507-7f0e-4749-9496-d1a32bf61e0f', 1, '2020-11-17 01:19:05.639745', true, 'Future Ozone Concentrations', 'FutureStratosphereTroposphereOzoneConcentrations', NULL, 'Future Stratosphere-Troposphere Ozone Concentrations', 'Apply ozone concentrations encompassing both the stratosphere and the troposphere from the ozone concentration database.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399687, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '7936797b-12b5-4750-a253-dfc0d020be35', 1, '2020-11-17 01:19:05.639745', true, 'SSP585-bgc-Initialisation', 'ssp585-bgc-Initialisation', NULL, 'SSP5-8.5 BGC Initialisation', 'Initialisation is from the end of the ssp585-bgc experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399688, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '20e4e392-babc-465e-a128-f3f5e5a87238', 1, '2020-11-17 01:19:05.639745', true, 'ZECMIP Protocol', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399689, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', '3349eae3-81fc-4bd0-a9fc-23cfa91d3fcd', 1, '2020-11-17 01:19:05.639745', true, 'amip-a4SST-4xCO2', 'amip-a4SST-4xCO2', NULL, 'AMIP plus warming pattern SSTs with 4xCO2', 'Same as amip, but a patterned SST anomaly is applied on top of the monthly-varying amip SSTs. This anomaly is a monthly climatology, taken from each model''s own abrupt4xCO2 run minus piControl (using the mean of years 111-140 of abrupt4xCO2, and the parallel 30-year section of piControl). CO2 is quadrupled, and the increase in CO2 is seen by both the radiation scheme and vegetation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399690, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '402f562d-7d4e-4eb1-a945-021088d954a7', 1, '2020-11-17 01:19:05.639745', true, 'Impose SST running mean N Atlantic', 'ImposeSSTrunningMeanNAtlantic', NULL, 'Impose 12-month running mean of SST in the north Atlantic', 'Alter surface fluxes to impose model climatology plus 12-month running mean anomalies of Sea Surface Temperature (SST) over the North Atlantic (10N-65N).  No SST modification if sea ice is present.  SST anomalies (1950-2014) will be provided by DCPP.  For groups that are unable to restore SSTs.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399691, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '6e061f67-1006-4c23-b0f8-b15a3d388b95', 1, '2020-11-17 01:19:05.639745', true, 'LGM Ice Sheets', 'LGMIceSheet', NULL, 'Ice sheets for the Last Glacial Maximum', 'Impose Last Glacial Maximum (21 kyr ago) ice-sheets, larger area than in the piControl.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399692, 'cmip6', '<cdrmip>', '--', 'cim.2.designing.NumericalExperiment', 'fc81fd2b-5ebd-4d33-a71d-d9ca9b34b63e', 1, '2020-11-17 01:19:05.639745', true, 'esm-ssp585-ocn-alk', 'esm-ssp585-ocn-alk', 'CDR-ocean-alk', 'emission-driven SSP5-8.5 scenario but with ocean alkalinization from year 2020 onward', 'Emission driven SSP5-8.5 scenario with ocean alkalinity forcing, optionally extending from 2100 to the year 2300. Beginning on 1 January 2020 add 0.14 Pmol total alkalinity (TA)/yr  to ice free ocean surface waters from between 70N and 60S. All other forcing is as in the esm-ssp585 experiment. Include all anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399693, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '1624c921-6392-496c-9730-1fa285de4082', 1, '2020-11-17 01:19:05.639745', true, 'All Land Management except with crop and pasture as grassland', 'allLandManagementCropPastureAsGrassland', NULL, 'All management active except treat crop and pasture as grassland in the model configuration', 'All applicable land management active in the land surface model configuration. Treat all new cropland and pastureland as unmanaged grassland.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399694, 'cmip6', '<lumip>', '--', 'cim.2.designing.NumericalExperiment', '5ab9737e-a264-4378-a8b2-f0658832b583', 1, '2020-11-17 01:19:05.639745', true, 'land-noPasture', 'land-noPasture', NULL, 'historical land-only with constant pastureland', 'Land surface model simulation.  Same as land-hist except with grazing and other management on pastureland held at 1850 levels/distribution. i.e. all new pastureland treated as unmanaged grassland (as in land-crop-grass). Start year either 1850 or 1700 depending on standard practice for particular model.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399695, 'cmip6', '<lumip>', '--', 'cim.2.designing.NumericalExperiment', '320ffc99-af13-4015-bb02-43cf33f551db', 1, '2020-11-17 01:19:05.639745', true, 'ssp370-ssp126Lu', 'ssp370-ssp126Lu', NULL, 'SSP3-7.0 with SSP1-2.6 land use', 'Keep all forcings the same as ScenarioMIP SSP3-7.0 (deforestation scenario), but replace land use with SSP1-2.6 (aforestation) scenario.  Concentration driven.  Additional ensemble members are requested with tier 2 priority.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399696, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'da992464-5b3a-4216-93e0-d0ff0e2d0425', 1, '2020-11-17 01:19:05.639745', true, 'Transient Fire Management', 'transientFireManagement', NULL, 'Transient historical fire management', 'Realistic transient anthropogenic ignition and suppression of fire.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399697, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '2468b643-e6ff-41e3-bb3a-78f5a37c9aeb', 1, '2020-11-17 01:19:05.639745', true, 'Pasture as grass', 'pastureAsGrass', NULL, 'Treat pasture as grassland', 'Pastureland is treated like natural grassland without any crop management in terms of biophysical properties.  Note that pastureland is treated as agricultural land for dynamic vegetation (i.e. no competition with natural vegetation areas).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399698, 'cmip6', NULL, '--', 'cim.2.shared.Party', '4321108c-08e2-49de-a3c2-2683a01b243d', 1, '2020-11-17 01:19:05.639745', true, 'Bjorn Stevens', NULL, NULL, NULL, '', NULL, NULL);
