INSERT INTO docs.tbl_document VALUES (399701, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'f11eb8cc-e2e0-4379-a537-87e696bd7326', 1, '2020-11-17 01:19:05.639745', true, '1850-1851 20yrs', '20yrs1850-1851', NULL, '1850/01/01-1850/12/31', 'Idealised temporal constraint, repeating 1850 for 20 years, to coincide with years 101 to 120 of the pre-industrial control', NULL, NULL);
