INSERT INTO docs.tbl_document VALUES (399709, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '79aa8f1f-62be-4446-8244-cc3b9a109e4b', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP present day SST for use with pre-industrial Antarctic SIC', 'PAMIP-pd-SST-clim-for-pi-ant-SIC', NULL, 'PAMIP monthly mean climatology of present day sea surface temperature for use with pre-industrial Antarctic sea ice concentration', 'Present day monthly mean cimatology of sea surface temperatue for use with pre-industrial antarctic sea ice. Data provided by PAMIP.', NULL, NULL);
