INSERT INTO docs.tbl_document VALUES (399713, 'cmip6', NULL, '--', 'cim.2.shared.Party', 'c2fad0c2-1f2b-4bec-935c-3f82c1016516', 1, '2020-11-17 01:19:05.639745', true, 'Johann Jungclaus', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399714, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '23175272-5ebc-4424-b12e-f69bc38b363b', 1, '2020-11-17 01:19:05.639745', true, '1950s WMGHG Concentrations', 'HistoricalWMGHGConcentrations1950s', NULL, 'Historical Well Mixed Greenhouse Gas (WMGHG) Concentrations 1950s Climatology', '1950s (10 year) climatology of forcing data for concentration-driven historical CMIP6 runs. Here, we provide an outline of a consolidated set of atmospheric concentrations for the long-lived greenhouse-gases, including CO2, CH4, N2O, HFCs, PFCs, SF6, several ODS, and NF3 to serve as input for the CMIP6 Historical simulations. 
INSERT INTO docs.tbl_document VALUES (399715, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '55054b90-2229-44e6-b0f7-4c460988e7d9', 1, '2020-11-17 01:19:05.639745', true, 'Pre-Industrial Proton Forcing', 'piProtonForcing', NULL, 'Pre-Industrial Proton Forcing', 'Include HOx and NOx productions by solar protons in models with interactive stratospheric chemistry by using the daily ionization data available from the SOLARIS-HEPPA website. For pre-industrial solar forcing use the (1850-1873 mean).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399716, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '1f66cb1b-8a5a-4b8f-9a14-121f5645c401', 1, '2020-11-17 01:19:05.639745', true, '8xPICO2', '8xPICO2', NULL, '8 x Pre-industrial CO2 concentration', 'Impose 8x pre-industrial (1850) concentration of Carbon Dioxide (CO2).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399717, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '1b577684-4cfa-41d0-8857-144279f88ef0', 1, '2020-11-17 01:19:05.639745', true, 'Historical Ozone Depleting Halocarbon Concentrations', 'HistoricalOzone DepletingHalocarbonConc', NULL, 'Historical Concentrations of Ozone Depleting Halocarbons', 'Impose historical concentrations of Ozone depleting Halocarbons (CFC/HCFC).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399718, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'c0c75cf6-f770-49ff-8433-9bdf0040fd32', 1, '2020-11-17 01:19:05.639745', true, '1950HistoricalInitialisation', '1950HistoricalInitialisation', NULL, '1950 Historical Initialisation', 'Initialisation is branched from the Historical AerChem Simulation in 1950.  To provide continuity between simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399719, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '67f44dae-bfe2-42c1-aaae-a31af49ef457', 1, '2020-11-17 01:19:05.639745', true, 'hist-1950 Initialisation', 'hist-1950Initialisation', NULL, 'Initialisation is a continuation of the hist-1950 simulation', 'Initialisation is a continuation from the end of the HighResMIP hist-1950 simulation.  To provide continuity between simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399720, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'e6c39025-04e9-4ad0-92bb-9481bd55fcd0', 1, '2020-11-17 01:19:05.639745', true, '2014 BC Emissions', '2014BC', NULL, '2014 Emissions of Black Carbon', 'Impose 2014 emissions of Black Carbon (BC).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399765, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '4c8f0885-0203-49e4-9bac-ece9c8c8472c', 1, '2020-11-17 01:19:05.639745', true, 'Past 2k Volcanic Aerosols', 'past2kSolar', NULL, 'Volcanic Aerosols for the first two millennia', 'Volcanic Aerosols for the first two millennia, 01 to 1849.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399766, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '79ee84b3-1db3-4b2e-a799-c96507a62e96', 1, '2020-11-17 01:19:05.639745', true, 'Standard Model Resolution', 'standardResolution', NULL, 'Standard model resolution', 'standard model resolution', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399721, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '3e1c4c0f-d59a-46a5-9b8a-c2f824f8e316', 1, '2020-11-17 01:19:05.639745', true, 'Historical stratospheric Ozone as a substitute for solar particle forcing', 'historicalStratO3', NULL, 'Historical stratospheric Ozone concentrations as a substitue for solar particle forcing for models without interactive chemistry', 'Impose historical stratospheric ozone as a substitute for solar particle forcing.  To be used by CMIP6 models that do not have interactive chemistry, they should instead prescribe the CMIP6 recommended ozone forcing data set.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399722, 'cmip6', NULL, '--', 'cim.2.shared.Party', '161b222a-3e2a-4820-8f76-c7accad4ca2b', 1, '2020-11-17 01:19:05.639745', true, 'David Lawrence', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399723, 'cmip6', '<ls3mip>', '--', 'cim.2.designing.NumericalExperiment', 'aa4d57c4-ea2d-45d0-b651-01877f9b5970', 1, '2020-11-17 01:19:05.639745', true, 'land-hist-wfdei', 'land-hist-wfdei', 'Land-Hist-wfdei', 'Historical land-only with WFDEI forcings', 'Land only simulations using WFDEI forcing data and a standard bias correction strategy. As LUMIP land-hist but with WFDEI dataset. WFDEI: WATCH Forcing Data methodology applied to ERA-Interim reanalysis data. The land model configuration should be identical to that used in the DECK and CMIP6 historical simulations for the parent coupled model.  Spin-up of the land-only simulations should follow the TRENDY protocol.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399724, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '422fe23a-09f9-477f-b145-c567412f70e4', 1, '2020-11-17 01:19:05.639745', true, 'The Polar Amplification Model Intercomparison Project (PAMIP) contribution to CMIP6: investigating the causes and consequences of polar amplification', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399725, 'cmip6', '<cdrmip>', '--', 'cim.2.designing.NumericalExperiment', 'aa23bdb9-cea4-4610-b356-a21717f7103a', 1, '2020-11-17 01:19:05.639745', true, 'esm-yr2010CO2-CO2pulse', 'esm-yr2010CO2-CO2pulse', 'CDR-yr2010-pulse', 'instantaneous 100 Gt C addition to an industrial era atmosphere', 'Branches from esm-yr2010CO2-control in the year 2015. At the beginning of 2015 instantaneously (within 1 time step) introduce 100 Gt C to the atmosphere.  Include all anthropogenic, solar, and volcanic forcing. Anthropogenic forcing includes aerosol emissions, non-CO2 greenhouse gas emissions, and land use changes.  CO2 concentration calculated (i.e. emission driven).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399726, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', '36c74639-f510-4654-a3d6-2ada08700d0e', 1, '2020-11-17 01:19:05.639745', true, 'abrupt-solp4p', 'abrupt-solp4p', NULL, 'Abrupt 4 percent increase of the solar constant', 'Conceptually similar to the abrupt 4xCO2 DECK experiment, except that the solar constant rather than CO2 is abruptly increased by 4%.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399727, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', '23a6ea10-1dda-4ecc-a0d5-4f5a9f18ba3b', 1, '2020-11-17 01:19:05.639745', true, 'ssp370SST', 'ssp370SST', NULL, 'SSP3-7.0, with  SSTs prescribed from ssp370', 'SSP-based RCP scenario following approximately RCP7.0 global forcing pathway. SSP3 socioeconomic conditions.  Atmosphere only with SST from ScenarioMIP experiment SSP3-70.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399728, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '67462cca-5197-4f86-a198-8806b580a009', 1, '2020-11-17 01:19:05.639745', true, 'G6solarInitialisation', 'g6solarInitialisation', NULL, 'GeoMIP G6Solar Initialisation', 'Initialisation is made from the final year of the GeoMIP G6solar experiment', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399729, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '06440881-61dc-4d6b-b07c-1ac026d2f961', 1, '2020-11-17 01:19:05.639745', true, 'RFMIP Pre-Industrial Forcing Excluding GHG', 'RFMIP-preImdForcingExclGHG', NULL, 'RFMIP Pre-industrial forcing excluding GHG', 'Pre-Industrial forcing excluding greenhouse gases (GHG).  See table 1 in Pincus et al 2016.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399730, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '8a608e93-7fb9-4fc8-b0da-be91a7d98081', 1, '2020-11-17 01:19:05.639745', true, 'Forced and internal twentieth-century SST in the North Atlantic', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399731, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '39abff48-6c66-4c43-b34e-e4e39a8d4283', 1, '2020-11-17 01:19:05.639745', true, 'AMIPInitialisation', 'AMIPInitialisation', NULL, 'AMIP Initialisation', 'AMIP integrations can be initialised from prior model integrations, or from observations or in other reasonable ways. Depending on the treatment of snow cover, soil water content, the carbon cycle and vegetation, these runs may require a spin-up period of several years. Results from the spin-up period (prior to 1979) should be discarded but the spin-up technique should be documented.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399732, 'cmip6', '<cmip>,<deck>', '--', 'cim.2.designing.NumericalExperiment', '479ff5ed-9c56-4d1e-98c3-f97a0864e7b4', 1, '2020-11-17 01:19:05.639745', true, 'piControl-spinup', 'piControl-spinup', NULL, 'pre-industrial control (spin-up)', 'A pre-industrial control spin-up simulation with non-evolving pre-industrial forcing. Forcing conditions are chosen to be representative of the period prior to the onset of large-scale industrialization, with 1850 being the reference year.  This experiment describes an initial climate spin-up, during which the climate begins to come into balance with the forcing. Run until at least the surface climate reaches equilibrium.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399733, 'cmip6', NULL, '--', 'cim.2.shared.Citation', '21484ce4-ee47-4089-9915-3d28b2664b7f', 1, '2020-11-17 01:19:05.639745', true, 'Trends in net land-atmosphere carbon exchange over the period 1980-2010', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399734, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '387a87c2-9940-4ee5-a6e1-21a86be30691', 1, '2020-11-17 01:19:05.639745', true, 'First Millennium Solar Variability', 'FirstMillenniumSolarVar', NULL, 'Solar variability in the first millennium', 'Solar variability (TSI and SSI) in the first millennium 01-849. The PMIP past1000 forcings data sets include the first millennium.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399735, 'cmip6', NULL, '--', 'cim.2.shared.Party', '3c452257-2f3b-48c7-9d72-a70ff6414c66', 1, '2020-11-17 01:19:05.639745', true, 'Sonia Seneviratne', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399736, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '0e4be57f-d023-4b3c-b11c-f3efe68ea3d1', 1, '2020-11-17 01:19:05.639745', true, 'SSP3-70 SST', 'SSP3-70SST', NULL, 'SSP3 RCP7.0 Sea Surface Temperature', 'Sea surface temperature from experiment SSP3-7.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399737, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '58a350d8-d2c2-44cf-a9dc-c74a35a6b721', 1, '2020-11-17 01:19:05.639745', true, '30yrs', '30yrs', NULL, '30 years', 'Run for 30 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399738, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '39d99060-876f-4f5f-b038-dee7c97ed808', 1, '2020-11-17 01:19:05.639745', true, '1950 Control Initialisation', '1950ControlInitialisation', NULL, 'Initialisation from the control-1950 simulation', 'Initialisation is branched from the HighResMIP control-1950 simulation after spin-up.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399767, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '41cba73e-6918-4488-a2d7-cf679dc55959', 1, '2020-11-17 01:19:05.639745', true, '1901-2014 114yrs', '114yrs1901-2014', NULL, '1901/01/01-2015/01/01', 'Historical, begin in 1901 and run for 114 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399768, 'cmip6', '<aerchemmip>', '--', 'cim.2.designing.NumericalExperiment', '1a37fef6-5662-44d8-a6df-d8ae3fae41c0', 1, '2020-11-17 01:19:05.639745', true, 'histSST-piCH4', 'histSST-piCH4', NULL, 'historical SSTs and historical forcing, but with pre-industrial methane concentrations', 'Historical atmosphere only simulation with historical forcings but with methane fixed at 1850 concentration levels. The model should have the capacity for interactive tropospheric and stratospheric chemistry.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399739, 'cmip6', '<fafmip>', '--', 'cim.2.designing.NumericalExperiment', '866f67b7-6b96-40fb-8fd4-6f99d4d7f3bf', 1, '2020-11-17 01:19:05.639745', true, 'faf-water', 'faf-water', NULL, 'control plus perturbative surface flux of water into ocean', 'Impose surface freshwater flux anomalies to the ocean (including the contribution from runoff change), calculated from the ensemble mean of the CMIP5 1pctCO2 simulations at the time of CO2 doubling.
INSERT INTO docs.tbl_document VALUES (399740, 'cmip6', '<aerchemmip>,<rfmip>', '--', 'cim.2.designing.NumericalExperiment', 'bfe14f6a-e016-47b4-9c90-a4ec7c337612', 1, '2020-11-17 01:19:05.639745', true, 'piClim-aer', 'piClim-aer', NULL, 'Pre-industrial timeslice with fixed SSTs, but 2014 aerosol emissions', 'Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases), pre-industrial tropospheric ozone precursors and present day (2014) emissions of aersols and aerosol precursors.  This is a timeslice experiment of 30 years total.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399741, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'cb403719-debf-4aa2-bca2-f8677adf8f0e', 1, '2020-11-17 01:19:05.639745', true, '1850-1859 10yrs', '10yrs1850-1859', NULL, '1850/01/01-1860/01/01', 'Timeslice, begin in 1850 and run for 10 years.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399742, 'cmip6', '<aerchemmip>,<rfmip>', '--', 'cim.2.designing.NumericalExperiment', '16abe6d4-49d2-4948-be53-a1362579e31b', 1, '2020-11-17 01:19:05.639745', true, 'piClim-control', 'piClim-control', NULL, 'pre-industrial with prescribed climatological SSTs', 'Fixed SST ERF simulation. Use pre-industrial climatological average SST and sea-ice distributions. Apply pre-industrial concentrations of WMGHG (well mixed greenhouse gases) pre-industrial emissions of NTCF (near-term climate forcers). This is a timeslice experiment of 30 years total.  Provided this experiment is run with the same interactive chemistry and aerosols, this will be the same as the RFMIP piClim-control experiment.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399743, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '45797a69-43d1-4b8e-a143-09a60971790a', 1, '2020-11-17 01:19:05.639745', true, 'Historical Ozone Concentrations', 'HistoricalStratosphereTroposphereOzoneConcentrations', NULL, 'Historical Stratosphere-Troposphere Ozone Concentrations', 'Apply ozone concentrations encompassing both the stratosphere and the troposphere from the ozone concentration database.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399744, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'dbc78d92-5469-497b-a7a7-3ece638a6d33', 1, '2020-11-17 01:19:05.639745', true, 'Sampling the physical ocean in CMIP6 simulations', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399745, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '19cb0664-b2ae-4b3d-89d1-ca161bc461d0', 1, '2020-11-17 01:19:05.639745', true, 'Present Day Land Surface Forcing', 'presentDayLandSurfaceForcing', NULL, 'land surface present day forcing', 'Land surface properties will be climatological monthly/seasonally varying conditions of leaf area index (LAI), with no dynamic vegetation and a constant land use/land cover consistent with the present-day period, centered around 2000.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399746, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '8183c271-f11f-40a5-a06d-48d50ab56998', 1, '2020-11-17 01:19:05.639745', true, 'Historical Land Use', 'HistoricalLandUse', NULL, 'Historical Land Use', 'Apply the global gridded land-use forcing datasets to link historical land-use data and future projections.  This new generation of “land use harmonization” (LUH2) builds upon past work from CMIP5, and includes updated inputs, higher spatial resolution, more detailed land-use transitions, and the addition of important agricultural management layers.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399769, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '443ce034-2814-4d2e-91a5-94d3f5293f20', 1, '2020-11-17 01:19:05.639745', true, 'All Land Management except with crop and pasture using net transitions', 'allLandManagementCropPastureNetTrans', NULL, 'All management active except crop and pasture use net transitions in the model configuration', 'All applicable land management active in the land surface model configuration. Cropland and pastureland use net transitions (exclude shifting cultivation) instead of gross transitions (include shifting cultivation).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399747, 'cmip6', '<lumip>', '--', 'cim.2.designing.NumericalExperiment', '8c63be45-84cf-4f67-9c18-35e6c53eab37', 1, '2020-11-17 01:19:05.639745', true, 'land-hist-altLu1', 'land-hist-altLu1', NULL, 'historical land-only with high land use', 'Land surface model simulation.  Same as land-hist except using alternative high land-use history reconstructions that span uncertainty in agriculture and wood harvest.  Note that land use in 1700 and 1850 will be different to that in land-hist so model will need to be spun up again for each alternative dataset. Use the same land model configuration as used in the coupled CMIP6 historical simulations. Include representation of land cover, land use and land management. All applicable land use features should be active. 
INSERT INTO docs.tbl_document VALUES (399748, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '9a73b14b-1e07-45c2-82fd-ec4ded8ff3d5', 1, '2020-11-17 01:19:05.639745', true, 'NMember', 'NMemberEnsemble', NULL, 'N Member Ensemble', 'An unspecified number of simulations', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399749, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '4494239f-1619-4f8f-8257-672e6e0fb697', 1, '2020-11-17 01:19:05.639745', true, 'TRENDY spin up for Princeton', 'trendySpinUpPrinceton', NULL, 'TRENDY protocol for the spin up with Princeton forcing', 'Spin up of the land surface model should follow the TRENDY protocol which calls for recycling of the climate mean and variability from two decades of the Princeton global forcing dataset (1901–1920). Land use should be held constant at 1850 as in the DECK 1850 coupled control simulation (piControl). CO2 and all other forcings should be held constant at 1850 levels during spin-up.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399750, 'cmip6', '<volmip>', '--', 'cim.2.designing.NumericalExperiment', '63cf09cf-3d38-44a8-b9b7-d1f569d61841', 1, '2020-11-17 01:19:05.639745', true, 'control-slab', 'control-slab', NULL, 'Control with slab ocean', 'Pre-Industrial control simulation with a slab ocean. Maintain the same constant boundary forcing as the pre-industrial control integration.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399751, 'cmip6', '<cfmip>', '--', 'cim.2.designing.NumericalExperiment', 'dff5e773-43c2-4ee0-9959-854797a45f9f', 1, '2020-11-17 01:19:05.639745', true, 'abrupt-solm4p', 'abrupt-solm4p', NULL, 'Abrupt 4 percent decrease of the solar constant', 'Same as abrupt-solp4p, except the solar constant is reduced by 4% rather than increased.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399752, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'fbf7bb17-f814-41fb-9e69-7629b1c07aaa', 1, '2020-11-17 01:19:05.639745', true, 'Ocean-SeaIce Configuration', 'Ocean-SeaIceConfiguration', NULL, 'OMIP ocean-sea ice model configuration', 'A coupled ocean-sea ice model.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399753, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '4cdfb380-b988-455b-9435-2936195f6863', 1, '2020-11-17 01:19:05.639745', true, 'Alternative RCP45 Aerosol', 'altRCP45Aer', NULL, 'Alternative RCP45 aerosols', 'Alternative estimate of RCP4.5 aerosol and aerosol precursor forcing', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399754, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'd253a635-f661-4ca7-823b-d706ff3c3949', 1, '2020-11-17 01:19:05.639745', true, '1850 Tropospheric Ozone Precursor Emissions excluding Lightning NOx', '1850TropO3PreExcludeLightningNOx', NULL, '1850 emissions of tropospheric ozone precursors excluding lightning NOx', 'Impose pre-industrial (1850) emissions of tropospheric ozone precursors excluding lightning NOx  (oxides of nitrogen).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399755, 'cmip6', '<pamip>', '--', 'cim.2.designing.NumericalExperiment', '109463ae-918b-40f9-b7e9-5323771f4623', 1, '2020-11-17 01:19:05.639745', true, 'pdSST-piAntSIC', 'pdSST-piAntSIC', '1.7', 'Atmosphere time slice with present day SST and pre-industrial Antarctic SIC', 'Time slice forced by climatological monthly mean sea surface temperature (SST) for the present day sea and pre-industrial Antarctic sea ice concentration (SIC). Radiative forcing to be set to present day (year 2000) levels. Past SIC will be computed from the ensemble of CMIP5 simulations by PAMIP. Sea ice thickness should be specified according to the CMIP6 AMIP protocol. Time slice simulations to begin on 1st April and run for 14 months, the first two months are ignored to allow for an initial model spin up. Minimum ensemble size is 100 simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399756, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'f946c402-a25d-4e76-bee6-529aa0eb5413', 1, '2020-11-17 01:19:05.639745', true, '2010 Electron Forcing', '2010ElectronForcing', NULL, '2010 Electron Forcing', '2010 electron forcing. CMIP6 recommends the use of parameterisations based on geomagnetic activity indices such as the Kp- or Ap-index to describe ionisation from electron precipitation in the lower thermosphere and upper mesosphere (for those models that explicitly include those height levels in their code) as a best estimate for the impact of electron precipitation.
INSERT INTO docs.tbl_document VALUES (399757, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '5b7d1f4c-869b-40cc-9fd2-bacab2464e30', 1, '2020-11-17 01:19:05.639745', true, 'Historical WMGHG Concentrations', 'HistoricalWMGHGConcentrations', NULL, 'Historical Well Mixed Greenhouse Gas (WMGHG) Concentrations', 'Forcing data for concentration-driven historical CMIP6 runs. Time varying global annual mean concentrations for CO2 and other long-lived greenhouse-gases, including CO2, CH4, N2O, HFCs, PFCs, SF6, several ODS, and NF3 to serve as input for the CMIP6 Historical simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399758, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', '44d8cb89-0252-45e0-a7c7-8d108e2b6dc8', 1, '2020-11-17 01:19:05.639745', true, 'RCP85 Forcing Excluding Aerosols', 'RCP85ForcingExclAer', NULL, 'RCP 8.5 forcing excluding aerosols', 'RCP8.5 forcing excluding aerosols.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399759, 'cmip6', NULL, '--', 'cim.2.shared.Party', '83d7bd8e-f5a0-4c68-9f90-8949ffc58763', 1, '2020-11-17 01:19:05.639745', true, 'Bob Andres', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399760, 'cmip6', NULL, '--', 'cim.2.shared.Party', '82f5dcc1-3146-48f1-8e5e-1746f457fcff', 1, '2020-11-17 01:19:05.639745', true, 'Gerhard Krinner', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399761, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', '78b58624-c007-4634-898a-ba815e243cb1', 1, '2020-11-17 01:19:05.639745', true, '2014-2054 41yrs', '41yrs2014-2055', NULL, '2014/01/01-2055/01/01', 'Scenario, from 2014 to the mid 21st century.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399762, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'dbdb18c3-2fb6-4c6e-83a3-f3347a71d450', 1, '2020-11-17 01:19:05.639745', true, '1870-2014 145yrs', '145yrs1870-2014', NULL, '1870/01/01-2015/01/01', 'Historical temporal constraint, pre-industrial to 2014', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399763, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '772328f3-713d-4fbb-94f1-f3b35185c37b', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP future Barents and Kara Seas SIC', 'PAMIP-fut-BK-SIC-clim', NULL, 'PAMIP monthly mean climatology of future Barents and Kara Seas sea ice concentration', 'Future monthly mean cimatology of Barents and Kara Seas sea ice concentration, data provided by PAMIP.', NULL, NULL);
