INSERT INTO docs.tbl_document VALUES (399771, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'edfeafd1-26c5-4e3b-a777-7dc32c4c9657', 1, '2020-11-17 01:19:05.639745', true, 'Present Day 2005-2014 SIC Climatology', 'PDSICClim', NULL, 'Present day (2005-2014) sea ice concentration climatology calculated from the model''s own historical simulation.', 'Present day sea ice concentration (SIC) calculated from a 2005-2014 climatology of the model''s own CMIP6 historical simulation.', NULL, NULL);
