INSERT INTO docs.tbl_document VALUES (399773, 'cmip6', NULL, '--', 'cim.2.shared.Party', '43354c0d-6645-4ca0-8644-447117dcc148', 1, '2020-11-17 01:19:05.639745', true, 'Jonathan Gregory', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399774, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '29b3d997-9d2d-45bd-992e-a2a841f512c7', 1, '2020-11-17 01:19:05.639745', true, 'CO2 concentration calculated', 'calculateCO2', NULL, 'Calculate freely evolving CO2 concentration', 'Carbon dioxide concentrations are calculated and allowed to evolve freely. For models that can calculate atmospheric CO2 concentration and account for the fluxes of CO2 between the atmosphere, the ocean, and biosphere.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399775, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', '92be3267-4756-4275-997a-2971c9d8a6e3', 1, '2020-11-17 01:19:05.639745', true, 'HistoricalInitialisation', 'HistoricalInitialisation', NULL, 'Historical Initialisation', 'Initialisation is from the end of the Historical experiment.  To provide continuity between simulations of the recent past and  future scenario simulations.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399776, 'cmip6', NULL, '--', 'cim.2.designing.TemporalConstraint', 'f5abef95-a488-416b-b576-f0ed1bd7d0c0', 1, '2020-11-17 01:19:05.639745', true, '210yrs', '210yrs', NULL, '210 years', 'Run for 210 years', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399777, 'cmip6', NULL, '--', 'cim.2.designing.EnsembleRequirement', 'ec67520e-48de-4afc-bc82-7432e6810f8a', 1, '2020-11-17 01:19:05.639745', true, '9 piControl Initialisations from April 1st', '9piControlInitialisationsApr1st', NULL, 'VolMIP ensemble of nine simulations initialised from the piControl', 'Nine initialisation states which span warm/cold/neutral El Niño-Southern Oscillation (ENSO) states and strong/weak/neutral Atlantic Meridional Overturning Circulation (AMOC) states. If, for instance, year Y of the control integration matches the desired conditions for the initial condition sampling, then the corresponding VolMIP simulation should start with restart data from April 1st of year Y-1 of the control.  Restart files from piControl must be accordingly selected and documented in the metadata of each simulation.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399778, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '40f60ec1-e9b8-453f-a341-ad908d913ec4', 1, '2020-11-17 01:19:05.639745', true, 'Impose SST PDV pos Pacific', 'ImposeSSTPDVposPacific', NULL, 'Impose positive PDV anomaly to sea surface temperatures in the Pacific', 'Alter surface fluxes to impose model climatology plus positive Pacific Decadal Variability (PDV) anomalies of Sea Surface Temperature (SST) over the  Pacific (15S-65N).    Idealised PDV anomalies of SST will be provided by DCPP.  For groups that are unable to restore SSTs.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399779, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '1497198f-6372-475e-be33-2ecbf1bbf03b', 1, '2020-11-17 01:19:05.639745', true, 'PAMIP present day SST for use with future Barents and Kara Seas SIC', 'PAMIP-pd-SST-clim-for-fut-BK-SIC', NULL, 'PAMIP monthly mean climatology of present day sea surface temperature for use with future Barents and Kara Seas sea ice concentration', 'Present day monthly mean cimatology of sea surface temperatue for use with future Barents and Kara Seas sea ice. Data provided by PAMIP.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399780, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'fccf966a-4d52-4a1b-bcf1-49138e7f4140', 1, '2020-11-17 01:19:05.639745', true, 'OCMIP', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399781, 'cmip6', '<ismip6>', '--', 'cim.2.designing.NumericalExperiment', 'ef85d067-bf2e-423f-a18e-0be879f54f73', 1, '2020-11-17 01:19:05.639745', true, 'ism-pdControl-std', 'ism-pdControl-std', NULL, 'offline ice sheet model forced by ISMIP6-specified AOGCM pdControl output', 'Stand alone ice sheet model driven offline by ISMIP6 CMIP6 standard input for constant present day forcing.  Forcings are set to the end of the initialisation procedure, which ranges from 1990s to 2014.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399782, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', '6f08fddf-293b-4412-8dc7-4c791a514ee3', 1, '2020-11-17 01:19:05.639745', true, 'Historical land surface forcings except CO2', 'historicalLandSurfaceForcingsNoCO2', NULL, 'Historical land surface forcings except carbon dioxide', 'Apply all transient historical forcings that are relevant for the land surface model except carbon dioxide (CO2). Include transient Nitrogen deposition, aerosol deposition and population density etc.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399783, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c639c157-9f91-467f-8ba7-a5ab837943fa', 1, '2020-11-17 01:19:05.639745', true, 'ssp245-cov-GHG Well Mixed GHG', 'ssp245-cov-GHGWMGHG', NULL, 'ssp245-cov-GHG Well Mixed Greenhouse Gases', 'Monthly concentrations of ssp245-cov-GHG well mixed greenhouse gases (WMGHG): CO2, CH4 and N2O.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399784, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'fe485d3c-0acc-46b5-9d19-754fa1ba2c57', 1, '2020-11-17 01:19:05.639745', true, 'CO2 bell 2000 PgC', 'CO2Bell2000PgC', NULL, '2000 PgC bell-shaped CO2 emissions profile', 'Use a bell-shaped CO2 emissions profile designed to give cumulative emissions of 2000 PgC after 100 years, then hold CO2 emissions at zero. The time series of global CO2 for the bell-shape emission profiles will be provided by ZECMIP via the C4MIP and CDRMIP websites.  A model decision is required on the spatial pattern of CO2 emissions, ZECMIP suggest globally uniform at surface.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399785, 'cmip6', NULL, '--', 'cim.2.shared.Citation', 'c7412f56-8844-470a-a86a-2f073e9ec5f0', 1, '2020-11-17 01:19:05.639745', true, 'GLODAPv2', NULL, NULL, NULL, '', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399786, 'cmip6', NULL, '--', 'cim.2.designing.ForcingConstraint', 'c790835f-0b4a-4dd1-a9d8-32dd8190a88b', 1, '2020-11-17 01:19:05.639745', true, '1850 Methane Concentration', '1850Methane', NULL, '1850 Methane Concentration', 'Impose pre-industrial, 1850, concentrations of methane (CH4).', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399787, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'f629286b-e1bf-4c92-892e-3b843c26ca00', 1, '2020-11-17 01:19:05.639745', true, 'CFC12 Tracer', 'cfc12Tracer', NULL, 'OCMIP2 CFC12 inert chemical tracer', 'Online simulation of CFC12 inert chemical tracers.', NULL, NULL);
INSERT INTO docs.tbl_document VALUES (399788, 'cmip6', NULL, '--', 'cim.2.designing.NumericalRequirement', 'ffa36118-1178-41aa-8620-86ca7e8dadfe', 1, '2020-11-17 01:19:05.639745', true, 'TRENDY Interim Forcing for CRU-NCEP', 'trendyInterimForcingCRU-NCEP', NULL, 'TRENDY protocol for 1850 to the first year of the CRU-NCEP forcing dataset', 'For the interim period from 1850 to the first year of the CRU-NCEP forcing dataset, the  forcing data should continue to be recycled but all other forcings (land-use, CO2, etc.) should be as in the CMIP6 historical simulation.', NULL, NULL);
