IPSL-CM5A is one of the two configurations of the IPSL-CM5 model for CMIP5, the second one being IPSL-CM5B, with a different set of atmospheric physical parameterizations.

IPSL-CM5A is an Earth system model based on an improved version of the IPSL-CM4 coupled ocean-atmosphere GCM that was used in CMIP3. Compared with IPSL-CM4, IPSL-CM5A includes among others the following improvements:
(i) An increase vertical resolution of the atmosphere from 19 to 39 vertical levels, with 15 levels above 20 km
(ii) six different species of aerosols that can be either externally prescribed or computed on-line
(iii) stratospheric and tropospheric ozone can be either prescribed or computed on-line
