OLAM employs an unstructured mesh of either hexagonal or triangular grid cells based on refinement of an icosahedron, thus avoiding the polar singularities of the more traditional latitude-longitude grid.  More importantly, this mesh configuration provides a natural adaptibility for local mesh refinement that i', NULL, NULL);

The atmospheric ICON-MPI-DWD model solves the fully compressible non-hydrostatic equations on a sphere using the shallow atmosphere approximation. The prognostic variables are wind, potential virtual temperature, moist density and water related moist air mixing ratios. The equations are discretized in the horizontal on a triangular icosahedral grid with C-grid staggering and in the vertical on a terrain following hybrid sigma-height grid using a Lorenz staggering. A two-way nesting approach is used for refinement in one or several regions.', NULL, NULL);
        a 2D shallow-water approach in the horizontal plane (Lin and Rood 1996, 1997). The vertical
        discretization utilizes a "Lagrangian control-volume" principle, which is based on a
        terrain-following floating Lagrangian coordinate system and a fixed Eulerian reference
        frame. In particular, the vertically stacked finite volumes are allowed to float for a
        duration of several time steps before they are mapped back monotonically and conservatively
        to the fixed reference system (Lin 2004). The advection algorithm makes use of the monotonic
        third-order piecewise parabolic method (Colella and Woodward 1984) with an explicit
        time-stepping scheme. Lower-order approximations are applied near the model top to add extra
        diffusion at the upper boundary. The FV dynamics package is built upon a regular
        latitude-longitude grid.', NULL, NULL);

