Traditional vertical coordinate choices [z-level, terrain-following (sigma), isopycnic] are not by themselves optimal everywhere in the ocean, as pointed out by recent model comparison exercises performed in Europe (DYnamics of North Atlantic MOdels - DYNAMO) and in the U.S. (Data Assimilation and Model Evaluation Experiment - DAMEE). Ideally, an ocean general circulation model (OGCM) should (a) retain its water mass characteristics for centuries (a characteristic of isopycnic coordinates), (b) have high vertical resolution in the surface mixed layer (a characteristic of z-level coordinates) for proper representation of thermodynamical and biochemical processes, (c) maintain sufficient vertical resolution in unstratified or weakly-stratified regions of the ocean, and (d) have high vertical resolution in coastal regions (a characteristic of terrain-following coordinates).', NULL, NULL);

